  { :name => "10am Epic walk of the BeltLine from Inman Park Marta to the Lindbergh Marta Station", :longitude => -84.3593805, :latitude => 33.755871, :gmaps => true, :description => "Please share this link and consider contributing, thank you www.indiegogo.com/angelshouse\n\nA year and a half ago my friend Katie Sobush invited the 17,000 employees of the CDC out for a walk on the NE section of the BeltLine.  459 people came out to see the corridor before construction had started on the Eastside Trail,   it is now time to invite the employees of the CDC back out to the trail to see the progress that has occurred in that year and a half.  \n\nI'm going to need the help of everyone who has walked this section to volunteer their smiles and knowledge as there will be a lot of people coming out to see the new trail for the first time. \n\nWe'll be starting at the Inman Park Marta Station at 10am walking to the Lindbergh Marta Station 6 1/2 miles.  The walk will take place on 1/2 mile of neighborhood streets, 2 miles on the Eastside Trail, 2 1/2 miles of temporary hiking trails, 1/2 mile on active rail and 1/2 a mile on city streets.  \n\nRoute of the walk.\n\nhttp://www.bikely.com/maps/bike-path/North-East-BeltLine-walk-from-Lindbergh-Marta-Station-to-Inman-P\n\n\nAfter we're done with the walk on the BeltLine you'll be able to take Marta to get back to the Inman Park Marta Station or where ever you need to go.\n\nStrollers will be fine on this walk but will only be good for the first 2 1/2 miles.  Kids and dogs are welcome.  \n\nThe walks will always be free but I am asking everyone to share the link to the indiegogo fund raiser I have going at the moment to raise money for my house.  Less than 30 days to go and a little more than $13,000 dollars to raise.  \n\nCheck it out here.\n\nwww.indiegogo.com/angelshouse\n\nThank you.\n\nSee you on the BeltLine \n\n\n\n\n\n", :start_time => "2012-11-17 12:00:00", :end_time => "2012-11-17 16:00:00", :address => "882-886 Edgewood Ave NE, Atlanta, GA 30307, USA", :fb_id => 312675392172720, :owner_id => 634963101, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373315_312675392172720_838007830_q.jpg", :atenders => 184, :privacy => nil, :created_at => "2012-11-15 03:08:42", :updated_at => "2012-11-15 03:08:42" },
