  { :name => "Coro Universidad de Chile - Coro Sinfónico: Celebración 170 Años Universidad de Chile", :longitude => -70.61858959999999, :latitude => -33.5929716, :gmaps => true, :description => "Amigos, Amigas, Familia:\n\nTenemos el agrado de invitarlos a la Celebración de los 170 Años de la Universidad de Chile. Se han hecho variadas actividades a lo largo de este año y como gran obertura, se presentará el Coro Universidad de Chile (compuesto por coros de facultades como Ciencias, Beaucheff, FEN) en conjunto con el Coro Sinfónico de la Universidad, dirigidos todos por el gran director David del Pino.\n\nhttp://www.uchile.cl/agenda/86388/concierto-al-aire-libre-celebrando-el-170-aniversario-u-de-chile\n\nEntre el repertorio se encuentran piezas musicales tales como:\nDanzas Polovetsianas - Alexandre Borodin\nTe Recuerdo Amanda, El Cigarrito, Plegaria a un Labrador - Victor Jara Sinfónico\nObertura 1812 - Tchaikovsky\n9a Sinfonía de Beethoven - Beethoven\n\n\nLa presentación se realizará el día Sábado 17 de Noviembre a las 20 horas en la Plaza de Armas de Santiago.\n\nEsperamos, por supuesto su asistencia :)\n\n", :start_time => "2012-11-17 20:00:00", :end_time => "2012-11-17 23:00:00", :address => "Plaza de Armas 3038, La Pintana, Santiago Metropolitan Region, Chile", :fb_id => 378498988894861, :owner_id => 660554460, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/188160_378498988894861_742652838_q.jpg", :atenders => 96, :privacy => nil, :created_at => "2012-11-15 03:10:04", :updated_at => "2012-11-15 03:10:04" },
