  { :name => "FlashMob Mundial: Baila por la amabilidad - Santiago, Chile", :longitude => -70.641997, :latitude => -33.4691199, :gmaps => true, :description => "Life Vest Inside e InspiraChile presentan un \"FlashMob Mundial: Baila por la amabilidad\":15 países, 31 ciudades! - Para participar: \n1. Completa formulario: http://bit.ly/U93jyk\n2. Aprende la coreografía http://bit.ly/QVLYe1\n3. Para más detalles revisa el video: http://bit.ly/TiHk7m\n4. Descarga la canción mundial: http://bit.ly/Qh4QqQ\n5. Únete al evento mundial del FlashMob: http://on.fb.me/QJlbk5\n\nCualquier duda escríbenos a:\ninfo@inspirahchile.com \n\nNunca dudes que un pequeño grupo de personas comprometidas pueden cambiar el mundo. De hecho, son los únicos que lo han logrado.\n\nNO HAY LÍMITE DE EDAD: jóvenes, niños y adultos juntos bailando...\n\nEl objetivo del día mundial de la Amabilidad, es mirar más allá de nosotros, más allá de los límites de nuestros países, más allá de nuestra cultura, raza o religión; y darnos cuenta que somos todos ciudadanos de un mismo mundo.\n\n***QUE ES BAILA POR LA AMABILIDAD?\nBaila por la amabilidad es un evento de dos partes: FreezeMob y FlashMob\n\n**FREEZE MOB: Aquellos que participen del freeze mob se congelarán en una posición de amabilidad durante unos minutos, dándole un abrazo a alguien, recogiendo a alguien del suelo, regalando una flor, etc… Las acciones hablan más que las palabras \nhttp://bit.ly/P5aTgK\n\n**FLASH MOB: Luego de la nada la música comienza y todos se empiezan a descongelar al ritmo de la música hasta convertirse en un FlashMob. Nuevamente las acciones hablan mejor que las palabras \nhttp://bit.ly/TI4che\n\nPreparándote para el día de mundial de la amabilidad, no olvides ver el video de Life Vest Inside: \nhttp://bit.ly/TCWmeT\n\n***QUE ES LIFE VEST INSIDE?\nLife Vest Inside is una organización sin fines de lucro dedicada a entregar amabilidad, empoderar a personas y a potenciar la autoestima y autoconfianza.\nhttp://facebook.com/lifevestinside\n\n***QUE ES INSPIRA CHILE?\nInspiraChile es una fundación que busca inspirar a los jóvenes de Chile, potenciar el genuino contacto humano, vivenciando gestos de amor inspirados en aceptación amabilidad y confianza.\nhttp://facebook.com/inspirechile\n", :start_time => "2012-11-18 02:00:00", :end_time => "2012-11-19 02:00:00", :address => "Ñuble 646-690, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 349639575120606, :owner_id => 345830518836848, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/203536_349639575120606_1295518258_q.jpg", :atenders => 2759, :privacy => nil, :created_at => "2012-11-15 03:14:58", :updated_at => "2012-11-15 03:14:58" },
  { :name => "ULTIMA FIESTA DEL AÑO REVISTA DEMOLICION 64", :longitude => -76.7905081, :latitude => 17.9830314, :gmaps => true, :description => "Revista Demolición, LA Revista de los deportes extremos en Chile, te invita a su ULTIMA FIESTA DEL AÑO !!!!!!!!!!\n\nNos vemos este jueves 15 de noviembre con los DJ’s:\n\nHAITI \nA.K.A AFRIK\n\nNICOLAS CASTRO\n(Radio Horizonte)\n\nMATIAS\nBATISTA\n\nmodiFICA\nVisuales en Vivo\n\nAdemás estaremos lanzando nuestra nueva edición 64.\n\nJUEVES 15 DE NOVIEMBRE\nCLUB EVE, Av. Vitacura 5480.\n23:00 horas\nMujeres (mayores de 21) $ 5.000\nHombres (mayores de 24) $ 5.000\n\nO´NEILL - CERVEZA CORONA - RED BULL\n\nColaboran:\nUndurraga - Tortilla Factory\n\nMedia Partner:\nRadio Horizonte\n\nInvitan: \nRevista Demolición y Club Eve\n\nSíguenos en twitter:\n@DemolicionMag", :start_time => "2012-11-15 23:00:00", :end_time => "2012-11-16 02:00:00", :address => "Eve Ln, Kingston, Jamaica", :fb_id => 418796064852556, :owner_id => 118530458921, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/211157_418796064852556_1641914714_q.jpg", :atenders => 446, :privacy => nil, :created_at => "2012-11-15 03:15:09", :updated_at => "2012-11-15 03:15:09" },
  { :name => "I Curso de Formación en Donación y Trasplante de órganos", :longitude => 151.4264488, :latitude => -33.4909223, :gmaps => true, :description => "http://sumatetrasplante.blogspot.com/\n\nQueremos invitarlos a participar del I CURSO de Formación en Donación y Trasplante de Órganos.\n\nObjetivos del curso:\n•\tEntregar conocimientos Teóricos sobre Donación y Trasplante de órganos a estudiantes de pregrado de Medicina\n•\tSer fuente de actualización e información sobre los últimos avances en Donación y Trasplante de órganos en Chile y el mundo.\n•\tPermitir que el Estudiante de Medicina complemente sus conocimientos adquiridos en sus respectivas escuelas con los entregados en nuestro curso.\n•\tPromover la Donación de órganos en los estudiantes de Medicina.\n\n\nPROGRAMA\n\nVIERNES 9 DE NOVIEMBRE          MODULO I: DONANTE\n1.\tMuerte, donación y trasplante                                                       17:00-17:40\n2.\tMuerte encefálica y ética en trasplante                                         17:40-18:20\n3.\tDonante vivo y donante fallecido                                                   18:20-19:00\n                                             COFFEE BREAK                                          19:00-19:30\n4.\tDetección del donante y protocolo administrativo                          19:30-20:10\n5.\tMalas noticias y entrevista familiar                                                  20:10-20:50\n6.\tMitos y leyendas de los trasplantes                                                 20:50-21:30 \n\n\nSÁBADO 10 DE NOVIEMBRE          MODULO II: ORGANIZACIÓN EN TRASPLANTE \n7.\tHistoria del Trasplante de órganos en Chile                                     9:00-9:40\n8.\tEquipo multidisciplinario                                                                    9:40-10:20\n9.\tLista de espera                                                                                10:20-11:00\n                                                     COFFE BREAK                                     11:00-11:30\n                                                       MODULO III: INMUNOLOGÍA DEL TRASPLANTE\n10.\tGeneralidades de la inmunología                                                       11:30-12:10\n11.\tInmunosupresión                                                                               12:10-12:50\n12.\tRechazo                                                                                             12:50-13:30\n\n\nVIERNES 23 DE NOVIEMBRE              MODULO IV: TIPOS DE TRASPLANTE\n13.\tTrasplante renal                                                                                 17:00-17:40\n14.\tTrasplante hepático                                                                           17:40-18:20\n15.\tTrasplante cardiaco                                                                           18:20-19:00\n                                               COFFE BREAK                                              19:00-19:30\n16.\tTrasplante de pulmón                                                                          19:30-20:10\n17.\tTrasplante de páncreas                                                                       20:10-20:50\n18.\tTrasplante de intestino                                                                        20:50-21:30\n\n\nSÁBADO 24 DE NOVIEMBRE                  MODULO V: MISCELÁNEOS\n19.\tTrasplante de tejidos compuestos y futuro del trasplante                      9:00-9:40\n20.\tInfección en Trasplante                                                                           9:40-10:20\n21.\tCharla Sociedad Chilena de Trasplante                                                  10:20-11:00\n                                                    COFFE BREAK                                            11:00-11:30\n22.\tExperiencia Donante Vivo                                                                      11:30-12:10\n23.\tExperiencia personal de un cirujano en trasplante                                12:10-12:50\n24.\tPrueba final                                                                                            12:50-14:30\n\n\nFECHA: 9-10 y 23-24 de Noviembre 2012\n\nLUGAR: Auditorio 21 Casa Central de la Pontificia Universidad Católica de Chile. Alameda 340.\n\nINSCRIPCIÓN: https://docs.google.com/spreadsheet/viewform?formkey=dFNPUmE0VE9Mck13RnNfbC10TDFvWlE6MQ\n\nAdhesión de $7.000 por alumno.\nDepositar a nombre de Felipe Moraga Torres (Director del Curso), cuenta corriente N° 0504-0019-0100497593 del Banco BBVA (al transferir desde Bancos Santander o Estado, no anteponga el cero inicial), RUT 16.751.353-0 y enviar por mail el comprobante de depósito, escaneado o comprobante electrónico, a sumate.trasplante@gmail.com, indicando el nombre del asistente al curso.\n\n\nORGANIZA: Súmate!\n\nPATROCINA:\n- Departamento de Procuramiento y Trasplante de Órganos y Tejidos del Ministerio de Salud de Chile\n- Corporación del Trasplante\n- Sociedad Chilena de Trasplante\n- Programa de Trasplante UC \n- Academia de Cirugía UC\n\nCualquier duda, pueden escribirnos a nuestro correo electrónico sumate.trasplante@gmail.com\n\n¡Los esperamos!\nEquipo Súmate.", :start_time => "2012-11-23 17:00:00", :end_time => "2012-11-24 14:30:00", :address => "2 Casa Pl, Copacabana NSW 2251, Australia", :fb_id => 232825676846134, :owner_id => 1067512285, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/277095_232825676846134_1945902121_q.jpg", :atenders => 166, :privacy => nil, :created_at => "2012-11-15 03:15:18", :updated_at => "2012-11-15 03:15:18" },
