  { :name => "LA FERIA, SNEAK y FEDERICO MOLINARI  ATENCION VIP  ♛ +56 9 8279 35 88", :longitude => -99.1956264, :latitude => 19.4161028, :gmaps => true, :description => "16 de Noviembre Club La Feria presenta:\n\nTHE REAL HOUSE GANGSTER \nDJ SNEAK ♛\n\n\nUno de los máximos responsables de la segunda ola de housemasters provenientes de la corte de Chicago. En 1983, Carlos Sosa pasó de vivir en el soleado Puerto Rico a la terrible y oscura Chicago pero ese viaje le cambió algo más que la vida ya que con él viaja también el ritmo de la salsa, el merengue y toda una orquesta latina bulliciosa que daría paso en 1992 al EP SneakyTracks Vol. 1 que contenía un corte llamado Work It. Un track que llamó la atención de Cajmere, al cual le gustó la frescura del tema de Sneak y le invitó a formar parte de Cajual Records, su sello discográfico. \n\nSus sesiones en los clubs están llenas de energía en las que mezcla el techno con el house con una maestría que le ha llevado a ser considerado uno de los mejores Djs de house del planeta. Acostumbrado a pinchar en los clubs ingleses como el Ministry of Sound o el The End (actualmente Sneak tiene una residencia bimensual con sus fiestas Sneak Beats en este club de Londres y en Sankey's Soap de Manchester). Tambien abrió un sello en 2001 con un nombre muy atractivo, Magnetic Recordings, dedicado al tribal house, y un año después inaugura Oomph en el que grabará como Groove Source. \n\nPreventas: $20.000 (Puerta: $30.000)\n\nMesas VIP: 8 personas\n$400.000 con $100.000 en consumo\nQuedan pocas!!!!!!\n\ncontacto:\n@pamebeytia\n+56 9 8279 35 88\npamela@clublaferia.cl\n\n\n\n\n\nClub La Feria\nConstitución 275, Bellavista.\nwww.clublaferia.cl\nwww.facebook.com/laferiaclub\nwww.twitter.com/laferiaclub\n\n\n", :start_time => "2012-11-16 22:00:00", :end_time => "2012-11-30 07:30:00", :address => "Av de Los Compositores, Bosque de Chapultepec II, Miguel Hidalgo, 11100 Mexico City, Distrito Federal, Mexico", :fb_id => 109868792507777, :owner_id => 1003100260, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/276993_109868792507777_1510119428_q.jpg", :atenders => 233, :privacy => nil, :created_at => "2012-11-15 03:18:10", :updated_at => "2012-11-15 03:18:10" },
