  { :name => "Matinee Summer Festival Chile - Amazing Tour Summer 2013", :longitude => -70.8812385, :latitude => -33.4516199, :gmaps => true, :description => "MATINÉE SUMMER FESTIVAL\nAmazing Tour\n\nMatinée Group se ha convertido en una marca reconocida mundialmente y estrechamente asociada con la diversión de calidad, la canalización de tendencias punteras, un criterio musical y estilismo infalible y, sobre todo, con una filosofía de la fiesta que, pese a ser única en el mundo, no conoce fronteras.\nMatinée World Tour nace en 2006 para atender las peticiones de colaboración del circuito internacional. Después de disfrutar del circuito europeo, durante los años 2007, 2008 y 2009 en ciudades como Londres, París, Madrid, Amsterdam, Milán y, Por supuesto, Ibiza, la energía Matinée llega a Brasil, Rusia, Marruecos, Egipto o Suecia tomando en cada ocasión la forma de una fiesta increíble, distinta e inolvidable.\n\nEs la hora de dar la bienvenida a Amazing Tour 2013 by Matinée Summer Festival.\n\nPor primera vez en Chile miles de apasionados vivirán un día de desenfreno en el Matinée Amazing Tour/Chile Summer 2013, una cita ineludible dentro del mundo de la Escena Electrónica, que tiene por tradición convertir una piscina en una espectacular pista de baile al aire libre.\n\nInternacional All Star Djs de Matinée Group\nVENESA KLEIN\nCHIPPER\nLYDIA SANZ\nTAITO TIKARO\n\n\n+ Djs Nacionales  e Internacionales Por Confirmar.\n\nPrecios  Pre-ventas\n\nSECTOR: 1\nNOMBRE SECTOR: GENERAL\nPRECIO: $ 15.000\n- Acceso a 3 piscinas en show central\n\nSECTOR: 2\nNOMBRE SECTOR: VIP\nPRECIO: $ 33.000\n- Acceso a 3 piscinas en show central\n- 2 piscinas sector vip\n- Zona de Relax\n- Masajistas \n- Guardarropa exclusivo sector vip \"gratis\"\n- Baños exclusivos sector vip\n- Y muchas sorpresas más...\n\nPARA MAYORES DE 18 AÑOS\n\nSABADO 19/01/2013 a las 10:00 Horas\nPISCINAS ESPACIO BROADWAY", :start_time => "2013-01-19 10:00:00", :end_time => "2013-01-19 22:00:00", :address => "Ruta 68, Pudahuel, Santiago Metropolitan Region, Chile", :fb_id => 491567097538706, :owner_id => 484504431577026, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/261165_491567097538706_595578242_q.jpg", :atenders => 0, :privacy => nil, :created_at => "2012-11-15 03:20:09", :updated_at => "2012-11-15 03:20:09" },
