  { :name => "Rocky Horror Show", :longitude => -70.6522474, :latitude => -33.4477836, :gmaps => true, :description => "Rocky Horror Show - Chile. \n\nTeatro Petulante organiza la primera convención anual de transilvanos en Chile, rebalsada de ironía, rock and roll y ciencia ficción. Escrita por el polifacético Richard O´Brien, narra las aventuras de Brad y Janet, una joven pareja de enamorados que viajan para invitar a su amigo el profesor Scott a su boda. En el camino en medio de una tormenta se ven obligados a pasar la noche en un castillo cercano, es ahí donde se encuentran con extravagantes y misteriosos personajes que transformarán sus vidas para siempre.\n\nElenco:\nFRANK N FURTER...........Pablo Aranda\nBRAD MAJORS................Braulio Basilio\nJANET WEISS.................Sandy Hartard\nRIFF RAFF......................Raúl Pizarro\nMAGENTA......................Constanza Biagini\nROCKY...........................Andrés Rillon\nCOLUMBIA.....................Francesca Merlino\nEDDIE/DR.SCOTT...........Miguel Rincón\nCRIMINOLOGO...............Miguelangel Morgado\n\nDIRECCION\nCristián Romo\n\nPRODUCCION\nCarolina Navarrete\n\n\nVenta de entradas: \nLocales Feria Mix y en http://www.feriaticket.cl/cgi-bin/wspd_cgi.sh/WService=wsPFDD/showEvent.p?eve_id=13383\n\n\nPlatea Alta:   $  8.000 + cargo por servicio ($ 9.000)\nPlatea Baja:  $13.000 + cargo por servicio ($14.500)\n\nIMPORTANTE: QUIENES ASISTIERON AL CONCIERTO TRIBUTO DEBEN COMUNICARSE AL CORREO CAROLINA@ROCKYHORROR.CL", :start_time => "2012-11-16 20:30:00", :end_time => "2012-11-16 23:30:00", :address => "Zenteno 200-234, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 229723703823415, :owner_id => 208045752573934, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/203570_229723703823415_1247600823_q.jpg", :atenders => 548, :privacy => nil, :created_at => "2012-11-15 03:22:11", :updated_at => "2012-11-15 03:22:11" },
