  { :name => "Día: Emprendimiento e Innovación BCI", :longitude => -70.6108185, :latitude => -33.4973582, :gmaps => true, :description => "Entre tantas elecciones, los invitamos a una de las últimas actividades de este año!\nUn gran día en donde podremos escuchar y conversar con diversos expositores, desde alumnos y profesores hasta emprendedores externos a la universidad.\n\n10:00 --> \"Café con...\"\nInvitados:\nCristóbal García: Sociólogo UC, Licenciado en Filosofía y Master de Ciencias en Comparative Media Studies del MIT, donde ha sido Investigador Visitante en varias ocasiones. Es profesor de Innovación en la Escuela de Administración, MBA y Magister de Innovación, Director de EmprendeUC y del Programa de Innovación de la Escuela de Administración.\nJosé Manuel Moller:  Alumno de nuestra facultad, ganador fondo \"desafío clave\" del INJUV con proyecto \"Algramo\" de innovación social. Coordinador proyecto TECHO, Liceo Alejandro del Rio, La Granja.\n\n12:50 --> \"Seminario Angloamerican: \"E+I de la facultad al país\"\nInvitados:\nJoaquín Poblete: ex alumno Ingeniería Comercial UC, Magister en Economía y Finanzas UC,  PhD rn Managerial Economics en Kellogg School of Management, profesor de London School of Economics.\nGastón Dussaillant:  Alumno 6° año ingeniería comercial, emprendedor y ganador de Start Up Chile.\nNicolás Cruz: Arquitecto,fundador y director nacional \"Junto al Barrio\".\n\n\nLos esperamos!", :start_time => "2012-11-15 10:00:00", :end_time => "2012-11-15 14:00:00", :address => "Camino Privado Pontificia Universidad Catolica De Chile, Macul, Santiago Metropolitan Region, Chile", :fb_id => 193238794146652, :owner_id => 1205932885, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/277003_193238794146652_819473741_q.jpg", :atenders => 57, :privacy => nil, :created_at => "2012-11-15 03:22:59", :updated_at => "2012-11-15 03:22:59" },
  { :name => "EcoFest 2012", :longitude => -70.50705599999999, :latitude => -33.400133, :gmaps => true, :description => "\"Tercera versión del Festival de Ecoturismo en Duoc-UC\"\n\nTe esperamos en la Sede de San Carlos de Apoquindo, de DuoC UC, donde habran actividades y talleres como:\n\n19 DE NOVIEMBRE:\n- SEMINARIO DE AREAS PROTEGIDAS.\n\n20 DE NOVIEMBRE:\n- TORNEO DE ESCALADA EN BOULDER.\n- TALLER DE INTREGACIÓN SOCIAL.\n- SUSTENTABILIDAD.\n- SLACKLINE.\n- FERIA DE PARQUES NACIONALES.\n- CONCURSO DE FOTOGRAFIA.\n\nY MUCHO MAS!!!\n\nMAS INFORMACION EN:\nFacebook: http://www.facebook.com/EcoFest2012\nWeb: http://www.duoc.cl/ecofest/index.html", :start_time => "2012-11-19 09:00:00", :end_time => "2012-11-20 19:00:00", :address => "Plaza 1905, Las Condes, Santiago Metropolitan Region, Chile", :fb_id => 491812434173956, :owner_id => 717211124, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/211199_491812434173956_1994053453_q.jpg", :atenders => 178, :privacy => nil, :created_at => "2012-11-15 03:23:17", :updated_at => "2012-11-15 03:23:17" },
  { :name => "EL DÍA DE LA TABLA", :longitude => -70.55594529999999, :latitude => -33.3788886, :gmaps => true, :description => "Estimados Tablistas y no tan Tablistas,\n\n este Jueves 15 de Noviembre\n\n El Bajo Boardshop te presenta\n\n ...:::EL DÍA DE LA TABLA:::... \n\nNos llegó un embarque completo de las nuevas tablas XFLEX directamente desde el país de la Samba!\n\nTambién tenemos el nuevo embarque de nuestros Stand Up Paddle COREBAN que arribaron esta semana desde Sudáfrica.\n\nJunto con eso tenemos toda la variedad de tablas John Carper, Bushman, ALL MERRICK, Klimax, Salerno, Madrid, Rusty, etc.\n\nPREPÁRATE PARA ESTE VERANO 2013 SÓLO EN EL BAJO BOARDSHOP.\n\nVen y elige tu combo \"El Bajo\"\n\n-Combo 1: Por la compra de tu tabla te regalamos leash, funda ó deck.\n-Combo 2: Descuentos hasta de 30% por tablas\n-Combo 3: Tablas para aprender con 50% descuento Softech\n-Combo 4: Bodyboards y aletas 50% descuento!!!!\n\nLos esperamos con todo el Style, DJ, Parrillita&Beer's y RedBull's en El Bajo.\n\nNos Vemos el Jueves 15!\n\nAv.Padre Hurtado Norte 2255, Vitacura.\n\n\n\n", :start_time => "2012-11-15 10:00:00", :end_time => "2012-11-15 22:00:00", :address => "Padre Hurtado Norte 2282-2336, Vitacura, Santiago Metropolitan Region, Chile", :fb_id => 521192004576578, :owner_id => 100000400238270, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276886_521192004576578_1541877931_q.jpg", :atenders => 212, :privacy => nil, :created_at => "2012-11-15 03:23:31", :updated_at => "2012-11-15 03:23:31" },
