  { :name => "Me voy a la huasteca con ConexionGDL", :longitude => -101.0199123, :latitude => 22.1449348, :gmaps => true, :description => "Reservaciones:\nhttp://conexiongdl.com/es/reserva-viajes/reserva-viajes.html\n---------------------------------------------------------------------------------------\n\nCONEXIÓN GUADALAJARA te invita a VIVIR LA HUASTECA!\n\nUno de los mejores destinos y viajes de nosotros con CULTURA, ECOTURISMO, y FIESTA\n\nEncontraremos en este gran viaje a la Huasteca Potosina una aventura con naturaleza, cultura y diversión llenos de adrenalina. Rodéate de cascadas turquesas y toda la mágia de este espectacular lugar en el puente del 19 de noviembre.\n\nToma 5 minutos para ver el fin de semana mágico que vamos a vivir:\nhttp://www.youtube.com/watch?v=HrIS2JByCqE\n\n---------------------------------------------------------------------------------------\nCONEXIÓN GUADALAJARA invites you to this Ecotourism trip! \n\nThis trip is going to be an adventure full of culture, fun, nature and adrenaline. Get immersed into the magic of this spectacular place! Monday 19th of november is OFF from everything (Holyday!!!)\n\nTake 5 minuts to realize and see what we are about to live:\nhttp://www.youtube.com/watch?v=HrIS2JByCqE\n\nVisitaremos/ We will visit:\n\n+ Castillo Surrealista de Edward James en Xilitla. \n+ La cascada de Tamul (105 m de Altura) \n+ La Cueva del Agua \n+ Puente de Dios \n+ Cascadas de Micos \n+ Tamazopo\n\n\nOpcional \n\n+ Los Rapidos de Tampoan (RAFTING) - Disponible soló para 150 personas\n+ El Sótano de las golondrinas \n\n\nIncluye:\n\n• Transporte de Lujo ida y vuelta (round trip) / Transportation\n\n• Seguro de viajero (Solo en transporte) / Travelers insurance on bus\n\n• 2 noches en Hotele/ 2 nights\n\n• Una noche de BARRA LIBRE / OPEN BAR Party\n\n• Servicio de Guías Profesionales Certificados /Certified Guides\n\n• Entradas a todas las cascadas y el castillo de Edward james / All entrances\n\n• Equipo personal completo / Personal Gear\n\n• Servicio de balsas (botes) para ir a las cascadas de Tamul / Boat Trip\n\n• Traslados locales / Local Transportation\n\n• Paramédicos certificados / Certified Paramedics\n\n\nFecha:\n16-19 Noviembre\n\nPrecio/Price :\n\n$2,490 pesos \n\n\nRP’s OFICIALES\n\nITESO\n1. Alejandro Jasso 333-578-7278\n2. Jose Luis Lopez 333-127-0890\n3. Melisa Castañeda 331-307-2651 \n4. Martha Palomar 3345938484\n5. Mario Becerra 333-578-8673\n6. Sofia Blanchet 3336763672\n7. Fabiola Bishop 333-577-7768\n8. Mariana Vera 331-410-4043 \n9. Faby Pimentel 333 661 59 64\n10.Melodie/ Margot 3318208344\n\nTEC\n\n1. Rosalie Porte (ENGLISH-FRENCH) 3311423614\n2. Nikki Kelderman (ENLGISH) 3311313845\n\nUNIVERSIDAD PANAMERICANA UP\n\n1. Michelle Aceves 333676-8456\n2. Maria Marshall (ITALIAN-ENGLISH) 3312160252\n\nCUCEA\n\n1. Estefania Iñiguez 331-458-3158 \n2. Varo Granja 333-828-0228\n3. Vianney Aldana 331 365 51 76\n4. Cristina Gauna 331-064-9405 \n\nCUCSH\n1.Jaime Arias 3314426611\n\nCUCS\n1. Estefania Iñiguez 3314583158\n\nCUCBA\n\n1. Sofia Gonzalez 3312149449\n\nCUAAD\n\n1. Paola Fiore 3310188414\n\nCUCEI\n1. Luis Vainillas 3311224538\n\nAUTONOMA UAG\n\n1. Alfonso Ledesma 3331927648\n2. Andrea Cadenas 3335770779\n\nESCUELA SUPERIOR DE ARQUITECTURA ESARQ\n\n3. Javier Leal 331-409-1655 \n\nCOLEGIO CULINARIO INTERNACIONAL\n\n4. Javier Marshall 333-189-6882\n\nEXTERNOS\n\n5. Adriana de Alba 3335702966\n6. Andres Zetter 333-676-3130\n7. Luis Carlos 33 10 88 77 12\n\nTequila Don Roberto: Patrocinador Oficial!", :start_time => "2012-11-16 23:00:00", :end_time => "2012-11-17 02:00:00", :address => "Montes Apalaches 115, Lomas de San Luis 1a. Sección, San Luis Potosí, Mexico", :fb_id => 433609213354082, :owner_id => 758421865, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/277036_433609213354082_1004071142_q.jpg", :atenders => 235, :privacy => nil, :created_at => "2012-11-15 03:24:45", :updated_at => "2012-11-15 03:24:45" },
