  { :name => "Gala UANDES DANCE, Hip Hop & JazzDance, Flamenco y Ballet!!", :longitude => -74.0670146, :latitude => 4.6024458, :gmaps => true, :description => "Ya vieneeee GALA UANDES DANCE 2012!!!!! \n\nHIP HOP & JAZZDANCE, FLAMENCO, Y BALLET !!!\n\n\nNO SE LO PIERDAAAAN!!\n\nSÁBADO 17 DE NOV A LAS 19:00 hrs, en Aula Magna Biblioteca.\n\nEl Show es GRATIS!!! La idea es disfrutar del Baile, de la música, y pasarlo increíble!!!\n\nDURACIÓN: 1 Hora\ny termina con un rico COCKTAIL!!! \n\nLOS ESPERAMOOOOOS!! :)\n\nUN ABRAZO GRANDE!\n\n\nP.D: PUEDE IR EL QUE QUIERA! No es necesario ser Alumno de Uandes\n\n\n \"Chiquilloooooos, como la mayoría sabe, se nos viene la gala Dance donde los talleres de Hip Hop, Ballet y Flamenco van a presentar estas maravillosas danzas en un entretenido y muy producido show, preparado durante meses y meses :D\nEntonces no se lo pueden perder: este sábado 17 de noviembre a las 19 horas los esperamos a todos en la aula magna de la biblioteca.\nVa a estar increíble!!!\" - Cena Sieyodji.\n", :start_time => "2012-11-17 19:00:00", :end_time => "2012-11-17 22:00:00", :address => "Carrera 3 # 2 a 100, Bogotá, Cundinamarca, Colombia", :fb_id => 389302307813028, :owner_id => 751174402, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/203605_389302307813028_1380759180_q.jpg", :atenders => 145, :privacy => nil, :created_at => "2012-11-15 03:26:28", :updated_at => "2012-11-15 03:26:28" },
  { :name => "BLOW UP!", :longitude => 121.02675, :latitude => 14.7260339, :gmaps => true, :description => "Entrada General: $6.000\nEntrada Preventa: $4.000\nH+20 - M+18\n\nEl Clásico de los martes se lo toma Dominga!!!\n\nLlega a Chile BLOW UP! Una increíble fiesta playera perfecta para recibir el verano de la mejor forma. \n\nHaremos explotar la discoteque, lloverán covers del cielo, collares tropicales, y mucho más, para que no dejes de sorprenderte durante la noche. \n                                                    \nEste martes 20 de noviembre será el lanzamiento oficial de BLOW UP!\nY para eso, tenemos el mejor auspiciador que también viene llegando a Chile, directamente desde Tahiti, cerveza Hinano se hará presente y tendrá muchas promociones durante la noche, además de cervezas gratis para los primeros en llegar… por eso queremos dejarles claro que desde ahora, el clásico de los martes será en Dominga!\n\nLineUp: DJ Alex Forero.\nMúsica ultrabailable.\n\nHinanos de regalo para los primeros.\nPisco y Ron a $2.500 hasta las 02:00 hrs.\nLas primeras 10 botellas de pisco a $12.000\n\nTeam Promotoras Hinano.\nFotos y video del evento.\nPremios y sorpresas.\nShow de Láser.\n                      \nBusca a nuestros embajadores quienes regalarán:\nMesa para 5 + Botella de Champaña\n\nLa barra se abre a las 23.00 hrs.\n\nPor eso no te puedes perder esta primera edición de BLOW UP!\nUna espectacular fiesta que busca entregar el mejor ambiente, con la mejor gente y en el mejor lugar.. \n\nPara conseguir tu preventa contáctate con nuestros embajadores.\nApúrate! Las preventas son limitadas!!\n\nContacto/Whatsapp:\n+569 8 159 43 07 (Tomás M.)\n+569 8 159 43 13 (Javier M.)\n+569 8 293 16 29 (Martin N.)\n+569 9 714 04 30 (Lucas E.)\n+569 9 783 09 49 (Tomás V.)\n\nNos vemos el martes, para que juntos reventemos la discoteque!\n\nEstacionamiento Privado.\nNos reservamos el derecho de admisión.", :start_time => "2012-11-20 23:00:00", :end_time => "2012-11-21 02:00:00", :