  { :name => "Mergulho no Tietê", :longitude => -46.6117159, :latitude => -23.5219483, :gmaps => true, :description => "Este é um ultimato para a despoluição dos rios Pinheiros, Tietê e seus afluentes.\n\nÉ um absurdo que nenhum governante (@Gilberto Kassab , @Geraldo Alckmin) tome medidas sérias com relação à despoluição. E sabem porque isso não é feito? Porque despoluir leva tempo, principalmente um rio como o Tietê. E coisas a longo prazo não trazem votos!\n\nMas já que a única coisa que importa para os políticos é voto e dinheiro, vamos falar de dinheiro:\n\nMilhões economizados na saúde:\n- Sim, imaginem em uma enchente quantas pessoas ficam em contato com essa água, além das doenças que são transmitidas por pernilongos (que se acumulam em milhões nas margens). E quantos problemas respiratórios não são gerados pelos gases liberados?\n\nDiminuição do trânsito:\n- Um exemplo disso são as cidades europeias que utilizam seus raros rios como meio de transporte para pessoas e cargas, de forma mais barata, tanto no custo da operação do transporte quanto na manutenção. Imaginem como seria São Paulo sem tantos caminhões.\n\nTurismo:\nUm sistema aquaviário é uma excelente opção de lazer.\n\nComércio:\nSeria a praia de São Paulo, onde centenas de lojas poderiam ser abertas, gerando uma grande quantidade de empregos para a população.\n\nBom, eu poderia escrever um livro sobre as vantagens de ter os rios de São Paulo limpos. Mas como não quero me estender, vou direto ao ponto.\n\nCHEGA DESSA PALHAÇADA!! PAREM DE ROUBAR E INVISTAM NOSSO DINHEIRO EM NÓS!!!!\n\nCompartilhe este evento como forma de protesto! Já existem casos de protestos como esse (sérios) que foram levados para discussão pelos nossos líderes. E assim, com certeza, poderemos mudar alguma coisa! \n\nE, quem sabe, daqui a 10 anos poderemos realizar um evento com um MERGULHO NO TIETÊ!!\n\nObrigado!", :start_time => "2021-11-12 15:00:00", :end_time => "2021-11-12 18:00:00", :address => "Av. Morvan Dias de Figueiredo - Vila Guilherme, Sao Paulo - São Paulo, 02170-000, Brazil", :fb_id => 164185803646983, :owner_id => 1407661382, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/203492_164185803646983_7933464_q.jpg", :atenders => 4831, :privacy => nil, :created_at => "2012-11-15 03:31:44", :updated_at => "2012-11-15 03:31:44" },
