  { :name => "CHILATIN BEATS + JIBARITO + LA GUACHA + FIESTA POST SHOW!", :longitude => -70.61233059999999, :latitude => -33.4227941, :gmaps => true, :description => "MUJERES CONFIRMADAS EN EVENTO, GRATIS, HASTA LAS 00:30 HORAS! (Solo quienes presionaron en \"Asistiré\" o \"Participar\")\n\nCHILATIN BEATS + JIBARITO + LA GUACHA\n+ DJ SET: NASH & BOOGIE MIKE\n\nEl subsuelo de providencia recibirá a tres de los exponentes más interesantes del último tiempo  en nuestro escena criolla. Juntos pero no revueltos subirán al escenario de Subterráneo Chilatin Beats, Jibarito y La Guacha.  \n\nChilatin Beats proyecto musical encabezado por  Ankatu Alquinta (actual guitarrista de Los Jaivas) y Dorian Chávez prestigioso Dj y productor Viene a mostrar lo más destacado de su debut, donde reversión canciones de Los Jaivas y clásicos de otros grandes de la música latinoamericana, mesclando pop electrónico bailable. Por su parte La Guacha llenará de cumbia y otros sonidos, con la inconfundible voz de su vocalista Soledad  del Rio  y Jibarito completa la tripleta con salsa y otros sonidos  latinos de  temas que sellaran una noche de fiesta imperdible.\n\n[VALORES!] Preventa: $3.000 (HASTA LAS 00 HORAS)\nGeneral: $6.000.\n\n2x1 en Terraza hasta las 1 AM!\n20% de dcto en carta de comidas hasta las 1 AM!\n[EVENTO PARA MAYORES DE 21 AÑOS]\n\n\n", :start_time => "2012-11-17 22:00:00", :end_time => "2012-11-18 05:00:00", :address => "Orrego Luco 11-163, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 467203683330273, :owner_id => 315916098493968, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373510_467203683330273_929850358_q.jpg", :atenders => 211, :privacy => nil, :created_at => "2012-11-15 03:32:46", :updated_at => "2012-11-15 03:32:46" },
  { :name => "COMO ASESINAR A FELIPES + FIESTA W/ CASO + BOOGIE MIKE + DUBLESS!", :longitude => -70.61237229999999, :latitude => -33.4227528, :gmaps => true, :description => "MUJERES CONFIRMADAS EN EVENTO, GRATIS, HASTA LAS 00:30 HORAS! (Solo quienes presionaron en \"Asistiré\" o \"Participar\")\n\nCOMO ASESINAR A FELIPES + DJ SET -> CASO + BOOGIE MIKE + DUBLESS!\n\nLuego de su participación en Maquinaria, llega al subsuelo más prendido de Providencia la banda Como Asesinar a Felipes con su cuarto disco bajo el brazo \"Comenzará de nuevo\", que contó con la colaboración del bajista de Faith no more Billy Gould. Para encender la pista de baile el line up de DJ SET estará a cargo de Caso, Boogie Mike y Dubless.\n\n[VALORES!] Preventa: $3.000 (HASTA LAS 00 HORAS)\nGeneral: $6.000.\n\n2x1 en Terraza hasta las 1 AM!\n20% de dcto en carta de comidas hasta las 1 AM!\n[EVENTO PARA MAYORES DE 21 AÑOS]", :start_time => "2012-11-16 22:00:00", :end_time => "2012-11-17 05:00:00", :address => "Orrego Luco 11-163, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 369835756433102, :owner_id => 315916098493968, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373274_369835756433102_1997500014_q.jpg", :atenders => 250, :privacy => nil, :created_at => "2012-11-15 03:32:51", :updated_at => "2012-11-15 03:32:51" },
