  { :name => "En busca de un Ecobarrio", :longitude => -70.6114054, :latitude => -33.4980507, :gmaps => true, :description => "Estimad@s:\n \nPorque queremos que nuestra villa se transforme en un Ecobarrio convocamos a participar de una charla informativa a realizarse el Jueves 15 de Noviembre a las 19:00 Hrs. en la sala D101 en el Campus San Joaquin de la UC - Facultad de College (Bachillerato), se recomienda entrar por puerta frente a Nicomedes Guzman con Benito Rebolledo. Esta actividad la estamos desarrollando en conjunto con el Centro de Alumnos de Ingeniería de la UC y el Área de Responsabilidad Social de la misma Facultad.\n \nEn esta charla dada por Pedro Mancilla (Consultor especializado en Sostenibilidad y Comunidad, conductor del programa de Television Sello Verde),\n \nhttp://compromisosustentable.cl/?page_id=194\n \nse presentara:\n \n¿ En que consite un Ecobarrio?\n \n¿Qué Beneficios provoca para nuestra ciudad este tipo de iniciativa?\n \nPara nuestra Unidad Vecinal es un paso importante, al cual invitamos a tod@s aquell@s que se interesan  por hacer de nuestra Comunidad un lugar que se destaque por su respeto y desarrollo de muchas actividades permanentes en que se refleje nuestro amor por el medio ambiente y la naturaleza.\n \nLos invitamos a participar con todas sus ganas :).\n \n \nCOMITE DE MEDIO AMBIENTE", :start_time => "2012-11-15 19:00:00", :end_time => "2012-11-15 20:00:00", :address => "Camino Privado Pontificia Universidad Catolica De Chile, Macul, Santiago Metropolitan Region, Chile", :fb_id => 485358414829320, :owner_id => 100001889741883, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373521_485358414829320_1232404081_q.jpg", :atenders => 76, :privacy => nil, :created_at => "2012-11-15 03:33:24", :updated_at => "2012-11-15 03:33:24" },
