  { :name => "The Amazing Race (Chicago)", :longitude => -87.6297982, :latitude => 41.8781136, :gmaps => true, :description => "Montreal - Niagara Falls - Chicago - Toronto - Montreal\n4 days\n\nNicknamed \"Windy City\" Chicago is the third largest city in the United States after New York and Los Angeles. Come explore Al Capone's city via Toronto and Niagara Falls during an AMAZING 4 days' race (new team challenges every day).\n\nFriday\nDeparture on Friday morning corner berri and St-Catherine at 3h00am to Niagara Falls, the arrival is scheduled for 11h30 . Two choices will be offered: a memorable Journey Behind the Falls (17$) or a walk around the falls (free). In the afternoon will discover the Niagara falls little Las Vegas, the Clifton Hill with all the amusements it has to offer (wax museum, arcade, a miniature golf and much more). A group dinner will be held in the evening (not included), followed by our challenges day winner announcement at a bar. Departure for Chicago at 22h00. Night aboard the bus.\n\nSaturday\nArriving in Chicago around 9h00am. We'll begin with a boat tour to explore the city (not inlcuded). \nChicago River Architecture Tour (75 min, 24.18$). Then we will visit Millennium Park with the world known Cloud Gates also called \"The Bean\", and the Buckingham Memorial Fountain.\nAround noon, check-in at the hotel.\nIn the afternoon we will visit the City Gallery in the historic Water Tower (free). We'll then go to the Navy Pier, Chicago's famous boardwalk on the shores of Lake Michigan occupied by an amusement park, where will be heading the annual toy and game fair (the largest toy fair in the country).\nEarly in the evening we will assist to the wonderfull annual parade of the Chicago magnificent mile lights festival. After we'll pass an awesome night the interstude's way at a nightclub (free entry and bottle at the rendez-vous)\nOvernight at the Chicago Getaway Hostel\n\nSunday\nIn the morning we'll walk from north to south the main artery of the city: Michigan Avenue. For those interested, we'll stop at the Museum of Contemporary Photography (free). After lunch, we'll be discovering the business district \"The Loop\". First by walking and then with the Skytrain (2.25$), that will give us an outside view of this great district. For those interested, some will go up the top of the tallest tower of America, the Willis Tower, offering lenses boxes built outside of the tower that give you an outstanding view of the city (14$). We'll spend the rest of the afternoon in the Lincoln Park and his Zoo (free).\nIn the evening we'll assist \"The Free for all\", a free improv comedy show at the playground theater. Leaving at 23h30 for Toronto.\n\nMonday\nArriving at 9h00 to Toronto. We will start our journey through the city by discovering the CN Tower (the Toronto emblem) and the Rogers Center (sporting events and concerts). In the afternoon, the ferry to Centre Island (7$) will take us for a magnificent view of the city. We'll then return to Toronto to explore the downtown heart (the City Hall, the Hockey Hall of Fame, Chinatown). Departure at 18h00 for Montreal to arrive around midnight.\n\nThe trip costs $275 including taxes per person and includes:\n- The luxury transportation for 4 days\n- Overnight at the Chicago Getaway Hostel with 1 diner and 1 Breakfast\n- The contribution to the FICAV of 0.035%\n- The Dream Team\n\n* You're always free to do what you want, you're not obligate to follow our itineraries\n* Due date November 1st or before it sold out.\n* We don't do refunds.\n* We only take payment by credit card or Paypal.\n* Limited quantity of 56 seats.\n* It is your responsibility to check with your embassy to see what you need to pass the border.\n* It is your responsibility to check if your travel insurance cover you in the United States.\n", :start_time => "2012-11-16 06:00:00", :end_time => "2012-11-19 03:00:00", :address => "300-310 S Federal St, Chicago, IL 60604, USA", :fb_id => 474378639262383, :owner_id => 752255728, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/592333_474378639262383_276494886_q.jpg", :atenders => 72, :privacy => nil, :created_at => "2012-11-15 03:35:52", :updated_at => "2012-11-15 03:35:52" },
