  { :name => "Weekend Ski à Tignes", :longitude => 6.900281, :latitude => 45.455334, :gmaps => true, :description => "Le Pistus, le Ski Club de Centrale et le Ski Club de Supélec vous invitent à passer votre weekend du 8-9 Décembre à Tignes!\n\nAu programme :\n- Deux jours de ski sur l'Espace Killy (Tignes + Val d'Isère : 2 glaciers, 300km de pistes. Neige garantie!)\n- Une nuit dans un hôtel 2 étoiles dans une chambre avec 3 de tes potes et avec un fat petit déjeuner offert le samedi matin.\n- Un slalom parallèle réalisé par des professionnels le samedi après-midi avec une paire de skis et des cadeaux à la clé!\n- Une soirée dans un bar à 2 pas de l'hôtel la nuit du samedi soir.\n- Un départ en bus le vendredi soir de Centrale (21h) et Supélec (21h30) pour un retour à Supélec (6h30) et Centrale (7h) le lundi matin avant le début des cours.\n\nAvec en plus :\n- Des tarifs préférentiels pour la location des ski/snow à prix intéressants : 20€ pour le pack Sport (ski, chaussure, battons, casques) et 28€ le pack Performance pour 2 jours.\n- Un repas Savoyard (entrée + plat + dessert + 1/4 vin par personne) le samedi soir à 17€ (en option).\n\nTarif : 154€ \n\nPour Centrale : Des permanences au RU auront lieu à partir du mercredi 21 entre midi et deux pour les inscriptions. \n\nContact : weekend@pistonski.com\n", :start_time => "2012-12-07 17:00:00", :end_time => "2012-12-10 15:00:00", :address => "Rue du Val Claret, 73320 Tignes, France", :fb_id => 364588496966738, :owner_id => 712856644, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373053_364588496966738_498443669_q.jpg", :atenders => 48, :privacy => nil, :created_at => "2012-11-15 03:40:14", :updated_at => "2012-11-15 03:40:14" },
