  { :name => "FRANKELET + PÁNICO EN  SHOW LARGA DURACIÓN + FIESTA POST SHOW / VIERNES 16 / AMANDA", :longitude => -70.5685793, :latitude => -33.3877846, :gmaps => true, :description => "Jameson presenta:\n¡PÁNICO EN VIVO!\n Abre el show: Frankelet\n+ Fiesta Post Show: Djs Fernando Mujica y Max Loof\n\nEn un show abierto por el grupo Frankelet, este viernes recibimos a la elite del rock alternativo. Pánico, una de las bandas más importantesa nivel nacional vuelve a Amanda con su último disco “Resonancia” bajo el brazo.\n\nPánico lleva casi 20 años de carrera y con ellos seis discos bajo el brazo, editados y lanzados.  Resonancia es el séptimo disco de la banda chilena-francesa, editado bajo el sello independiente Hueso Records, y que pronto será editado en Chile bajo el sello Oveja Negra. \n\nGrabado en San Pedro de Atacama, “Resonancia” es el resultado final de la  experimentación y  búsqueda de sonidos nuevos en el vacío del desierto chileno.\n\nPost Show la fiesta estará a cargo de los Djs Fernando Mujica y Max Loof, que encenderán la pista de día viernes para que carretees hasta la madrugada.\n\nEntradas a la venta en https://secure.welcu.com/buy/1638/d7b0d60d\n\nApertura de Frankelet: de 23:00 a 23:30 hrs \n\nValores: \nPreventa 1: $5.000\nPreventa 2: $7.000\nPreventa 3: $9.000\nPreventa 4: $10.000\n", :start_time => "2012-11-16 02:00:00", :end_time => "2012-11-17 02:00:00", :address => "Embajador Doussinague 1711-1765, Vitacura, Santiago Metropolitan Region, Chile", :fb_id => 471973586180397, :owner_id => 151664078230406, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276906_471973586180397_789738521_q.jpg", :atenders => 159, :privacy => nil, :created_at => "2012-11-15 03:49:09", :updated_at => "2012-11-15 03:49:09" },
