  { :name => "Turno", :longitude => -5.171975499999999, :latitude => 39.8012561, :gmaps => true, :description => "En una sala de recuperación de un hospital, dos hombres recién operados no sabemos de qué, se recuperan lentamente de la anestesia que les administraron. Estos son atendidos por la enfermera de turno quien pasa de ser una funcionara común y corriente a ser parte de las alucinaciones que esta anestesia les provoca. La fragilidad en que se encuentran los llevará a situaciones algunas veces dramáticas y otras absurdas que no sabemos si son parte de la realidad o de alguna alucinación.\n\nTemporada\nDesde el jueves 15 de noviembre al sábado 15 de diciembre 2012.\nFunciones: jueves, viernes y sábado a las 20:00 hrs.\nTeatro Del Puente / Parque Forestal s/n, entre puente Pio Nono y Purísima /Metro Baquedano \n\nPrecios\n\n$ 5.000.-Adulto\n$ 3.000.-Estudiantes y tercera edad\nVentas de entradas a través de TICKETEK\n\nReservas al teléfono 7324883 o mail  reservas@teatrodelpuente.cl\nwww.teatrodelpuente.cl\n\nFicha Técnica “Turno”\nDirección y dramaturgia: Emilia Noguera \nAsistente de dirección: María de los Ángeles Calvo \nElenco: Etienne Bobenrieth, Carlos Ugarte y Carla Casali\nDiseño Integral: Cristian Reyes\nCreación Musical: Diego Noguera \nDiseño Grafico: Eduardo Cerón\nFotógrafo: Rodrigo Canales\nDifusión en Prensa Vicky Cárdenas \nProducción General: Daniela Orrego\n\n", :start_time => "2012-11-15 20:00:00", :end_time => "2012-12-15 20:00:00", :address => "Calle del Teatro Moratín, 7, 45570 El Puente del Arzobispo, Province of Toledo, Spain", :fb_id => 239515519511393, :owner_id => 684773585, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276902_239515519511393_972870853_q.jpg", :atenders => 193, :privacy => nil, :created_at => "2012-11-15 03:51:02", :updated_at => "2012-11-15 03:51:02" },
