  { :name => "PROYECTO XPSU/ 4 DIC / SALA MURANO", :longitude => 11.9556472, :latitude => 45.4517513, :gmaps => true, :description => "            ..:::::::::::::: PROYECTO X PSU ::::::::::::::.\n\n             \n Se viene la psu y muchos están tiritando, otros ansiosos y simplemente otros que no están ni ahí. Es por eso que queremos que cada uno celebre, pase las penas o simplemente se ponga un mambo de aquellos, en donde no existan barreras, para que esto sea posible contaremos con barra abierta como tu lo querías no stop toda la noche, show láser, Dj en escena y lo mejor de todo lugares cómodos en donde pueden hacer lo que quieran.\n\nLa idea es tirar la casa por la ventana y para eso te queremos a ti disfrutando de este gran evento que tanto te mereces, por prepararte estudiando, gozando, o pastiando en realidad da lo mismo por qué?  Por qué termino el colegio mierda ¡!!!!! Así que te esperamos el 4 de dic en Sala Murano desde las 11:00 pm.\n\nPara cualquier información tendremos un staff de rrpp que serán tus aliados en esta odisea que dará que hablar. \nNo esperes mas y asegura tu entrada porque contamos con una capacidad limite y no queremos que quedes fuera, mucha suerte a todos \n \n(no sera un juego)\n\n* Show  laser y la mejor iluminacion!\n\n* Bar abierto sector general en Pisco Capel! \n\n* Bar abierto para sector VIP con Pisco Alto del carmen, Vodka Stolichnaya, Ron Bacardi y con BAJON DE REGALO !!!\n\n- Dj Residente Redbull en escena (cargado con todos los hits que a ti te gustan)\n\n- Animacion en vivo con Concursos y regalos cortesia de BILLABONG. \n\ny muchas sorpresas mas!\n\nasi que ya saben, se nos viene fieston de aquellos!!!\n\n\n***********Nuestros Vendedores Autorizados*****************\n\nJeronimo izquierdo\nhttps://www.facebook.com/jeronimo.izquierdoalmarza\n\nNikola Simunovic\nhttps://www.facebook.com/niko.simunovic\n\nLeo Tapia\nhttps://www.facebook.com/leo.t.salazar\n\nGabriela Leonardi\nhttps://www.facebook.com/gabriela.leonardi.54\n\n