  { :name => "PRIMAVERA FAUNA 012", :longitude => -70.7546809, :latitude => -33.4537335, :gmaps => true, :description => "EL MEJOR FESTIVAL CON POOLPARTY A LLEGADO A CHILE Y NO TE LO PUEDES PERDER! CON ARTISTAS INTERNACIONALES Y NACIONALES.\n\nÉsta no será una celebración cualquiera. Fiel a su creación, este año la idea es consolidar un festival único, con estilo y estética propia y hecho 100% a medida: Primavera Fauna, Festival de Música y Artes hecho en Chile. Sí, porque además de la música, este año se podrán ver instalaciones artísticas, realizadas por destacados artistas visuales.\n El sector piscinas del Espacio Broadway nuevamente será la sede de nuestro Festival: un gran espacio de áreas verdes, con zonas de esparcimiento y piscinas habilitadas. Un marco inmejorable en la época más agradable del año.\n \n3 escenarios, internacional, latino y pool party; 14 de horas de música, la primavera en todo su esplendor. PULP, Clap your Hands and Say Yeah, The Walkmen, Francisca Valenzuela y Astro son algunos de los 24 nombres que desfilarán este 24 de noviembre.\n \nPrimavera Fauna es LA fiesta de la Primavera, una instancia que pretende insertarse a lo largo de tiempo como única en Chile.\n\nPrimera Pre Venta:\n - GENERAL: $28.500 (QUEDAN POCAAS!! )\n - VIP: $56.500  (QUEDAN POCAAS!! )\n\n \nPre Venta General: \n - GENERAL: $38.000  \n \nEl sector VIP se ubicará entre los 2 escenarios principales y le otorgará a los asistentes una vista privilegiada y beneficios como baños y guardarropía exclusiva, y otras sorpresas.\n\nContacto: Sacha Levy (inbox)/celular: +56 9 98357798 (llamadas, mensajes, whats app)", :start_time => "2012-11-24 02:00:00", :end_time => "2012-11-25 02:00:00", :address => "Oceanía 543-573, Pudahuel, Santiago Metropolitan Region, Chile", :fb_id => 423293217720148, :owner_id => 609838690, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373204_423293217720148_76741126_q.jpg", :atenders => 72, :privacy => nil, :created_at => "2012-11-15 03:57:08", :updated_at => "2012-11-15 03:57:08" },
  { :name => "Armada Night | SHOGUN | Viernes 23 de Noviembre @ DOT Club by SINNERGY", :longitude => -70.6779506, :latitude => -33.3637421, :gmaps => true, :description => "ARMADA NIGHT\n\n★SHOGUN★ + ★SOUL & SENSES★\n\nViernes 23 de Noviembre @ DOT Club | Santiago\n(Av. Américo Vespucio 1737, Huechuraba) a 3 minutos de Espacio Riesco.\nHAY QUE ENTRAR AL MALL PLAZA NORTE!\n\nArmada Music y Sinnergy se enorgullecen en presentar una nueva versión de Armada Night Santiago. Esta vez, junto al primer DJ y Productor Asiático en unirse a las filas de Armada Music, Shogun. \n\nAndrew Chen a.k.a. Shogun, tiene un historial impecable, ya sea remixeando para el DJ número uno del mundo, Armin Van Buuren, o produciendo para la cantante y compositora nominada al Grammy, Nadia Ali, su trabajo se ha ganado el respeto de las estrellas más grandes de la industria. \n\nShogun ya tiene a su haber varios hits y su habilidad como DJ ha provocado gran euforia en las pistas de los mejores clubes del globo, ahora, es el turno de Chile para recibirlo por primera vez. En esta ocasión, Shogun estará acompañado del dúo nacional Soul & Senses, quienes no necesitan mayor introducción, la primera mitad del 2012 se presentaron en los escenarios de Ultra Music Festival Buenos Aires, Godskitchen Boombox y Lollapalooza. Sin duda será otro épico Armada Night.\n\n\n\nwww.shogun-music.com\nwww.facebook.com/djshogunmusic\nwww.twitter.com/shogunmusic\nwww.youtube.com/djshogunmusic\n\n_______________________________________________________\n\n::::Auspician::::\n\nJack Daniel´s - Appleton Estate - Finlandia - Cerveza Corona\n_______________________________________________________\n\n::::Media Partners::::\n\nDJ MAG LA - Sonora \n_______________________________________________________\n\n::::Tickets::::\n\n★GENERAL★\n·Preventas Limitadas: $10.000\n·Puerta: $15.000\n(más cargo por servicio)\n\n★Vip Bottle Service★\n·INFO: vip@sinnergy.cl\n\nCompra online:\nPronto a través de ticketek.cl\n_______________________________________________________\n\n::::Produce::::\n\nSINNERGY AGENCY\nwww.sinnergy.cl\nwww.facebook.com/sinnergy\nwww.twitter.com/SinnergyAgency\nwww.youtube.com/sinnergyagency\n_______________________________________________________\n\n::::Colaboran::::\n\nARMADA MUSIC\nwww.armadamusic.com\nwww.armadanightsla.com\n\nDJ MAG LATINOAMERICA\nwww.djmagla.com\n\nTWENTY 4 SEVEN\nwww.twenty4sevenmanagement.com\n_______________________________________________________\n\n* Evento para mayores de 18 años.", :start_time => "2012-11-23 23:00:00", :end_time => "2012-11-24 02:00:00", :address => "Camino Privado, Huechuraba, Santiago Metropolitan Region, Chile", :fb_id => 161985413947469, :owner_id => 152537181431577, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373514_161985413947469_191713326_q.jpg", :atenders => 135, :privacy => nil, :created_at => "2012-11-15 03:57:32", :updated_at => "2012-11-15 03:57:32" },
