  { :name => "Trabajos Voluntarios UAI Stgo Verano PAREDONES 2013", :longitude => -71.900145, :latitude => -34.651965, :gmaps => true, :description => "Una vez más llegó el momento de invitarlos a una experiencia única e imperdible que marcará tu vida universitaria:\n\nTRABAJOS VOLUNTARIOS VERANO PAREDONES 2013\n\nEsta Localidad se ubica en la VI región.\n\nNecesitamos de su ayuda !! Paredones nos está esperando, y sin ustedes no podremos lograrlo!!!!\n\nInscríbete en nuestro stand EN LAS PANTALLAS DEL EDIFCIO A,  HASTA EL 23 DE NOVIEMBRE !!! o en la página web www.trabajosvoluntariosuai.cl\n\nNo esperes más y forma parte de este proyecto. \nEs ahora cuando tenemos que poner manos a la obra.\n\nLos esperamos!!\n\n\"UNA PERSONA, UNA HUELLA\"\n\nMás información:\nwww.trabajosvoluntariosuai.cl\n\nSíguenos:\nFacebook: Trabajos Voluntarios UAI STGO\ntwitter: tvuaistgo\n", :start_time => "2013-01-03 02:00:00", :end_time => "2013-01-04 02:00:00", :address => "I-72, Paredones, O'Higgins Region, Chile", :fb_id => 193960907407214, :owner_id => 503265418, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/203616_193960907407214_1097824651_q.jpg", :atenders => 33, :privacy => nil, :created_at => "2012-11-15 03:58:21", :updated_at => "2012-11-15 03:58:21" },
  { :name => "Taller de Numerología Tántrica", :longitude => -70.641997, :latitude => -33.4691199, :gmaps => true, :description => "Este sábado 24 de noviembre Taller de Numerología Tántrica: una herramienta para la evolución espiritual\n\nTe invitamos a participar del Taller de Numerología Tántrica realizado por Paraestarbien.\n\nLa numerología tántrica relaciona la fecha de nacimiento con las fuerzas cósmicas y los correspondientes estados vibracionales presentes en ese momento. En cada uno de nosotros esto se traduce en determinadas tendencias psicológicas y espirituales.\n\nA partir de la fecha de nacimiento se obtienen aspectos de nuestra existencia que nos dan información clave para nuestra evolución espiritual. La numerología tántrica permite saber qué vinimos aprender en esta experiencia terrenal, tanto en el desarrollo interno como en la relación con los demás. Además, para facilitar nuestra evolución, la carta numerológica nos muestra las herramientas con las que contamos en esta vida para lograr esos aprendizajes y alcanzar así nuestra misión de vida armónica.\n\nAl hacernos conscientes de nuestras debilidades, fuerzas, talentos y conocimientos podemos canalizar nuestra energía en pos de lograr nuestros objetivos planificados en planos espirituales.\n\nTodo esto nos da la posibilidad de analizar nuestras experiencias de vida desde una perspectiva más trascendental, entendiéndolas como experiencias de aprendizaje y permitiendo el equilibrio con nuestra esencia.\n\nFecha: sábado 24 de noviembre.\n\nHorario: 11°° a 19°° horas\n\nIncluye: té breaks, apuntes completos con el significado de los números.\n\nModalidad: teórico-práctica\n\nInversión: $25.000.-\n\nDictado por: Lorena Mallea y Carla Saavedra. Licenciadas en psicología de la Universidad de Chile, diplomado en Psicología Educacional, Directoras de Paraestarbien.\n\nLos cupos son limitados, para reservar tu espacio debes realizar una transferencia o depósito de $10.000.- pesos y enviarnos un mail para 