  { :name => "Misiones de verano 2013 - Misión Cárcel", :longitude => -56.683773, :latitude => -36.6966095, :gmaps => true, :description => "¡Ya hemos abierto las inscripciones para lo que serán las misiones de verano 2013 de Misión Cárcel!\n\nEn esta ocasión las misiones se realizarán en dos de las tres cárceles de menores que visitamos regularmente durante los fines de semana del año; el CRC San Bernardo, que es un centro masculino en la RM y el CIP-CRC Limache, cárcel también de hombres ubicada en la V región.\n\nEstas misiones serán del 6 al 12 de enero, período durante el cual alojaremos en un colegio cercano a las dependencias que visitaremos en jornadas de mañana y tarde para acompañar a los jóvenes, llevarles entretención, conversación, distintas actividades y lograr compartir con ellos mediante diversas instancias que les tendremos preparadas.\n\nPara ser parte de esta grandiosa experiencia tan solo debes inscribirte en el siguiente formulario http://www.surveymonkey.com/s/XK5KFPL donde deberás dejarnos tus datos para así poder contactarte lo antes posible y contarte los detalles respectivos dependiendo del centro que elijas.\n\nCualquier duda que tengas también puedes manifestarla en el mismo formulario o enviarnos un correo a voluntariado@misioncarcel.cl\n\nNosotros contamos cuántos días nos faltan para salir de vacaciones,\n¡ellos cuentan contigo!\n\n\nMás información acerca del proyecto en www.misioncarcel.cl", :start_time => "2013-01-06 02:00:00", :end_time => "2013-01-07 02:00:00", :address => "De la Reducción 600-698, San Bernardo, Buenos Aires Province, Argentina", :fb_id => 370711469683853, :owner_id => 100001638894502, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373469_370711469683853_357206448_q.jpg", :atenders => 45, :privacy => nil, :created_at => "2012-11-15 04:01:52", :updated_at => "2012-11-15 04:01:52" },
