  { :name => "Deuda Saludable 2.0", :longitude => -71.2375002, :latitude => -32.86147589999999, :gmaps => true, :description => "Proyecto de intervención urbana sin fines de lucro para enseñar a las personas a endeudarse de una manera responsable.\n\nOBJETIVO:\nconcientizar, educar y asesorar a las personas sobre los principales temas financieros.\n\nMISIÓN:\ncrear conocimiento sobre los tópicos básicos de endeudamiento que debería manejar el ciudadano común, focalizando la actividad bajo el concepto y/o idea fuerza: “Deuda Saludable\".\n\nTÓPICOS BÁSICOS:\n• Enseñar el concepto de presupuesto familiar (concientizar cuánto es lo máximo que pueden destinar a fin de mes a pagar créditos)\n• Enseñar a leer los contratos de los créditos (explicar que son las comisiones, intereses)\n• Enseñar a evaluar un crédito\n• Atender dudas y aclarar términos que no siempre manejan y, por ende, no entienden al momento de endeudarse.\n\nENTIDADES RELACIONADAS:\nstand de apoyo del SERNAC Financiero, staff de abogados.\n\nFECHAS DE LAS ACTIVIDADES:\n• Sábado 17 de Noviembre, Plaza de Armas de Quillota, de 10 a 13 hrs.\n• Miércoles 21 de Noviembre, Casa Central Pontificia Universidad Católica de Valparaíso, de 10 a 14 hrs.\n• Viernes 7 de Diciembre, Plaza María Luisa Bombal de Viña del Mar, de 15 a 19 hrs (Av. Valparaíso esq. Villanelo).\n\nVISITA:\n http://www.facebook.com/DeudaSaludable20\n", :start_time => "2012-11-17 10:00:00", :end_time => "2012-11-17 13:00:00", :address => "Valdebenito 100-198, Quillota, Valparaíso Region, Chile", :fb_id => 244540785673926, :owner_id => 1157138792, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373184_244540785673926_1584389495_q.jpg", :atenders => 63, :privacy => nil, :created_at => "2012-11-15 04:10:00", :updated_at => "2012-11-15 04:10:00" },
