  { :name => "Tour Autorizado Querétaro Time and Space Festival @ México, Df  (La Marquesa).", :longitude => -70.5510826, :latitude => -33.5584506, :gmaps => true, :description => "Time and Space – The 2012 Countdown Festival\n\nDiciembre 15 & 16 – México, DF.\n\nLa locación se dará a conocer días antes del evento.\n\n\nEl 21 de Diciembre 2012, llegaremos al final de un ciclo de 26,000 años calculado con gran precisión por unos de los más avanzados astrónomos de la antigüedad: Los Mayas.\n\nY mientras todos nos preguntamos que pasará cuando llegue el día, hay serias especulaciones sobre un cambio significativo y un despertar de consciencia.\n\nTodo lo que nosotros sabemos, es que la música reúne a las personas en paz y armonía, revelando una conexión que sólo puede describirse como mágica… Creemos que en tiempos como éstos ciertamente necesitamos algo de ésta magia.\n\nCordialmente invitamos a todos en la Galaxia a la cuna de la Civilización Maya a presenciar el comienzo de una nueva era para la humanidad.\n\nUna celebración como ninguna otra que trascenderá en las páginas de la Historia.\n\n\n\n\nl Invitado Especial l \n\nAlex Grey (Live Painting)\n\nAlex Grey (born November 29, 1953) is an American artist specializing in spiritual and psychedelic art (or visionary art) that is sometimes associated with the New Age movement. Grey is a Vajrayana practitioner. His body of work spans a variety of forms including performance art, process art, installation art, sculpture, visionary art, and painting. Grey is a member of the Integral Institute. He is also on the board of advisors for the Center for Cognitive Liberty and Ethics, and is the Chair of Wisdom University's Sacred Art Department. He and his wife Allyson Grey are the co-founders of CoSM, Chapel of Sacred Mirrors, a non-profit church supporting Visionary Culture in Wappinger, New York.\n\n\n:: Line up ::\n\nPsychedelic Trance//Chill Out// Progressive Trance\n\n\nShpongle\nPerfect Stranger\nYounger Brother\nGreen Nuns of the Revolution\nZen Mechanics\nZentura\nAce Ventura\nTristan / Killerwatts\nPrometheus\nGnomes of Kush\nSon Kite\nEitan Reiter\nKarotte\nLoud \nMatador\nOpiuo\nSunmonx\nAvalon\n\n\n\n:: Line up ::\n\nDeep House//Techno// Progressive House\n\nTroy Pierce\nGuy J\nHenry Saiz\nMarc Marzenit\nPaul Ritch\nDousk\nBlond:ish\nWehbba\nA. Balter & E. Reiter\nAmbivalent\nMinilogue\nManuel Sofia aka Mos\n\n\n\nwww.timeandspacefestival.com\n\n\n\nNUESTROS PAQUETES\n\nOpcion 1\nViaje Redondo Queretaro-La Marquesa Edo. México-Queretaro + Acceso al evento\nCosto de la pre venta en fecha + $250 Pesos\n\n\nOpcion 2 \nViaje Redondo Queretaro-La Marquesa Edo. México-Queretaro + Acceso al evento + Lunch \nCosto de la preventa en fecha + $320 Pesos\n\nOpcion 3 \nViaje Redondo Queretaro-La Marquesa Edo. México-Queretaro + Acceso al evento + Lunch + Barra Libre\nCosto de la preventa en fecha + $380 Pesos\n\n\n\n\nPRECIO DE PREVENTAS!!\n\n\n\nPreventa 1 \nDel 19 de Octubre al 16 de Noviembre * \nGeneral: $330 Pesos \n\nPreventa 2 \nDel 17 de Noviembre al 14 de Diciembre * \nGeneral: $390 Pesos\n\nTaquilla\nGeneral: 450 pesos\n\n\n\nCONTACTO\n\nTour Autorizado Queretaro Time & Space Festival\n\n\nLuis Enrique Buenrostro\n 442 141 32 29\n52*1028674*3\n\nOscar Perez\n72*986341*2", :start_time => "2012-12-16 00:00:00", :end_time => "2012-12-16 08:00:00", :address => "El Principado 6339, Puente Alto, Santiago Metropolitan Region, Chile", :fb_id => 172241686248565, :owner_id => 674731082, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/592210_172241686248565_1973527419_q.jpg", :atenders => 101, :privacy => nil, :created_at => "2012-11-15 04:13:29", :updated_at => "2012-11-15 04:13:29" },
