  { :name => "SUMANDO - BOLEROS Y TEATRO", :longitude => -70.76743429999999, :latitude => -33.490685, :gmaps => true, :description => "Función especial de \"La Que Hubiera Amado Tanto\" para ayudar a Sergio Alberto Martínez Lozano para corregir su problema de distonía generalizada.\n\n¿¿Nos extrañaste??\n\nComprometidos con ayudar, \"La Que Hubiera Amado Tanto\" y el tenor Andrés Pichardo y la soprano Fernanda Barrón en colaboración con muchos artistas queretanos dispuestos a sumarse a una causa noble, hemos decidido ayudar a Checo Martínez Lozano a reunir la cantidad de $400 mil pesos para someterse a una cirugía que le permitirá corregir su distonía generalizada, para lo cual estamos SUMANDO esfuerzos para presentar un programa artístico inolvidable.\n\n¿Has entrado a un bar de los años 40´s?, ¿Alguna canción te ha conmovido hasta las lágrimas?, ¿Sientes que, para entender a las mujeres, deberías comprarlas a tu gusto?\n\nLa función será en el Teatro Alameda y el costo mínimo del boleto será de $40.00, sin embargo, sí alguien quiere dar más, BIENVENIDO SEA!! Todo el dinero recaudado será entregado íntegramente a Sergio...\n\nPara mayores informes, favor de comunicarse a los teléfonos: 4421867946, 4422724010 o 4423427456.\n\n¡¡¡NO TE PIERDAS LA OPORTUNIDAD DE DIVERTIRTE Y AYUDAR A CAMBIAR LA VIDA DE UNO DE NOSOTROS!!!", :start_time => "2012-11-20 20:00:00", :end_time => "2012-11-20 23:00:00", :address => "Teatro Alameda 1-99, Maipu, Santiago Metropolitan Region, Chile", :fb_id => 227877997342032, :owner_id => 157112787665403, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/203475_227877997342032_1508966300_q.jpg", :atenders => 331, :privacy => nil, :created_at => "2012-11-15 04:14:04", :updated_at => "2012-11-15 04:14:04" },
  { :name => "Torneo Gotcha BATTALLA DEL RIO QRO", :longitude => -100.0973268, :latitude => 20.3978901, :gmaps => true, :description => "El torneo consiste en:\n\n- equipos de 5 personas mixtos los cuales jugaran un minimo de 3 juegos.\n- 100 tiros cada uno (con la posibilidad de adquirir mas balas) .\n- El objetivo es capturar la bandera del equipo contrario ya sea obteniendola durante el juego o eliminando completamente a los contrarios.\n\nLos equipos que califiquen se le seguirán otorgando 100 tiros por juego. \n\n¿ Dónde ?\n\nTodo se desarrollara en la parte trasera del Hotel Fiesta Americana Galindo a 25 min de Querétaro es un ESCENARIO REAL que cuenta con arboles gigantes, un río y demasiados spots para esconderse creando una experiencia realmente extrema. \n\n¿ Que incluye la inscripcion $350 ?\n\nCareta JT\nCasaca de manga larga\nChaleco acolchonado\nMarcador de pintura (pistola de paintballs)\nHopper ó contenedor de cápsulas\nGas ILIMITADO\n\n3 JUEGOS MINIMO CON 100 CAPSULAS CADA UNO.\n\n¿ Que Habrá?\n\n- Zona de bebidas\n- Snacks \n- Dj y musica para la convivencia fuera del campo de juego. \n\n¿ PREMIO ?\n \n Aparte de la gran experiencia que vivirán en este gran escenario los ganadores podrán seguir festejando esa misma noche en MINT nightclub con 3 botellas nacionales y 8 cortesías.   (Estaremos dando mas cortesías para los asistentes durante el evento).\n\n¿ DONDE ME INSCRIBO?\n\nBOLETOS A LA VENTA EN NATURALEXA (Plaza Boulevares a un lado de Subway a partir del miércoles 24 de Octubre )\nESCUELA BANCARIA COMERCIAL , CORREGIDORA QUERTARO.\n\n\nCOSTO : $350 POR PERSONA = $1750 POR EQUIPO\n\nCUALQUIER DUDA O ACLARACION ESTAMOS A SUS ORDENES !! \n\nLLAMAR A LOS TELEFONOS:\n\n62*237467*1 / 4423672067 / 4422551399 / 72*981812*2 / 4421237651 /  4423512475\n\nraventertainment@hotmail.com\n\n\n ¡ BATALLA DEL RIO !", :start_time => "2012-11-17 12:00:00", :end_time => "2012-11-17 15:00:00", :address => "San Juan Del Rio - Coroneo, Querétaro, Mexico", :fb_id => 296019977168626, :owner_id => 536737325, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/372931_296019977168626_352627535_q.jpg", :atenders => 254, :privacy => nil, :created_at => "2012-11-15 04:14:09", :updated_at => "2012-11-15 04:14:09" },
  { :name => "Hipstagram @Mint Querétaro", :longitude => 151.2123208, :latitude => -33.8690255, :gmaps => true, :description => "Hipstagram 2012\n\n** NO SHAVE MOVEMBER! Las 2 mesas con más bigotes al más puro estilo 'Movember' se llevarán una botella a su elección. (Lista de selección). MAY THE BEST MOUSTACHES WIN!!\n\nAdemás de nuestra promoción de viernes:\n1 botella de Jagermeister + 1  botella de Stolichaya por $1250.\n\nMujeres con pulsera = open bar de flavored mezcal **\nHombres con pulsera = perla negra de cortesía\n**Promoción de pulsera válida hasta las 12\n\nHay días donde estamos hartos de la comercialidad de la música cotidiana. Días donde buscamos opciones para expandir nuestro conocimiento y poder explayar nuestras ideas.\n\nLa música, la moda, el estilo de vida se vuelve algo caricaturizado, como si ya estuviera controlado y se nos dictara qué hacer, qué decir, cómo actuar.\n\nTu que odias a Lady Gaga, vomitas cada vez que alguien baila el ‘Gangnam Style’ y buscas un puente cada vez que alguien te dice que David Guetta y Pitbull deberían de hacer un duo… ven a Hipstagram y expresa tu individualidad, tus gustos, interactúa con gente como tú, que no se conforma, que altera el status quo, que es diferente.\n\nDisfruta de excelentes y variados géneros musicales como:\n\nIndie Rock\nTrip Hop\nAlternaitve Hip Hop\nElectronic Rock\nRock alternativo\nGrunge\nPost-punk\nChillwave\nY muchos más\n\nTodo esto de la mano de nuestro DJ invitado Andrés Dobarganes, DJ residente de Sirilo.\n\nPreventas a los teléfonos: 1 90 07 02 / 72*8*28238\n", :start_time => "2012-11-17 01:30:00", :end_time => "2012-11-17 07:00:00", :address => "10 Macquarie St, Sydney NSW 2000, Australia", :fb_id => 333089700122726, :owner_id => 1452137129, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373116_333089700122726_495428688_q.jpg", :atenders => 260, :privacy => nil, :created_at => "2012-11-15 04:14:15", :updated_at => "2012-11-15 04: