  { :name => "PARAPENTE - SÁBADO 17 NOV. / SEN", :longitude => -72.2108246, :latitude => -39.3079756, :gmaps => true, :description => "Los queremos invitar el Sábado 17 de Noviembre a disfrutar una experiencia inolvidable como pasajero en un vuelo biplaza en Parapente con un piloto profesional certificado por la DGAC.\nPartimos a las 14:00 hrs. y regresamos a las 18:00 hrs. aproximadamente.\n\nLos vuelos están sujetos a las condiciones del viento y sin lluvia, y tienen una duración de 25 minutos en el aire, pero la actividad completa dura alrededor de 1 Hora.\n\nDespués del Parapente realizaremos un Asado en un parque con una naturaleza única.\n\nEsta aventura se inicia en un parque aventura donde subes en vehiculo 4x4 en compañia de tu piloto hasta el despegue, en la cima del Cerro Blanco. Allí te equipas, recibes la instrucción del piloto y listo, a volar! \n\nEl paseo incluye:\n\n- Transporte privado Santiago - Cajon del Maipo - Santiago.\n- Subida al Cerro en vehículo 4x4 (Cima Cerro Blanco).\n- Vuelo en Parapente con instructores profesionales.\n- Equipamiento de seguridad.\n- Entrada al parque Los Heroes.\n- Asado Chileno, bebidas y cervezas.\n- Fotos y Videos del vuelo (Llevar memoria SD en lo posible para que las fotos queden grabadas de inmediato).\n\n- El Vuelo en Parapente para Miembros de Santiago Exchange tiene un precio de: $45.000 / USD 90, Si pagas antes del Martes 13 de Noviembre.\n- El Vuelo en parapente para No-Miembros de Santiago Exchange tiene un precio de: $50.000 / USD 100, Si pagas antes del Martes 13 de Noviembre . (La tarjeta SEN te la entregamos en el paseo).\n\nPara confirmar tu participación deberás ingresar a www.santiagoexchange.cl, entrar a PASEOS, PARAPENTE, llenar el formulario, enviarlo y luego podrás pagar utilizando el sistema PayPal.\n\nComo alternativa al pago PayPal, puedes ir a un Banco BICE y hacer un depósito bancario o transferencia electrónica a la siguiente Cuenta Corriente:\n- Banco: BICE\n- Cuenta Corriente N°: 12-75309-8\n- Nombre: Servicios y Eventos S&C Limitada\n- Rut: 76.126.605-5 \n- E-mail: info@santiagoexchange.cl (Enviar mail de confirmación una vez realizado el pago)\n\nVen a disfrutar de una naturaleza única en el mundo, acompañado(a) de un gran grupo de estudiantes de distintas universidades y nacionalidades!\n\nPD: Si somos menos de 10 inscritos el paseo se suspende y se hacen las respectivas devoluciones de dinero.", :start_time => "2012-11-17 14:00:00", :end_time => "2012-11-17 18:00:00", :address => "Paso Cajón del Maipo 1155, Villarrica, Araucanía Region, Chile", :fb_id => 457379377642074, :owner_id => 197537983647949, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276825_457379377642074_1444997714_q.jpg", :atenders => 34, :privacy => nil, :created_at => "2012-11-15 04:17:32", :updated_at => "2012-11-15 04:17:32" },
