  { :name => "Vamos sonhar juntos?", :longitude => -46.6388182, :latitude => -23.5489433, :gmaps => true, :description => "SONHAR JUNTOS\n\nVAMOS SONHAR JUNTO COM CRIANÇAS QUE TAMBÉM TEM O DIREITO DE SONHAR!\n \nO final de ano é a clássica época em que nos ‘fechamos para balanço’: é a hora de refletir sobre o ano que passou e pensar – planejar, mudar, sonhar, ambicionar, ter fé no futuro – no que faremos para sermos mais felizes no ano seguinte. E esse final de 2012 não poderia ser diferente. Com a chegada de 2013, nossos sonhos de hoje ganham mais força. Mas e os sonhos dos outros?\n\nEsse é um convite a todos que querem sonhar juntos. Enquanto construímos novos projetos e novos sonhos, muitas crianças – existe idade melhor para sonhar? – vivem sem a expectativa de um 2013 com mais direitos de criança: direito a brincar, a estudar, a viver bem, a dormir quentinhas, se agasalhar e se empanturrar de coisas gostosas. Vamos sonhar juntos com elas?\n\nPara ajudar algumas crianças a sonhar um pouquinho mais em 2013, vamos recolher doações de todos os tipos (descrição abaixo) e presentar os meninos e meninas da Associação Maria Helen Drexel (http://www.helendrexel.org.br/). Quando estiverem concluídas as arrecadações, TODOS que quiserem estão convidados para participar da visita à associação, entregar os presentes para a criançada e concretizar esse sonho. \n\nO que doar: alimentos não perecíveis, produtos de higiene, brinquedos*, roupas* sapatos*, livros*, fitas de VHS*, DVDS* material escolar*, roupas de cama* e roupas de banho*. \n* novos e usados para qualquer idade\nQuando doar: Receberemos as doações até o dia 14 de dezembro (sexta)\nOnde doar: \nSilvia – Av. Ceci, 1577, Planalto Paulista – casa de esquina com a Alameda dos Maruás, travessa da Av. Indianópolis. \nMariana – Rua Araguari 418, Moema\nNicole – Rua Japão, 50, Itaim Bibi\nFlavia - Rua São Paulo antigo, 437, Morumbi\nPedro Murgel - Anglo Sergipe (11) 995956332\nOu nas faculdades PUC (Silvia e Nicole), FGV (Karina), USP (Juliana), IED (Mariana Shinomata), Mackenzie (Gabriela e Flávia), Belas Artes (Bruna), ESPM (Ana Flávia). \nComo: Basta entrar em contato com a gente antes de realizar sua doação.\nSilvia – (11) 995-535-653\nNicole – (11) 993-145-068\nMari – (11) 975-552-980\n\nO evento é aberto então convidem todos que quiserem! Quanto mais gente ajudando melhor fica!\n\n“O presente é tão grande, não nos afastemos\nNão nos afastemos muito, vamos de mãos dadas”\nCarlos Drummond de Andrade", :start_time => "2012-12-14 02:00:00", :end_time => "2012-12-15 02:00:00", :address => "Av. Vinte e Três de Maio, 149-165 - República, Sao Paulo - São Paulo, 01316-060, Brazil", :fb_id => 812149122256910, :owner_id => 100001065570793, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276674_812149122256910_1695980471_q.jpg", :atenders => 299, :privacy => nil, :created_at => "2012-11-15 04:21:50", :updated_at => "2012-11-15 04:21:50" },
