  { :name => "::KYMATICA Vol.2::  16 de Nov. 3° Piso Ex Fabrica::", :longitude => -70.64419579999999, :latitude => -33.428731, :gmaps => true, :description => ": K Y M A T I C A 2012 ::\n\nEstimad@s, con mucha alegría les comunicamos que kymatica vuelve el viernes 16 de Noviembre  con el fin de reunirnos y compartir de buena psicodelia a cargo de experimentados artistas nacionales y nuestro amigo Willy Espora de Argentina.\n\nEn esta version preparamos un line up que cuenta con 3  back to backs, y un  live actualizado de nuestro amigo Josh, representando a Antu Records.\n\nKymatica se caracteriza por su buena atmosfera, excelente sonido y psicodelia garantizada. producida y pulsada por un gran crew de amigos con vasta experiencia en producciones, deco, visuales y por supuesto, música.\n\nLa invitación es para  el día Viernes 16 de Noviembre en Ex fabrica, 3°piso.\nContaremos con un exelente sistema de sonido.\nasunción 426 esq. Patronato - Recoleta\n\n\n:LINE UP:\n\n\n> FUNTHAMENTAL vs NIIA  ( Ovnimoon Rec./ Digital Yonkis Rec.)\nhttp://soundcloud.com/funthamental\nhttp://www.myspace.com/d_niia\n\n> ESPORA vs ASTRO  ( Digital Yonkis Rec./ Enzyme Rec.)\nhttp://soundcloud.com/dj-espora\nhttp://www.mixcloud.com/astrolipe/\n\n> JOSH Live! ( Antu Rec.)\nhttp://soundcloud.com/joshlivemusic\n\n> JUKAP VS TKALII  (ambos  Digital Yonkis Rec. y Trancetour crew)\nhttp://soundcloud.com/jukap\nhttp://soundcloud.com/tkalii\n\nVISUALES :\n\n>AKBAL SACRED GEOMETRY TRANSMISSION\n\nDECO:\n\n> 2GEEKS\n> ENTES GEOMETRIC ART\n\n>STANDS DE SANDWICHS VEGETARIANOS/ TE CHAI/ INTELLIGENT FOOD\n\nValores:\nMujeres Gratis Hasta las 12:00 \nEntrada gral. $2.000 hasta las 1:00 después $3.000\n\n\n> Producen:\n\n:: Humanos de Andromeda (Andes Extreme)::\n:: Trancetour ::\n:: Club Ex-Fabrica :\n\n\n> Colaboran:\n\n2geeks\nEntes Geometric Art\n@stro@ngel project\nMicrodelico\nDigital Yonkis Records\nEnzyme Records\nMotherShip \nSquid Chile\nPsylence Crew\nGoabase.de", :start_time => "2012-11-16 11: