CE\nComunidad Ombligo - Operacion Daisy", :start_time => "2012-12-01 22:00:00", :end_time => "2012-12-02 01:00:00", :address => "Ruta 68, Pudahuel, Santiago Metropolitan Region, Chile", :fb_id => 536385193057163, :owner_id => 1041350185, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276741_536385193057163_1602487243_q.jpg", :atenders => 31, :privacy => nil, :created_at => "2012-11-15 04:36:28", :updated_at => "2012-11-15 04:36:28" },
