egalo, sujeto a la cantidad de amigos que lleves.\n\nYa lo sabes, si estas cansado de lo mismo cada semana veni y disfruta de una fiesta NUEVA Y FRESCA!!!!\n\nNos reservamos el derecho de admisión ABSOLUTAMENTE.\n+18.\nNO ropa deportiva.\nNO jockeys.\nNO estado de ebriedad al ingresar.\n\nINVITA\n-----------------\nEEAA Producciones.\n\nESKAPE CLUB. Purisima 129, esquina dardigñac. Barrio bellavista.", :start_time => "2012-11-17 23:55:00", :end_time => "2012-11-18 05:00:00", :address => "Purísima 102-198, Recoleta, Santiago Metropolitan Region, Chile", :fb_id => 493795613975721, :owner_id => 1306963930, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/277021_493795613975721_1141545085_q.jpg", :atenders => 112, :privacy => nil, :created_at => "2012-11-15 04:36:41", :updated_at => "2012-11-15 04:36:41" },
