  { :name => "Mini Makerfaire Santiago", :longitude => -70.6260324, :latitude => -33.44304109999999, :gmaps => true, :description => "Este va a ser un diciembre muy especial en Santiago. Estamos organizando la primera Maker Faire de latino america! Dos dias para celebrar la innovacion, la creatividad, la invencion y la locura. ¿Quieres que tu trabajo aparezca en la feria? Para postular solo tienes que tener un proyecto, invento, locura, un taller o alguna performance audiovisual que te gustaría exhibir o hacer y un jurado de expertos decidirá si el proyecto califica y ya estarás en la feria (no necesitas pagar inscripción). http://makerfairesantiago.com/call-for-makers/", :start_time => "2012-12-15 02:00:00", :end_time => "2012-12-16 02:00:00", :address => "Italia 890-984, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 420908521297418, :owner_id => 100003774791687, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276675_420908521297418_61430144_q.jpg", :atenders => 182, :privacy => nil, :created_at => "2012-11-15 04:37:35", :updated_at => "2012-11-15 04:37:35" },
  { :name => "Universidad de Verano 2012", :longitude => -70.5437448, :latitude => -33.3765996, :gmaps => true, :description => "La Universidad de Verano de  LyD es un seminario intensivo de 2 días y medio, dirigido a jóvenes de toda Latinoamérica entre 20 y 30 años con capacidades de liderazgo e interés en las políticas públicas, la democracia y la libertad. La actividad consiste en una serie de exposiciones de diferentes economistas y analistas, chilenos y latinoamericanos, además de ex autoridades importantes para la historia de la política chilena.\n\nEn la actividad se debatirá sobre el escenario latinoamericano, las políticas públicas y los fundamentos de una sociedad libre.\n\nLos interesados deben postular llenando el formulario de inscripción.\n\nPosteriormente se hará una selección de los participantes. Aquellos seleccionados deberán pagar US$ 40 o $20.000 que incluyen el hospedaje y las comidas.", :start_time => "2012-12-13 02:00:00", :end_time => "2012-12-14 02:00:00", :address => "San Josemaría Escrivá de Balaguer 9501-9615, Vitacura, Santiago Metropolitan Region, Chile", :fb_id => 219930004795767, :owner_id => 1249539026, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash3/174557_219930004795767_1981003874_q.jpg", :atenders => 97, :privacy => nil, :created_at => "2012-11-15 04:37:40", :updated_at => "2012-11-15 04:37:40" },
  { :name => "Taller Programa tu Arduino", :longitude => -70.6260132, :latitude => -33.4431134, :gmaps => true, :description => "Profesor: Christian Oyarzún www.error404.cl\nFecha: miércoles 5 de diciembre\nHorario: 19:00 – 22:00 hrs\nCupos: 15\nValor: $33.000 / 28.000 para miembros!\nTE LLEVAS TU PROPIO ARDUINO UNO + CABLE USB + kit de componentes electrónicos!!!\nPrecio de referencia: $11.935 + $2.565 (Ref: http://www.olimex.cl/index.php?cPath=76_78)\nMateriales incluidos\n+info e inscripción: talleres@stgomakerspace.com\n\nDescripción del curso: En este taller se enseñará a usar Arduino, una plataforma de prototipado electrónico Open Source con la que podrás capturar fácilmente señales del entorno físico (movimiento, luz, humedad, presencia, etc), programar sensores y actuadores para funcionamientos automáticos y controlados desde el microcontrolador.\n\nQué aprenderás?\n-Partes y funciones de la placa\n-Configuración de la placa\n-Entorno de programación y las API de Arduino\n-Conexiones a las entradas/salidas analógicas y digitales\n-Nociones de electrónica básica\n\n*Debes traer tu computador portátil.", :start_time => "2012-12-05 19:00:00", :end_time => "2012-12-05 22:00:00", :address => "Italia 889-985, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 121907054629501, :owner_id => 100003774791687, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/188190_121907054629501_1683102948_q.jpg", :atenders => 18, :privacy => nil, :created_at => "2012-11-15 04:37:45", :updated_at => "2012-11-15 04:37:45" },
  { :name => "Taller mi primer robot: solo para chicos", :longitude => -70.62572779999999, :latitude => -33.4428608, :gmaps => true, :description => "Descripción del curso: El taller “mi primer robot” es un taller de robótica 0.1, donde se les entrega a los niños las habilidades de entender y construir un circuito simple, y armar la estructura que lo contiene. En este taller aprenderán conceptos básicos de electrónica y desarrollarán la creatividad. Al niño se le entregan un set de herramientas y piezas con las que pueda configurar un robot que se mueve sobre el cual ellos pueden configurar lo que quieran en base a estructuras de papel y piezas plásticas (sin un programa especial, solo usando la creatividad personal).\n\n\nProfesor: Macarena Pola, Leonel Lagos & Francisco Troncoso www.stgomakerspace.com / www.corazondechileno.cl\nFecha: sábado 24 de noviembre\nHorario: 16:00 – 19:00 hrs.\nCupos: 15\nValor: $20.000\nMateriales incluidos\n+ info e inscripción: talleres@stgomakerspace.com", :start_time => "2012-11-24 16:00:00", :end_time => "2012-11-24 19:00:00", :address => "Luis Montaner 451-541, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 181838001945101, :owner_id => 100003774791687, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373516_181838001945101_969010983_q.jpg", :atenders => 11, :privacy => nil, :created_at => "2012-11-15 04:37:53", :updated_at => "2012-11-15 04:37:53" },
  { :name => "Taller Mi primer producto de cerámica", :longitude => -70.62595379999999, :latitude => -33.4433079, :gmaps => true, :description => "Descripción del curso: Conocer y aprender el desarrollo de la elaboración de piezas de cerámica por medio de moldes de yeso. El objetivo principal será adquirir el conocimiento de una técnica artesanal con gran capacidad productiva, para poder llevar a cabo el desarrollo de un diseño personal que posea un gran carácter comercial. \n\nProfesor: Katia Muñoz y Carla Jara\nFecha: jueves 22, viernes 23 y jueves 29 de noviembre + 2 días que serán en terreno\nCupos: 20\nValor: $70.000\nMateriales incluidos\nSe entregarán certificados de asistencia", :start_time => "2012-11-22 17:00:00", :end_time => "2012-11-22 21:30:00", :address => "Italia 890-984, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 122462404572438, :owner_id => 100003774791687, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/372920_122462404572438_1233869588_q.jpg", :atenders => 27, :privacy => nil, :created_at => "2012-11-15 04:37:58", :updated_at => "2012-11-15 04:37:58" },
  { :name => "Taller Producción de Toys", :longitude => -70.62598299999999, :latitude => -33.443209, :gmaps => true, :description => "Descripción del curso: Es un taller destinado a producir figuras en serie. Dirigido a estudiantes y profesionales de carreras de expresión creativa; Ej. Diseño, arquitectura, arte. Coleccionistas y aficionados a los juguetes que deseen crear sus propios diseños, conocer los materiales y procesos necesarios para esto, utilizando la creatividad como principal recurso. El objetivo principal es fabricación en serie de una figura plástica.\n\nProfesor: Axel Ascuy Kirsingër\nFecha: lunes 19, martes 20 y miércoles 21 de noviembre (19:00 – 22.000 hrs)\nCupos: 15\nValor: $65.000 / $60.000 Para miembros!\nMateriales incluidos\n+ info e inscripción: talleres@stgomakerspace.com ", :start_time => "2012-11-19 19:00:00", :end_time => "2012-11-19 22:00:00", :address => "Italia 890-984, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 486658521366666, :owner_id => 100003774791687, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/203580_486658521366666_2054695273_q.jpg", :atenders => 35, :privacy => nil, :created_at => "2012-11-15 04:38:06", :updated_at => "2012-11-15 04:38:06" },
  { :name => "ASIAN WAVE 2012 : Competencia + Cultura", :longitude => -70.6519941, :latitude => -33.4475657, :gmaps => true, :description => ":::::::: ASIAN WAVE 2012 :::::::: Competencia + Cultura\n\nPrimer evento Kpop-Jpop  en dónde se realizará una competencia seria, con jurados de calidad, además de difundir la cultura asiática entre los jóvenes chilenos, contando con stands de música, juegos y comida tradicional, para introducirlos en esta interesante tendencia.\n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\nCOMPETENCIA “DANCE BATTLE”\nSe evaluarán las siguientes exigencias, los cuales sumarán puntos en una tabla de evalución.\n(Animado por Hanul Park y Harley Munieka).\n\n1. Coreografía / A cargo de Runfang Cheng (Bailarina profesional UNIACC): \nSe evaluará netamente la buena ejecucción de los pasos, la similitud coreográfica con el artista que se interpreta y el nivel de dificultad.\n\n2. Vestuario / A cargo de Esteban Pomar (encargado de la revista de modas www.vistelacalle.com):\nSe evaluará la calidad de trajes de acuerdo al artista que se imita, su parecido al original (el jurado contará con una foto del artista e información previa), accesorios y la creatividad que tuvieron para la imitación de este.\n\n3. Interpretación / Jurado por confirmar:\nSe evaluará la calidad de interpretación, elementos complementarios (creativos y fieles a la coreografía original) y manejo del escenario por parte de los bailarines principales, como de los bailarines secundarios (en el caso que tengan) y la capacidad de expresión desde el escenario.\n\n3. Fidelidad Coreográfica / A cargo de Arturo Reyes: \nSe evaluará que la coreografía este bien ejecutada, con los pasos correspondientes en los tiempos correctos, además de las posiciones y tiempos.\n\n4. Interpretación / A cargo de Pablo Saldivia:\nSe evaluará la calidad de interpretación, elementos complementarios (creativos y fieles a la coreografía original) y manejo del escenario por parte de los bailarines principales, como de los bailarines secundarios (en el caso que tengan) y la capacidad de expresión desde el escenario.\n\n:: Puntos extras:: (en menor grado)\n\n* Puntualidad: Se sumarán puntos a los grupos responsables, que lleguen a la hora / Esta vez si será considerado en un concurso/\n* Votación por asistencia: Al entrar los asistentes tendrán la oportunidad de votar según el apoyo que quieran brindar a algún grupo en competencia. /Esto NO hará ganar a nadie, pero sí será un pequeño aporte/\n\n:::::::: INSCRIPCIONES $1.500 por persona ($1.000 a los de regiones), desde el 25 de Abril hasta 18 de Mayo :::::::: \nEnviar al mail park.junhee91@gmail.com lo siguiente:\n\n- Nombre del Grupo\n- Integrantes (Nombre y rut)\n- Logo del grupo\n- Canción que se bailará (link de descarga) \n\nLAS BASES DEL CONCURSO : https://docs.google.com/document/d/1pWskjMezFKa4ruacmWFSnOnjC5HHhcjfU1Yc8VepYs4/edit\n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\nCONCURSO PARA EL PÚBLICO\n\nSe harán 5 preguntas durante el evento, todas las preguntas referentes a la cultura coreana. Si esta es respondida correctamente se llevará un premio sorpresa.\n\nAsí que motivense !!\n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\nSORTEOS\n\nSe sortearán entre los asistentes, premios otorgados por los auspiciadores del evento, por número de entrada.\n\n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\nCOMIDA\n\nEn Asian Wave 2012, encontrarás un stand con dulces koreanos a cargo de Kimbap Love \n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\nSTANDS \n\nSi quieres participar como stand en nuestro evento, envía un mail a park.junhee91@gmail.com con remitente “stand” para más información.\n\nVenta:\n\n- Kimbap Love\n\nCulturales:\n\n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\nENTRADAS: En Patronato local \"Corea Mall\"\n\n( Se empezará con la pre -venta después de fijar el lugar)\nPre-Ventas $2.000- \nPuerta $ 3.000.-\nA los de regiones se le cobrara $ 1.500- (Con pasaje que acredite)\n\n:::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\n* Organiza:\nAlumnos de Ingeniería de la Universidad de Chile “Océano Producciones”\n\n* Colabora\n\nJóvenes Coreanos en Chile\nK Passion\nCorea Mall /Accesorios y artículos de corea/ (Antonia Lopez de Bello 327)\n\n*Auspicia\n\nGLAMOUR /Tienda de ropa coreana/ (manzano 484, Patronato)", :start_time => "2013-07-31 13:00:00", :end_time => "2013-07-31 16:00:00", :address => "Tarapacá 1103-1199, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 346400662076364, :owner_id => 100003792434832, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/592058_346400662076364_1957884987_q.jpg", :atenders => 591, :privacy => nil, :created_at => "2012-11-15 04:39:13", :updated_at => "2012-11-15 04:39:13" },
