  { :name => "/// SNEAK PEEK 20 DE NOVIEMBRE \\\\\\", :longitude => -76.7905081, :latitude => 17.9830314, :gmaps => true, :description => "El Clasico de los martes, te sigue divirtiendo y no te falla! \n\n\nConfirmando el evento entran gratis hasta las 23:00 \n\nDespues de un lleno total \"EL CLASICO DE LOS MARTES\" continua con la tradicion......y este martes 20 de Noviembre te dejara loco nuevamente. Tenemos un regalo que le encantara a las mujeres!!!\n\nLas mujeres gratis hasta la 1:00 y los hombres +21 con invitacion hasta las 00:15 y los +23 hasta las 00:30. Confirma el evento y pide tu invitacion a o.party@hotmail.com, escribiendo en el muro o a los rrpp.\n\nLleguen temprano para que aprovechen los regalos.\n\nNuestros aupiciadores los regalonearan con sus productos, y nuestros Djs tienen preparados nuevos set para que no puedan dejar de bailar en toda la noche.\n\nTe esperamos en la fiesta que ha sabido divertirte martes a martes, semana a semana..........y claramente este MARTES 20 DE NOVIEMBRE continuaremos haciendolo. No te lo pierdas!!!\n\nSiguen las coronas de regalo para los que llegan temprano y nuestros famosos Shots gratis toda la noche!!\n\nCORONAS A $2000\n\nCELEBRA TU CUMPLEAÑOS CON NOSOTROS\nY RESERVA TU MESA CON ANTICIPACION\n\nLos esperamos a todos en CLUB EVE\n\nMujeres gratis hasta la 1:00 con carnet en mano\n\nHombres (+21)con credencial universitaria\nUAI-LOS ANDES-UDD-PACIFICO-PUC hasta las 00:00\nLos beneficios de entrada gratis es para mayores de 21", :start_time => "2012-11-20 22:00:00", :end_time => "2012-11-21 04:00:00", :address => "Eve Ln, Kingston, Jamaica", :fb_id => 163432610469380, :owner_id => 321677771220650, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276977_163432610469380_429203251_q.jpg", :atenders => 20, :privacy => nil, :created_at => "2012-11-15 04:44:21", :updated_at => "2012-11-15 04:44:21" },
  { :name => "EVENTO INFINITIVE", :longitude => -70.89999999999999, :latitude => -33.746456, :gmaps => true, :description => "INFINITIVE: ACTIVA TU INFINITO\nEncuentro de sanación y terapias en Centro Turístico Remanso del Espíritu, Isla de Maipo.\nSantiago de Chile, 17 y 18 de Noviembre.\nUna noche y un día para tu propio encuentro\n\nACTIVIDADES NOCTURNAS:\n\nSábado 17 de Noviembre\n\n19.00 hrs: Llegada al Campamento\n21.30 hrs: Motivación inicial - “Naturaleza y sanación”\nSanidad planetaria, V j\n\nDesde las 22 horas: Música en vivo\n\n-Los Jachas (Música Andina)\n\n-Hemandad Oxiana (biorock)\n\n-Pachadelica (Música orgánica ancestral www.facebook.com/pachadelica)\n\nACTIVIDADES DIURNAS – Domingo 10.00 a 19.30 horas\n\n10.00 am Despertar de la Energía\n10.30 am Yoga en el área de la Laguna\n11.30am Desayuno comunitario\n11.00 a 18.00 horas. Espacio recreativo y Talleres terapéuticos grupales:\n- Taller de Yoga Nidra (sala multiuso)\n- Taller de Preparados de Esencias Florales\n- Taller de Improvisación musical\n- Taller de Terapia Metamórfica (sanación desde la vida intrauterina)\n- Taller de Masaje Energético Articular\n- Taller de Yoga Integral\n- Taller de Sonidoterapia y experiencias de sonidos\n-Meditación del Chakra del Corazón (Osho)\n- Taller de Gemoterapia\n-Piscina y relajo\n\n- Terapias individuales: flores de Bach, masaje metamórfico, reflexología, masoterapia, sonoterapia, gemoterapia, shiatsu, evaluación bioenergética (chakras y meridianos)\n\n14.00 hr Almuerzo naturista (devotos)\n17.30 a 19.30 horas Cierre con Danzas\n19.30 horas Fin campamento, dejando todo plenamente acorde a la naturaleza que nos acogió. \n\n::::::::::::::::::::::::::::::::::::::::::::::::\n\nPara la estadía debes traer carpa, saco de dormir y traje de baño.\n\nSe comercializarán alimentos naturistas y además podrás llevar tu propio alimento.\n\nEvento a beneficio de la actividad solidaria “Amigos de la calle” patrocinada por Remanso del Espíritu. \nAmigos de la Calle es una iniciativa solidaria que surge en el 2011 en apoyo a las necesidades primordiales de nuestros amigos indigentes en alimentación, ropa y recreación. Esta actividad realizada por un equipo de voluntarios se realiza todos los Domingo de 21 a 23 horas en sector Posta Central, donde más de 70 personas reciben cada semana reparto de alimentos y ropa. \n\n::::::::::::::::::::::::::::::::::::::::::::::::::::::\n\nFecha: Sábado 17 de Noviembre desde las 19:00 hrs. hasta el domingo 18, 19:30 hrs.\n\nValores: $7.000 por persona, preventa de 2 x $12.000.\nEl costo incluye acceso a todos los talleres grupales.\n\nSe cancelan aparte terapias individuales en $5000 por terapia. \nEntrada sólo día domingo: $5.000\n\nLugar: Centro de eventos Remanso del Espíritu. Ubicado a sólo 50 kms al sur de Santiago, en la Comuna de Isla de Maipo.\n\nDirección: \nCamino Las parcelas con La Herradura, Parcela n°2, Lonquén, Isla de Maipo.\n\nCómo llegar:\nEn locomoción colectiva desde Santiago, terminal San Borja de Estación Central, bus “Lonquén-Caperana\", bajarse en Camino Las Parcelas y a 700 metros esta cruce con calle La Herradura  (mapa en nuestra página web)\n\nContacto: (02) 8192717 – (09)3336244 – (09) 84382123\n\nwww.centrodeeventosremansodelespiritu.com\n\nE-mail: remansodelespíritu@gmail.com\n\n::::::::::::::::::::::::::::::::::::::::::::::::::::::\n\nCentro Turístico Remanso del Espíritu\n\nA solo 50 Kms. al Sur de Santiago, ubicado en la comuna de Isla de Maipo, se encuentra Remanso del Espíritu, un lugar diseñado especialmente para quienes buscan renovar energías y elevar su espíritu en medio de la naturaleza, con 2 hectáreas de parque ecológico de inigualable belleza, dotado de especies arbóreas nativas y exóticas.\nEl lugar dispone de diversos servicios que apuntan al desarrollo personal de nuestros visitantes, relacionándolos activamente con el Turismo, la Naturaleza y la Sanación.\n\n    Disponemos de\n\n    Área de camping\n    Cocina comunitaria, refrigeradoras, lavaplatos.\n    Luz, agua potable.\n    Sala multiuso.\n    Baños para hombres y mujeres.\n    Duchas con agua caliente.\n    Quinchos, mesas, sillas. Área de picnic.\n    Parrillas.\n    Piscina.\n    Vestidores.\n    Plataforma para fogata.\n    Cancha de futbolito, basketball, mesa de ping-pong, juegos infantiles.\n    Parque natural con flora nativa y exótica, próximamente sendero interpretativo \n\n\nSe ruega evitar el ingreso de bebidas alcohólicas.\n", :start_time => "2012-11-17 19:00:00", :end_time => "2012-11-18 19:30:00", :address => "Lo Herrera 387-605, Isla de Maipo, Santiago Metropolitan Region, Chile", :fb_id => 366794033403558, :owner_id => 728433239, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276731_366794033403558_1632952873_q.jpg", :atenders => 132, :privacy => nil, :created_at => "2012-11-15 04:44:29", :updated_at => "2012-11-15 04:44:29" },
