  { :name => "SATAN CLAUS II", :longitude => -70.6380772, :latitude => -33.4306072, :gmaps => true, :description => "Satan Claus II\nRecrucide :: Rajavana  :: Primitivo :: Umea (Argentina)\n15 de Diciembre 2012, Bar Oxido\n\nBar Oxido el clásico centro Rock-Metalero de excelencia ha logrado reunir a cuatro de las bandas Metal más devastadoras en vísperas de la navidad maldita mas esperada de Chile auspiciada por Satan Claus II, cuatro bandas con puro poder y esencia Metal, la furia técnica de Recrucide, la caravana de destrucción de Rajavana, el poder frontal y brutal de Primitivo y los argentinos Umea, invitados especiales que se presentarán en esta ocasión en el marco de su gira 2012 por nuestro país... Juntos unen sus fuerzas en el mismo escenario para inyectar en tu alma y tus sentidos el poder máximo del Metal del fin del mundo, la ley esencial, frontal y consecuente del acero, solo en Bar Óxido, este 15 de Diciembre 2012 desde las 21:30 Hrs...\n\n\nPrimitivo ya tiene listo su 2º trabajo de estudio, el cual bajo el imponente nombre “World out of balance” está a punto de ebullición listo para explotar en Satan Claus II.\n\nRecrucide continúa azotando con su última creación \"Blood Divine\", confirmadísimos para la segunda jornada de The Metal Fest 2013, mostrarán lo más selecto de su discografía.\n\nUmea es una banda de Mendoza, Argentina que empezó a gestarse allá por el año 2005, tiene un marcado estilo de Death Metal melódico, Metalcore y buenas dosis de Thrash que promete inyectar puro poder directo a tus sesos\n\nRajavana continúa con su caravana de carnicería y destrucción, mostrará material nuevo de su próximo disco de nombre aun revelado y están listos para destrozar Satan Claus II con furia pura.\n\n\nCoordenadas:\n\nBar Oxido\nPurísima 282, Recoleta, Santiago\nEntrada: $2500 / 2x1 Hasta las 23:00 Horas\n\nVenta de material de las bandas, sorpresas y mucho mas...\n\nMás información en:\n\nFacebook Event: http://www.facebook.com/events/318053138302609\nP