  { :name => "TDV 2013 SECUNDARIOS RM", :longitude => -72.331113, :latitude => -38.948921, :gmaps => true, :description => "La Araucanía es la región más pobre de Chile. Miles de familias de escasos  recursos prácticamente no tiene acceso a fondos ni ayuda del Estado para tener un mejor pasar. Aún, en el 2012  siguen viviendo en precarias condiciones y luchando día a día por tener condiciones de vida más dignas.\nMovilizaremos 500 voluntarios y ayudaremos a 84 familias construyendo viviendas de calidad. Casas amplias, con tecnología de aislación y diseñadas para dar una mejor solución de emergencia a las familias que siguen esperando después de muchos años.\nLas familias de Renaico, Purén, Los Sauces, Lumaco, Capitán Pastene y Tirúa están esperando de nuestra ayuda\n\nSUMATE!!\n“EL CHILE QUE CONOCES, JAMÁS VOLVERÁ A SER EL MISMO”\n\nINSCRIPCIONES: http://bit.ly/Xwckpy\n\nDudas: Antonia.susaeta@techo.org  // vicente.stiepovich@techo.org\n", :start_time => "2013-01-03 02:00:00", :end_time => "2013-01-04 02:00:00", :address => "S-395, Cunco, Araucanía Region, Chile", :fb_id => 296257067145920, :owner_id => 449479085096261, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/276670_296257067145920_455659457_q.jpg", :atenders => 382, :privacy => nil, :created_at => "2012-11-15 04:52:01", :updated_at => "2012-11-15 04:52:01" },
