  { :name => "3 Day StartUp", :longitude => -82.33009589999999, :latitude => 29.6527054, :gmaps => true, :description => "The idea of 3 Day Startup is simple: start tech companies over the course of three days. We rent work space for an entire weekend, recruit 45 student participants from a wide range of backgrounds, cater food and drinks, and bring in top-notch entrepreneurs and investors. The participants pick the best ideas for startups during the Friday brainstorming session and deliver prototypes and investor pitches on Sunday night.\nMore Info at http://www.eventbrite.com/event/4731268351/efblike", :start_time => "2012-11-16 20:00:00", :end_time => "2012-11-18 23:00:00", :address => "Santa Fe CIED, Gainesville, FL 32601, USA", :fb_id => 304816626301021, :owner_id => 18717813, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/static-ak/rsrc.php/v2/yE/r/tKlGLd_GmXe.png", :atenders => 19, :privacy => nil, :created_at => "2012-11-15 04:58:08", :updated_at => "2012-11-15 04:58:08" },
  { :name => "Startup Hour Gainesville", :longitude => -118.2424754, :latitude => 34.0568992, :gmaps => true, :description => "Enjoy your Thanksgiving and be ready for the next Startup Hour!!! \n\nDecember 13th!\n\nFeel free to invite people from your own Facebook friends list. Please invite lots of peeps.\n\nAs usual, there will be awesome drink specials. You must be 21 to drink alcohol.\n\n101 Downtown is a sleek bar/club with great cocktails. For details check out www.101gainesville.com\n\nThis invitation is open to everyone, but Startup Hour is really intended to bring together creative and talented people to exchange ideas about new companies. \n\nLook forward to seeing you there!\n\nCheers,\nTed & Augi", :start_time => "2012-12-13 21:30:00", :end_time => "2012-12-14 00:30:00", :address => "Santa Ana Fwy, Los Angeles, CA 90012, USA", :fb_id => 450474701665251, :owner_id => 278011273513, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373517_450474701665251_473510651_q.jpg", :atenders => 42, :privacy => nil, :created_at => "2012-11-15 04:58:20", :updated_at => "2012-11-15 04:58:20" },
