  { :name => "Dusty Kid (Italy) @ Guadalajara", :longitude => -103.4534067, :latitude => 20.6938803, :gmaps => true, :description => "DUSTY KID \n[aka Paolo Alberto Lodde] es conocido en el círculo de aficionados al techno como Dusty Kid. Después de mucho trastear simples y secuenciadotes llega a fichar por el sello inglés Lowered Recordings a la tierna edad de 19 añitos con el doce pulgadas I found a reason. Este salto editorial le llevará a remezclar a figuras ya consagradas como Robbie Rivera. En 2004 crea el proyecto Duoteque junto a su compañero Andrea Ferlin con el que edita varios maxis en el sello Boxer Recordings. Discos que son pinchados por Djs de minimal como Magda, Villalobos o Richie Hawtin. Además de grabar en Boxer, Systematic o Kling Klong también consigue colaborar con el sello británico Southern Fried Records propiedad de Norman Cook conocido mundialmente como Fatboy Slim: la excusa se titula The Cat / The Kitten con remix incluído de Nathan Detroit. Unos meses después también entra en la plantilla de Bpitch Control con Luna que lleva integradas remezclas del madrileño Tadeo y de Lee Van Dowsky.\n\n----------------------------------------------------\n\nDUSTY KID \n[aka Paolo Alberto Lodde] was born in the first half of the decade of the 80’s. As a new ‘enfant prodige’ he immediately showed his natural attitude for the variegated ‘music world’. At 10, after just one year of private lessons of the basic notions of piano and violin, he was admitted directly to the 6? year of the piano course in the conservatory of his native city. Following the accademic experience, his tasks moved gradually from the austere classical world to the electronic system, free from binds and traditional old-fashioned diktats. DUSTY KID started to manipulate synthesizers, samplers and sequencers, and he realized that one passion was growing and growing: the ardor for arranging and producing his own compositions. He released his first single ‘I Found A Reason’ at 19 on the English label Lowered Recordings, and then he produced various singles and remixes for Mutiny UK, Robbie Rivera and Trinity Hi-Fi. The first official single under the aegis of the pseudonym DUSTY KID was ‘The Summer of Love’.\n\nBut it’s during 2004 that Dusty Kid creates the project Duoteque with DJ Andrea Ferlin and releases numerous EPs on Boxer Recordings and the tracks were immediately included in the DJ sets of some of the most important names, like Richie Hawtin, Tiefschwarz, Ricardo Villalobos, Domenic Eulberg, Sven Vath and Magda.\n\nAfter the Duoteque experience Paolo decides to take his own way and to release his own productions as DUSTY KID.\n\nFirst release was the NEW ORDINAMENT EP on Motivo, followed by a second EP in 2007. 2007 is also the year of various releases as Dusty Kid on labels such as Kling Klong ‘Signal ’63 EP’, Systematic ‘Tsunamy’/‘Milk’, Boxer Recordings ‘Anatome EP Vol.1’ and Southern Fried Records ‘The Cat’ / ‘The Kitten’, all hugely supported by DJS all over the world and still doing damage on the dancefloors and in the charts, as well as getting amazing reviews from press.\n\n----------------------------------------------------\nPreventa 150$ con #Teamducky y Super Boletos.\n\nPaulina Zaragoza       3335788959 (Caav/Autonoma)\nAlan Salcedo      3311458846 (Puerta de Hierro/ITESO)\nIrving George        3311342237 (All over)\nSalvador Figueroa        3314175610 (ITESO)\nDaniel Raddall        3310434768 (Chapultepec)\nJuan Andres      3310977070\nPepe Homs        3331280387 (Chapultepec)\nMonica Alarcon        3221505847 (Chapalita)\nAdrian Mps            3311500826\nCorina Espinosa         3334704727 \nSaely Tinoco           3311803266 (Providencia)\nEl Negro         3331664713 (ITESO/Chapultepec/Cañadas)\nMisus Ricalde          3331796830 (CAAV, Chapultepec)\nJeisa Rocha          33.10.897.507 (ITESO)\nIgnacio Villagomez     16142286 o 62*207285*2 (Providencia)\nRafa Anaya     3315205579 (Nueva Galicia)\n\nwww.socialducky.com\nwww.faceboook.com/socialducky\nTwitter: @socialducky\nFoursquare: Socialducky\nInstagram: Socialducky\nwww.youtube.com/socialducky\n\nPRENSA: alrahi@socialducky.com", :start_time => "2012-11-17 00:00:00", :end_time => "2012-11-17 07:00:00", :address => "Tepic-Guadalajara, Ciudad Granja, 45010 Zapopan, JAL, Mexico", :fb_id => 463036957081598, :owner_id => 112559828810632, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373455_463036957081598_2024168940_q.jpg", :atenders => 226, :privacy => nil, :created_at => "2012-11-15 05:01:57", :updated_at => "2012-11-15 05:01:57" },
  { :name => "POR UN TOTITO EN VIETNAM 2013 ;)", :longitude => 108.277199, :latitude => 14.058324, :gmaps => true, :description => "Amigos, familia, conocidos, no conocidos pero si cachables e incluso no cachables... \nCreo este evento por Amor, como la mayoría sabe, nuestra historia con Sophie es bastante larga e increíble, varias veces me han weviado con que es \"de pelicula\" jajaj\n\nLes cuento...\nSon 6 años ya los que he vivido con el corazón ocupado, o mejor dicho... sin corazón, porque mi corazón lo tiene Soph. Nunca pensé que uno se podia enamorar tanto, tan joven... del amor de verdad, ese amor que hace que des todo por otra persona, que hace que sea tu batería, tu sonrisa cada mañana, tu empuje, tu frente en alto... ese que te transforma, te hace irreconocible a ti mismo, ese que hace que pongas tu vida en segundo lugar porque el primero lo tiene la otra persona!\nLes cuento que Sophie es mi vida y no se imaginan cuanto me frustra no poder hacerla feliz, no poder estar con ella, compartir todo con ella. Todo aquel que tienen una relación o ha tenido una linda relación sabe lo rico que es ver a esa persona, llegar y que siempre haya un abrazo esperándote, es muy duro querer abrazarla, darle un simple beso, de esos que te revuelven la guata, querer regalonear, apapacharla... o mirarla un rato a la cara, o quizás solo escuchar un te quiero para tus oídos, o un te amo para el corazón, y darse cuenta que no puedes tener nada de esto...\nque el propósito de tu vida esta como en el aire, esta lejos. Sacar fuerzas para seguir, teniendo esta incertidumbre de no saber cuando nos volveremos a ver, es muy difícil. Ni yo se realmente como he aguantado, porque seguimos enamorados, a pesar de todo, y mas fuerte que nunca! asique creo firmemente que esto es grande, de cierta forma siempre lo he sabido. Como la mayoría debe saber con Sophie nos hemos podido ver un par de veces desde que se fue a Vietnam, 4 veces en 5 años... y estoy contando la ultima vez que fue en octubre pasado de este año, que tuvimos la suerte de vernos de nuevo, 2 semanas...\n\nEn este momento no sabemos cuando nos volveremos a ver... y nos tiene ... mal, yo no voi a perderla. \"La victoria no está en siempre salir victorioso, si no en nunca desanimarse\" Napoleon Bonaparte... y yo .. yo no me voi a rendir, nunca me rindo.\n\nLes cuento que Sophie está terminando Senior Year (4to medio) y se acerca su \"Prom\" o fiesta de graduación... y me invito para ser su \"Prom date\", su pareja. Para que mas linda ! jajaj \nEl tema es... que con 3 hermanos y una universidad que pagar, no puedo pagar de una, asi cash cash el pasaje... es imposible, estuve averiguando precios y comprar el pasaje ESTE AÑO, osea con ... 6 meses de anticipación, me cuesta 1 millon 142 mil pesos .... --- $1.142.000--- pero con el paso del tiempo el valor aumenta ... y si lo compro con un par de meses de anticipación ya me cuesta casi el triple.... :/ ... asique decidí moverme y hacer esta campaña solo porque bueno hay harta gente que conoce nuestra historia y quizás se le ablanda el corazón (: ... yo por mi cuenta estoy haciendo part/time jobs y pero al paso que voy no juntaré ni la mitad de la plata que necesito...\n\nAsiesque eso es ... TENGO UNA META QUE CUMPLIR CABROS! ... espero que me puedan ayudar... hasta con 1.000 pesos quedo feliz ! todo sirve en este momento de verdad significaría mucho para mi\n\nObviamente que si aun con el aporte de todos no alcanzo a cumplir la meta antes del 25 de diciembre se juntara toda la plata que cada uno dono y se utilizará para beneficiar al Campamento \"Los Paltos\" de San bernardo en donde vengo ayudando hace ya casi 3 años\n\nEspero que me entiendan, estoy desesperado, es la mujer de mi vida!\n\n\n\n\n\n\n- POR RAZÓNES DE SEGURIDAD ME RECOMENDARON CAMBIAR LA DINÁMICA DE APORTE Y MEJOR SI QUIEREN AYUDARME ME PIDAN LOS DATOS POR INBOX O AL CELULAR. (9-789 37 47)\n\nMuchisimas gracias de nuevo (:\n \n\n*porfa si aportan- pongan que me llegue una notificacion al mail pa tener un recuento ;) MUCHISIMAS GRACIAS A TODOS ! \n", :start_time => "2012-12-10 02:00:00", :end_time => "2012-12-11 02:00:00", :address => "19, Mang Yang District, Gia Lai province, Vietnam", :fb_id => 298874556883953, :owner_id => 659437886, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276992_298874556883953_414602121_q.jpg", :atenders => 219, :privacy => nil, :created_at => "2012-11-15 05:02:56", :updated_at => "2012-11-15 05:02:56" },
  { :name => "Cadena de oración y buenos pensamientos", :longitude => -71.266075, :latitude => -35.053029, :gmaps => true, :description => "Amigos de facebook desde mañana comienza una cadena de oración para mi hermanita Pilar Espinoza, que esta hospitalizada debido a su enfermedad, les pido cooperar y difundir para que nuestra fe la ayude y le de mas fuerzas para salir de esta. De ante mano muchas gracias.\nFamilia Espinoza Saavedra.", :start_time => "2012-12-30 10:00:00", :end_time => "2012-12-30 13:00:00", :address => "K-147, Molina, Maule Region, Chile", :fb_id => 510221305655814, :owner_id => 1162562800, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/203562_510221305655814_685181359_q.jpg", :atenders => 109, :privacy => nil, :created_at => "2012-11-15 05:03:53", :updated_at => "2012-11-15 05:03:53" },
