  { :name => "EVOL presents ALT-J - Live at O2 Academy 1", :longitude => 120.9311426, :latitude => 14.3517493, :gmaps => true, :description => "Dear EVOL Doers,\n\nWe're absolutely delighted to be announcing this one...\n\nSaturday 11th May 2013\n\nEVOL presents\n\nALT-J - LIVE at O2 Academy 1\naltjband.com/\n\nWe've championed this band since the days they were called FILMS and played early shows at Evol/Sound City. Now they are Alt-J or ∆, they've sold out shows across the UK and their debut LP \"An Awesome Wave\" hit the Top 20 and stayed there. We love them and their slightly twisted darkside.\n\nTickets go on O2 pre sale this Wednesday and then general sale from 9am Friday 7th September via Ticketweb.co.uk\n\nO2 Academy Liverpool, 11-13 Hotham Street, L3 5UF\nwww.o2academyliverpool.co.uk\n\nFor more info follow EVOL on Twitter @ClubEVOL\n\nListings\n\n20.09 Wet Nuns @ The Shipping Forecast\n30.09 Silver Apples (USA) & Blue Orchids @ The Kazimier\n06.10 Field Music @ The Kazimier\n10.10 PINS @ The Shipping Forecast\n13.10 The Invisible @ Studio 2\n24.10 Dry The River @ The Kazimier\n26.10 Dan Le Sac & Friends @ The Kazimier\n27.10 Two Gallants (USA) @ Leaf\n29.10 Clock Opera @ The Kazimier\n07.11 Ariel Pink’s Haunted Graffiti (USA) @ The Kazimier\n09.11 Charli XCX @ The Shipping Forecast\n14.11 Mystery Jets @ The Kazimier\n15.11 Shabazz Palaces & THEEsatisfaction @ The Kazimier\n28.11 Purity Ring + Doldrums (Canada) @ The Kazimier\n29.11 Chain And The Gang (USA) @ The Shipping Forecast\n01.12 Band Of Skulls @ O2 Academy 1\n05.12 Chilly Gonzales @ Capstone Theatre\n06.12 The View @ O2 Academy 1\n15.12 Ian McNabb & Band @ The Kazimier\n11.05 ∆ @ O2 Academy 1\n\nwww.ticketweb.co.uk / www.seetickets.com / www.ticketline.co.uk\n\n\n", :start_time => "2013-05-11 16:00:00", :end_time => "2013-05-11 19:00:00", :address => "Liverpool, Dasmariñas City, Philippines", :fb_id => 461126900587859, :owner_id => 554170215, :city => nil, :country => nil, :picture => "https://fbcd