  { :name => "EVOL presents LOCAL NATIVES (USA) at the Kazimier", :longitude => -81.64167, :latitude => 41.44088900000001, :gmaps => true, :description => "Tuesday 12th Februray 2013\n\nEVOL proudly presents\n\nLOCAL NATIVES (Silver Lake, Los Angeles, USA)\nhttp://www.thelocalnatives.com/\n\nOur favourite band at SXSW two years running finally make their debut performance at Evol after a 4 year chase touring not only \"Gorilla Manor\" but also the bands 2nd album which is due late January entitled \"Hummingbird\". \n\nThis will be an epic show that will amaze and enthrall.\n\nSupport TBA\n\nDoors 8pm 18+\n\nTickets £10.50 advance available via http://bit.ly/TztyQe \n\nThe Kazimier, 4-5 Wolstenholme Square, Liverpool, 4JJ\nwww.thekazimier.co.uk\n\nListings\n\n14.11 Mystery Jets, Drenge & Best Friends @ The Kazimier\n15.11 Shabazz Palaces & THEEsatisfaction (USA) @ The Kazimier\n23.11 The Sundowners Single Launch @ Zanzibar Club\n27.11 Peace, Virals & The Liberty Vessels @ The Kazimier\n28.11 Purity Ring, Doldrums (CAN) & Ghosting Season @ The Kazimier (in association with Harvest Sun)\n29.11 Chain And The Gang (USA), Lovecraft, Ticks & Owls* @ The Shipping Forecast\n01.12 Band Of Skulls & Folks @ O2 Academy Liverpool\n05.12 Chilly Gonazles (CAN) Piano Talk Show @ Capstone Theatre\n06.12 The View, The Rialto Burns, The Razz & The Dirty Rivers at O2 Academy Liverpool\n15.12 Ian McNabb (Icicle Works) & Band with Cold Shoulder @ The Kazimier\n08.02 Dutch Uncles @ The Kazimier\n12.02 Local Natives (USA) @ The Kazimier\n23.02 Swim Deep @ The Kazimier\n16.03 Poltergeist @ The Kazimier\n11.05 Alt-J @ O2 Academy Liverpool - SOLD OUT\n", :start_time => "2013-02-12 17:00:00", :end_time => "2013-02-12 20:00:00", :address => "4498 E 68th St, Cleveland, OH 44105, USA", :fb_id => 377969932290380, :owner_id => 554170215, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276808_377969932290380_354929098_q.jpg", :atenders => 45, :privacy