  { :name => "EVOL presents THE VIEW with The Rialto Burns, The Razz, & The Dirty Rivers", :longitude => 120.9311426, :latitude => 14.3517493, :gmaps => true, :description => "Dear Evol Doers,\n\nThursday 6th December 2012\n\nWe present another welcome return from \n\nTHE VIEW\nhttp://www.theviewareonfire.com/\n\nWe've had some adventures over the years with Dundee's finest, early shows, crazy aftershow parties at Korova, bus loads down from Scotland, drivers going missing, girlfriends smashing it on the decks, unbelievable consumption, all kinds of wives'tales, pretty much everything has happened with The View. If you went to either of the last shows at the Kazimier or O2 you know the boys have aged like a fine wine, and as ever unprecented scenes were witnessed by this writer. So we're doing it all again, and why not? the bands fourth studio album \"Cheeky For A Reason\" has been riding the crest of a high wave in the album charts and every festival the band have played throughout the summer has been vanquished and torn apart. So, just when you thought it was safe to go back into the water, they're back...\n\nIn support:\n\nThe Rialto Burns\nhttp://www.therialtoburns.com/\nCheck the new single 'Hibernation' out now...\nhttp://www.youtube.com/watch?v=QzUWo-_GsCY&feature=player_embedded\n\nThe Razz\nhttps://twitter.com/TheRazzOfficial\nCausing a menace across the land, bad boy youngbloods.\n\nThe Dirty Rivers\nhttp://soundcloud.com/the-dirty-rivers\nNew favourites, antics, tunes, balls, proper rocknrollers.\n\n\nDoors 19;00 - 23:00 14+ show\nTickets £14 advance via the link http://bit.ly/STAvjf \nOr Ticketweb, Seetickets and Ticketline\nO2 Academy Box Office open 11:30am - 5pm\nNo booking fee on cash sales.\n\nO2 Academy, 11 - 13 Hotham Street, Liverpool, L3 5UF\nwww.o2academyliverpool.co.uk\n\nFollow EVOL on Twitter @ClubEVOL\n\nListings\n\n20.09 Wet Nuns @ The Shipping Forecast\n30.09 Silver Apples (USA) & Blue Orchids @ The Kazimier\n06.10 Field Music @ The Kazimier\n10.10 PINS @ The Shipping Forecast\n13.10 The Invisible @ Studio 2\n24.10 Dry The River @ The Kazimier\n26.10 Dan Le Sac & Friends @ The Kazimier\n27.10 Two Gallants (USA) @ Leaf\n27.10 Lindstrom - Live @ The Kazimier\n29.10 Clock Opera @ The Kazimier\n07.11 Ariel Pink’s Haunted Graffiti (USA) @ The Kazimier\n09.11 Charli XCX @ The Shipping Forecast\n14.11 Mystery Jets @ The Kazimier\n15.11 Shabazz Palaces & THEEsatisfaction @ The Kazimier\n27.11 PEACE @ The Kazimier\n28.11 Purity Ring + Doldrums (Canada) @ The Kazimier\n29.11 Chain And The Gang (USA) @ The Shipping Forecast\n01.12 Band Of Skulls @ O2 Academy 1\n05.12 Chilly Gonzales @ Capstone Theatre\n06.12 The View @ O2 Academy 1\n15.12 Ian McNabb & Band @ The Kazimier\n11.05 ∆ @ O2 Academy 1\n\nwww.ticketweb.co.uk / www.seetickets.com / www.ticketline.co.uk\n\n", :start_time => "2012-12-06 16:00:00", :end_time => "2012-12-06 19:00:00", :address => "Liverpool, Dasmariñas City, Philippines", :fb_id => 488641861159402, :owner_id => 554170215, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276837_488641861159402_640442704_q.jpg", :atenders => 61, :privacy => nil, :created_at => "2012-11-15 05:06:05", :updated_at => "2012-11-15 05:06:05" },
  { :name => "Nebular en SCD de Vespucio. Lanzamiento del Disco \"Sentir\"", :longitude => -70.59677789999999, :latitude => -33.5165141, :gmaps => true, :description => "Chicos!!! Por fin llegó el tan esperado momento!!\n\nAnímese e invite a todo el mundo para el próximo 5 de diciembre del 2012, en Sala SCD de Vespucio. Será el lanzamiento oficial de nuestro disco \"Sentir\".\n\nNos estamos preparando con todo para entregar un increíble show con varias sorpresas e invitados especiales! Está imperdible, a repletar SCD!!!!!\n\nEl valor de las entradas es de $2500, y las pueden comprar contactándose directamente con nosotros, NEBULAR o a través de Ticketek http://www.ticketek.cl/tktfunciones.aspx?evento=NEBULAR+EN+SCD\n\nNOS VEMOS EL 5!!! ", :start_time => "2012-12-05 20:00:00", :end_time => "2012-12-05 22:00:00", :address => "Froilán Roa 798-998, La Florida, Santiago Metropolitan Region, Chile", :fb_id => 278493115604088, :owner_id => 735173496, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373155_278493115604088_1475666636_q.jpg", :atenders => 94, :privacy => nil, :created_at => "2012-11-15 05:06:10", :updated_at => "2012-11-15 05:06:10" },
