  { :name => "EVOL presents CHAIN AND THE GANG (USA)", :longitude => -2.9915726, :latitude => 53.4083714, :gmaps => true, :description => "yoyoyoyo,\n\nThursday 29th November 2012\n\nEVOL presents\n\nCHAIN AND THE GANG (Washington DC)\nhttp://chainandthegang.tumblr.com/\nhttp://chainandthegang.bandcamp.com/\n\nWay back in 2004 EGBGs had a visit from Weird War, Ian Svenonius's former band, it was an unforgettable evening and will never leave the memory of those that attended.\n\nIan returns to Liverpool with his new project Chain And The Gang promoting their new long player \"In Cool Blood\", again those that witnessed Chain at Sound City in 2010 enjoyed another incredible evening.\n\nThese are the shows we love...\n\nIn support\n\nLovecraft\nhttps://www.facebook.com/Lovecraftmusic\nTicks\nhttps://www.facebook.com/Ticksband\nOwls*\nhttp://owls.bandcamp.com/\n\nTickets £10 advance available from Probe Records and via the link  http://bit.ly/QoGD1r \n\nDoors 7:30pm\n\nThe Shipping Forecast, 15 Slater Street, L1 4BW\nhttp://www.theshippingforecastliverpool.com/\n\nFor more info follow EVOL on Twitter @ClubEVOL\n\nListings\n\n30.09 Silver Apples (USA) & Blue Orchids @ The Kazimier\n06.10 Field Music @ The Kazimier\n10.10 PINS @ The Shipping Forecast\n13.10 The Invisible @ Studio 2\n24.10 Dry The River @ The Kazimier\n26.10 Dan Le Sac & Friends @ The Kazimier\n27.10 Two Gallants (USA) @ Leaf\n29.10 Clock Opera @ The Kazimier\n07.11 Ariel Pink’s Haunted Graffiti (USA) @ The Kazimier\n09.11 Charli XCX @ The Shipping Forecast\n14.11 Mystery Jets @ The Kazimier\n15.11 Shabazz Palaces & THEEsatisfaction @ The Kazimier\n28.11 Purity Ring + Doldrums (Canada) @ The Kazimier\n29.11 Chain And The Gang (USA) @ The Shipping Forecast\n01.12 Band Of Skulls @ O2 Academy 1\n05.12 Chilly Gonzales @ Capstone Theatre\n06.12 The View @ O2 Academy 1\n15.12 Ian McNabb & Band @ The Kazimier\n11.05 ∆ @ O2 Academy 1\n\nwww.ticketweb.co.uk / www.seetickets.com / www.ticketline.co.uk", :start_time 