  { :name => "K&TE Live @ Glassfire", :longitude => -3.1333718, :latitude => 53.4043234, :gmaps => true, :description => "After doing the odd one or two open mics there - Kenny & the Energy at long last plays Saturday night @ Glassfire! 24th of November at 9pm - Come on down for night of maniacal music!", :start_time => "2012-11-24 18:00:00", :end_time => "2012-11-24 21:00:00", :address => "214 Millhouse Ln, Birkenhead, Wirral CH46, UK", :fb_id => 168073753316586, :owner_id => 518224176, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373328_168073753316586_2024088868_q.jpg", :atenders => 17, :privacy => nil, :created_at => "2012-11-15 05:06:48", :updated_at => "2012-11-15 05:06:48" },
  { :name => "TICKETS PRIMAVERA FAUNA SIN RECARGO.", :longitude => -70.8812385, :latitude => -33.4516199, :gmaps => true, :description => "GENERALES A $38.000 sin recargo\nVIP $65.000 (deposito previo)  Contactarme al mail mpaz.aranda@gmail.com o Inbox \n\nFINALIZA EL 9 DE NOVIEMBRE! LUEGO SUBIRÁN A $45.000.-\nATINE AHORA!\n\n \n..\n\nINFO DEL EVENTO\nPrimavera Fauna, la fiesta de la Primavera en Chile\n\nEste sábado 24 de noviembre en el sector piscinas del Espacio Broadway se llevará a cabo la segunda versión de Primavera Fauna, un gran espacio de áreas verdes, con zonas de esparcimiento y piscinas habilitadas. Un marco inmejorable en la época más agradable del año.\n\nPrimavera Fauna no será una celebración cualquiera. Fiel a su creación, este año la idea es consolidar un festival único, con estética propia y hecho 100% a medida: Primavera Fauna, Festival de Música y Artes hecho en Chile.\n\n2 escenarios (Internacional Virgen Mobile, Latino Red Bull Panamerika) que funcionan alternadamente para que no te pierdas ningún show, pool party en el escenario de Djs Corona Light, más de 14 de horas de música, instalaciones de artes visuales, sector de comidas, áreas VIP y la primavera en todo su esplendor a tan sólo 10 minutos de Santiago.\n\nEscenario Internacional: Virgin Mobile\n\n- Pulp\n- Dinosaur Jr.\n- The Walkman\n- Clap Your Hands Say Yeah\n- José González\n- Little Boots\n- The Virgins\n- Poolside (LIVE)\n\nEscenario Latinoamericano: Red Bull Panamerika\n\n- Illya Kuryaki & The Valderramas\n- Bomba Estéreo\n- Astro\n- Francisca Valenzuela\n- Bonde Do Role\n- Alex Anwandter\n- Dënver (Gala)\n\nEscenario Djs: Corona Light\n\n- Seth Troxler\n- Lindstrom\n- Aeroplane\n- Poolside Dj Set\n- Goldroom\n- Surtek Collective\n- Dicky Trisco & Pete Herbert\n- Kruz y Kunza\n- Daniel Klauser\n\nhttp://www.primaverafauna.cl\n\nInvita: Foster\nAuspicia: Dentyne, Skechers, Flor de Caña, Finlandia, Jack Daniels.\nMedia Partners: La Tercera, Radio Horizonte, NNM, Super 45, GAM.",