  { :name => "Altocamet en Bar Loreto", :longitude => -70.6410226, :latitude => -33.4286539, :gmaps => true, :description => "Este viernes seguimos con las visitas internacionales con Altocamet en vivo. Banda  formada en 1995 en Mar del Plata, que cuenta con seis discos y cinco vinilos editados. Ganadores de tres  premios Gardel en 2008, 2009 y 2011; y un premio Luca Prodan en 2009. Conjugan pop, rock y electrónica a través de letras íntimas y evocativas. Han compartido escenario con Gustavo Cerati, Babasónicos, Andy Rourke, Robin Guthrie y Asobi Seksu. También han tocado en diversos festivales en la última década, como el Nokia Trends, Creamfields, Mardelpop, Primavera Alternativa junto a Sonic Youth y Sean Lennon, y han llevado su música a través de diferentes escenarios en la Argentina, y otros países de Latinoamérica.\nDespués de la presentación de la banda, Dj Julián García Reyes (Horizonte) y Roberto Parra (Primavera Fauna) se encargarán de animar la noche. Mientras, en el segundo piso, Dj Pablo Giadach hará lo suyo.  \n\nViernes 16 de noviembre\nArtista: Altocamet (Argentina)\nDj: Julián García Reyes + Roberto Parra (Primavera Fauna)  / Salón Verde: Dj Pablo Giadach\nEntrada: $ 3.000 hasta la 00:00hrs,  luego $ 4.000.- \n", :start_time => "2012-11-16 23:00:00", :end_time => "2012-11-17 05:00:00", :address => "Loreto 390-498, Recoleta, Santiago Metropolitan Region, Chile", :fb_id => 408772772528103, :owner_id => 197757850264203, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/211071_408772772528103_675128145_q.jpg", :atenders => 30, :privacy => nil, :created_at => "2012-11-15 05:07:35", :updated_at => "2012-11-15 05:07:35" },
