  { :name => "Tratamiento aborto no punible. Estaremos por la mujer y por el niño por nacer", :longitude => -68.84228999999999, :latitude => -32.8893852, :gmaps => true, :description => "POSIBLE NUEVA FECHA TRATAMIENTO: 27 DE NOVIEMBRE. A PREPARARSE...\n\nEstuvimos en la Legislatura. Seguimos adelante. No se trato el protocolo ni la 62.903, pero mostramos que estamos y que estaremos para que se de solución verdadera al problema de la mujer y el niño por nacer...\n\nQUEREMOS LEY DE EMBARAZADAS.\n\nEL 13 ESTUVIMOS EN LA LEGISLATURA Y EN LA CASA DE GOBIERNO DE LA PROVINCIA.\n\nFOTOS: https://www.facebook.com/media/set/?set=a.337869516311886.73265.110365502395623&type=1\n\n---\nAnte los publicado por algunos medios la verdad es que NO se ha descartado por completo un posible tratamiento de la ley que permitiría el aborto legal encubierto, por eso NO HAY QUE BAJAR LOS BRAZOS. Por lo que seguimos con la convocatoria Las mujeres y niños merecen que cuidemos sus derechos frente a toda incertidumbre.\n\n• Para estar presentes por si resuelven tratar la adhesión a la guía abortista. Posibilidad que aún existe.\n• Queremos el tratamiento de la ley \"Programa de Prevención, Asistencia y Compensación”, dirigido a las mujeres que cursen un embarazo como producto de una violación. De los senadores Stevanato y Segovia. (http://www.senadomza.gov.ar/exptes/texto.php?expte=0000062903)\n• Mostrar nuestro rechazo a cualquier intento de legalizar un protocolo o guía abortista, formalizando legalmente los abusos institucionales contra las mujeres.\n• Porque  interpelarán al Ministro de Salud Dr. Diaz Russo, por su defensa de los derechos de las mujeres y niños por nacer, por lo que ha sido acosado en las últimas semanas, él merece todo nuestro apoyo.\n• Es el momento que los representantes que hemos elegido trabajen para los Mendocinos, en especial las mujeres y los niños, cumpliendo con su deber de trabajar con políticas progresistas que promuevan el valor de la vida sin discriminaciones porque TODA VIDA VALE.\n\nLos esperamos, es el momento de movernos\nPOR LAS MUJERES, POR LOS NIÑOS, POR MENDOZA, POR LA VIDA!\n\nGracias!\n---\n\nINFORME COMPLETO SOBRE EL ABORTO NO PUNIBLE: ABC DEL PROTOCOLO\nPARA DESCARGAR YA! (o leer online)\n---\nLink de descarga o lectura online: http://bit.ly/Rpmpn9\n---\nLa guía para entender los abusos del protocolo abortista que nos quieren imponer\n\nRESUMEN DE LO HECHO POR FRENTE JOVEN MENDOZA HASTA EL MOMENTO.\n\nFOTOS DE LO QUE FUE LA MOVIDA EN EL GRAN MENDOZA:\nhttps://www.facebook.com/media/set/?set=a.330265120405659.71422.110365502395623&type=1\n\nFOTOS MOVIDA EN LOS DEPARTAMENTOS:\nhttps://www.facebook.com/media/set/?set=a.330159097082928.71385.110365502395623&type=3\n\n\n\nLas moVIDAs fueron en días diferentes,\nsegún la localidad:\n\n- SÁBADO 20 de OCTUBRE.\nSan Martín, Rivadavia y Alvear.\n\n- DOMINGO 21 de OCTUBRE:\nTunuyán, San Rafael, Malargüe.\n\n- LUNES 22 de OCTUBRE 20.30 hs:\nCiudad de Mendoza.\n\n- MARTES 13 DE NOVIEMBRE 13.00 hs. \nCiudad de Mendoza.\n---\n\nConvocatorias masivas para detener el aborto no punible en Mendoza.\nNo queremos ni victimas de violación ni victimas de protocolo.\nEl protocolo condena a la mujer a un espiral de violencia y deja impune al violador.\nLEY DE EMBARAZADAS YA: contención y ayuda para la mujer y el niño por nacer.\n\n---\nPara ver nuestro apoyo al proyecto de Ley de Compensación a las Víctimas de Violación:\nhttps://www.facebook.com/notes/frente-joven-mendoza/comunicado-apoyo-a-la-ley-de-prevenci%C3%B3n-asistencia-y-compensaci%C3%B3n-a-las-v%C3%ADctimas/327707593994745\n---\nPREPARENSE TODOS POR LA MUJER, POR EL NIÑO POR NACER Y POR LA VIDA.\n---\n", :start_time => "2012-11-27 09:00:00", :end_time => "2012-11-27 17:45:00", :address => "Espejo 202-300, Mendoza, Mendoza Province, Argentina", :fb_id => 450849611624317, :owner_id => 110365502395623, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373460_450849611624317_1629839579_q.jpg", :atenders => 1530, :privacy => nil, :created_at => "2012-11-15 05:13:52", :updated_at => "2012-11-15 05:13:52" },
