  { :name => "Parcelazo fin del mundo \"THE END BLACKOUT\"", :longitude => -70.8812385, :latitude => -33.4516199, :gmaps => true, :description => "¿ESTAS LISTO PARA VIVIR EL FIN DEL MUNDO?\n \nTHE END BLACKOUT - EL APAGON FINAL \nPARCELAZO FIN DEL MUNDO\n\nClub de campo Espacio Broadway \n\nVENTA DE ENTRADAS A PARTIR DEL MIERCOLES 7 DE NOVIEMBRE \n\nOperación Daisy en conjunto con Comunidad Ombligo han confirmado la fecha para el 2012 \n\nEn la noche del sábado 01 de Diciembre, a solo 15 minutos del centro de la capital, los habitantes en las afueras de Santiago, verán miles de peregrinos caminar hacia el Fin del Mundo: El Club de Campo de Espacio Broadway. \nEste lugar, será el punto de encuentro de la primera versión de \nTHE END BLACKOUT\n \nLa mezcla de estructuras impresionantes con iluminación de alta tecnología junto a la naturaleza (6 hectáreas) crearán una atmósfera mágica. \nTHE END BLACKOUT es una experiencia de alto nivel para disfrutar al aire libre junto a tus amigos. \n\nDESPERTARAS EL 2013 / RESERVAS PARA SOBREVIVIR: \nELLOS entran 1 botellla de ALCOHOL \nELLAS entran 1 botella de BEBIDA  \n\nEste año se sumarán 2 escenarios del mas alto nivel y estándar nacional, entregando así más variedad de música y espectáculos para ver, bailar y sentir. \n\nLINE UP\n \n...:STAGE 1 DESTRUCTION ZONE:...\n \nDJ BYTE Ganador Red Bull Thre3style Chile\n Telonero de LMFAO en Chile\n \nDJ BOSS / DJ PAPITAS \n\n\n...:STAGE 2 AREA OF SURVIVORS:...\n \nALTAMIRANO / FRANCISCO IBARRA / HERNAN ALFARO\n \n\nVENTA ENTRADAS\n Los tickets se pondrán a la venta el miércoles 7 de noviembre. La primera PREVENTA $4.500\nPUERTA $6.000 \nMás información sobre precios, descuentos y otros en:\n \nTwitter @operaciondaisychile \n\nFacebook /operaciondaisychile \n\nwww.operaciondaisy.com \n\n\nCOLABORADORES\nManquehuito Pop Wine - Coca Cola - PF - Flor de caña - Alto del Carmen - Cerveza Roma - Prendela.cl \n\n\nPRODUCE\n Comunidad Ombligo - Operacion Daisy\n ", :start_time => "2012-12-01