  { :name => "Foro: Formación de deportistas de Alto Rendimiento", :longitude => -71.6057556, :latitude => -33.0444714, :gmaps => true, :description => "FORMULARIO DE INSCRIPCIÓN:\n\nhttp://goo.gl/4wMv3\n\nForo organizado en el marco de la campaña #Yo Quiero Un Chile Olímpico, que busca poner en discusión las actuales políticas deportivas para la formación integral de deportistas de alto rendimiento. Al hablar de formación integral nos referimos al apoyo que reciben los deportistas desde sus inicios hasta después de su retiro profesional, lo cual será debatido desde distintas perspectivas con miras a crear un país más comprometido con el deporte de alto rendimiento.\n\nExpositores:\nArturo Guzmán: Gerente General - ADO Chile\nMarcelo Ubal: Secretario Ejecutivo - Plan Olímpico de Chile, IND\nErika Olivera: Destacada Maratonista Olímpica nacional\nFelipe Soto: Coach Olímpico nacional - Taekwondo \n\nA continuación les dejamos los 3 primeros videos de la campaña, realizados con el apoyo de DAR Chile:\nMarisol Villarroel, Patinadora Artística: http://youtu.be/nfoxHBCvkFE\nThomas Briceño, Judoka: http://youtu.be/wRoKmB-7VlM\nRobinson Méndez, Tenista Paralímpico: http://youtu.be/yA_u2Tg3hts\n\nContacto:\nFacebook: https://www.facebook.com/yoquierounchileolimpico\nTwitter: https://twitter.com/ChileOlimpico\nDAR Chile: https://www.facebook.com/DarChile\n\nSalón Quinto Centenario, Casa Central, PUCV\n\n¡Los esperamos!", :start_time => "2012-11-19 10:30:00", :end_time => "2012-11-19 13:30:00", :address => "Brasil 2950, Valparaíso, Valparaíso Region, Chile", :fb_id => 122959921193153, :owner_id => 671566839, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276671_122959921193153_824513940_q.jpg", :atenders => 125, :privacy => nil, :created_at => "2012-11-15 05:17:02", :updated_at => "2012-11-15 05:17:02" },
