  { :name => "Espacio wave : WAVE PARTY (FIESTA + ARTE) tercera edicion CENTRO ARTE ALAMEDA 24 de nov 23:00 ELECTRO / DRUM AND BASS / DUBSTEP", :longitude => -99.1463086, :latitude => 19.4364274, :gmaps => true, :description => "FIESTA+ ARTE       ELECTRO / DRUM AND BASS / DUBSTEP\n\nIntensive art live promete para todos sus asistentes una noche llena de sensaciones adictivas : música , diseño, visuales, tatuajes, performance y mas sorpresas ...\n\nwave party es conocida por ser una fiesta donde bailamos al ritmo de los sonidos electrónicos que prepara nuestra variedad de dj`s (estilo y crew) y al mismo tiempo apreciar las distintas áreas artistas (de los expositores y en vivo) que se presentan dentro de la fiesta es una instancia donde interactuar y vivir un evento full arte es lo que mas hace sudar nuestro cerebro !!!!!\n\nDespués de un largo descanso y bastante tiempo de preparación estamos listos con todo para EXPLOTAR TUS SENTIDOS !!!!!!!!!!!\n\n \nline up dj`s GROSERO !!!!!!\n\n- NOISE YONKI b2b BEASTI NOISE (electro - fidget - dubstep)\n\n- ELIAS KERNSCHATTEN (electro - fidget - dubstep)\n\n- FRANTIK b2b ROACH ( liquid - rolling -  techstep)\n\n- WILLI DESTROY ( heavy dubsep - dnb)\n\n- DANI MACH (drum and bass)\n\n- JUNGLE SOUL feat MARABUNTAZ (drum and bass)\n\nVJ TRYPICAT visuales y show de mapping \n\nFotografía : Greco Rockers  (acreditado-wave)\nhttp://www.facebook.com/abraham.barrios.5\n\nFotografía : Francisca Parada Burgos  (acreditado-wave)\nhttp://www.facebook.com/chicle.declorofila\n\n********************************************\n\nARTISTAS EN VIVO !!!!!!!\n\nPerformance : full dancing gogos IRINA Y KENZY\n\nhttp://www.facebook.com/irina.algo\nhttp://www.facebook.com/kenzydance\n\nPintura: STEFANY VASQUEZ\nhttp://www.facebook.com/stefany.vasquez.75?fref=ts\n\nPintura: CLAUDIO DRE \nhttp://www.facebook.com/drepintor\n\nPintura : URBAN RACE\nhttp://www.facebook.com/dvi.hidalgo\n\nTatuaje: PANCHO BAEZA\nwww.facebook.com/pancho.baezatatuajes\n\nTatuaje: MALDITO MENDEZ\nhttp://www.facebook.com/TatuajesMendez\n\nTatuaje  : LIVITY TATOO\nhttp://www.facebook.com/easc\n\nTatuaje  : JUAN PABLO VALDES \nhttp://www.facebook.com/juanpablotatuajes\n\nTatuaje: CHICO CAMPOS\nhttp://www.flickr.com/criurone\n\nBodygraff: DIETER LÓPEZ \nhttp://www.facebook.com/Myk.Bodypaint\nhttp://www.flickr.com/photos/myk_1\n\nGraffiti: LATINAJE SOLO\nhttp://www.facebook.com/soloadu\n\nGraffiti: MACRO AERO GUIC COLLIO\nhttp://www.flickr.com/photos/macro-aerosol-bmcru/\n\n\n\n********Exposiciones********* \n\n- ABIGAIL ABGNES\n http://www.facebook.com/nopodriadejarde.ser\n\n- FRANCISCO VERGARA (fotografía)\nhttp://www.facebook.com/francisco.fvergara\n\n- WUATANAZ (Artista visual)\nhttp://www.facebook.com/wuatanaz2014\n\n- JAIR PARRA MONSALVE (Pintura)\nhttp://www.facebook.com/jparramonsalve\n\n- SEBASTIAN GALLARDO (Ilustracion)\nwww.flickr.com/nokings\n\n- ALEJANDRO MONTESINO \nhttp://alejandrodemontecristo.wordpress.com/\n\n++++++++ MAS ARTISTAS POR CONFIRMAR ++++++++++\n\nDonde \"CENTRO ARTE ALAMEDA\"\n\nCuando 24 de nov de 2012\n\nHora 23:00 (Regalamos JELLY SHOT a los primeros en llegar)\n\nCuanto : chicas $1000 hasta las 00:00\ntodos : 2 x 5000 hasta la 01:00 (ESCRIBIENDO SUS NOMBRES EN EL MURO PARA LA LISTA)\nGENERAL : 3500 después de la 01:00 (sin lista)\n\n\n\nCOLABORA\n- centro arte alameda\n- bajo attacke\n- bluster recordings\n- soul beats \n- screamrobost\n- a portarse mal\n- MAD\n\n\n*************************************************\n\nartistas y/o emergentes en las diferentes áreas que se desarrollan dentro de una fiesta cultural (wave party intensive art live),la fiesta es auto-gestionada cada artista hace o lleva su talento nosotros ponemos y abrimos el espacio a ...\n\nBiografía\nEn el contexto en el que nos desenvolvemos, con los grandes y veloces cambios que este ofrece, nace la idea de brindar a los jóvenes un espacio donde a través de las creaciones artistas en distintas áreas que se mezclan y hacen que puedan conocer, disfrutar y abrir sus conocimientos sobre las nuevas tendencias de sonidos, músicas, variedad en diseño e ilustración, visuales, pintura, performance intervenciones y otras tendencias artísticas sean las protagonistas de sus nuevas miradas que el mundo global y local ofrece. \n\nA través de la realización de eventos innovadores como wave party art live donde las temáticas serán variadas en cada una de sus realizaciones, donde la interactividad será una constante e innovador por no presentarse con anterioridad eventos de este tipo, se podrán tener nuevas perspectivas frente a las artes electrónicas, a demás de tener un espacio de esparcimiento donde se genera la participación activa de todos los asistentes.\nCon esto pues, se quiere lograr que la mayor cantidad de jóvenes que tiene inquietudes frente a este tipo de nuevas tendencias se vea convocado y tenga un lugar donde explorarlas, y que se genere un nuevo paradigma en chile, el de las fiestas interactivas….\n\nDescripción\nSOMOS FIESTA + ARTE \nwave party intensive art live ... con todo !!!!!!!!!!\n\n", :start_time => "2012-11-24 21:00:00", :end_time => "2012-11-25 03:00:00", :address => "Doctor Mora, Guerrero, Cuauhtémoc, Mexico City, Distrito Federal, Mexico", :fb_id => 443070092405461, :owner_id => 100003986457819, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276745_443070092405461_1274316712_q.jpg", :atenders => 527, :privacy => nil, :created_at => "2012-11-15 05:19:33", :updated_at => "2012-11-15 05:19:33" },
