  { :name => "Revive Vintage 2012", :longitude => -70.78906959999999, :latitude => -33.5148556, :gmaps => true, :description => "Revive Vintage es la Experiencia que te permitirá ser parte de la historia de los años sesenta, en el cual se revivirán emociones y posibilitará a las nuevas generaciones descubrir y viajar al pasado, a través del encuentro de exponentes de las más importantes tendencias de la época, en un lugar especialmente ambientado con los principales íconos de aquellos años en cuanto a la moda, música, cine e historia.\nContaremos con stands de venta y/o exhibición de productos, música en vivo y la cafetería estará a cargo de Café del Jardín.\n\nVen a Disfrutar en familia de esta experiencia y ayuda a los niños de la Teletón con tu aporte voluntario.\n¿Cuándo?   Sábado 24 de Noviembre\n¿Dónde?     Parque Potrerillos de la Quinta Vergara\n La entrada es Liberada!!!\n\nPrograma:\n10:00 \tApertura y bienvenida a Revive Vintage\n11:00 \tPinta caritas y globoflexia\n13:00 \tSergio Pino, Cantante Vintage\n15:00 \tConcurso para Niños: “Pinta a Teletín”\n16:00 \tConcurso de Rock & Roll\n17:00       Premiación Mejor caracterización Sesentera\n17:30       Liverval, banda tributo a “The Beatles”\n19:00       Sucio Pérez, banda tributo a “Deep Purple”\n20:00 \tCierre\n\nRevive Vintage es patrocinado por la Ilustre Municipalidad de Viña del Mar y Fundación Teletón.\nColabora con nosotros la Productora Noches Luminosas.\n\nSI QUIERES SER PARTE DE REVIVE VINTAGE COMO STAND, PUEDES ESCRIBIRNOS  A NUESTRO CORREO ELECTRONICO. QUEDAN POCOS CUPOS! \n\nPara mayor información contáctenos:\nE-mail:            revivevintage2012@gmail.com\nFacebook:      http://www.facebook.com/ReviveVintage\nTwitter:          http://www.twitter.com/revive_vintage\n", :start_time => "2012-11-24 08:00:00", :end_time => "2012-11-24 18:00:00", :address => "Quinta Vergara 1749, Maipu, Santiago Metropolitan Region, Chile", :fb_id => 286102274834461, :owner_id => 423300507729859, :city => nil, :co