  { :name => "PISCO MISTRAL presenta: Pinball Deluxe @ Bar Loreto: SOKIO lanza disco \"Atlántico\" en vivo // Dj'ing: GARBO", :longitude => -70.6406342, :latitude => -33.4282798, :gmaps => true, :description => "_________________________________________________\nPISCO MISTRAL Presenta:\nPINBALL DELUXE @ BAR LORETO\nViernes 23 Noviembre :: Desde las 23:00 hrs\n_________________________________________________\n\nEn esta nueva edición de PINBALL DELUXE @ BAR LORETO, el reconocido músico, productor y fundador del sello chileno Ponk Records: SOKIO, lanza su nuevo disco ‘Atlántico’. El álbum, fue grabado en Estudios Unísono entre Diciembre de 2011 y Enero 2012 por Milton Mahan (Dënver) y Pablo Muñoz, con quien componen De Janeiros; y contó con la participación del “dream team” del pop chileno: Mariana Montenegro (compañera de Mahan en Dënver), el líder de Astro Andrés Nusser y las solistas Fakuta y Deplasticoverde, cuyas voces apoyan a Sokio en su nueva incursión como cantante, además del mexicano Torreblanca en piano y voz. \n\nAtlántico es editado en México por Indie Alliance (iarcrds.com) y en Chile por Ponk Records (ponkrecords.com) y esta edición especial en CD por Pinball Recordings (www.pinballrecordings.cl).\n\nLa música en la fiesta pre y post show, estará a cargo de GARBO, director de Pinball Recordings.\n\nNo te pierdas esta gran fiesta !!\n_________________________________________________\nPISCO MISTRAL Presenta:\nPINBALL DELUXE @ BAR LORETO\nViernes 23 Noviembre :: Desde las 23:00 hrs\n\nEn Vivo: SOKIO Lanza su disco \"Atlántico\"\n\nDj'ing: GARBO (Pinball Recordings)\n\nFotos: THE SHOOT!\n\nEntradas: \n$ 3.000 c/cover PISCO MISTRAL hasta las 12:30 am.\n$ 4.000 General.\n\nProduce: \nPinball Recordings ©2012 http://www.pinballrecordings.cl\n_________________________________________________\nNo olviden visitar nuestro sitio: http://www.pinballrecordings.cl\n_________________________________________________\nUnete al grupo de Facebook de Pinball Recordings y así te mantendremos informado de nuevos discos, las fiestas que tenemos agendas para el 2012 en Santiago, Valparaíso, Viña del Mar y las fechas de nuestros artistas en otras ciudades, descargas gratis, descuentos, listas y todo lo que encontremos oportuno comunicar:\nhttp://www.facebook.com/group.php?gid=114344081932626\n_________________________________________________\n\nAuspicia:\nPISCO MISTRAL\nhttp://www.piscomistral.cl/\n1 HOST- Tools for the web\nhttp://www.1host.cl/\nREVISTA ZONA\nhttp://www.revistazona.cl\nPORTAL DISC\nhttp://www.portaldisc.com\n\nColaboran:\nMusica de Color (http://www.musicadecolor.cl)\nSuper45 (http://www.super45.cl/)\nSaborizante (http://www.saborizante.com/\nEl Safari (http://www.elsafari.cl)\n_________________________________________________\nBAR LORETO\nLoreto 435 - Bellavista\nSantiago - Chile\nhttp://www.barloreto.cl\n_________________________________________________\nhttp://www.pinballrecordings.cl\n_________________________________________________\n", :start_time => "2012-11-23 21:00:00", :end_time => "2012-11-24 03:00:00", :address => "Buenos Aires 206-248, Recoleta, Santiago Metropolitan Region, Chile", :fb_id => 489697691052923, :owner_id => 549207707, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373026_489697691052923_1033859286_q.jpg", :atenders => 18, :privacy => nil, :created_at => "2012-11-15 05:39:05", :updated_at => "2012-11-15 05:39:05" },
