  { :name => "Capacitación en “Análisis Sensorial y Armonización/Maridaje de Cerveza”", :longitude => -70.641997, :latitude => -33.4691199, :gmaps => true, :description => "Continuando con nuestro ciclo de capacitaciones, los invitamos a participar de la nueva versión de nuestra capacitación en “Análisis Sensorial y Armonización/Maridaje de Cerveza”. El próximo jueves 22 de noviembre. \nAprenderemos, analizaremos y degustaremos más de 10 estilos de cerveza diferentes  con varios acompañamientos: entradas, platos principales, quesos, finos chocolates, y frutas. Guiados por un experto certificado internacionalmente, disfrutaremos de un agradable ambiente, una organización impecable, alimentos cuidadosamente elaborados y por supuesto las más exclusivas cervezas. Un panorama imperdible para educar los sentidos y brindar a los asistentes una verdadera y real experiencia sensorial.\nLas inscripciones están abiertas en: www.boutiquedecervezas.cl\nInversión por persona 50.000 pesos. Cupos limitados!!\nLos esperamos!!!\n", :start_time => "2012-11-22 17:00:00", :end_time => "2012-11-22 20:00:00", :address => "Ñuble 646-690, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 388677501210124, :owner_id => 100002857403036, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276814_388677501210124_380375973_q.jpg", :atenders => 10, :privacy => nil, :created_at => "2012-11-15 05:39:19", :updated_at => "2012-11-15 05:39:19" },
