  { :name => "DANIEL KLAUSER + DIEZ SENTIDOS + ECKOBEATS / CONCEPCIÓN, SÁBADO 17 NOV @ DIESEL CLUB", :longitude => 23.5884887, :latitude => 46.76968919999999, :gmaps => true, :description => "█ LINE UP:\n\n►DANIEL KLAUSER (DIAMANTE RECORDS) \n(Artista de Lollapalooza 2013 y del festival Primavera Fauna)\n\nDj y productor chileno, fundador de Diamante Records, con un estilo propio ha logrado ser reconocido internacionalmente, editando en diferentes sellos como Top Billin, Get Flavor y Soulles Lab, y apareciendo las destacadas revistas XLR8R y Fact Magazine. Ha compartido escenario con grandes músicos, tanto chilenos como internacionales, como Modeselektor, Justice, Matanza, Dj Raff, Diplo, Machinedrum, entre muchos otros. Actualmente, ha colaborado y producido con destacados artistas del rap chileno, como Zonora Point, CEAESE, Tea Time, Jamez Manuel, G Infinitum, Camilleazy, y muchos más.\n\nhttp://soundcloud.com/danielklauser\n\n►DIEZ SENTIDOS (SPACE ZOO)\nEs director general de SPACE ZOO donde el verano del 2012 comenzaron produciendo eventos en club la sala / Valparaiso. \nHoy Diez Sentidos está preparando su primer trabajo como productor, para lanzar un EP en Diciembre con el nombre de “Verano Animal”.\nSus sets están ligados a los sonidos más espaciales y vanguardista que van por él, Future Bass - Uk Garage - BassLine. A tocado por varios club's de Stgo, Temuco, Concepción, Viña del Mar, Valparaíso y Mas. Compartiendo escenario con grandes de la escena nacional e internacional como: Douster, Echo Park, Matanza, Daniel Klauser, New kids on the Noise, Theego, Jet Marte, Bassbangerz, Ceaese, Zonora Point, Entre otros.\n\nhttp://soundcloud.com/diezsentidos\n\n\n█ WARM UP\n\nECKOBEATS   (DSCC)\n\nDJ  y productor de eventos , a participado de distintos escenarios  electrónicos como Club Hi-fi Knockout ,  Underworld Music SL , Sala Murano Lican Ray , Space Zoo , Arte Matta Santiago , Santeria Club Stgo , Sala 019 Stgo , Diesel Club,\nCreepyland 2012 Espacio Marina.\n\nSus mezclan pasan por lo más acido del DUBSTEP y ritmos  psicodélicos del BASSLINE .  Sus Sets incorporan distintos estilos electrónicos Underground como Tech house , Dutch House , Dirty Dutch , Fidget , Moombah ,  Wobble, D&B ,entre otros.\n\nhttp://soundcloud.com/eckobeats\n\n\nENTRADA EN LISTA : $2500 c/c  hata las 2:00HRS.\n\n//// Promociones ////\nPISCO, RON, WHISKEY -------> 2X1 hasta las 01:00 am\n\n- Pisco Capel, Alto del Carmen, Mistral\n- Ron Flor de Caña\n- Golpeados De Tequila\n\n- Red Bull $ 1.500\n- Cerveza Corona, Cristal Cero $ 1.500\n\n- JACK 2 X 1 A $7.000.-\n- 2 JACK + RedBull $9.000.-\n\nValores de Tickets General\n\n$ 4.000.- c/cover Hasta las 01:00 Am.\n( Alto del Carmen , Mistral , Ballantine's , Ron , Vodka Stolichnaya )\n\n$ 5.000.- c/cover Después de las 01:00 Am.\n( Alto del Carmen , Mistral , Ballantine's , Ron , Vodka Stolichnaya )\n\nVIP $ 7.000 c/cover ( Jack Daniel's , Bacardi , Absolut , Alto , Mistral )\n\n", :start_time => "2012-11-17 21:00:00", :end_time => "2012-11-18 03:00:00", :address => "E81 Piata Unirii, Cluj-Napoca, Romania", :fb_id => 466303750089116, :owner_id => 100003331902716, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/276911_466303750089116_1874350558_q.jpg", :atenders => 121, :privacy => nil, :created_at => "2012-11-15 05:39:43", :updated_at => "2012-11-15 05:39:43" },
