e ;) ««\n\nAuspicia: Speed Injection – Pleasure Toys\nColabora: Radio Pulso – Rey Mono – Dubstep Beats Chile \n", :start_time => "2013-02-01 21:40:00", :end_time => "2013-02-02 00:40:00", :address => "Teatro Recoleta 170, Maipu, Santiago Metropolitan Region, Chile", :fb_id => 258355364282968, :owner_id => 232557716848553, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373237_258355364282968_76236303_q.jpg", :atenders => 385, :privacy => nil, :created_at => "2012-11-15 05:42:23", :updated_at => "2012-11-15 05:42:23" },
