  { :name => "La Union Hace La Fuerza Vol II - Sabado 1 de Dic 18hs - Grooveland- 9 Bandas.1 Objetivo!", :longitude => -58.3851184, :latitude => -34.6816136, :gmaps => true, :description => "Sabado 1 de Diciembre, Grooveland, Gerli, 18 hs.\n9 Bandas.1 Objetivo!\n\nVamos cerrando el año, y que mejor manera de hacerlo si no es con la 2da edicion de \"La Union Hace La Fuerza\"\nUn festival armado totalmente a pulmon y gracias a la buena voluntad de las bandas que participan.\nLa Union Hace La Fuerza entre las bandas, evitar intermediarios y hacer las cosas uno mismo, y ayudandonos entre todos.\nCamaraderia y buena onda es lo principal!\nComo siempre, ademas de las bandas, feria de discos, remeras, etc!\n\n9 Bandas!!!\nVeni temprano, apoyando a todas las bandas, el orden es enteramente a sorteo!\n\n*NO PRODIGOS\nhttp://www.noprodigos.com.ar\nhttp://soundcloud.com/noprodigos\n\n*THE INDECENTES\n http://www.myspace.com/theindecentes\nhttp://facebook.com/los.indecentes\n\n*FORWARD\n http://www.forwardhcp.com.ar\nhttp://facebook.com/forward.hcpunk\n\n*LOS TESEO\nhttp://www.myspace.com/teseomusic\nhttp://facebook.com/losteseo\n\n*LOS AUTODETERMINACION\nhttp://facebook.com/losautodeterminacion\n http://www.myspace.com/autodeterminacion\n\n*NATURAL FURY\n http://www.myspace.com/naturalfury\nhttp://facebook.com/naturalfury\n\n*NUESTRAS ARMAS\nhttp://www.myspace.com/nuestrasarmas \nhttp://www.facebook.com/pages/Nuestras-Armas/244271565615675?fref=ts\n\n*FEEL THE NOISE\nhttp://www.myspace.com/ftnoficial\nhttp://facebook.com/ftnoficial\n\n*ANOTHER CHANCE(ROSARIO)\nwww.myspace.com/anotherchance55\nhttp://facebook.com/anotherchance.rosario\n\nComplejo Grooveland H. Yrigoyen 2166, Gerli, 18hs!!", :start_time => "2012-12-01 17:00:00", :end_time => "2012-12-01 20:00:00", :address => "Av Hipólito Yrigoyen 2002-2100, Gerli, Buenos Aires Province, Argentina", :fb_id => 170297429777894, :owner_id => 1437914969, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/277000_170297429777894_291168852_q.jpg", :atenders => 79, :privacy => nil, :created_at => "2012-11-15 05:45:13", :updated_at => "2012-11-15 05:45:13" },
  { :name => "JUNTEN MIEDO!!! por primera vez juntos Los 4 MOUSTHROS !!!", :longitude => -70.64911599999999, :latitude => -33.4040185, :gmaps => true, :description => "Durante toda su carrera Vincent Price siempre estuvo personificando el inconsciente oscuro de la raza humana, y es por eso q lo resucitamos desde el estrado mas alto de las tinieblas para q vuelva a ser el portavoz de una de las juntas mas esperadas de los últimos años.\n\nCon casi 20 años de trayectoria tenemos el orgullo de presentar a los 4 grandes Mousthros del verdadero e independiente Rock Nacional, Yajaira, Devil Presley, Tabernario y Hielo Negro, y la cita es el Viernes 30 de noviembre en el Arena Recoleta.\n\nAsí q damas y caballeros ya lo saben, no viviremos mas a partir de esto, solo malviviremos, los barrotes del psiquiátrico quedan abiertos, la visión de tales Mousthros trastornan sus cerebros y se enraizaran como un tumor cancerigeno q te carcomerá de principio a fin, lo siento mucho, dejad de gritad por favor.......\n\nYAJAIRA\nDEVILPRESLEY\nTABERNARIOS\nHIELONEGRO\n\nARENA RECOLETA EINSTEIN 898 METRO EINSTEIN\nENTRADA PUERTA: $6.000\nPREVENTA: $4.000\nPORTAL LYON\nEL BOLICHE LOCAL 78\nROCK Y FIESTA TODA LA NOCHE\nPRODUCE: WHAT!\nAUSPICIA: ROCKAXIS", :start_time => "2012-11-30 20:00:00", :end_time => "2012-12-01 06:00:00", :address => "Obpo del Pozo 2331-2389, Recoleta, Santiago Metropolitan Region, Chile", :fb_id => 287981064641217, :owner_id => 1337002844, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276984_287981064641217_629387247_q.jpg", :atenders => 79, :privacy => nil, :created_at => "2012-11-15 05:45:20", :updated_at => "2012-11-15 05:45:20" },
