  { :name => "** DANCEHALL XPLOSION mexico ** 2da. edicion !!!!", :longitude => -99.13814769999999, :latitude => 19.4374514, :gmaps => true, :description => "LISTA LA SEGUNDA EDICION DEL UNICO FESTIVAL EN MEXICO...\nESTRICTAMENTE DE DANCEHALLL !!!!!! \n[[   iniciativa dancehall mexico   ]]   presenta ...\n******* DANCEHALL XPLOSION MEXICO *******\n\nEn esta ocacion contando con interesante cartel:\n\nDIRECTAMENTE DESDE JAMAICA\n** DELLY RANX ***\n es un deejay dancehall jamaiquino y productor musical.\n \nNacido en Kingston, Jamaica, Delly  Ranx primero tuvo éxito en la década de 1990 con sencillos como  “No Gal No More Than You”,  ha lanzado más de 80 singles desde 1993 y en el 2009 lanzó el álbum Good Profile.\nEn 2010 produjo  Saudi Arabia riddim\" con el cual tuvo un rotundo éxito  grabando su tema \"Toppa Toppa\" y también sirvió de base para los hit´s de Buju Banton, Wayne Wonder, Morgan Heritage y Sizzla.  Otro producido por Ranx ha sido “the voice”  para Sean Paul y Mavado.\n En 2011, él lanzó un álbum de combinación, Fi Di Dancehall con la cantante estadounidense Sadiki.\nRanx lanzó su cuarto álbum, the next chapter , en julio de 2012, con apariciones especiales de  Bunny  rugs y Buju Banton.\nÉl libera sus propias producciones en su sello Pure Music Promotions.\n sus colaboraciones con artistas como:  elephant man, capleton, bounty killa, \nmr bogle, voicemail, ding dong, spragga benz,Gappy ranks, mega banton lo conviereten hoy por hoy en un artista top dentro del circuito dancehall internacional.\n\nDIRECTAMENTE DESDE BRASIL:\n\n*** JIMMY LUV ***\n\nMC, Productor Musical, DJ\nRagga, Reggae, Bass Music\n\nMC Jimmy Luv fue y es una pieza clave en la evolución del sonido ragga y Dancehall, en Brasil. En la década de 2000 formó  uno de los primeros grupos de rap con influencias de ragga,”Enganjaduz” después se expandió con un estilo más concreto con la familia 7 velas. Recorriendo prácticamente todas las zonas de Brasil. Nominado para el premio en los MTV VMB 2009 categoría Reggae. Paralelamente trabaja su carrera en solitario con el sistema  de sonido Echo, y Blanka Dubalizer Krew. Además de ser MC es también productor / beatmaker y DJ.\nPIONERO Y FUNDANDOR DE LA ESCENA RAGGA Y DANCEHALL DE BRASIL **\n\nNACIONALES !!!\nCARLOS THUNDER * MURDERCREW * MC PELUSA * MIZERABLES * MASACRE ALLIANCE * SELAH SON & JAH MAIK \n\nDJ´S !!\nJAHMING * JAH AARON * HARRY P * TAVO RANKS * SATIVITY GANG *\n DIBUR * SPLIFF * JAH SAVE *  \n\nADEMAS :\nSO SPECIAL DANCEHALL CREW * DANCEHALL QUEEN MEXICO * FASHION LADYS * IRATION CREW **\n\nUNA GRAN  FIESTA NOS ESPERA !!!! TE LO VAS A PERDER ???\n\n*********************************************************************\nPREVENTA: 120                 \nAPARTIR DEL 1RO DE OCTUBRE EN: \n* SALON CALAVERA \n* SATIVA REGGAE CLUB (dj jordan)\n* DIRECTO CON SKAR (55-41-29-32-52) facebook: skar vibrazion reggae\n \nCOSTO EL DIA: 150  inicio: 8:00pm", :start_time => "2012-11-24 09:00:00", :end_time => "2012-11-24 12:00:00", :address => "República de Cuba 34, Centro, Cuauhtémoc, 06000 Mexico City, Distrito Federal, Mexico", :fb_id => 470700556286066, :owner_id => 100000324743973, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/188051_470700556286066_1355949210_q.jpg", :atenders => 361, :privacy => nil, :created_at => "2012-11-15 05:47:23", :updated_at => "2012-11-15 05:47:23" },
  { :name => "Sacrificar a Piñera para calmar a la Pachamama.. Antes de 2012!", :longitude => -70.641997, :latitude => -33.4691199, :gmaps => true, :description => "Este pelotudo cree que somos hueones?\n\n\"ya, transparentemos.. pa no cagar a a mis amiguis hagamos universidades \"publicas\", privadas sin fines de lucro, y privadas con fines de lucro.. oobvio q sus utilidades las pagará mediante impuestos..\"\ny obvio q el gobierno les dará financiamiento a esas instituciones.. ¬¬º\n\nEducación Pública de Verdad! \nno un estado que con suerte financia el 10% del presupuesto de la U.\nY por favor.. Sabemos que debe haber diferencia entre una U pública y privada.. pero no significa que se tenga que cagar a los de Ues privadas con un crédito como el aval..\n\nÉl mismo lo dijo.. EDUCACIÓN GRATUITA Y DE CALIDAD!\nAcá Piñera vendiendo la pomada si no lo ha visto..\nhttp://www.youtube.com/watch?v=uMP-ly8FF2M\n\nSeguir movilizados para lograr algo de VERDAD!\nModificaciones Orgánicas profundas, no parches como lo que ofreció..\n\nSi lavín adelantó las vacaciones.. Adelantemos las Elecciones!\nChao con todos estos payasos.", :start_time => "2012-12-21 04:00:00", :end_time => "2012-12-21 07:00:00", :address => "Ñuble 646-690, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 162308597151880, :owner_id => 1142573016, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-prn1/162031_162308597151880_2914961_q.jpg", :atenders => 4047, :privacy => nil, :created_at => "2012-11-15 05:47:30", :updated_at => "2012-11-15 05:47:30" },
