  { :name => "\"Fiesta en llamas\"", :longitude => -70.64111059999999, :latitude => -33.4329116, :gmaps => true, :description => "¡¡Hola a todos!!,\n\nEl último año de la Academia de Fernando González Mardones los invita a participar de esta increíble fiesta que es a beneficio para una compañera que está egresando con nosotros y que necesita terminar de pagar su último año. Como curso y con el apoyo de los profesores tenemos el objetivo de llegar a una meta que claramente con la ayuda de ustedes podremos lograrla. Y que mejor chiquillos que bailando hasta sacar chispas en la pista de baile.\n\nLa fiesta se realizará el día Sábado 24 de Noviembre a las 23:00 horas en Dardignac 172 - Barrio Bellavista, en el Centro experimental de arte Tessier, mas conocido como \"ceat\". \n\n\nAmigos, habrá música de todos los tiempos,  bebestibles para todos los gustos y por su puesto con excelente compañía. Será una noche imperdible e inolvidable. \n\n¡¡I-NOL-VI-DA-BLE!!\n\nY qué mejor combinado: ayudando carreteando. De ante mano, muchas gracias por el apoyo.\n\nValor pre-venta: $2000\nValor puerta: $2500\n\nAtte. 3er año de la Academia F.G.M", :start_time => "2012-11-24 21:00:00", :end_time => "2012-11-25 02:30:00", :address => "Dardignac 150-170, Recoleta, Santiago Metropolitan Region, Chile", :fb_id => 432463966790902, :owner_id => 1146098812, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/211218_432463966790902_1654622887_q.jpg", :atenders => 253, :privacy => nil, :created_at => "2012-11-15 05:53:26", :updated_at => "2012-11-15 05:53:26" },
  { :name => "Halloween Art Terror... Presenta: “La Esencia del Miedo”  Radioteatro en Vivo, único en Santiago", :longitude => -70.6679652, :latitude => -33.4390926, :gmaps => true, :description => "“La Esencia del Miedo” será un espacio dedicado a las historias de fantasía, terror y misterio en formato de radioteatro, una puesta en escena que mezclara el glamour de una antigua grabación radioteatral y la novedad de lo moderno desde la estética en escena, el uso de alta tecnología en la producción de sonido y los libretos originales, narrados en primera persona, hacen de éstas obras algo único en el género. “La esencia del Miedo” porque conocer los misterios y los horrores del mundo, es un privilegio destinado sólo a los que tienen el valor de ver su propio reflejo en las sombras.\n\n", :start_time => "2012-11-24 20:30:00", :end_time => "2012-11-24 22:30:00", :address => "Catedral 2246-2300, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 196041437198102, :owner_id => 1516925669, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373486_196041437198102_759182115_q.jpg", :atenders => 12, :privacy => nil, :created_at => "2012-11-15 05:53:30", :updated_at => "2012-11-15 05:53:30" },
  { :name => "PACO IBAÑEZ EN CHILE!!!", :longitude => -70.62781509999999, :latitude => -33.4302528, :gmaps => true, :description => "PACO IBAÑEZ EN CHILE\nCENTRO CULTURAL MONTECARMELO\n24 DE NOVIEMBRE, 21:00 HRS.\n\nPaco Ibáñez es un artista total, que ha vivido, durante toda su carrera, en simbiosis, en simultaneidad artística global, con todas las artes.\n\nTras cuatro años de silencio discográfico, un nuevo álbum: Paco Ibañez canta los poetas latinoamericanos y llega a Chile este 24 de noviembre a las 21 hrs al encantador espacio del  Centro Cultural Montecarmelo.\n\nUn disco impregnado de las vivencias musicales y personales del artista, fruto de la relación que ha mantenido durante toda su trayectoria con Latinoamérica, sus poetas, su música y sus problemas sociales y políticos. Esta nueva creación es una obra única en la que ofrece una serie de canciones inéditas y revisita clásicos de su repertorio tratados con nuevos arreglos que les conceden una nueva vida.\n\nEn la voz y la música de Paco Ibáñez suenan las palabras de Alfonsina Storni, Pablo Neruda, César Vallejo, Nicolás Guillén y Rubén Darío y surgen canciones de amor, de lucha y resistencia, de puro existencialismo, que se van enlazando envueltas por la fuerza de la poesía, los ritmos y los instrumentos... canciones que siendo universales desprenden el alma de América Latina.\n\nSus discos siempre están acompañados por pinturas o esculturas de grandes artistas: Salvador Dalí, José Ortega, Antonio Saura, Alfred Manessier, Corneille, Jorge Oteiza, Frederic Amat, Claude Viallat. Seleccionada, musicalizada e interpretada por Paco Ibáñez esta \"Antología de la poesía en lengua castellana /España e Iberoamérica/ desde el s.XIII hasta la actualidad\" es una Obra única.\n\nEn su regreso a Chile, Paco Ibáñez brilla en un escenario con una sobria y bella escenografía, vestido de negro y abrazado a su guitarra; viaja por la historia de la literatura en lengua castellana, en un concierto basado en una de las más bellas antologías musicadas de la poesía española e Iberoamericana desde el s.XIII hasta la actualidad.\n\nLa voz y la música de Paco Ibáñez atraviesan el tiempo y el espacio y el concierto se convierte en un paseo geográfico por el alma de la música y de la poesía universal.\n\nPaco Ibáñez transporta, rodeado de magníficos músicos, al Chile de Pablo Neruda, a la Argentina de Alfonsina Storni, al Perú de César Vallejo o a la Nicaragua de Rubén Darío, enlazando canciones de amor, de lucha y resistencia, de puro existencialismo, envueltas por la fuerza de la poesía y de los ritmos y los instrumentos...\n\nCada concierto de Paco Ibáñez es una nueva creación, irrepetible. El artista conduce el concierto seleccionando con maestría las canciones, entre sus más de 160 composiciones, creando con su sensibilidad y su arte momentos únicos.\n\nEntradas:\nVip $ 28.000\nGolden $22.000\nGeneral $14.000\n•\t www.ticketek.cl\n•\tCall center 690 2000\n•\tPuntos habilitados en Falabella y Cines Hoyts\n", :start_time => "2012-11-24 19:00:00", :end_time => "2012-11-25 21:00:00", :address => "Monte Carmelo 2-26, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 161570787318709, :owner_id => 207450215985419, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276899_161570787318709_1178051495_q.jpg", :atenders => 23, :privacy => nil, :created_at => "2012-11-15 05:53:35", :updated_at => "2012-11-15 05:53:35" },
  { :name => "Mar Rojo / Lanzamiento Oficial Segundo Disco \"Insomnio\"", :longitude => -70.5963853, :latitude => -33.516739, :gmaps => true, :description => "Después de dos años de haber lanzado su primer disco llamado “Pulsación”, La banda nacional Mar Rojo presentara en sociedad su nuevo álbum de estudio titulado \"Insomnio\", el proximo 24  de noviembre en la Sala SCD Vespucio.\n\nEste segundo disco se grabó entre mayo y septiembre de 2012. Contiene 9 temas, contó con la participación de Francisco González (ex-Lucybell) en uno de sus temas,  fue Masterizado por el destacado productor Gonzalo “Chalo” González. (Francisca Valenzuela, Astro, De Saloon, entre otros).\n\nBandas Invitadas:\n\n- Desencajados / http://www.myspace.com/desencajados\n- Skasisuena     / http://soundcloud.com/banda-skasisuena-ska-reggae\n\nPreventa por sistema ticketek $ 2500  www.ticketek.cl \nventa on line: Preventa de entradas en: http://www.ticketek.cl/tktfunciones.aspx?evento=MAR%20ROJO%20LANZAMIENTO%20SEGUNDO%20DISCO%20INSOMNIO\n\nMar Rojo\nwww.marrojo.cl", :start_time => "2012-11-24 18:00:00", :end_time => "2012-11-24 21:00:00", :address => "Froilán Roa 798-998, La Florida, Santiago Metropolitan Region, Chile", :fb_id => 404208016317960, :owner_id => 1348574711, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/203617_404208016317960_122383665_q.jpg", :atenders => 90, :privacy => nil, :created_at => "2012-11-15 05:53:43", :updated_at => "2012-11-15 05:53:43" },
  { :name => "Sonidos Curativos en la Florida", :longitude => -70.5941607, :latitude => -33.5323479, :gmaps => true, :description => "Queridos Amigos los invitamos a vivir una experiencia maravillosa, a empreder un viaje hacia lo mas profundo de su ser, a aumentar las vibraciones de todos los atomos de su cuerpo, sanando y llevandonos a un esta de profunda paz y plenitud interior. Tendremos cuencos de cuarzo, tibetanos, didgeridoo, tambor, canto armonico y mucho mas. \n\nSon solo 20 cupos, no se lo pierdan!\n\nAsegura tu cupo realizando una transferencia o deposito a la cuenta rut 17.250.736-0 del banco estado a nombre de Carlos Vasquez, y luego enviarnos el comprobante junto a tus datos al correo sonidomedicina@gmail.com. \nRecomendamos realizar este tramite lo antes posible ya que las personas que pagen con anticipacion tendran prioridad sobre los pre- inscritos.\n \nSi por algun motivo no pueden transferir, pueden dirigirse al centro mandala ubicado en Av. Vicuña Mackenna 8965 (Metro Rojas Magallanes), alli deben hablar con Daniela, la pueden ubicar los dias lunes, miercoles y viernes a partir de las 14 horas, alli pueden pagar y reservar su cupo en 100%.\n\nFecha: Sabado 24 de noviembre\nHora: Desde las 17:00 a las 18:30 horas aprox.\nValor: $3.000\n\nLugar: Centro de Terapias Mandala, Av. Vicuña Mackenna 8965 (Metro Rojas Magallanes)\nmapa: http://goo.gl/maps/CgrPE (hacer click para ver el mapa)\n\n****Traer una frasada, agua y fruta**** ", :start_time => "2012-11-24 15:00:00", :end_time => "2012-11-24 16:30:00", :address => "Vicuña Mackenna Oriente 8260-8310, La Florida, Santiago Metropolitan Region, Chile", :fb_id => 177507265719076, :owner_id => 1128735493, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/276924_177507265719076_807716712_q.jpg", :atenders => 87, :privacy => nil, :created_at => "2012-11-15 05:53:50", :updated_at => "2012-11-15 05:53:50" },
