  { :name => "CONCIERTO ANIVERSARIO 170 AÑOS DE LA UNIVERSIDAD DE CHILE", :longitude => -70.61858959999999, :latitude => -33.5929716, :gmaps => true, :description => "El Coro de la Facultad de Ciencias, junto a la Orquesta Sinfónica de Chile, y los Coros de la Universidad de Chile, dirigidos por el Maestro David del Pino Klinge, darán vida al Gran Concierto por el 170º Aniversario de la Universidad de Chile.\n\n150 instrumentistas y 230 cantantes darán vida a un concierto único en la historia de Chile, donde se recorrerán grandes obras de Chile y el mundo.\n\n\nPROGRAMA\n\nRené AMENGUAL & Julio BARRENECHEA: Himno de la Universidad de Chile\n\nLudwig van BEETHOVEN: Obertura Egmont\n\nLudwig van BEETHOVEN: Sinfonía no. 9 \"Coral\" (selección del cuarto movimiento)\n\nEdwuard ELGAR: Serie de marchas \"Pompa y Circunstancia\" (selección), Marcha No. 2\n\nAlexandr BORODIN: El Príncipe Igor (selección), Danzas Polovetsianas\n\nEnrique SORO: Aires Chilenos (selección), Cueca\n\nCarlos ZAMORA: Suite \"(Víctor) Jara Sinfónico\" (selecciones):\n- \"Te Recuerdo Amanda\n- \"El Cigarrito\"\n- \"Plegaria del Labrador\"\n\nPyotr Ilych TCHAIKOVSKY: Obertura Festival \"El año 1812\"", :start_time => "2012-11-17 18:00:00", :end_time => "2012-11-17 21:00:00", :address => "Plaza de Armas 3038, La Pintana, Santiago Metropolitan Region, Chile", :fb_id => 122507167907103, :owner_id => 1013429063, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/592215_122507167907103_435358825_q.jpg", :atenders => 58, :privacy => nil, :created_at => "2012-11-15 05:59:41", :updated_at => "2012-11-15 05:59:41" },
  { :name => "\"El Circo Mas Grande Del Mundo\"", :longitude => -70.6675192, :latitude => -33.452395, :gmaps => true, :description => "Hasta un lejano y frió país de Europa llega Antonio Chumbeca Garay un inocente y tierno payasito que decide especializarse, en el arte de hacer reír. Pero este noble sueño se ve truncado cuando el destino intersecte en su camino a un malvado mimo que habla.Director de la escuela mundial de mimos, quien desea convertir al mundo en una manada de seres cara pálida sin expresión ni voz.para ello su amada rehén la desaparecida Madeleine Mackein, llegara a Chile para tomar el rol de Antonio y así concretar el oscuro plan del rey de los cara palida...\n \n\nDramaturgia: Alvaro Ponce F.\n \nadaptación teatral de la historia:  Compañía Gran Circo Teatro\n \nCon: Micaela Sandoval / Marcela Pumarino / Rosa Ramirez / Alvaro Ponce / Felipe Verdugo / Sebastian Caro / Nilton Gutierrez.\n \nMúsicos: Fernando Pereira / Miguel Avalos\n \nDiseño: Roberto Pablo Fariña\n \nDirección: Rosa Ramirez Rios\n \nCon una gran carpa de circo, decorados circenses y elogiosas actuaciones\n Gran Gira por la Región Metropolitana:\n\n\n-Sábado 17 de Noviembre\nPlaza Pablo Neruda. Avenida el Bosque / Avenida Recoleta\nComuna de Huechuraba\na las 20:00hrs.\n\nreferencia metro Zapadores, allí se baja y toma la 203 o la 208  y lo dejan en la plaza.\n\nASISTA EN FAMILIA Y DISFRUTE DEL NUEVO ESPECTÁCULO DEL GRAN CIRCO TEATRO!!!\n\nENTRADA LIBERADA\n\n\n\n ", :start_time => "2012-11-17 18:00:00", :end_time => "2012-11-17 21:00:00", :address => "Rep 299-399, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 389715437772197, :owner_id => 177902132338791, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/203607_389715437772197_945416324_q.jpg", :atenders => 34, :privacy => nil, :created_at => "2012-11-15 05:59:46", :updated_at => "2012-11-15 05:59:46" },
  { :name => "Festival Multicultural por la Buena onda y la Paz !!!", :longitude => -70.7860367, :latitude => -34.2131066, :gmaps => true, :description => "Compañeros, compañeras, camaradas, contertulias, gozadores, carnavalisticos, alpinistas, contorsionistas, amiguitos y amiguitas del baile y la buena vida . No puedo dejar de invitarlos al primer Festival en donde todas las Artes salen al ruedo, un festival en donde la autogestion y las ganas de sacar los proyectos adelante priman por sobre todo !!! \nVamos corran la voz que los artistas locales requieren de este tipo de espacios en donde todos podamos compartir y disfundir a toda esta gente linda que con mucho amor entrega su creatividad y deja todo en el escenario. Inviten a sus familias ya que tendremos un parrillero de lujo el cual nos deleitara con corderos al palo, anticuchos , y para los que no comen carne tendremos sus hamburguesas de soya. No lo duden y y vengan a disfrutar de toda esta energia que se dara en el aire el Sabado 17 de Noviembre del 2012, el lugar que nos concentrara sera el centro de eventos La Terraza, ubicado en Gultro pasado el contro de carabineros en direccion al Sur por la carretera, pasado el paso nivel por la mano de la izquierda , bueno ahi tendremos banderas con el simbolo de la Paz señalando la entrada al lugar. \n\nEs importante llevar la mejor de las ondas y las ganas de generar energia positiva !!! \n\nUn abrazo nos vemos en la pista , exito y Paz !!!", :start_time => "2012-11-17 16:30:00", :end_time => "2012-11-18 04:00:00", :address => "H-40, Olivar, O'Higgins Region, Chile", :fb_id => 360505880707494, :owner_id => 553326434, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/188041_360505880707494_71881416_q.jpg", :atenders => 47, :privacy => nil, :created_at => "2012-11-15 05:59:55", :updated_at => "2012-11-15 05:59:55" },
