  { :name => "Temporada de la obra \" La Pequeña Hada Del Cine\"", :longitude => -70.6371266, :latitude => -33.4324541, :gmaps => true, :description => "\"La Pequeña Hada Del Cine\" \n\nUna obra basada en la mágica y divertida novela del galardonado y talentoso escritor Chileno Hernán Rivera Letelier \"La contadora de películas\".\n\nEs una historia llena de magia, luminosidad y contrastes que utiliza un gran número de personajes para contar, conmover y robar muchas carcajadas al espectador.\n\nComo muchas otras historias escritas por este autor, \"La pequeña hada del cine\" nos permite conocer la vida en las salitreras Chilenas,  tomando como enfoque la particular perspectiva de una niña extremadamente creativa con un gran don (Contar películas como si fueran a tecnicolor y cinemascope) entregando momentos memorables a  los mineros y sus familias o  sus \"Vecinos Varios\" como dice su hermano Manuel, a su propia familia y ciertamente a ella misma, debido a que el cine es su gran pasión.\n\nUna obra literaria maravillosa que hemos llevado con amor a las tablas y que ha sido amada por quienes la han visto, conozcan o no la obra de Hernán Rivera Letelier.\nEstán todos cordialmente invitados a vivir la cinematográfica historia de \"la pequeña hada del cine\". \n\nCompañía:\nLos últimos3.\n\nDirección:\nClaudio Kramer.\n\nElenco: \nFelipe Piagneri.\nRocio Farfán.\nVerónica Rivera.\n\nTécnico:\nCamila Parra.\nCamila Arias.\nDuración:\n01:05 hrs. aprox.\nGénero:\t\nComedia\n\ntodos los jueves de Noviembre 8, 15 ,22 y 29\nLa adhesión es de $5000 general y $2000 estudiantes y 3ra edad.\n2x1 club de lectores del mercurio.\nConsulte otros descuentos.\n\nReservas al 02-735 08 61.\n", :start_time => "2012-11-15 18:30:00", :end_time => "2012-11-29 18:30:00", :address => "Ernesto Pinto Lagarrigue 100-198, Recoleta, Santiago Metropolitan Region, Chile", :fb_id => 364071547017499, :owner_id => 1248413856, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.