  { :name => "Proyecto Oxigeno", :longitude => -71.55138149999999, :latitude => -33.1567268, :gmaps => true, :description => "En el camino que va desde el sector de Peñuelas hacia el cruce Quintay existe un hermoso y frondoso bosque que seguramente alberga diversidad de flora y fauna típica de la zona. Tristemente se ha convertido en un basural ya que algunos inescrupulosos botan desechos de todo tipo transformando el lugar en verdadero vertedero. Sin duda, esto trae consigo empobrecimiento del paisaje y destrucción de un recurso natural que ya escasea en nuestro sector.\n\nObjetivos\n\n-Rescatar los recursos naturales\n-Limpiar el entorno\n-Salvar la flora y fauna\n-Devolver la vida al bosque contaminado\n-Resguardar a la comunidad de contaminaciones y enfermedades producto de la                  basura \n-Crear conciencia ecológica en la comunidad \n\nEsperamos con el ejemplo y el trabajo en equipo, crear conciencia en la comunidad especialmente en la juventud y nuestros niños, para que puedan disfrutar y valorar los recursos naturales, que son una invitación a mejorar la calidad de vida, a vivir en armonía, y cultivar el contacto sencillo y humilde con la tierra y sus recursos.\n\nLas personas que sientan llamados a trabajar en esta hermosa actividad,  deberán enviar datos como NOMBRE, EDAD Y TELÉFONO al igual que aquellas personas que presenten alguna duda, o deseen cooperar con útiles de limpieza como bolsas de basura, guantes, mascarillas  etc,, al correo PROYECTOOXIGENO02@GMAIL.COM...\n\nEl punto de reunión sera en el colegio de Peñuelas el día 24 de noviembre desde las 9:00 hasta las 17:00 hrs.\n\nOJO ES UNA ACTIVIDAD PRA TODAS LAS EDADES UN MOMENTO PERFECTO PARA UN DIA FAMILIAR...\n\nmuchas gracias...!!!", :start_time => "2012-11-24 07:00:00", :end_time => "2012-11-24 15:00:00", :address => "Santiago - Valparaíso, Sector: Túnel Zapata - Valparaíso., Valparaíso, Valparaíso Region, Chile", :fb_id => 398226346912279, :owner_id => 100004612564876, :city => nil,