  { :name => "The Last Party on Earth", :longitude => -95.8644018, :latitude => 36.1550003, :gmaps => true, :description => "Come join the last party on earth! This will be man-kind's last stand to let the cosmos know we had a great time on our planet while it lasted, this is the party to end all parties (literally!)\n\nWhat to bring:\nFriends\nMemories\nGood intentions\nWhat ever gets you crazy\nAnd lots of love!\n\nWhat to leave behind:\nThe past\nUnpaid bills\nHate\nAnything that keeps you from getting your party on\n\nCome enjoy, there will be free stuff (you're not gonna need it afterward anyway...), and most of all, HAVE A GREAT TIME!\n\nOK EVERYONE!!!! LETS MAKE THIS PARTY ACTUALLY HAPPEN!!\n\nIN ORDER TO MAKE THIS A REALITY...\n\nWE NEED:\n\n-A location \n---> (ANYONE with a large property/house/warehouse/barn etc , HIT ME UP ASAP)\n-Entertainment: \n--->ANYONE WHO IS A DJ OR KNOWS SOMEONE WHO MAKES MUSIC, HIT ME UP ASAP!\n", :start_time => "2012-12-20 00:00:00", :end_time => "2012-12-21 00:00:00", :address => "10130 E 4th Pl, Tulsa, OK 74128, USA", :fb_id => 125517510796044, :owner_id => 625952495, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash3/174638_125517510796044_6282778_q.jpg", :atenders => 4585, :privacy => nil, :created_at => "2012-11-19 19:58:08", :updated_at => "2012-11-19 19:58:08" },
