  { :name => "Ayuda para que conozcamos a Lady Gaga", :longitude => 0.000298, :latitude => 0.000243, :gmaps => true, :description => "Porfavor con la Javiera Icaza queremos conocer a Lady Gaga, estamos participando para ganarnos unas entradas. Lo unico que tienen que hacer es ponerle\"LIKE\" a mi comentario (belen trivelli) que es el video que hicimos con la Javiera. Es el comentario numero 10! Enverdad es nuestro sueño conocerla, es un segundo el que se demoran  \n\nEste es el link! porfavor ayúdennos \nhttps://www.facebook.com/photo.php?fbid=385592538184503&set=a.173811592695933.44020.137866966290396&type=1\n\ny aprovechen de ver nuestro video tambien \nhttp://www.youtube.com/watch?v=rYWmoryccYs&sns=fb\n\nLa idea es que se haga viral para que le llegue a Lady Gaga, no cuesta nadaaaa\n\nGracias a todos\nBelen Trivelli \nJaviera Icaza ", :start_time => "2012-11-20 02:00:00", :end_time => "2012-11-21 02:00:00", :address => nil, :fb_id => 222919274507476, :owner_id => 747849207, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/261192_222919274507476_958208568_q.jpg", :atenders => 261, :privacy => nil, :created_at => "2012-11-19 19:58:23", :updated_at => "2012-11-19 19:58:23" },
  { :name => "AYUDA PAL TATA", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Si estás dispuest@ a dedicarle un poco de tiempo a alguien más que a ti mism@, te invito a leer las siguientes líneas:\n\nSegún los egipcios y cuanto saben los egipcios, en el juicio final te harán 2 preguntas; 1- ¿Fuiste feliz? 2- ¿A cuánta gente hiciste feliz?... Pero, se puede ser feliz sin hacer feliz a nadie?... cada uno tendrá su respuesta.\n\nPero, según mi opinión y no pretendo tener la razón, he ahí el problema del paradigma sociocultural en el que vivimos. Desde wawos se nos enseña a preocuparnos de nosotros mismos, preocupate de tus notas para tener tu carrera, para tu trabajo, tus hijos, tu bienestar… al final todos esperan el momento en que tienen que dejar de estar preocupados de si mismos… y en ese constante ocuparse en uno, uno va como caballo y no se da cuenta que al lado hay oportunidades de serle útil a alguien más y eso sería darle sentido a nuestra propia existencia… porque que sentido tiene ocupar toda la vida en uno mismo si uno al final se va y si no hiciste nada por nadie, no dejas NADA.\n\nEntonces aquí les voy a contar una pequeña historia y les voy a dejar la oportunidad de darle más sentido a su existencia:\n\nDon Aníbal Perez Benavides, más conocido como “el tata”, fue toda su vida auxiliar de un colegio para niños en alto riesgo social, como el común de los auxiliares de colegio siempre fue un tipo muy under, humilde, trabajador, apañador y por eso se ganó el cariño y respeto de todos los que tuvieron la oportunidad de compartir con él. Pero nadie sabía mucho de su vida, hasta ahora.\nCuando el tenía 16 años tuvo una polola de la cual estuvo obligado a separarse porque la madre de ella jamás lo aceptó, ambos siguieron con su vida, se casaron, etc… pero sus matrimonios fueron un fracaso y 20 años después se volvieron a encontrar. Retomaron su relación y vivieron juntos y felices muchos años. “El Tata” ya estando viejo, jubiló y dejó el colegio para dedicarse exclusivamente a compartir con su ahora mujer (se casaron hace 6 meses), la señora Brunilda Cabello Astorga.\nEl asunto es que hace poco a ella le encontraron un cáncer al colón y don Aníbal no tiene niuno y no le puede pagar el tratamiento, él que toda su vida la dedicó a apañar a los demás sin pedir nada a cambio hoy necesita ayuda para mantener viva a su mujer que es lo único que tiene.\n\nYo me enteré de esta situación porque un profesor de su colegio me hizo clases en 3ro básico, nunca más nos vimos, pero él se acordó de mi y pensó que yo de alguna forma lo podía ayudar y espero poder hacerlo a través de todos ustedes. Asíque estos son sus datos por si apañan a aportarle unas lucas:\n\nANÍBAL PÉREZ BENAVIDES. RUT: 3289205 - 1\n \nBANCO ESTADO\n \nCUENTA VISTA N° 32892051\n\nMAIL: gumegatica@gmail.com (es el del profe que me contacto, él le va a ir avisando de los depósitos)\n\nEsto es real, nadie se los está tratando de cagar yo personalmente hablé con don Aníbal y como les dije, véanlo como una oportunidad de ser útil, apañar, justificar su existencia. Todo se devuelve en la vida.\n\nSi pretenden apañar, háganlo altoque, porque si lo dejan para después se les va a olvidar y va a quedar en nada, las buenas intenciones no sirven pa na’, y si apañan y no les cuesta nada, inviten a su gente a este evento, difúndanlo, mientras más seamos mejor.\nY piensa. Si hoy fuera el ultimo día de tu vida ¿Qué harías?\n\nSaludos a tod@s.\n\nAquiles", :start_time => "2012-12-21 02:00:00", :end_time => "2012-12-22 02:00:00", :address => nil, :fb_id => 542204515805191, :owner_id => 713682105, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/203535_542204515805191_2054153475_q.jpg", :atenders => 74, :privacy => nil, :created_at => "2012-11-19 19:58:27", :updated_at => "2012-11-19 19:58:27" },
