  { :name => "Carrete del fin del mundo", :longitude => -101.1946067, :latitude => 19.7438311, :gmaps => true, :description => "No soy un profeta de mal agüero, ni un convencido del fin del mundo, pero me parece que para ese día hay que estar carreteando, por si acaso.\n\nPuesto que el mundo se acaba, hay que despedirlo como corresponde!! así que esa noche está todo el mundo invitado a desmensurar, a descontrolar, a exceder los excesos, a probar, a bailar, a celebrar y a disfrutar que el mundo se va a acabar!! traigan lo que crean necesario y no escatimen en nada, que ahorrar ya no es necesario.\n\nPara aquellos que somos escépticos al fin del mundo, vamos pues, a decirle al 2012 que los prendidos somos eternos sobrevivientes, y que la vida continúa.\n\nIdeal sería, para que no quede nadie sin asistir, contar con 3 ambientes:\n\n-El primero, el ambiente tipo discoteque, para los eternos amantes del baile y el perreo, con la música popular del momento y el ambiente apropiado.\n\n-El segundo, el ambiente electrónico, diseñado para yonkis y gustonas, deseosos de estimular sus sentidos y poner a prueba sus limitaciones.\n\n-El tercero, el ambiente relax, para los amantes del buen pasar, de los besos con risas, de la pacha mama y de los cuerpos relajados.\n\nEl que se queda afuera es porque no pertenece a ningún mundo.\nLos comentarios religiosos no tienen cabida en este grupo.\nNo es mi intención debatir si el fin del mundo es cierto o no.\nLa idea es celebrar que sobrevivimos al fin del mundo, no quiero suicidios ni cosas raras.\n\nSaludos.\n\n(TODO el spam en el muro será borrado instantáneamente, que los concursos de fotos, los mensajes de \"agréguenme\", publicidades y otros mensajes que intenten aprovecharse de la concurrencia no caben en este espacio.)", :start_time => "2012-12-21 22:00:00", :end_time => "2012-12-22 22:00:00", :address => "Zafiro, Ampliacion Gertrudiz Sanchez II Etapa, Morelia, Michoacán, Mexico", :fb_id => 103469996353094, :owner_id => 100000713161696, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-prn1/161998_103469996353094_7221867_q.jpg", :atenders => 4222, :privacy => nil, :created_at => "2012-11-19 19:58:45", :updated_at => "2012-11-19 19:58:45" },
  { :name => "Campeonato Ramas JMU Schoenstatt", :longitude => -100.4351848, :latitude => 20.5480926, :gmaps => true, :description => "Gran Primer Campeonato interno de todas las ramas de jmu de schoenstatt! Cabros se viene con todo, el próximo sábado 24 en la mañana en bellavista, un tremendo campeonato de futbolito pa pasarlo bien y pasarlo bien nomás! Toda la mañana de fútbol para terminar con unos choripanes y algo para tomar! Participan\n\n-Rama Maipu\n-Rama Nuevo Belen\n-Rama Campanario\n-Rama Buin\n-Rama Bellavista\n-Rama Providencia\n-Otros invitados, posiblemente equipo de seminarista o alguna rama de provincia que se motive a venir\n\nSábado 24, de 10 a 14 hrs, Bellavista, Patio de las cebollas, al lado de la casa de la jmu! Empezamos con una oración en el Santuario a las 10 en punto.\nAprovechemos la oportunidad para encontrarnos, conocernos y pasar un buen rato. Aquí abajo reglas del campeonato!\n\n--------\n\nREGLAS DEL CAMPEONATO\n\n-Equipos de 6 jugadores en cancha, 9 inscritos.\n-Los equipos pueden estar formado por integrantes de cualquier rama\n-Partidos de 15 minutos\n-Cambios libres durante partido\n-El sistema de campeonato (eliminatorias, grupos, etc) se definirá dependiendo de cantidad de equipos inscritos\n-Inscripción 6 luca x equipo (para costear medallas, asado, bebidas)\n-Todo aquel que no tenga equipo pero quiero jugar igual escribir a felipealamos@gmail.com para armar equipos entre los que estén en la misma.\n-Inscripciones antes del viernes 23 aquí (1 inscripción por equipo): \nhttps://docs.google.com/spreadsheet/viewform?formkey=dFJlTXJZQ3NpTkNuNnZ4RjRzeDlSenc6MQ", :start_time => "2012-11-24 08:00:00", :end_time => "2012-11-24 12:00:00", :address => "Residencial Bellavista 11C, Bellavista, 76900 El Pueblito, Querétaro, Mexico", :fb_id => 552115374803860, :owner_id => 729336891, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276419_552115374803860_2036902044_q.jpg", :atenders => 20, :privacy => nil, :created_at => "2012-11-19 19:58:51", :updated_at => "2012-11-19 19:58:51" },
  { :name => "Carbon Ariztía!!", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Se viene el 18 y la epoca de asados!! por eso estamos vendiendo Carbón 100% de espino  A $7.000 el saco de 10Kg REPARTO A DOMICILIO!!\nEste carbon es producido en nuestro campo  lo pasamos por coladores para evitar los pedazos chicos y todo ese polvo de mierda!\ninteresado llamar al:\n9-6985998 José Antonio Rodríguez\n8-2291391 Pedro Ariztia", :start_time => "2013-02-28 02:00:00", :end_time => "2013-03-01 02:00:00", :address => nil, :fb_id => 329871703769036, :owner_id => 740267365, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373684_329871703769036_2032531872_q.jpg", :atenders => 201, :privacy => nil, :created_at => "2012-11-19 19:58:55", :updated_at => "2012-11-19 19:58:55" },
  { :name => "The Only Pi Day of Our Lives", :longitude => -109.3429769, :latitude => 37.5210025, :gmaps => true, :description => "In memory of Jarrod Newton...  3/14 of '87 to 08/26/2011,\n\nYes, the time is upon us. Everyone knows pi day is March 14th, but any true nerd realizes pi is not 3.14, but rather an irrational constant which continues infinitely in decimal expansion. Starting at 9:26:53 (.589... sec) AM, the longest extended Pi Day of our lives will come into action. The date, at the AM and PM hours, will be \" 3/14/15 at 9:26:53.589. Days like this only come once in a lifetime! \n\nIt is understood 1592 was a better year. This was probably the greatest pi day in history. Every 100 years (1915, 2015, 2115 etc) come the next closest pi days. It is also understood there are other minor pi days (be creative). Yes, 22/7 is pi approximation day -- But it's not that accurate! I wrote this just for all you people who like to find missing details written in nerd events. I'm sure you'll still find more ;)\n\nIf you're a nerd, you will invite ANY other nerd you know :D\n\nInvite all your friends and let's make this the number one nerd event on facebook ;)\n\nPi = \n4*Sum[(-1)^i/ (2*i+1) ,{i,0, infinity}]\n= 4*( 1 - 1/3 + 1/5 - 1/7 + 1/9-...)\n\nThis formula can be derived using the Taylor series for arctan via integration, namely arctan[x] = integral[1/(1+t^2),{t,0,x}] \nand writing 1/(1+t^2) as a geometric sum with generator -t^2. \n\n\n***We recently have begun selling some epic wrist bands (like the yellow livestrong ones etc) that have pi day information. \"Pi Day 3/14/15 9:26:53...\" For more information visit http://thepidayofourlives.homestead.com/\n\n^ Are awesome, you know you want one :D", :start_time => "2015-03-14 09:00:00", :end_time => "2015-03-14 21:30:00", :address => "Around the World Rd, Blanding, UT 84511, USA", :fb_id => 328804572620, :owner_id => 547689430, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofil