  { :name => "ACTIVAMOS LA RED!!! 'me gusta'", :longitude => -0.000131, :latitude => 0.000231, :gmaps => true, :description => "HOLA A TODOS! \n\nEMPECEMOS A COMPARTIR toda esta tarea que, EN CONJUNTO,  estamos realizando!! \n\nhe estado viendo que hay gente que se reune, que hace eventos, actividades y demás cosas en sus ciudades; también hay gente que pone noticias, canalizaciones e información muy interesante. Con el equipo de trabajo hemos hecho algunas modificaciones en el blog, la idea es ir compartiendo alli esta parte del CAMINO que van recorriendo ustedes, desde sus lugares. \n\nQUE SE CORRA LA VOZ!!!\n\nLOS INVITO A:\n\n- Suscribirse al blog: sigan el link en la columna del lado izquierdo, abajo! http://harwitumharwitum.blogspot.com.ar\n\n- Harwitum 'me gusta' \nhttps://www.facebook.com/HARWITUM\n\n- Escribir al harwinoticias@gmail.com, cuando organicen actividades o si crean algún grupo Harwitun de activación en sus localidades. \nQueremos  ir renovando semanalmente las actividades que todos ustedes van coordinando... \n\n- Ayudarnos a DIFUNDIR!!! con twiter, facebook, mail.\n\nQUE SE CORRA LA VOZ!!!\n\nUn gran saludo a todos, seguimos caminado...\n\nMATIAS\n\n(la fecha la tuve que poner xq sino no podía subir el evento, es un evento para dar difusión)", :start_time => "2012-11-22 02:00:00", :end_time => "2012-11-23 02:00:00", :address => "EN TODOS LADOS!!!", :fb_id => 393069694088757, :owner_id => 100003303705840, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash3/50392_393069694088757_1989404120_q.jpg", :atenders => 825, :privacy => nil, :created_at => "2012-11-19 20:00:07", :updated_at => "2012-11-19 20:00:07" },
  { :name => "Alumni Supper 2012", :longitude => -70.54569719999999, :latitude => -33.3370997, :gmaps => true, :description => "Supper 2012: New House, Same Spirit\n\nTe invitamos a conocer e impregnar nuestro school spirit en la nueva casa SC. Tu presencia es fundamental para hacer de esta ceremonia un momento inolvidable. Invita a tus ex compañeros, a recordar momentos únicos de nuestro paso por el colegio. ¡Es el comienzo de una nueva etapa y tú no te la puedes perder!\n\nVenta de entradas\nEste año, para facilitar la venta de entradas y entregarles un mejor servicio, contamos con el auspicio de Chilexpress, que dispondrá, a través de su sitio web y un importante número de oficinas, la venta de tickets. Por esta vía, los ex alumnos podrán comprar su boleto de una manera más rápida y cómoda. No se venderán entradas en las oficinas de Alumni como en años anteriores.\n\nLas entradas saldrán a la venta mediante esta vía desde el martes 9 de octubre y hasta el día 4 de noviembre.\n\nLas modalidades de compra serán las siguientes:\n\n1. Compra electrónica:\n    - Cada ex alumno debe ingresar al sitio www.ticket-express.cl\n    - Buscar e ingresar al evento: Santiago College Alumni Supper 2012.\n    - Ingresar los datos solicitados por el sistema \n    - Ingresar pago\n    - Escoger modalidad de entrega del ticket:\n      - Impresión electrónica\n      - Envío a Domicilio (Es la misma entrada que puedes imprimir, posee un costo adicional)\n\n\n2. Compra presencial:\nOficinas de Chilexpress ubicadas en:\n    - Alto Las Condes (Las Condes)\n    - Parque Arauco (Las Condes)\n    - Vitacura 6975 (Vitactura)\n    - Bandera 200 (Santiago)\n    - Las Condes 12340-9\n    - Apumanque (Las Condes)\n    - Paseo Estado 378 (Santiago)\n    - Isidora Goyenechea 2966 (Las Condes)\n    - Providencia 2246 (Providencia)\n    - Irarrazaval 2716 (Nuñoa)\n    - Alejandro Fleming 8898. Strip Center, local 11 (La Reina)\n    - Arturo Prat 677 (Antofagasta)\n    - Colo Colo 430 (Concepcion)\n    - Caupolican 1217 (Temuco)\n\n¡No te quedes sin entrada, los cupos son limitados!\n\nIMPORTANTE\n\n    - El evento Alumni Supper está dirigido sólo para Ex Alumnos del Colegio Santiago College.\n    - La entrada será personal e intransferible, y estará asociada al RUT de cada Alumni. Esto será verificado por códigos de barra electrónicos en la entrada del evento. Se exigirá cédula de identidad a todos los asistentes. NO se permitirá el ingreso sin la presentación de ambos documentos.\n    - El ticket de entrada no podrá ser utilizado por otro ex alumno una vez que éste se registra bajo su nombre y CLASS de egreso al momento de la compra. Cualquier cambio deberá ser realizado antes del 23/11/12, de lo contrario, no podrá ser reutilizado por otro ex alumno. Cada caso debe ser revisado de forma personal, antes de la fecha mencionada, en oficina de Alumni.\n    - Cualquier duda, consultar en oficina de Alumni Association, teléfono (562) 733 8896", :start_time => "2012-12-06 17:30:00", :end_time => "2012-12-06 20:30:00", :address => "Camino Los Trapenses 4299, Lo Barnechea, Santiago Metropolitan Region, Chile", :fb_id => 221875341271548, :owner_id => 132335486778347, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/372923_221875341271548_1308849407_q.jpg", :atenders => 671, :privacy => nil, :created_at => "2012-11-19 20:00:29", :updated_at => "2012-11-19 20:00:29" },
  { :name => "THE MISPERS FIRST LONDON SHOW", :longitude => -0.0925862, :latitude => 51.51250169999999, :gmaps => true, :description => "The time is nye. The wait is almost over. So everyone just chill the fuck out alright?!?!!? \n\nThe Mispers first London show:\n\nThursday, November 29th. \nQueen of Hoxton\n20:00\n\n\"One of the best bands I've EVER heard\"- Everyone\n\n\"Best New Band 2012\"- Important newspaper\n\nDon't forget to say Mispers at the door. \n\nLove\nx\n\n\n\n", :start_time => "2012-11-29 15:00:00", :end_time => "2012-11-29 18:00:00", :address => "71 Queen St, City of London, EC2R, UK", :fb_id => 173872032752029, :owner_id => 1611810076, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373176_173872032752029_1647534686_q.jpg", :atenders => 61, :privacy => nil, :created_at => "2012-11-19 20:00:34", :updated_at => "2012-11-19 20:00:34" },
  { :name => "Encuesta Smartphones", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Hola a todos! Por favor respondan esta encuesta, sería de gran ayuda para un trabajo en la universidad!\nSaludos a todos y gracias por su tiempo.\n\nEste es el link:\nhttps://docs.google.com/spreadsheet/viewform?fromEmail=true&formkey=dC1CbndpZXQwUXFBTTRkS2VXWXFWbEE6MQ", :start_time => "2012-11-21 02:00:00", :end_time => "2012-11-22 02:00:00", :address => nil, :fb_id => 381351865275475, :owner_id => 550958096, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/static-ak/rsrc.php/v2/yE/r/tKlGLd_GmXe.png", :atenders => 24, :privacy => nil, :created_at => "2012-11-19 20:00:47", :updated_at => "2012-11-19 20:00:47" },
