  { :name => "\"TODOS LOS GRANDES ACTORES SON MUJERES\" Egreso Universidad Mayor", :longitude => -69.9833333, :latitude => 18.5, :gmaps => true, :description => "Universidad Mayor\n \nFacultad de Artes, dirigida por el Decano Héctor Noguera y la Escuela de Teatro dirigida por Alexis Moreno, presenta:\n \nEgreso “TODOS LOS GRANDES ACTORES SON MUJERES”, segundo egreso de la generación 2012 de la Escuela de Teatro.\n \nDirección: Cristián Plana\n \nAsistente de dirección: Valentina Jorquera\n \nElenco:    Yenedith Arias\n                Sebastián Bretón\n                Catalina Cerda\n                Víctor Díaz\n                Estefanía Duarte\n                Valentina Flores\n                Simone Muñoz\n                Camila Núñez\n                Natalia Ríos\n                Víctor Silva\n \nDiseño Integral: Belén Abarza\nMúsica: Diego Noguera\nGráfica: Hernán Rodríguez\n \nMontaje de egreso estructurado a partir de diversos textos teatrales (\"Saverio el cruel\" de Roberto Arlt, \"Las sirvientas\" de Jean Genet y \"Las bacantes\" de Eurípides) cuya mezcla dramática permite construir una reflexión escénica en torno al fenómeno de la actuación entendido como un territorio ambiguo, donde los límites de lo real y la ficción, la verdad y la mentira, lo femenino y lo masculino han sido disueltos, creando un cuerpo colectivo dionisiaco, portador de una ritualidad promiscua y trágica.\n\nDel 26 de noviembre al 4 de diciembre a las 21 horas. / Domingo 02 de Diciembre no hay función.\n\nFacultad de Arte, Sala de Teatro de la Universidad Mayor\nSanto Domingo #711 esquina Mac Iver, Santiago Centro (Metro Bellas Artes)\n\nReservas al teléfono 328 18 67- 65 / CUPOS LIMITADOS\n\n\nENTRADA LIBERADA\n\n(RECORDATORIO: La función EMPIEZA a las 21 hrs. Llegar con anticipación, una vez iniciada la función NADIE podrá entrar)", :start_time => "2012-11-27 19:00:00", :end_time => "2012-12-04 19:00:00", :address => "Cuyaya, Santo Domingo, Dominican Republic", :fb_id => 3250548342683