  { :name => "Descarga gratis el PRIMER DISCO de LIMANDO !!", :longitude => -0.000282, :latitude => 0.000128, :gmaps => true, :description => "Revive el concierto de presentación del disco!\nhttp://www.youtube.com/watch?v=Hx4obHJ0c-o\n\nTras 10 años de trayectoria lanzamos nuestor primer disco!!\nDESCARGALO GRATIS AQUI http://www.putlocker.com/file/0244FD23585FF9C2\n\n\n¡¡¡ Invita a tus amigos a este evento para ayudarnos con la difusión de nuestro disco !!!  GRACIAS\n\nhttp://www.putlocker.com/file/0244FD23585FF9C2\n\nSólo tienes que hacer click en este enlace y seguir las instrucciones. Es rápido, sencillo y para toda la familia.\n\nDamos las gracias de antemano a todo aquél que se baje el disco, al que lo comparta y sobre todo a aquellos que invitéis  a todos vuestros amigos al evento para que puedan bajarse ellos también el CD y ayudarnos con la difusión.\n\nLo podreís adquirir fisicamente en cualquiera de nuestros conciertos o contactando con nosotr@s\n\nPara más información y fechas de conciertos visitar \nwww.myspace.com/limandoelserrucho\n\n¡¡¡ MUCHAS GRACIAS !!!\n\n", :start_time => "2013-05-04 02:00:00", :end_time => "2013-05-05 02:00:00", :address => nil, :fb_id => 306447499450182, :owner_id => 100000737133116, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373346_306447499450182_503476776_q.jpg", :atenders => 219, :privacy => nil, :created_at => "2012-11-19 20:01:03", :updated_at => "2012-11-19 20:01:03" },
  { :name => "San Francisco Juleball 2012", :longitude => -122.4194155, :latitude => 37.7749295, :gmaps => true, :description => "Juleballet i San Francisco har vært arrangert i mange år, og 2012 blir inget unntak. Studerer du i USA eller Canada er dette noe du ikke burde gå glipp av!\n\nTradisjonen tro starter torsdagen med en sosial runde golf på formiddagen, etterfulgt av en hyggelig thanksgiving middag på en av San Franciscos restauranter. Fredagen er dedikert til sightseeing, det blir arrangert båt tur som tar for seg de spektakulære omgivelser San Francisco har å by på. Høydepunktet kommer på lørdagen da juleballet arrangeres. Ballsal, taler, god mat og hyggelige nordmenn er utgangspunktet for en kveld som i seg selv er verdt turen til San Francisco! \n\nInformasjon om betaling kommer så fort vi får oversikt over hvor mange som skal være med. Eventuelle spørsmål kan sende til juleball12@gmail.com\n\nSett av helgen og gå til innkjøp av flybilett!!\n\nVi gleder oss til nok en vellykket helg her i San Francisco!\nMvh Juleball komitéen\n\n\nPS! Dette er en åpen evnt, så inviter venner og bekjente!\n\n\n---------------------------------------------------------------\n\n\nVi ønsker å få en ordentlig oversikt på hvem som ønsker å være med på de forskjellige aktivitetene på årets juleballhelg. Vi tar i første omgang utgangspunkt i disse prisene.\n\nGolf: 150 NOK\nYacht: 450 NOK\nBall: 750 NOK\n\nAlt totalt: 1350 NOK\n\nMan må ikke melde seg på alt, men vi anbefaler på det STERKESTE å delta på alle aktiviteter. Vi legger stor innsatt i planleggingen, og kan garanterer en konge helg!\n\nMerk at det ikke holder å være attending i denne gruppen, du MÅ sende inn en mail til juleball12@gmail.com og melde deg på!\n\nVennligst følg denne malen:\nFullt navn\nMail adresse\nØnskede aktiviteter: Golf, yacht, ball\n\nPÅMELDINGSFRIST 14. OKTOBER!\n\nBetalingsinfo kommer så fort vi har fått oversikt over hvor mange som deltar på de forskjellige aktivitetene. \n\n\n---------------------------------------------------------------\n\n\nFor å gjøre det klart for de som er usikre og lurer på hva ballhelgen inneholder. Her kommer noen stikkord.\n\nTorsdag:\n- uhøytidelig og sosial golfrunde, musikk og fri bar\n- samlet middag etterfulgt av en runde på byen\n\nFredag:\n- Yacht: sightseeing i bayen rundt San Francisco's omgivelser og fri bar\n- kvelden samles alle på en bar/utested\n\nLørdag:\n- Ball med middag etterfulgt av dansing og sosialisering til de sene nattetimer\n", :start_time => "2012-11-22 02:00:00", :end_time => "2012-11-23 02:00:00", :address => "1601-1645 Market St, San Francisco, CA 94103, USA", :fb_id => 198749730255044, :owner_id => 514941351, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373238_198749730255044_1169126410_q.jpg", :atenders => 260, :privacy => nil, :created_at => "2012-11-19 20:01:16", :updated_at => "2012-11-19 20:01:16" },
