  { :name => "Semifinal Sub 19 Old Girls - Por confirmar", :longitude => -70.5751185, :latitude => -33.3921217, :gmaps => true, :description => "Old Girls se encuentra este sábado en las semifinales del torneo nacional en el club manquehue. Los esperamos!!", :start_time => "2012-11-24 16:00:00", :end_time => "2012-11-24 19:00:00", :address => "Vitacura 5703-5901, Vitacura, Santiago Metropolitan Region, Chile", :fb_id => 296550920462562, :owner_id => 283315528416605, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/211178_296550920462562_2031421163_q.jpg", :atenders => 67, :privacy => nil, :created_at => "2012-11-19 20:02:24", :updated_at => "2012-11-19 20:02:24" },
  { :name => "TRABAJO PART-TIME", :longitude => -70.641997, :latitude => -33.4691199, :gmaps => true, :description => "Highlights es una productora dedicada a hacer diferentes tipos de eventos ya sea masivos o de acuerdo a sus requerimientos.\nPara esto estamos en busca de RRPP, Anfitrionas, Barman, Barwoman, Djs, Fotografos, Bandas, Garzones, etc.\nSi quieres trabajar con nosotros tienes que llenar el siguiente formulario y nos contactaremos contigo:\n\nhttp://numrl.com/highlights\n\n", :start_time => "2012-11-19 20:00:00", :end_time => "2013-02-27 23:00:00", :address => "Ñuble 646-690, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 369973653081834, :owner_id => 213114232095677, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/277100_369973653081834_290429653_q.jpg", :atenders => 0, :privacy => nil, :created_at => "2012-11-19 20:02:29", :updated_at => "2012-11-19 20:02:29" },
  { :name => "Año Nuevo Cota Zero Cachagua 2013", :longitude => -71.451964, :latitude => -32.580346, :gmaps => true, :description => "Dos de las productoras más innovadoras y vanguardistas de Santiago\n(La Aldea y Gran Santiago), se unen para presentar el Año Nuevo más increíble del 2013: \n\n✹ AÑO NUEVO COTA ZERO  CACHAGUA 2013 ✹\n\n➾ Ticketek: www.ticketek.cl/tktfunciones.aspx?evento=COTA+ZERO\n\n➾ Ubicación: Helipuerto, Club de Polo Cachagua.\n\n\nEnclavado en plena costa pacífico, el balneario de Cachagua y sus bondades naturales serán el telón de fondo de una noche mágica. El lugar perfecto para despedir este año y dar la bienvenida al cambio de ciclo. \n \nTodo esto acompañado de Live Act´s & Dj´s de alta factura, quienes serán los encargados de recargar tus energías y sensaciones a través de envolventes frecuencias melódicas.\n\n\n✹ Apertura de puertas: 23:30 Hrs || Cierre 06:50 ✹\n\n\nLINEUP♫♬\n\n\n➲ Live Act's \n\n\n♦ ASTRO\n\nEl sonido espacial de Astro ya no es novedad, hoy son referentes de una nueva generación musical que responde a la filosofía del desprejuicio y la iluminación de sonidos en base a una simple formula: seguir tus impulsos.\n\nSon una de las bandas con más presencia en el circuito nacional, exponentes de un pop fresco y luminoso, la cara más novedosa y exportable de la escena actual. \n\nCon solidas presentaciones en Lollapalooza, Mysteryland y Primavera Fauna, es hora de unir los planetas, alinear las estrellas y hacer a los astros brillar en Cota Zero.\n\nhttp://www.facebook.com/astrosonidoespacial\nhttp://www.myspace.com/astrosonidoespacial\n\n♦ MATANZA\n\nRecientemente firmados por el sello Europeo Anabatic Records, te presentamos a los maestros sonoro-espirituales del nuevo concepto electro andino que impregna el mundo en base a beats de vanguardia y frecuencias altruistas. Lo de Matanza es una mezcla única de dub, rave, house y folclor  altiplánico. \n\nLa mística de sus presentaciones son un espectáculo aparte, conectando en sintonía los conceptos fundamentales de una agrupación que tiene su origen en la tierra misma, ahí la importancia de dar protagonismo a los elementos orgánicos que dan vida a un show que fusiona raíces y modernidad. \n\nLuego de girar por segunda vez a través del viejo continente, y después de haber tocado en Lollapalooza Chile, Mysteryland y Primavera Fauna, Matanza está listo y dispuesto aterrizar en Cota Zero para recibir cargados de buenas vibras el 2013.\n\nhttp://www.facebook.com/Matanza.Music?fref=ts\nhttp://soundcloud.com/matanza\n\n♦ MECANICO\n\nLa banda revelación del 2012 toma las banderas de una generación y define el nuevo estilo de baile de una era. Catalogados por la prensa nacional e internacional como la nueva mejor banda de electropop del cono sur, Mecánico se autodefine como una agrupación sin etiquetas, cruzando estilos musicales sin prejuicios; desde el indie rock de suburbios pasando por break beats sacados del mejor soundtrack de los ochenta. \n\nTal fue su impacto sonoro que sus singles dieron la vuelta al mundo, recibiendo deliciosas críticas por parte de la prensa especializada de EE.UU, Australia, Francia, Alemania, Suecia, España e incluso países tan alejados como Indonesia. \n\nSus trabajos además han sido remixeados por dj´s de vanguardia tales como Kolt 13, Short Circuit y MoonChild, este último llegando al Top Ten del reconocido ranking de blogs internacionales, The Hype Machine.\n\nConfirmados a Lollapalooza 2013 y luego de presentarse el año pasado en Primavera Fauna y Mysteryland, Mecanico está listo para aterrizar con sus avalancha de beats en Año Nuevo Cota Zero 2013!\n\n\n\nhttp://www.facebook.com/mecanicomusic?fref=ts \nhttp://soundcloud.com/mecanicomusic\nhttp://mecanicomusic.com\n\n\n➲ Dj's \n\n\n♦ BUTANO\n\nDJ Consagrado en la escena electrónica Chilena. Ha tocado con importantes DJ's tanto nacionales, como internacionales, entre los cuales destacan: Audiofly, Mandy, Superpitcher, Reboot, Matias Kaden, Lineas de Nazca y muchos más.\n\nhttp://www.facebook.com/andre.butano?fref=ts\nhttp://soundcloud.com/andrebutano/\n\n♦ The Chronik\n\nDuo nacional integrado por Justin Page y Francisco Martínez. DJ's del genero Tech & Deep House con referentes como: Nick curly, Audiofly, Francisco allendes, Andre Butano, Mandy, Mihai Popoviciu entre otros. Actuales residentes de Alive.\n\nhttps://www.facebook.com/duothechronik\n\n♦ Felipe Suau\n\nSin ser DJ ni músico de profesión y estando más bien ligado a la publicidad, Felipe sin dudas se ha ganado un espacio en la escena. Fundador de Gudnois y colaborador en proyectos independientes varios, ha lanzado publicaciones en sellos como Cuantech Records (Holanda) y Fever (New York, USA) y compartido escenario con artistas como Cut Copy (Modular), Simian Mobile Disco (Kitsuné), Vicarious Bliss (Ed Banger), Warpaint (Rough Trade) entre otros. Este año nuevo nos hará bailar con una fina selección de house, disco y sonidos frescos como adelanto de un nuevo e inédito proyecto llamado PUNCHI PUNCHI, que busca acercar conceptos underground a un público chic.\n\nhttps://www.facebook.com/felipesuauofficial\n\n♦ Rodrigo Valdes\n\nRodrigo sabe muy bien como hacer bailar. Semana a semana se mueve en las mejores fiestas de la noche de Santiago, su estilo musical no tiene definición ni limites, desde lo mas comercial del electro y el progressive hasta lo mas under del house; todo es posible en un de sus dj set.\n\nHa compartido escenario con monstruos de la música como La Mala Rodrigues, Bob Sinclar, Calvin Harris, Laidback Luke,  Michael Woods, Nervo, Alesso & Fedde Le Grand. Su particular carisma y estilo de mezclar lo transforman en un dj que no puede faltar en una fiesta donde se quiera tener a uno de los mejores de la escena nocturna local.\n\nhttp://www.facebook.com/rodrigo.valdes.52?ref=ts&fref=ts\n\n♦ Juani Vender\n\nhttp://www.facebook.com/jivender?fref=ts\nhttp://soundcloud.com/juanivender\n\n♦ Domingo Sandoval\n\nhttp://www.facebook.com/domingosandoval?fref=ts\n\n\n\n➲ MAIN STAGE:\n\n- 23:00 - 00:00: ➔ Tello Rodriguez\n- 00:00 - 01:20: ➔ MECÁNICO (En Vivo)\n- 01:20 - 02:30: ➔ ASTRO (En Vivo)\n- 02:30 - 03:00: ➔ José Bacarreza \n- 03:00 - 04:00: ➔ Domingo Sandoval\n- 04:00 - 06:00: ➔ Rodrigo Valdes\n\n\n➲ ELECTRO-HOUSE STAGE: \n\n23:00 - 00:30: ➔ The Chronik\n12:30 - 02:00: ➔ Pato Salinas\n02:00 - 04:00: ➔ MATANZA (Live Act)\n04:00 - 05:30: ➔ Juani Vender\n05:30 - Cierre: ➔ ANDRE BUTANO\n\n◄ VENTA DE ENTRADAS ►\n\n➾ Pre venta 1 $15.000.-\n➾ Pre venta 2 $18.000.-\n➾ Pre venta 3 $20.000.-\n\n➾ Entrada General $25.000.-\n\n➾ Ticketek: www.ticketek.cl/tktfunciones.aspx?evento=COTA+ZERO\n\n➾ Información General COTA ZERO Año Nuevo Cachagua 2013\nhttps://www.facebook.com/pages/Cota-Zero/287611251357924\n\n\n\n\n\n\n\n\n\n\n\n", :start_time => "2012-12-31 21:50:00", :end_time => "2013-01-01 05:00:00", :address => "Los Molles, Zapallar, Valparaíso Region, Chile", :fb_id => 479969555375955, :owner_id => 287611251357924, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/276904_479969555375955_1989013977_q.jpg", :atenders => 400, :privacy => nil, :created_at => "2012-11-19 20:02:51", :updated_at => "2012-11-19 20:02:51" },
