  { :name => "¡Fiesta Buena Onda!", :longitude => -58.416199, :latitude => -34.5865141, :gmaps => true, :description => "Sábado 24/11  FIESTA BUENA ONDA!! en Club Araoz\nLas entradas son anticipadas y salen $20. Lo recaudado es  para realizar acciones solidarias el día de navidad y donaciones. Abajo esta el concepto del grupo para que conozcan nuestra propuesta!\nACCESO VIP- INGRESO HASTA 03:30 CON ANTICIPADAS- BARRA 2X1 (+21)\nPONGANLE ONDA QUE LOS ESPERAMOS!!\n\nhttp://www.facebook.com/groups/494004510621145/\n\nDÍA MUNDIAL DE LA BUENA ONDA\n\nPorque estamos cansados de la rutina y de que los días se nos vuelvan monótonos y pesados.\n\nPorque queremos disfrutar más de las cosas simples que están al alcance de la mano.\n\nPorque que nos interesa vivir mejor en sociedad.\n\nPorque tenemos la oportunidad de ser felices todos los días y hay que aprovecharla.\n\nY porque HOY es el camino que transitamos para un mejor MAÑANA:\n\nQUEREMOS INSTALAR EN LA ARGENTINA, LA CULTURA DE LA BUENA ONDA.\n\nPero, ¿qué sería la buena onda?\n\nEntendemos la buena onda como la capacidad de la persona de tener gestos sencillos que transmitan alegría. Un abrazo, una mirada cómplice, un escuchar al otro, una sonrisa, un favor, entre otras. Todos estos tipos de ingredientes conforman la BUENA ONDA.\n\n¿Y qué se pretende?\n\nSe busca lograr reunirnos en un día que sea festivo, en el cual, la gente pueda asomarse a la calle y vivir intensamente. Un día en el que la “rutina” sea una fiesta. La gente se salude con entusiasmo y fraternidad, nos podamos juntar en plazas a hacer grandes rondas de mates, haya globos en los colectivos y en el subte, las personas toquen sus instrumentos y canten en las esquinas, bailen en los balcones, etc. Básicamente se intenta encontrar el espacio para fusionarnos todos en un gran marco de Buena Onda colectiva.\n\n¿Qué día es el día?\n\nLa jornada será en plazas a confirmar a partir de las 16:00 hs del 21 de diciembre de 2012. Sí, de 2012, el famoso y mega promocionado día de cambios energéticos o catástrofes (según se mire).También es el día que empieza el verano, asique los signos para esa fecha sobran. Pero, nosotros queremos darle el mejor impulso a ese día, que realmente sea un momento en el que podamos compartir lo mejor de cada uno, con el otro. Queremos una fiesta. Que nos sirva para ir despidiendo el año de la mejor manera y recibir el nuevo con todas las pilas, pero por sobre todo pretendemos darnos la posibilidad de experimentar en cuerpo y vida la Buena Onda!\n\nY ESTÁN TODOS INVITADOS!!", :start_time => "2012-11-24 02:00:00", :end_time => "2012-11-25 02:00:00", :address => "Aráoz 2401-2499, Buenos Aires, Autonomous City of Buenos Aires, Argentina", :fb_id => 135730099909047, :owner_id => 436356649735505, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/277035_135730099909047_422621951_q.jpg", :atenders => 36, :privacy => nil, :created_at => "2012-11-19 20:03:33", :updated_at => "2012-11-19 20:03:33" },
