  { :name => "Formación Terapeuta Respiración Ovárica y Alquimia Femenina / 12 - 16 de Diciembre", :longitude => -70.641997, :latitude => -33.4691199, :gmaps => true, :description => "Por primera vez en Chile Sajeeva Hurtado ofrecerá la Formación de Terapeuta en Respiración Ovárica y Alquimia Femenina. \n\nSajeeva se desempeña como psicoterapeuta corporal, especializada en Medicina tradicional china para patologías femeninas. Iniciada en Tantra Shivaista de Cashemire. Además, tallerista internacional, ha recorrido mas de diez países impartiendo talleres para el despertar de la conciencia femenina. \n\n¿En qué consiste la Formación de Terapeuta en Respiración Ovárica y Alquimia Femenina?\n\nLos ovarios, el útero y los senos son la parte de la anatomía femenina con más potencial energético de todo el organismo, es allí donde se encuentra intrínsecamente la semilla de la vida. La técnica de respiración ovárica, reúne diferentes secuencias que nos ayudan a contactar con esta energía y aprender a utilizarla en pro de nuestra propia sanación y poderla compartir con otras mujeres.\n \n\n\nEs un proceso de sensibilización, conciencia, limpieza y purificación energética, una vez tomado el contacto con esta energía entramos en una segunda faceta, de distribución y sanación alquímica, este proceso nos permite, mantener el flujo energético de nuestro cuerpo fluido y libre, y así no solo prevenir y tratar enfermedades si no también vivir una vida mas plena y fértil, y al decir fértil nos referimos a un sentido más amplio de la palabra, que solo concebir hijos físicos. \n\n\nLa mujer es la fuente creativa del universo, es el gran útero creador, donde todo lo que se siembra florece. Y esa energía que solventa esa vida, proviene de los óvulos que se generan en los ovarios. Cuando una mujer sede su poder, ósea sede su energía creativa (sexual), y se deja penetrar indiscriminadamente, no solo por hombres variados si no por el entorno, llena sus distintos cuerpos por una capa energética densa que consume su energía vital y la aleja de su poder personal, el cual es por naturaleza el poder de la creación, contactar de nuevo con nuestro poder personal activa inmediatamente al sanador o maestro interior que es realmente en quien nos debemos apoyar, para realizar el tránsito de esta vida alineadas con nuestras misión.\n \nEn la práctica tanto en consulta como en grupo de la respiración nos orientamos a llevar a la practicante a alinear la mente las emociones y el cuerpo y a través del contacto con uno de ellos poder desbloquear los otros, retomando la unidad y llevando a la persona a la integración de sus distintas partes.\n Muchos de los bloqueos con los que nos encontramos en el cuerpo vienen dados por creencias, por introyectos, por nuestra raza, credo y lugar donde vivimos, ya que cada cultura tiene una concepción distinta de la energía sexual y de lo que significa ser mujer, eso marca ampliamente nuestra actitud hacia esta energía, por eso parte del proceso va orientado a la limpieza emocional y mental, y a la separación del yo y el entorno, a través de técnicas de la Psicología Gestáltica y de pautas lingüísticas.\n \n\n\nDurante la práctica de la Respiración Ovárica, Alquimia Femenina, se aprenden distintas técnicas tántricas y taoístas para poder alquimizar y depurar las capas mentales, emocionales y físicas que nos alejan del ser. \n\n\n\nLas técnicas de la Respiración Ovárica, Alquimia Femenina, nos aportan herramientas de trabajo personal con las cuales poder desprender los distintos paradigmas de mi mente, y así poder modificar mi emocionalidad y sanar mi templo.\n \n\n\nEs planetariamente urgente que la mujer sane su útero, se alinee con su feminidad, integre su masculinidad y resignifique la sexualidad.\n Este es un llamado a todas las mujeres a recuperar y vivir su potencial femenino, que está latente bajo capas de nuestras mentes, emociones o de desarmonías de nuestros cuerpos. \n\n\nObjetivos de la técnica\n \n- Recuperar la conexión con la sabiduría de nuestro cuerpo, emociones e intuición. \n- Desarrollar recursos personales que favorezcan el proceso de sanación de la practicante.\n- Soltar bloqueos físicos, mentales y emocionales y abrirnos a la energía sexual creativa que habita en cada una de nosotras. \n- Resignificar nuestro cuerpo, la sexualidad la sensualidad y la fertilidad. - mejorar nuestro conocimiento personal a través del contacto íntimo conmigo misma.\n- Desarrollar una mejor autoestima, equilibrio emocional y confianza. - actuar sobre patologías especificas como cáncer, problemas menstruales, de fertilidad o de más desarmonías orgánicas femeninas.\n \n\nObjetivos del entrenamiento para Profesoras y Terapeutas\n\n\n - Aportar al practicante el conocimiento profundo de las distintas disciplinas por las cuales esta diseñada esta técnica.\n-  Dar nociones básicas de la medicina tradicional china y su práctica.\n- Brindar herramientas necesarias para poder hacer un diagnóstico y un tratamiento personalizado.\n - Conducir al practicante a la comprensión de la técnica a través de la propia vivencia.\n- Capacitar a las estudiantes en el manejo interdisciplinario de la técnica.\n- Impulsar a cada una a inyectar su dosis personal y descubrir su talento y misión e integrarla su propia práctica, respetando los conceptos básicos de la técnica. \n\n\n\nDirigido a:\n Terapeutas, Médicos, Psicólogos, Doulas, Yoguis, Meditadores, Enfermeras, a todas las personas que trabajen y estén en contacto con mujeres y quieran aportar en el proceso de desarrollo de estas y a mujeres que lo quieran hacer simplemente por su propia sanación y desarrollo.\n \nMetodología\nEsta técnica fue creada por Sajeeva Hurtado, graduada en medicina china y especializada en china y Vietnam en patologías femeninas. Desarrolló esta técnica fusionando distintas disciplinas como el Taoísmo, el Tantrismo, el Chamanismo, la Medicina china, el Yoga , la Psicología Gestalt, el Arte terapia y el Coach Oncológico. Teniendo como resultado una técnica que sirve para el autoconocimiento y sanación de la mujer de forma holística, abarcando la mente, las emociones y el cuerpo. Con la cual al día de hoy mas de mil mujeres alrededor del mundo, han tratado problemas de salud, como quistes en los ovarios y en las mamas, problemas de depresión, duelos, bajo autoestima y problemas de fertilidad entre otros.\n \n\nCertificación y temario\n Para poder recibir el certificado y trabajar con la técnica en consulta y en el desarrollo de grupos es necesario tener el 100% de las horas de trabajo realizadas, más la entrega de trabajos y una tesina.\n El entrenamiento tiene un total de 50 horas practicas.\n\nTemario\n- Teoría de los cinco elementos.\n- Teoría de la polaridad.\n- Teoría de los centros energéticos y los cuerpos sutiles.\n- Teoría energética y física sobre el aparato reproductor.\n- Teoría alquímica y tántrica.\n- Visión de la enfermedad según la medicina tradicional china.\n- Secuencias de respiración ovárica según el chakra.\n- Secuencias de respiración ovárica según el órgano y emoción afectado.  \n- Ejercicios de limpieza, energetización y sanación energética.\n- Respiración alquímica, de pie, acostado, en movimiento.\n- Diagnóstico energético según el pulso.\n- Tratamiento y aplicaciones clínicas según el pulso y las topologías.\n- Meditaciones alquímicas.\n- Trabajo emocional y mental a través de técnicas de la Psicología Gestáltica y el Coaching Ontológico.\n- Intervención y manejo del grupo.\n- Técnicas integrativas.\n- Arte terapia.\n- Danza terapia.\n \nFechas y costos\nDesde el 12 al 16 de Diciembre 2012\nValor: $600 dólares\nValor estudiantes: $500 dólares\nPara reservar tu cupo: 50 dólares\nNota: el entrenamiento solo se llevará a cabo si hay el número mínimo de alumnas inscritos con su reserva.\n \nContácto, Dudas e Inscripciones:\n\nCarla Silva Osorio\n\nPsicóloga - Terapeuta floral\n \nEmail: carla.silva.osorio@gmail.com\n \nTeléfono: 88687245\n\nLugar: Santiago de Chile (lugar exacto por definir)", :start_time => "2012-12-12 02:00:00", :end_time => "2012-12-13 02:00:00", :address => "Ñuble 646-690, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 120614468090955, :owner_id => 894895397, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373155_120614468090955_2089465635_q.jpg", :atenders => 55, :privacy => nil, :created_at => "2012-11-19 20:04:36", :updated_at => "2012-11-19 20:04:36" },
