  { :name => "Total Solar Eclipse", :longitude => -2.0853567, :latitude => 53.35701770000001, :gmaps => true, :description => "http://en.wikipedia.org/wiki/Solar_eclipse_of_August_21,_2017\n\nThis will be the first solar eclipse visible from the contiguous United States since 1979! Don't miss it, since the next one we'll be able to see won't be until April 2024.\n\nThe longest duration of totality will be for 2 minutes 40 seconds in Christian County, Kentucky (36°58.5′N 87°39.3′W), so start planning that road trip now before everyone else finds out!", :start_time => "2017-08-21 15:00:00", :end_time => "2017-08-21 21:00:00", :address => "Planet Earth, Middlewood Rd, Poynton, Stockport, Cheshire SK12 1TX, UK", :fb_id => 164606643572054, :owner_id => 673343221, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash3/41574_164606643572054_7992749_q.jpg", :atenders => 4791, :privacy => nil, :created_at => "2012-11-19 20:08:35", :updated_at => "2012-11-19 20:08:35" },
