  { :name => "El Habanero / Miércoles 21 Noviembre / Club Eve", :longitude => -66.6682557, :latitude => 10.2457299, :gmaps => true, :description => "EL HABANERO, tu break a mitad de semana! \nTe esperamos este miércoles con unas ricas mesas de cortesía desde las 21:00 hrs. \n\nLas mejores ofertas en barra!!\n2 Piscolas Alto del Carmen x $5.000 toda la noche.\n2 Skyy Vodka x $6.000 toda la noche.\n\nTe esperamos este miércoles 21 de noviembre para compartir y comentar el gran fin de semana largo que nos llena de energía para empezar el mes.\n\nApertura Puertas: 21:00 hrs. \nEntregamos un 50% de descuento en Carta de Comida hasta las 01:00 hrs. \n\nSeguiremos viviendo esta experiencia Miércoles por medio, donde buscamos hacer un break en tu semana para dedicarle tiempo a los amigos y compartir un momento agradable. \nPara esto EL HABANERO se la juega con un rico picoteo y con una atención de calidad como te lo mereces. Este miércoles seguimos con los Mojitos y Daikiris para quienes lleguen temprano y hacer aun mas grata esta experiencia.\n\nTambién tenemos beneficios para los que NO lleguen temprano, ya que contactando a nuestros embajadores podrán recibir sus invitaciones directamente al celular.\n\nHabaneras y Habaneros: Invitaciones validas hasta las 00:30\n\nEL HABANERO tiene capacidad limitada por lo que te invitamos a llegar temprano y aprovechar todos los beneficios que tenemos para ti.\n\nTenemos la mejor promoción para los piscoleros! \n2 Piscolas Alto del Carmen x $5.000 toda la noche.\n\nEste Miércoles 21 tendremos nuestros DJ’s residentes y anfitrionas que estarán pintando fluor a los asistentes para bailar toda la noche!\n\n\nLINE UP:\n\nCRISTOBAL SALOM / Indie Hits & Electro-Pop\n\nFERNANDO VARGAS / Ultra-Bailable & Matri-Style\n\n\nPRECIO: $5.000 Entrada General\n\nAuspicia: Corona / Skyy Vodka\n\nEL HABANERO se Reserva el Derecho de Admisión\n\n→ COOL DRESS CODE\n→ MESAS DE CORTESIA E INVITACIONES POR PARTE DE LOS EMBAJADORES\n→ CUPOS INVITACIONES LIMITADOS (250 PERSONAS GRATIS)\n→ EVENTO EXCLUSIVO PARA MAYORES DE 23 (1989 EN ADELANTE)", :start_time => "2012-11-21 19:00:00", :end_time => "2012-11-22 01:55:00", :address => "Avenida Ayacucho, Santa Teresa, Venezuela", :fb_id => 533866446642409, :owner_id => 100004429093646, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/372917_533866446642409_2123313148_q.jpg", :atenders => 252, :privacy => nil, :created_at => "2012-11-19 20:08:52", :updated_at => "2012-11-19 20:08:52" },
  { :name => "VENTA ENTRADAS ULTRA CHILE Javier", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "IMPERDIBLE\nNuestro primer line up los sorprendió Avicci Carl Cox 24/7 (official page) Dash Berlin Armin van Buuren son recién los primeros 4 Djs de más de 20 que te harán vivir una experiencia única!\n\nAprovechen ahora la Pre Venta y no se pierdan ningún minuto de #UltraChile 2013.\n\n\nDesde el ticket 5001 en adelante $ 42.000 por día y $ 58.000 weekend.\n\nRESERVEN VIA INBOX!!!! o en el evento!!\nJavier González de la Vega G.\n\nhttp://www.facebook.com/UltraChileOficial\n", :start_time => "2013-02-22 02:00:00", :end_time => "2013-02-23 02:00:00", :address => nil, :fb_id => 108992269264960, :owner_id => 1145025952, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373030_108992269264960_1324448627_q.jpg", :atenders => 30, :privacy => nil, :created_at => "2012-11-19 20:08:57", :updated_at => "2012-11-19 20:08:57" },
  { :name => "Cabane à Sucre / Sugar Sack", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Finally the activity that you have all been waiting for THE SUGAR SHACK. Come experience this typical Quebec tradition with your friends and the CAI.\nUpon arriving, we will visit the facility to see how the maple syrup is made, the process from getting the maple water from the tree until the last final step of canning it before sending it off to be sold. We will take a short train ride into the maple fields; you will be able to see the complicated process of collecting the water.  Right after, the tour of the maple syrup it will be time to eat, what are we going to eat other than a typical meal Quebecois. During the night, there will be lots of animation, lots of dancing and best of all the typical Quebec line dancing. I hope you are ready for this once in a life time Quebec experience. For those who are interested, we have negotiated a special price; a pitcher of draft beer will be $11. And what better way to end the night, than having a maple lollipop (hot maple syrup poured on snow, then you take a popsicle stick and roll your own maple taffy) the only problem is to just eat one.\n\nCome and enjoy this memorable experience with us on November 30. We will be leaving from parking lot in front of the FSA at 5PM.\n\nPrice\n$25 for the first hundred (100) students \n$30 for the rest\n\n*****There will be a prize for the best costume lumberjack / traditional Québecois******\n\nVoici l'activité attendu de tous la CABANE À SUCRE. Venez vivre cette expérience avec nous. Nous allons vous faire vivre une vrai soirée des sucres!!\n\nTout d'abord vous aller faire la visite des installations de la cabane et voir comment le sirop d'érable est fabriqué. Ensuite, nous allons faire un tour de train dans l'érablière, vous verrez le système de collecte de l'eau d'érable et tout le fonctionnement. Nous allons manger un repas typiquement québecois pendant le temps des sucres. Nous aurons même une initiation à la dance québecoise après le repas. Et comment finir mieux la soirée que de manger de la tire sur neige! Pour les intéressés nous avons un prix spécial sur le pichet de draft qui est de 11$!!!\n\nVenez vivre cet expérience mémorable avec nous le 30 novembre. Le départ se fera dans le stationnement du PAP à 17h.\n\nLes prix:\n\n25$ pour les 100 premières personnes à s'inscrire au CAI\n30$ pour les autres!!\n\n**** Il y aura un prix pour le meilleur déguisement de bucheron/traditionnel Québecois****", :start_time => "2012-11-30 17:00:00", :end_time => "2012-12-01 00:30:00", :address => "Cabane à sucre Napert", :fb_id => 487194584654164, :owner_id => 692509638, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/188125_487194584654164_1811534278_q.jpg", :atenders => 178, :privacy => nil, :created_at => "2012-11-19 20:09:09", :updated_at => "2012-11-19 20:09:09" },
