  { :name => "Lista CAAPSI \" Crece 2013\"", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Presidente: Jaime Rodriguez\nVicepresidente: Joaquín Mellado\nTesorero: Camila Badiola\nSecretaria: Constanza Parada\n\nEncargada de eventos: Pia Ossa\nEcargada de cultura: María Ignacia Pérez\nSecretaria ejecutiva: Nicole Rosmanich\nAcción social: Osvaldo Parra\nAsuntos estudiantiles: Javiera Aylwin\nRelaciones publicas:Javiera Cid\n\n\nBuscamos re significar la carrera no sólo de manera externa, sino que también de una manera interna: mejorar la visión propia que tenemos como psicólogos y dónde nos situamos dentro de la universidad.\n\nEsto lo queremos poner en practica a través de charlas y talleres. Con el fin de desarrollar nuevas, o completar antiguas, habilidades y capacidades personales y colectivas. Aprovechando además de crear una instancia de crecimiento en el vínculo profesor-alumno.\n\nProyectos:\n\n-Talleres prácticos para la comunidad de psicología, realizados por expertos en dichos temas (ejemplos: biodanza, alimentación, educación, psicoterapia, etcétera).\n-Charlas de profesores, alumnos, ex-alumnos, profesionales, etcétera.\n-Ciclos de terapias para darlas a conocer y experimentar nuevas maneras de abordar la psicología.\n-Al menos un mambo al mes.\n-Ocupar espacios verdes de la universidad para el desarrollo de las actividades anteriormente mencionadas.\n-Mejorar la inclusión profesores-alumnos.\n-Celebrar el día del psicólogo.\n-Discutir y evaluar horas de clases destinadas a los electivos de la carrera, tanto organizacionales como clínicos.\n-Gala únicamente de psicología.\n-Día del auxiliar UAI\n-Más relaciones con los psicólogos de viña\n-Feria de las Pulgas\n\nINVITAMOS A TODOS A PARTICIPAR Y CREAR CONJUNTAMENTE NUESTRO GRAN PROYECTO: SER UNA ESCUELA DE PSICOLOGÍA ACTIVA Y UNIDA\n\nVotaciones 12 y 13 de noviembre\n\n¡ CRECE 2013 !\n", :start_time => "2013-03-01 02:00:00", :end_time => "2013-03-02 02:00:00", :address => nil, :fb_id => 381476778588021, :owner_id => 1110153218, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/211194_381476778588021_1859766282_q.jpg", :atenders => 63, :privacy => nil, :created_at => "2012-11-19 20:20:34", :updated_at => "2012-11-19 20:20:34" },
