  { :name => "Proyecto a beneficiencia, ayuda porfavor", :longitude => 0.000147, :latitude => 0.000235, :gmaps => true, :description => "Hola amigos, otra vez estamos llevando a cabo un proyecto para la U, pero esta vez es un evento a beneficiencia, que consta en ayudar a los niños del jardín Los enanitos de lo barnechea, al cual van niños en riesgo social hasta 4 años aproximadamente\n\nLa ayuda consta en lograr reconstruir su jardín que está en bastantes malas condiciones, y aportarles con juguetes, libros, etc. además de pinturas, brochas, cemento, baldozas (materiales para ayudar a reconstruir), utencilios de limpieza, etc. todo aporte es bienvenido :)\n\nLa idea es que si pudiesen aportarnos con algo se contacten con nosotros lo antes posible y lo vamos a buscar.\n\nSi les complica/molesta dar ayuda via facebook, aqui estan los encargados del proyecto a beneficio y comuniquese con alguno de nosotros, cualquier cooperacion, ayuda nos sirve para reconstruir el jardin y lograr ayudar a los niños,\n\n-Carolina Lopez: 8.7286511\n-Constanza Franco: 9.3192392\n-Jose Ortuzar: 9.9670012\n-Maria Belen Sanchez: 7.6158483\n-Matias Gomez: 9.8856514\n-Paula Gimenez: 5.0514075\n\nOjalá puendan ayudarnos, muchas gracias :)", :start_time => "2012-11-30 02:00:00", :end_time => "2012-12-01 02:00:00", :address => "jardín infantil los enanitos", :fb_id => 459474054104482, :owner_id => 852189482, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373023_459474054104482_1536369711_q.jpg", :atenders => 90, :privacy => nil, :created_at => "2012-11-19 20:24:01", :updated_at => "2012-11-19 20:24:01" },
