  { :name => "Se Vende PALTA HASS  de Exportación", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Estimados(as): \nTienen el agrado de saber que al igual que el año pasado vamos a estar vendiendo excelentes PALTAS HASS de exportación durante todo el año!!\nLos precios varían todas las semanas por lo que vamos a estar publicando semanalmente el valor por kilo.\nLos despachos a domicilio son gratis sobre los 3 kilos (las condes, vitacura y lo barnechea),\n*Despachos solo dias --> LUNES, MIÉRCOLES, SÁBADOS Y DOMINGOS \n\nHaz tus pedidos:\nRoberto Carrasco --> 98284742\nFrancisco Searle --> 84188811", :start_time => "2012-11-21 02:00:00", :end_time => "2012-11-22 02:00:00", :address => nil, :fb_id => 146376398824200, :owner_id => 1243876878, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373052_146376398824200_1655798101_q.jpg", :atenders => 107, :privacy => nil, :created_at => "2012-11-19 20:25:10", :updated_at => "2012-11-19 20:25:10" },
  { :name => "Paradise 2013 - Año nuevo - Casona de peloton.", :longitude => -71.1972222, :latitude => -32.7866667, :gmaps => true, :description => "Si eres un sobreviviente del 2012! vive Paradise 2013 Still Alive\n\nhttps://www.facebook.com/2013Paradise\n\n▼Despliega la Info en Ver más.\n\n► Paradise Stage\n\n10.000 M2 Para activar tus sentidos con la mejor música!\nSeras envuelto de la magia de Paradise con un escenario de 10 metros de alto, 4 torres lanza fuego, tus oídos solo escucharan los armónicos de la música con un sistema line Array, tu ojos no podrán pestañar con las luces y las visuales en una Performance única en Chile.\n________________________________________________________________\n\n► Green Stage\n\nDesprende tus neuronas del estrés de la cuidad y sumérgete en el Green Stage de Paradise, donde podrás relajarte en un ambiente de armonía con la naturaleza y la música, donde tus sensaciones te llevaran al máximo.\n\n________________________________________________________________\n\n► VIP House\n\nTu exclusividad solo se vera reflejada en la VIP House, disfruta de una noche mágica con la mejor comodidad y privacidad, tu paladar sera seducido por los tragos que solo el paraíso te puede ofrecer, en un ambiente místico por los secretos que en la casa se ocultan.\n\n________________________________________________________________\n\n► VIP Lounge\n\nTu mente te puede llevar a lugares irreales, pero que para ti son la proyección de tus pensamientos mas íntimos, disfruta del VIP Lounge en un exceso que sólo podrás manejar con tus sentidos, deja que la música te lleve al éxtasis de la vida y los colores te envuelvan, siente como tus poros se abren y tu piel se eriza al vivir Paradise de una forma exclusiva.\n\n________________________________________________________________\n\n▬ Valores:\n\n▼Entrada General (Paradise Stage - Green Stage)\n\n1era Pre-venta desde el lunes 12 de Noviembre hasta el 1 de Diciembre:\n\n$15.000 - Bar abierto (Pisco - Ron - Vodka)\n_________________________\n\n2da Pre-venta desde el martes 9 de Diciembre hasta el viernes 28 de Diciembre:\n\n$20.000 - Bar abierto (Pisco - Ron - Vodka)\n_________________________\n\nEntrada en puerta el 1 de enero de 2013:\n\n$25.000 - Bar abierto (Pisco - Ron - Vodka)\n_________________________________________________________________\n\n▼Entrada VIP Lounge\n\nHasta agotar stock (200 entradas)\n\n$25.000 - Bar abierto (Pisco - Ron - Vodka - Cerveza - (Energéticas{con stock}))\n_________________________\n\n▼Entrada VIP House\n\nMesa para 6 personas hasta agotar stock:\n\n$200.000 - Bar abierto (Pisco - Ron - Vodka - Cerveza - Whisky - (Energéticas{12 por mesa}))\n_________________________________________________________________\n\n▼Estacionamientos\n\nCupos limitados, asegura tu lugar junto con tu pre-venta\nPor auto:\n\n$2000 \n_________________________________________________________________\n\n▼Buses de acercamiento\n\nLas Condes - Providencia - Ñuñoa - La Florida - Peñalolen - Mauipu - Santiago Centro\nSan Bernardo - La Cisterna - Calera de tango - Longuen - Talagante - Buin - Otros por confirmar.\n\nSe confirmaran los lugares de salida y llegada.\n\n$2000 (Ida y vuelta)\n________________________________________________________________\n\n▼Line-up:\n\n1)Deejay Sedy\n2)Deejay Kemen\n3)Deejay Diego Nuñez\n4)\n5)\n6)\n7)\n________________________________________________________________\n\n\n▼Sector de comidas:\n\nAperitivos, Sushi, Hot-dog.\n\n\n________________________________________________________________\n\n▼Auspicia:\n\nRed-bull, Corona, Jack Daniel's \n\n________________________________________________________________\n\n▼Banda Invitada:\n\n♫TOMO COMO REY\n\nhttp://www.tomocomorey.cl\n\n________________________________________________________________\n\nSíguenos a través de Facebook y Twitter:\n\n►https://www.facebook.com/2013Paradise\n►https://twitter.com/Paradise_2013\n\nEvento para mayores de 18 años.\n\n\nStaff acreditados para vender \n-  Alejandra morales /+56974765681 / San Bernardo.\n-  Nicolas Gomez / +569 74783346 /  La Florida y Las Condes.\n- Cristobal Quezada /+56983831255 / San bernardo.\n-  Loreto Navarro / +56954161171 / San Bernardo.\n-  Mario fuentes / +56954180401 / San bernardo.\n-  Macarena caprio / 88219334 / san bernardo.\n - Nicolas Jara / +56962390187 / Lo barnechea y universidad catolica\n-  Francisco Palacios / +56973061297 / San Bernardo .\n- matías leal / 91257149 / san bernardo.\n- Felipe Moraga / +56965413420 / San Bernardo.\n- Nicole Arraño /+569 77437351 / La Cisterna.\n-  Diego Villavicencio / +56 9 8963 1283 / san bernardo.\n- jose antonio caro / +56972813039/ la cisterna.\n-  Daniel Mancilla / 71085812 / la florida.\n- Jeanfranco Frei - +569 7 969 24 74 - Peñalolén. \n- Hernan Gutierrez // +569 54015397 - La cisterna\n- Maria jose Olea // 94131076 - El Bosque\n-Maximiliano Senno / +569 66870522 - San miguel", :start_time => "2012-12-31 23:00:00", :end_time => "2013-01-01 06:00:00", :address => "María Rita 499, Calera, Valparaíso Region, Chile", :fb_id => 277502842325389, :owner_id => 1209816598, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373123_277502842325389_1024539850_q.jpg", :atenders => 1678, :privacy => nil, :created_at => "2012-11-19 20:25:21", :updated_at => "2012-11-19 20:25:21" },
  { :name => "Curso de Reino 2012", :longitude => -71.1972222, :latitude => -32.7866667, :gmaps => true, :description => "¿Has sentido alguna vez esa inquietud por vivir más conectado con Cristo y su Iglesia? ¿Quieres darle a tu vida diaria un sentido más profundo, más espiritual, más pleno? Te invitamos a esta segunda versión del Curso de Reino, del 26 al 30 de diciembre. El tema de este año es \"La Fe en la Vida Pública: Atrévete a vivir tu Fe\", para que tengas herramientas para vivir mejor este año de la Fe anunciado por el Papa Benedicto XVI. Contaremos con los mejores charlistas y expositores. \n\nPrecio: $25.000\n\nATRÉVETE A VIVIRLO", :start_time => "2012-12-26 02:00:00", :end_time => "2012-12-27 02:00:00", :address => "María Rita 499, Calera, Valparaíso Region, Chile", :fb_id => 128906383928897, :owner_id => 668695243, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373094_128906383928897_1838114276_q.jpg", :atenders => 17, :privacy => nil, :created_at => "2012-11-19 20:25:26", :updated_at => "2012-11-19 20:25:26" },
  { :name => "\"MISERIA Y TERROR\". Egreso Escuela de Teatro UC", :longitude => -70.5940725, :latitude => -33.4542414, :gmaps => true, :description => " Amigas y Amigos: \n\nQuedan todos coordialmente invitados a nuestro montaje de egreso de la carrera de actuación de la UC.  \n\n\"Miseria y Terror\".  \nUna adaptación libre de la obra \"Terror y miseria en el Tercer Reich\", de Bertolt Brecht, con textos de Heiner Müller. \n\nDirección: Rodrigo Pérez \nAsistente de dirección: Jaime Leiva \nDiseño integral: Catalina Devia \n\nElenco: David Atencio, Montserrat Ballarín, Juan Cano, Javiera Del Pino,\n Pablo Greene, April Gregory, Colomba Horta, María Jesús Marcone, \n Erick Meléndez, Catalina Muñoz, Mario Ocampo, Carlos Ocayo, \nJorge Ruiz, Nicolás Russi.  \n\nDel 27 de Noviembre al 1 de Diciembre. \nA las 20:30 hrs. \n \nTeatro Universidad Católica  (Jorge Washington #26)  \n\nENTRADA GENERAL: $ 3.000\n\nReservas al (02) 2055652 (Boletería TEUC) \n \n¡Los esperamos!", :start_time => "2012-11-27 18:30:00", :end_time => "2012-11-27 21:30:00", :address => "Jorge Washington 9-129, Ñuñoa, Santiago Metropolitan Region, Chile", :fb_id => 325336967574344, :owner_id => 512091156, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/277089_325336967574344_152979729_q.jpg", :atenders => 348, :privacy => nil, :created_at => "2012-11-19 20:25:38", :updated_at => "2012-11-19 20:25:38" },
  { :name => "Exposición \"Huellas de la Memoria\"", :longitude => -70.66698749999999, :latitude => -33.4507793, :gmaps => true, :description => "Amigos, amigas, los queremos invitar cordialmente a nuestra primera exposición, que estará durante dos meses en pacto arte bar, la muestra consiste en muchos de nuestros trabajos, ya sean pinturas o grabado, los cuales hemos trabajado desde casi nuestro inicio como estudiantes de artes visuales. Para nosotras es muy importante contar con su apoyo y participación, ojalá todos puedan irrr!!!\nPara las primeras personas que lleguen habrá un cocktail que corre por parte del local.\n\nCote y Coni", :start_time => "2012-11-22 18:00:00", :end_time => "2013-01-22 18:00:00", :address => "Manuel Montt 101-199, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 386447504768356, :owner_id => 1307640095, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373118_386447504768356_598055912_q.jpg", :atenders => 78, :privacy => nil, :created_at => "2012-11-19 20:25:49", :updated_at => "2012-11-19 20:25:49" },
  { :name => "THE GATOR RUN", :longitude => -82.354406, :latitude => 29.646493, :gmaps => true, :description => "The.Best.5k.Ever.\n\nRegister at www.TheGatorRun.com\n\nThe Gator Run is an experience unlike any other. It’s a 5k that’s less about the run and more about the fun. Whether you’re a pro athlete or seasoned couch potato, this course around campus will definitely be the most enjoyable 3.1 miles you’ve ever traveled. The Gator Run allows you to walk/run/dance/hop through UF while literally displaying your Orange & Blue pride. \n\nEach kilometer of the event features an Orange or Blue “Zone”, with fellow Gators ready to dust you with buckets of powder. Don’t worry, the mix is 100% natural and safe to digest – we even tested it on some very brave UF students. (We recommend using a strong soap afterward!)\n\nGrab your friends and mark your calendars because this is an event you don’t want to miss.\n\n$5 for UFAA student members (until Nov. 30- $10 after)\n$25 for other UF students (includes an annual membership, tailgate chair, CHOMP t-shirt, koozie and more!)\n\nRegistration includes a GATOR RUN t-shirt, as well as access to the run and post-party.\n", :start_time => "2013-01-26 15:00:00", :end_time => "2013-01-26 18:00:00", :address => "2303-2307 Woodlawn St, Gainesville, FL 32603, USA", :fb_id => 264414553681640, :owner_id => 43413577920, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/277098_264414553681640_1295647866_q.jpg", :atenders => 0, :privacy => nil, :created_at => "2012-11-19 20:25:54", :updated_at => "2012-11-19 20:25:54" },
  { :name => "The Battle For Middle Earth", :longitude => -96.78860019999999, :latitude => 33.1763799, :gmaps => true, :description => "Fire blooms from Mount Doom as a nameless fear grows in the east. The noble races of men and elves join forces to disintergrate the threat of the dark lord Sauron. The age of the orc is nigh, time is of the essence. For 3000 years, the realm of Gondor held back the shadow and the threat from the East. Come forth all ye who oppse and take a mighty stand for blessed hope of all mankind....\n\nA CALL TO ARMS OF ALL ABLE MEN AND WOMEN\n\nOh yeah, bring your own armour and weapons lol. Afterparty at the Shire, drinks are on Frodo. We will be travelling by noble stallions, so remember to bring a packed lunch (no nuts, some soilders have allegies) as the journey may be long treacherous and unforgiving. Bring sun cream as the fires of mount doom might be hot. I bid thee farewell noble warriors, I will meet you on the battle field.\n", :start_time => "2014-01-01 00:00:00", :end_time => "2014-04-30 00:00:00", :address => "12011 Mordor Ln, Frisco, TX 75035, USA", :fb_id => 223842688011, :owner_id => 897395631, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373420_223842688011_1792979950_q.jpg", :atenders => 4947, :privacy => nil, :created_at => "2012-11-19 20:26:07", :updated_at => "2012-11-19 20:26:07" },
  { :name => "Fiesta de Gala Periodismo UDD 2012", :longitude => -70.55647080000001, :latitude => -33.3854717, :gmaps => true, :description => "¡Te esperamos este miércoles 28 de noviembre!\nEl Centro de Alumnos de Periodismo UDD te invita a su primera Fiesta de Gala, a realizarse en el Estadio Croata (Av. Vitacura 8049).\n\nCompra tu preventa desde este martes con tu delegado del Centro de Alumnos. Ya informaremos quiénes están a cargo de la venta.\n\nEntrada general: $17.000", :start_time => "2012-11-28 20:00:00", :end_time => "2012-11-28 23:00:00", :address => "Vitacura 8001-8063, Vitacura, Santiago Metropolitan Region, Chile", :fb_id => 221482247984500, :owner_id => 288228981198003, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/592193_221482247984500_1344253529_q.jpg", :atenders => 62, :privacy => nil, :created_at => "2012-11-19 20:26:17", :updated_at => "2012-11-19 20:26:17" },
  { :name => "DESAFIO LEVANTEMOS CHILE / LUNES 19 NOVIEMBRE / AMANDA", :longitude => -70.56852169999999, :latitude => -33.3878633, :gmaps => true, :description => "Evento en apoyo a  Desafío Levantemos Chile\nEn vivo: Julio Pino\nDj Set: Matias Batista - Marinetti - Tello Rodriguez - Mcleod - Felipe Rabi - Pablo Sepulveda\n\nEL EVENTO COMIENZA A LAS 20.30 HRS\n\nAdidas y Centro Cultural Amanda te invitan a evento destinado a recaudar fondos destinado a proyectos de \"Desafío Levantemos Chile\".\n\nLa campaña “50 desafíos para Chile”, impulsada por la fundación de Felipe Cubillos y el Banco de Chile seleccionó entre más de mil proyectos, sólo 50 que buscan ser implementados en varias comunas del país, donde serán favorecidas 105 mil personas. Entre los proyectos ganadores, hay 11 de educación, 8 de deporte, 11 de emprendimiento, 4 de salud, 5 sociales, 3 de medio ambiente, 4 de energía y 4 de construcción.\n\nEn esta ocasión el show contará con la participación de Julio Pino (la banda del actor Matías Oviedo) y los djs Matías Batista, Mcleod, Tello Rodríguez, Marinetti, Felipe Rabi y Pablo Sepúlveda.\n \nLa segunda fecha ya está agendada para el próximo lunes 17 de diciembre.\n\n\nPrecios: Las donaciones comienzan desde los $5000 // Cada donación es valida por una entrada.\n\n\nAbierto desde las 20.30 hrs\n \nmás info en: www.desafiolevantemoschile.cl\n\npresenta:\n\nCentro Cultural Amanda\nAdidas Group\n", :start_time => "2012-11-19 18:30:00", :end_time => "2012-11-19 21:30:00", :address => "Embajador Doussinague 1711-1765, Vitacura, Santiago Metropolitan Region, Chile", :fb_id => 488645504491855, :owner_id => 151664078230406, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/592186_488645504491855_241573983_q.jpg", :atenders => 335, :privacy => nil, :created_at => "2012-11-19 20:26:23", :updated_at => "2012-11-19 20:26:23" },
  { :name => "CAMBIO DE MANDO Centros de Alumnos UAI", :longitude => -70.5183125, :latitude => -33.485746, :gmaps => true, :description => "Estimados,\n\nLos actuales Centros de Alumnos tienen el agrado de invitarlos a participar de la ceremonia de cambio de mando que se realizará el día Viernes 23 de Noviembre a las 11.00 hrs. en el Auditorio del A.\n\nVen a conocer a tu Centro de Alumnos, quiénes serán tus nuevos representantes y qué esperan lograr para el año 2013.\n\nTe esperamos!", :start_time => "2012-11-23 09:00:00", :end_time => "2012-11-23 12:00:00", :address => "Camino Particular, Peñalolén, Santiago Metropolitan Region, Chile", :fb_id => 385203404898338, :owner_id => 1796989623, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/592291_385203404898338_1306415628_q.jpg", :atenders => 67, :privacy => nil, :created_at => "2012-11-19 20:26:50", :updated_at => "2012-11-19 20:26:50" },
