  { :name => "BYOB STGO", :longitude => -70.6378074, :latitude => -33.45302, :gmaps => true, :description => "BYOB (Bring Your Own Beamer - Trae Tu Propio Proyector) es una idea original de Rafaël Rozendaal, la cual tiene como propósito gestionar una muestra audiovisual siguiendo tres \"simples\" pasos: conseguir un espacio, hacer una curatoría y pedirle a cada uno de los participantes que lleve su proyector. Esta iniciativa se ha llevado a cabo en muchas ciudades de distintos paises del mundo, pero esta será la primera vez que se realice en Chile.\n\nhttp://www.byobworldwide.com/\nhttp://byobstgo.tumblr.com/\n\nBYOB STGO 2012:\n\n-Yohanna Ovalle\n-Pati Hitler\n-Catalina Garretón\n-Aníbal Bley\n-Carlos Apablaza Baschmann\n-Paulina Giustinianovich\n-Kriztoval Opazo\n-Felipe Klaue\n-Manuel Orellana\n-Constanza Figueroa\n-Elefante Gonorrea\n-Cru Painemilla\n-Antonio Toro\n-Poli Muji-K\n-Fabian Neisskenwirth\n-Matías Gonzalez\n-Martin Bruce\n-Felipe Weason\n-Ignacio Gatica\n-Clemente Del Rio\n-Matthew Neary\n-Valeria Hernandez\n\nMusicaliza:\n-Corona Andrade ( http://soundcloud.com/coronaandrade )\n\n01/12/12\nLira #767", :start_time => "2012-12-01 16:00:00", :end_time => "2012-12-01 19:00:00", :address => "Lira 758-797, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 432820250107748, :owner_id => 100004305877529, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/187762_432820250107748_1135178189_q.jpg", :atenders => 114, :privacy => nil, :created_at => "2012-11-19 20:27:32", :updated_at => "2012-11-19 20:27:32" },
