  { :name => "Inauguración \"Belleza, Imagen, Manipulación y Medios\"", :longitude => -70.6436514, :latitude => -33.4358451, :gmaps => true, :description => "Tengo el agrado de invitarles a la inauguración de la exposición \"Belleza, Imagen, Manipulación y Medios\" en el marco de las presentaciones de trabajos de titulación de la carrera de Fotografía Profesional, promoción 2012 de Instituto Arcos.\nLa inauguración tendrá lugar el día 20 de noviembre a las 20ºº Hrs. En la galería \"Posada del corregidor\" Ubicada en calle Esmeralda # 749. Santiago Centro.\nLa exposición estará abierta desde el 20 al 27 de Noviembre, de Lunes a Viernes de 10ºº a 18ºº Hrs. ", :start_time => "2012-11-20 18:00:00", :end_time => "2012-11-20 21:00:00", :address => "Ismael Valdés Vergara 400-508, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 367358520024192, :owner_id => 1158049803, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/211156_367358520024192_1395851884_q.jpg", :atenders => 76, :privacy => nil, :created_at => "2012-11-19 20:27:46", :updated_at => "2012-11-19 20:27:46" },
  { :name => "Swedish House Mafia - One Last Tour [Sat 2nd Feb] [BUCKY] [MICHAEL TRANCE] [HARDCOPY]", :longitude => 151.0676967, :latitude => -33.8430707, :gmaps => true, :description => "SOLD OUT.   \n\n\n\n\n\nFAQ .\n\nQ.Are theses hardcopys? \n\nA.YES THEY ARE\n\n\nQ.What are pre sales purchases ?\n\nA. Purchasing pre sale tickets means you get to secure your tickets when i get them in my hands , You have priority over people who are paying later when i get them in my hand . Saves me and you convenience.\n\n\nQ. Can i purchase them with cash on pick up?\n\nA. Yes you may, but if someone transfers me money and pre-purchases them , they have priority over you and it is first come , first serve! :]\n\n\nQ. Bulk Discount? \n\nA. No bulk discount for this event! \n\n\nQ. Are theses standing or seated ?\n\nA. My tickets are STANDING ARENA tickets .. means you will partying on the grass. \n\n\n\n\n", :start_time => "2013-02-02 01:30:00", :end_time => "2013-02-02 07:00:00", :address => "Grand Parade, Sydney Olympic Park NSW 2127, Australia", :fb_id => 188796477911795, :owner_id => 741655172, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/203516_188796477911795_134676073_q.jpg", :atenders => 303, :privacy => nil, :created_at => "2012-11-19 20:27:52", :updated_at => "2012-11-19 20:27:52" },
  { :name => "GONWAY", :longitude => -0.000236, :latitude => 0.000145, :gmaps => true, :description => "Hola a todos, quiero informaros sobre una nueva red social que empezará en septiembre, se llama GONWAY.\n\nEsta red social quiere ser el canal de relación entre estudiantes y empresas. La idea es que un universitario a través de unas actividades que el quiera hacer va a poder demostrar a la empresa realmente lo que vale y se le va a valorar mas allá del cv y las notas. Esas actividades por ejemplo, son un portal de ideas donde puedes decir lo que piensas sobre un tema que te propongan.\n\nAdemás tenemos el cuvitt un curriculum vitae inteligente que te ayuda a conocerte a ti mismo y y dice que aptitudes tienes q desarrollar para determinados puestos de trabajo.\n\nLos usuarios que quieran se pueden aprovechar de promociones, asistir a eventos pero es siempre opcional.\n\nSolo hay que registrarse en www.gonway.com, y formarás parte esta red social y a partir de septiembre podrás acceder a sus servicios.\n\nSi teneis alguna duda no dudeis en escribir a esta dirección info@gonway.com\n\nPor favor, pasad el evento a todas las personas que creais que les puede interesar, intentad que sea con al menos 10 personas!\n\nhttp://youtu.be/uOhfpvvTV1k\n Demuestra lo que vales!\n \nwww.gonway.com\n\n\n", :start_time => "2012-12-31 02:00:00", :end_time => "2013-01-01 02:00:00", :address => nil, :fb_id => 251991991578323, :owner_id => 728510244, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373655_251991991578323_1176982952_q.jpg", :atenders => 1458, :privacy => nil, :created_at => "2012-11-19 20:28:00", :updated_at => "2012-11-19 20:28:00" },
  { :name => "Congreso Estudiantes Educación Superior Privada", :longitude => -70.641997, :latitude => -33.4691199, :gmaps => true, :description => "Descripción\n\nCONGRESO DE ESTUDIANTES DE EDUCACIÓN SUPERIOR PRIVADA\n\nComo estudiantes de la educación superior privada luego de un 2011 lleno de lucha y protesta social, comenzamos a organizarnos y levantar nuestras banderas por una educación pública, gratuita y al servicio del pueblo; producto de lo anterior surgió la necesidad de organizar el primer Encuentro Nacional de estudiantes de la educación superior privada organizado por MESUP (Movimiento de Educación Superior Privada). En aquella jornada pudimos constatar las diversas problemáticas transversales que nos afectan como estudiantes de un mismo sector, ello como consecuencia de la educación de mercado imperante en nuestro país.\n\nDurante este 2012, las instituciones del sector privado han estado constantemente en la opinión pública, producto de una serie de irregularidades que han suscitado tanto a nivel mediático, como judicial, evidenciando aún más el conflicto que existe en esta materia. Se ha visto con claridad que nuestras casas de estudio funcionan como empresas sin un proyecto educativo real que se vincule con lo que nuestro país necesita, sin considerar la voz de los miembros de la comunidad estudiantil en la toma de decisiones, sin democracia interna y lo que es peor muchas de ellas coartando todo tipo de organización estudiantil. A ello se suma las constantes aspiraciones de ampliar un negocio perverso versus el acceso a un derecho social universal, lo cual se evidencia y agrava aún más cuando atendemos al lucro como la única finalidad de estas casas de estudio.\n\nEn relación a lo anterior surge la necesidad de realizar un Congreso de Estudiantes de Educación Superior Privada, que integre tanto a Centros de Formación Técnica, Institutos Profesionales y Universidades, siendo un espacio de discusión de carácter nacional, no sólo con la finalidad de volver a levantar problemáticas, que develen o ratifiquen un conflicto, sino que también buscar en conjunto aquellas soluciones al corto, mediano y largo plazo.\n\nEs por ello que el Congreso se realizará durante dos jornadas. El primer día se conformarán mesas de trabajo para discutir las demandas en base a los diversos ejes temáticos a desarrollar. El segundo día nos encontraremos nuevamente en una plenaria en donde cada comisión expondrá su trabajo, para posteriormente proyectar el resultado final de dicho documento en un análisis conjunto encausando las respectivas soluciones.\n\nSe realizará en la Universidad Santo Tomás Sede Santiago, los días 23 y 24 de Noviembre. El día viernes a partir de las 14:00 hrs., mientras que el día sábado las actividades comenzarán a las 09:00 hrs.\n\nPara participar deberás enviar nombre, rut e institución a la que perteneces al correo de contacto: encuentrodeprivadas@gmail.com, en el lugar del Congreso se hará entrega de una credencial previa acreditación de Pase Escolar o Credencial de la institución.\n\nPor la democratización de nuestros espacios, construcción de una comunidad educativa, por el fin al lucro efectivo, por un proyecto educativo real y por más dignidad para los estudiantes de las instituciones privadas ¡TE ESPERAMOS!", :start_time => "2012-11-23 12:00:00", :end_time => "2012-11-24 18:00:00", :address => "Ñuble 646-690, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 465087126863790, :owner_id => 100003197614222, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/187792_465087126863790_681347934_q.jpg", :atenders => 203, :privacy => nil, :created_at => "2012-11-19 20:28:12", :updated_at => "2012-11-19 20:28:12" },
  { :name => "Venta de zapatos de Estados Unidos!!!", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Estimadas:\nHa llegado a ustedes una tienda virtual dedicada a la venta de zapatos de estados unidos. Excelente calidad e increibles diseños a un precio super accesible!!!\nLas invitamos a conocer nuestra tienda poniendo LIKE o ME GUSTA en el siguiente link!\n\nhttp://www.facebook.com/raspberrystoreusa\n\nEstaremos subiendo siempre nuevod modelos y colores de zapatos\n\nLas esperamos!!!!  Encarguen sus zapatos!!!", :start_time => "2013-12-31 12:00:00", :end_time => "2013-12-31 15:00:00", :address => nil, :fb_id => 172244059578565, :owner_id => 100000396138191, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/188078_172244059578565_585031112_q.jpg", :atenders => 61, :privacy => nil, :created_at => "2012-11-19 20:28:17", :updated_at => "2012-11-19 20:28:17" },
  { :name => "Generation 15 Presents: \"Risky Business\"", :longitude => -82.3473083, :latitude => 29.6493451, :gmaps => true, :description => "Exams? Graduating? Moving Out of Town? Bummed about the Gators?\n\nHere's a business tip:\n\nPut pleasure before business and join Generation Sketch Comedy for its 15th All-Original Production!\n\nSpeaking of business, our show is BOGO!\nExcept the performances cost nothing.\nRemember - this show is FREE to all!\n---\nFRIDAY\nNOV 30\nREITZ ROOM 285 (New Room!)\n8PM\n---\nSATURDAY\nDEC 1\nREITZ ROOM 282\n8PM\n----\n\nThe cast of Generation has been working ALL semester to bring you a completely original show created entirely by UF students & alumni.\n\nStarring:\n*Otto Akin\n*Rich Camillucci\n*Kelly Collar\n*Sam Kanal\n*Naomi LeVine\n*Bernard Marger\n*Gina Martorana\n*Chris Mullet\n*Alyssa Pivniouk\n*Talles Sidronio\n\nDirected By:\n*Dan LeVine - Director\n*Jeff Spalding - Asst. Director\n*David Mucci - Video Director\n", :start_time => "2012-11-30 20:00:00", :end_time => "2012-12-01 23:00:00", :address => "Stadium Rd, Gainesville, FL 32603, USA", :fb_id => 484179754955688, :owner_id => 325732537464846, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373180_484179754955688_828293298_q.jpg", :atenders => 103, :privacy => nil, :created_at => "2012-11-19 20:28:57", :updated_at => "2012-11-19 20:28:57" },
  { :name => "III Rodeo de la Amistad Colloncos \"Adrián Prado\"", :longitude => -71.72847999999999, :latitude => -34.123746, :gmaps => true, :description => "ÚLTIMO MINUTO: INSCRIPCIONES DE COLLERAS CERRADA!!\n\n¡¡¡SE VIENE!!! El gran Rodeo de la Amistad de los Colloncos \"Adrián Prado\" ya tiene fecha y tú no te puedes quedar fuera.\nEste año se viene mejor que nunca; 20 colleras se disputarán el honor de ser los campeones colloncos de este año, 5 candidatas a reina, más de 200 entradas ya vendidas en la preventa... llega a dar miedo.\nLa gran orquesta Sangre Norteña nos amenizará un baile exótico y apoteósico, en una noche mágica en que todo puede pasar, ya tu sabes!\nLas entradas ya están a la venta y no son muchas las que quedan, así que todos los colloncos a asegurarse con la suya! \n\nPara conseguir tu entrada tienes varias opciones:\n\n1) Para envíos a Regiones: Contacta a Felipe Valdovinos al: 98156091 o a fvaldovinos@colloncos.cl\n\n2) Para Litueche: Contacta a César Farías al: 85179091 o a Misael Jara al: 91642731\n\n3) Para Santiago: Contacta a Sebastián Gallardo al: 92561214 o a sgallardo@colloncos.cl o simplemente adquiérela en Pesebrera Nº3 (Bucarest 17 depto. 3 Providencia)\n\n4) Para la Quinta Región: Contacta a Queno Lucero al: 91957556\n\nSi te lo pierdes es porque eres muy w...\n\nZúmbale zúmbale zúmbale!!!!!!!\n\nÚLTIMO MINUTO: INSCRIPCIONES DE COLLERAS CERRADA!!", :start_time => "2012-11-24 08:00:00", :end_time => "2012-11-24 11:00:00", :address => "O. Larraín, Litueche, O'Higgins Region, Chile", :fb_id => 160226527449718, :owner_id => 534169653, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/203600_160226527449718_150853613_q.jpg", :atenders => 335, :privacy => nil, :created_at => "2012-11-19 20:29:04", :updated_at => "2012-11-19 20:29:04" },
