  { :name => "GRAN FIESTA GAUCHA", :longitude => -64.4166718, :latitude => -31.7999992, :gmaps => true, :description => "El 24 y 25 de noviembre realizaremos una vez mas la fiesta  del Fortín Gaucho Del Río Los Molinos, la cual es una excelente opción para pasar un fin de semana familiar rodeado de nuestras tradiciones, música de nuestra ARGENTINA, destrezas  gauchas (criollos de américa, sortija, lanceado, rastrin, doma de vacunos, testimonio, truco, taba,etc) , esmerado servicio de bufet (asado de tira, empanadas y del mejor vino), por la noche del sábado una gran peña folclórica acompañada del conjunto Los Sacha entre otros artistas y un gran cierre chamamecero...\nEs una excelente oportunidad para hacerle honor a nuestras tradiciones y compartir entre amigos un maravilloso fin de semana!!\nEsperamos contar con su presencia y agradecemos la difusión de dicho evento!!\nsaludos!!\nPor cualquier duda sobre como llegar o consultas comunicarse al 0351-157350002 (Francisco Blanco)\n\nFortín Gaucho Del Río Los Molinos\n", :start_time => "2012-11-24 02:00:00", :end_time => "2012-11-25 02:00:00", :address => "Ruta Provincial 56, Córdoba Province, Argentina", :fb_id => 465856916800605, :owner_id => 761677175, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373172_465856916800605_34068198_q.jpg", :atenders => 130, :privacy => nil, :created_at => "2012-11-19 20:32:01", :updated_at => "2012-11-19 20:32:01" },
