  { :name => "Delta Zeta supporting BeLoved Atlanta", :longitude => 0.000148, :latitude => 0.000287, :gmaps => true, :description => "Please join us in raising awareness and money for women who are attempting to escape the sex-trafficking industry in our city. Delta Zeta has partnered up with a non-profit organization called BeLoved Atlanta to make a difference.\n\nBeLoved Atlanta \nis nonprofit organization committed to empowering women, ages 18 and older, who desire to escape the sex industry to regain their freedom through a home model of RESTORATION, EDUCATION & REINTEGRATION into society.\n\nDid you know?\n-Atlanta is one of the top 14 cities in the United States for sex-trafficking.\n-7,200 men pay for sex each month\n-82.1 percent of victims in sex trafficking incidents were identified as U.S. citizens.\n\nADMISSIONS - $5 (all proceeds go to BeLoved Atlanta)\n\nThere will be DRINKS & SNACKS (:\n\n$1 Raffle - Prizes!!!\n\nWomen toiletry donations will be gladly accepted. \n\nSpecial Guests:\nAmelia Quinn - Founder\nKelley Stagnaro - Cofounder\n\nhttp://www.belovedatlanta.org/\nhttp://www.facebook.com/BeLovedAtlanta", :start_time => "2012-11-28 19:00:00", :end_time => "2012-11-28 20:30:00", :address => "Gsu Greek Community Room", :fb_id => 323376737770445, :owner_id => 1120591027, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/188061_323376737770445_882110907_q.jpg", :atenders => 113, :privacy => nil, :created_at => "2012-11-19 20:32:46", :updated_at => "2012-11-19 20:32:46" },
