  { :name => "TOMMY REY, EN VIVO + FIESTA W/ BOOGIE MIKE + NASH!", :longitude => -70.612134, :latitude => -33.4229883, :gmaps => true, :description => "Confirmad@s en evento Facebook, GRATIS, hasta las 00 horas! (Solo quienes presionaron en \"PARTICIPAR\" o \"ASISTIRÉ\") \n\nLA SONORA DE TOMMY REY! // DJ SET: Nash &  Boogie Mike!\n\nSubterráneo se viste de etiqueta para recibir sobre su escenario a una de las agrupaciones clásicas y queridas de nuestro país, La Sonora de Tommy Rey, que llegarán , junto a todo su repertorio de hits como \"La peineta\", \"La Parabólica\", \"Se Murió Tite\",  además  de su más reciente producción “Los Padres de La Cumbia”, en un show que promete ser de larga duración y memorable. La fiesta seguirá a cargo de Dj Nash y Boogie Mike.\n\nentrada: $4000 hasta las 01am / $6000 gral.\n2x1 en Terraza hasta las 1 AM!\n20% de dcto en carta de comidas hasta las 1 AM!\n[EVENTO PARA MAYORES DE 21 AÑOS]", :start_time => "2012-11-24 20:00:00", :end_time => "2012-11-25 03:00:00", :address => "Orrego Luco 11-163, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 315266445253143, :owner_id => 315916098493968, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373021_315266445253143_716703828_q.jpg", :atenders => 169, :privacy => nil, :created_at => "2012-11-19 20:34:12", :updated_at => "2012-11-19 20:34:12" },
  { :name => "MECÁNICO, EN VIVO + FIESTA POST SHOW W/ EDDY PISTOLAS (PÁNICO)", :longitude => -70.61236149999999, :latitude => -33.42276349999999, :gmaps => true, :description => "Confirmad@s en evento Facebook, GRATIS, hasta las 00 horas! (Solo quienes presionaron en \"PARTICIPAR\" o \"ASISTIRÉ\") \n\nMECANICO celebra el próximo estreno de la nueva edición remasterizada de su EP debut \"MECANICO EP\" en el Club Subterráneo.\n\nSon uno de los grupos más interesantes de la reciente nueva camada de músicos chilenos. Mecánico, banda conformada el año 2010 y que desde su debut ha acaparado todas las miradas de  medios nacionales e internacionales, compartiendo en escenario con artistas como Chromeo, Miami Horror, Bag Raiders, The Sounds, entre otros. Antes de participar en Misteryland y Lollapalooza 2013 donde ya han sido confirmados,  aterrizarán en el subsuelo más prendido de la capital para mostrar todo su catálogo de  canciones. Además el dj set estará a cargo del líder de Pánico Edie Pistolas.\n\n[VALORES!] General: $4.000 (hasta la 1 AM)\n\n2x1 en Terraza hasta las 1 AM!\n20% de dcto en carta de comidas hasta las 1 AM!\n[EVENTO PARA MAYORES DE 21 AÑOS]", :start_time => "2012-11-22 20:00:00", :end_time => "2012-11-23 02:00:00", :address => "Orrego Luco 11-163, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 176093242528361, :owner_id => 315916098493968, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373020_176093242528361_6005718_q.jpg", :atenders => 160, :privacy => nil, :created_at => "2012-11-19 20:34:29", :updated_at => "2012-11-19 20:34:29" },
  { :name => "2º Jogo do Brasil na Copa do Mundo 2014 em Fortaleza Ceará", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Fortaleza terá papel destaque na Copa do Mundo de 2014. A capital cearense recebeu a missão da Fifa de sediar o segundo jogo da Seleção Brasileira, na fase classificatória da competição .\n\nE a capital cearense voltará a receber um jogo do Brasil, em caso de classificação do time verde-amarelo. Se a Seleção avançar em 1º lugar de seu grupo, o estádio Castelão receberá um jogo das quartas-de-final do Mundial. Se a equipe hoje comandada por Mano Menezes terminar a primeira fase em 2º lugar, Fortaleza recebe o Brasil nas oitavas de final.    \n\nA Fifa também anunciou o papel das cidades-sede, determinando o calendário do Mundial. Cada uma receberá pelo menos quatro partidas. Fortaleza já tem garantidos seis jogos do Mundial (veja as datas no quadro ao fim do texto). A capital cearense só foi menos contemplada que Rio de Janeiro e Brasília, que receberão, ao todo, sete jogos.\n\nAinda na fase classificatória, Fortaleza receberá ainda mais duas seleções Cabeça de Chave. Uma do grupo G e outra do D.\n\nA grande final da Copa do Mundo, agora confirmada oficialmente, será no Maracanã. O Mineirão, em Belo Horizonte, receberá a outra semifinal. A disputa de terceiro lugar acontecerá no Estádio Nacional de Brasília.\n \n\nA ABERTURA E A FINAL\n\nA Fifa confirmou nesta quinta-feira o que já era esperado: o Itaquerão, estádio do Corinthians, em São Paulo, abrirá a Copa do Mundo de 2014. A arena foi ainda agraciada com o maior número de partidas entre todas as sedes - seis, incluindo uma semifinal. O Maracanã, no Rio de Janeiro, será o palco da decisão.\n\nO anúncio foi feito após a reunião do Comitê Executivo da Fifa, em Zurique, na Suíça. Ao longo dos últimos dias, entidade e Comitê Organizador Local (COL) discutiram os detalhes para definição do calendário da Copa. Nesta quinta, a programação foi apresentada e aprovada pelo comitê.\n\nQuatro horários\n\nA Fifa anunciou os horários das partidas do Mundial. A abertura, no Itaquerão, acontecerá às 17h (de Brasília). Os jogos da fase de grupos serão disputadas às 13h, 16h, 17h e 20h. Os das oitavas e das quartas de final, às 13h e 17h. Semifinais e disputa de terceiro lugar, às 17h. A decisão está marcada para as 16h.\n\n \nDATAS DOS JOGOS DA COPA DO MUNDO EM FORTALEZA\n\n1º - 14 de junho de 2014\n\n2º - 17 de junho de 2014\n\n3º - 21 de junho de 2014\n\n4º - 24 de junho de 2014\n\n5º - 29 de junho de 2014 (oitavas de final)\n \n6º - 14 de julho de 2014 (quartas-de-final)\n\nFONTE: http://esportes.opovo.com.br/app/esportes/futebol/copadomundo/2011/10/20/noticiacopadomundo,2226810/com-um-jogo-garantido-do-brasil-na-copa-castelao-pode-receber-outro-nas-oitavas-ou-quartas.shtml\n \n\n", :start_time => "2014-06-17 17:00:00", :end_time => "2014-06-17 19:00:00", :address => "Arena Castelão", :fb_id => 184482318298727, :owner_id => 46822763283, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276852_184482318298727_1977729152_q.jpg", :atenders => 579, :privacy => nil, :created_at => "2012-11-19 20:34:34", :updated_at => "2012-11-19 20:34:34" },
  { :name => "Mantenimiento y Servicio Técnico de Computadores", :longitude => 0.000108, :latitude => 0.0002, :gmaps => true, :description => "Nuestro servicio de mantenimiento de computadores (PC) apunta a la solución integral de los problemas que usted pueda tener con su equipo computacional casero, y al mismo tiempo a maximizar su rendimiento de manera que los labores que usted realiza en el puedan llevarse a cabo de una forma expedita y optima.\n\nPrecios:\n\nConsulta: $3000 \n\n*Si el problema identificado lo trata con nosotros, la consulta es gratis.\n\nReparación: Variable, dependiendo del problema.\n\nArmamos computadores, ayudamos con la cotización y buscamos un computador con las piezas según las características y los rangos de dinero que usted esta dispuesto a gastar.\n\nmail de contácto: mantenimiento.computadores2002@gmail.com\n\n\nSolo Santiago.\n\nFavor difundir entre sus contactos.", :start_time => "2014-12-31 00:30:00", :end_time => "2014-12-31 03:30:00", :address => nil, :fb_id => 211935508884656, :owner_id => 1112385440, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276434_211935508884656_1474932731_q.jpg", :atenders => 19, :privacy => nil, :created_at => "2012-11-19 20:34:38", :updated_at => "2012-11-19 20:34:38" },
  { :name => "Obra de teatro: Esperando la carroza", :longitude => -71.5296865, :latitude => -33.0158455, :gmaps => true, :description => "Alumnos de diferentes carreras de la Universidad Adolfo Ibáñez presentarán la comedia titulada \"Esperando la carroza\". \n\nLa comedia está ambientada en los años 90', que trata sobre como hermanos y sus señoras discuten por quien se queda con su madre, quien desaparece en el momento más inoportuno.\n\nLas fechas son:\n\n23 de Noviembre Auditorio Sede Sporting Hora: 19:00\n24 de Noviembre Auditorio Sede Sporting Hora: 19:00\n\nELENCO\n\n1.\tSusana: Catalina Barias\n2.\tJorge: Pato \n3.\tMamá Cora: Paula Moraga\n4.\tElvira: Rocío Longueira\n5.\tSergio: Gonzalo Cuevas\n6.\tMatilde: Bernardita Imhoff\n7.\tAntonio: Pablo Errazuriz\n8.\tNora: Marianne Gelfestein\n9.\tEmilia: Valeria Sepúlveda\n10.\tSra Juanita: Consuelo de la Maza\n11.\tTía Filipa: María Paz Paulsen\n12.\tJunior: Pablo Errazuriz\n\nDirige: Clauda Ramírez\nCo-directora: Tamara Bullhmann\n", :start_time => "2012-11-23 17:00:00", :end_time => "2012-11-23 20:00:00", :address => "Padre Hurtado, Viña del Mar, Valparaíso Region, Chile", :fb_id => 118111371679065, :owner_id => 1051435772, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276888_118111371679065_1256913240_q.jpg", :atenders => 61, :privacy => nil, :created_at => "2012-11-19 20:34:58", :updated_at => "2012-11-19 20:34:58" },
