  { :name => "UF Peace Corps Information Session", :longitude => -82.3449598, :latitude => 29.6485296, :gmaps => true, :description => "Returned Peace Corps Volunteers (RPCV) from UF's Masters in Sustainable Development Practice (MDP) will be leading a Peace Corps scenario planning information session.  This will be a unique way to learn about the likely situations Peace Corps Volunteers encounter and to see if you, the UF student, can see yourself working and living in these kinds of situations.  \n\nStudents will gain an overview of Peace Corps and will actively participate in activities and scenario planning with RPCV MDP students - Ralston Reodica, Jessica Jefferson, Leandra Clough, Hans Goertz.  Former UF PC Recruiter, Amy Panikowski will be overseeing the event.\n\nPlease join us!", :start_time => "2012-11-19 18:00:00", :end_time => "2012-11-19 19:30:00", :address => "The HUB, Gainesville, FL 32603, USA", :fb_id => 292124037571772, :owner_id => 103250363810, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/276674_292124037571772_302631936_q.jpg", :atenders => 14, :privacy => nil, :created_at => "2012-11-19 20:35:33", :updated_at => "2012-11-19 20:35:33" },
