  { :name => "4 Únicas funciones de LAS COSAS TAMBIÉN TIENEN MAMÁ... antes de partir a Taiwán", :longitude => -70.6317632, :latitude => -33.4492967, :gmaps => true, :description => "La Mona Ilustre y Teatro Facetas, presentan:\n\n                                        LAS COSAS TAMBIÉN TIENEN MAMÁ\n Con 4 únicas funciones la compañía se despide de Chile antes de partir de gira a Taiwán.\n                     (http://www.youtube.com/watch?v=vipX64XhSJI)\n\n\n TEMPORADA: \n24 de noviembre al 2 de diciembre\nSábados: 21 hrs. / domingos: 20 hrs.\nEntrada general: $5000; Estud. y 3ª Edad: $3000\nPreventa a $3000 en el Teatro: lunes a viernes de 13 a 20 hrs. y en www.teatrofacetas.cl\nTEATRO FACETAS, Vicuña Mackenna 602 Providencia, fono 222 8298 (Metro Santa Isabel, Ruta Verde) \n\n\n Primero fue España, luego Francia ahora La Mona Ilustre se presentará en el “Taiwan International Festival of Arts” (TIFA), uno de los festivales más importantes de Taipei, en donde han pasado grandes directores como Ariane Mnouchkine, Robert Wilson, Peter Brook, Robert Lepage, entre otros y que por primera vez invita a un grupo proveniente de Chile para presentarse en su versión número 26 con el multipremiado espectáculo “Los Peces no vuelan”. \n Antes de esto, la compañía presentará una última temporada con cuatro únicas funciones de Las Cosas también tienen mamá.\n\n LAS COSAS TAMBIÉN TIENEN MAMÁ\n\n Esta es la historia de Juliette Jacquot, que vuelve a su casa de infancia después de veinte años de ausencia. Tras su regreso, nos traslada a un universo lleno de juguetes, muebles, utensilios. Objetos que con el paso de sucesivos otoños se nos muestran desdibujados, con tamaños y formas inverosímiles, llenos de historias de una niñez cargada al olvido. Esta memoria fragmentada irrumpe en el presente y se hace vívida en una marioneta grande y de madera, un cajón de manzanas que huele a infancia, una muñeca de trapo, unas lámparas araña que cuelgan del cielo sobre un horizonte con casitas recortadas, una fina lluvia de flores negras en forma de burbujas, una cama barco y tempestad, un carretón de abuela lleno de tesoros, una mesa de cocina desproporcionadamente alta que parece una casa, o lo parecía cuando éramos niños... \n\nLas actrices manipulan a la vista muebles, marionetas de talla humana, juguetes… Los objetos se mueven constantemente en un desván añoso que va generando distintos espacios, va estirándose, desperezándose, despertando. Las cuatro mujeres del elenco se convierten en adalides de un recuerdo generado a partir de una coreografía espacial sin bambalina que trata de dibujar las emociones de Juliette, el personaje que regresa. \n\nElenco: Emilie Urbas, Paula Barraza, Claudia Araya, Isidora Robeson\nDirección: Miguel Bregante\nDramaturgia: Andrea Gutiérrez\nIdea original: La Mona Ilustre\nDiseño integral: Eduardo Jiménez\nMúsica: Tomás Preuss\nSonido: Diego Hinojosa\nVestuario: Hanne Geertz \n\n\n\n", :start_time => "2012-11-24 19:00:00", :end_time => "2012-12-02 18:00:00", :address => "Vicuña Mackenna 599-625, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 500730799947547, :owner_id => 1815791510, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373050_500730799947547_335239307_q.jpg", :atenders => 74, :privacy => nil, :created_at => "2012-11-19 20:36:01", :updated_at => "2012-11-19 20:36:01" },
  { :name => "LMS- Val Thorens Winter Trip", :longitude => 6.584663, :latitude => 45.296603, :gmaps => true, :description => "                               ******SOLD OUT******\n\nLeeds Met Snowsports are proud to announce that for our annual winter trip we will be taking you lovely lot to Val Thorens. Needless to say IT’S GOING TO BE BIG! \n\nImportant facts:\n•      4th -12th January 2013\n•      Val Thorens, France\n•      Only £339!\n \nWhat’s included:\n•      Accommodation (ski in- ski out. In the heart of VT)\n•      Transport (Executive coach with the usual fancy dress)\n•      Six day lift pass\n•      Breakfast (This will include tea, coffee, sugar, butter, jam,       chocolate spread, cereal, milk and fresh bread delivered each morning.)\n•      Holiday T-shirt\n•      Exclusive drinks discounts in various bars\n•      *An amazing holiday that you will not forget!\n \nVAL THORENS:\nIf you've not been to Val T then you've not yet really been to the Alps. Highest resort in Europe. The 3 Valleys. 600km of piste. 6 snow parks. Bar 360. Malaysia (Highest club in Europe) . It not only ticks every box you need from a holiday, it smashes them into the ground and beats them around the face.\n\n'First lift, last orders' is the only way to make the most of Val Thorens, with the largest array of bars and the exhilarating nightlife coming second only to the amazing 600km of jaw-dropping pisted runs. As part of the largest linked ski resort in the world with a huge network of blue and green runs, it's perfect for beginners as they can really make the most of the mountain. If you're a pro then the copious parks (including the famous DC Park just over in Meribel) and the abundance of challenging black runs will keep you more than entertained.\n\nVT Truly is a bullet-proof resort and one of the most student friendly. NUCO working closely with the LMS committee will make sure that there is never a dull moment from our freestyle jam sessions, mountain meal to wacky fancy dress themes most nights.\n \nOptional extras:\n‘Meal on the mountain’ – LMS highly recommend this, as it’s the icing on the cake to a great day’s skiing! We all gather up the mountain, have some exciting food, get a bit silly LMS style followed by a wobbly ski down into VT.\nLessons and equipment hire – For anyone who is a complete beginner, fear not NUCO can sort all your lessons and equipment through the booking page. Skiing and Boarding holidays are a unique holiday altogether and chances are you're going to get hooked!\n\nBook via…\n\n1.\tCreate a NUCO profile at: https://accounts.nucotravel.com/create\n2.\tBook the LMS holiday at: https://booking.nucotravel.com/sy/leedsmet\n\nGet booking guys! (Places are limited) \n\n*The first 100 to book will receive a free LMS goodie bag including a free club t- shirt\n\nSee you there...\n", :start_time => "2013-01-04 11:00:00", :end_time => "2013-01-12 06:00:00", :address => "Rue de Gebroulaz, 73440 Saint-Martin-de-Belleville, France", :fb_id => 121315721350357, :owner_id => 463572550338596, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/188061_121315721350357_1802330975_q.jpg", :atenders => 183, :privacy => nil, :created_at => "2012-11-19 20:36:12", :updated_at => "2012-11-19 20:36:12" },
