  { :name => "7º Encuentro Internacional  de Maxihandball (  Senior,Veteranos, Master)", :longitude => -58.4666667, :latitude => -34.55, :gmaps => true, :description => "Amigos los invitamos a participar de esta nueva edición de nuestro 7º Encuentro Internacional de Maxihandball, el mismo lo llevaremos a cabo los días 24,25 y 26 de Noviembre 2012 en el Estadio del Instituto Superior de Educación Física Nº 1 ISEF 1º \"Enrique Romero Brest\" sito en calle Miguel Sánchez Ex Crisologo Larralde 1338 a 300 m Av. Del Libertador en el Barrio de Núñez, Ciudad Autónoma de Buenos Aires, Argentina. Ya tenemos confirmada la sede del Club del Circulo Militar sito en Av. Del Libertador esquina Villate frente a la quinta presidencial en Olivos, Vicente López, Buenos Aires,( a tan solo 3500 m del Estadio del ISEF 1º), en cuyas instalaciones dispondremos nuestra Villa Deportiva con alojamiento en regias habitaciones dobles, y quíntuplas con baño privado, desayuno, almuerzos , cenas y esparcimiento frente al Río para todas las delegaciones para su mas esmerada atención y comodidad .Obtuvimos muy competitivas y eficientes tarifas a partir de negociar todo en un solo sitio para beneficio de todos los participantes.  No se Pierdan este verdadero Encuentro de Amistad y camaradería, ya comprometieron su presencia equipos BRASIL Andebol Master de Alagoas, Uruguay, 2 de Cordoba, 1 de Mendoza, 4 de Buenos Aires, 1 Santacruz.  Este año incorporaremos una categoría 40-50 años y otra 50 años en adelante con el objetivo que todos jueguen entre pares de similares edades\nAmigos para que tengas datos concretos y rápidos les paso informalmente las tarifas de hoy , pueden variar pero muy poco, luego les voy a pasar la info completa bien armada con los menú a elección bien prolijo, pero así ya pueden ir calculando :\nCirculo Militar sede Olivos un lugar muy bueno y distinguido, muy bien ubicado, les va a gustar. Mírenlo en la pagina Web\n http://www.circulomilitar.org/olivos.htm\nAlojamiento por día por persona en habitación doble o quíntuple con baño privado, con desayuno, $ 152.- Almuerzo $ 55.- Cena $ 75.- total aproximado hoy,  puede variar \n$ 282.- por día por persona.\nValores expresados en Pesos Argentinos. \nPronto les paso info prolija y detallada incluyendo costo inscripción, etc.,....\n\nUn Abrazo Luis López\n4.571.3095\n15.5.760.3544\nluislopez@lopezarce.com.ar\n", :start_time => "2012-11-24 08:00:00", :end_time => "2012-11-24 11:00:00", :address => "Juana Azurduy 2301-2399, Buenos Aires, Autonomous City of Buenos Aires, Argentina", :fb_id => 353236594755784, :owner_id => 100002925720160, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/195780_353236594755784_1996384468_q.jpg", :atenders => 65, :privacy => nil, :created_at => "2012-11-19 20:37:35", :updated_at => "2012-11-19 20:37:35" },
