  { :name => "Últimas 2 funciones de \"Granos de uva en el paladar\"", :longitude => -58.3734158, :latitude => -34.5997467, :gmaps => true, :description => "Luego de realizar funciones en el Ciclo 2012 de Teatro x la Identidad y ante la significativa repercusión por parte del público, “Granos de uva en el paladar”, obra  escrita y dirigida por las dramaturgas españolas Susana Hornos y Zaida Rico, realizará funciones los viernes de octubre y noviembre, a las 21, en el prestigioso y representativo Teatro Payró. Cabe destacar que dicho teatro está celebrando, en el mes de octubre, 60 años de actividad teatral independiente e ininterrumpida y fue recientemente reconocido por los Premios ACE.\n\n“Granos de uva en el paladar” plantea un recorrido por la historia de España entre 1932 hasta la actualidad, en el que seis actrices recrean este largo período de cambio y coraje a través de personajes que nunca aparecerán en los libros de historia. \n\nEl espectáculo enlaza tres historias desarrolladas a partir de tres cuentos de Susana Hornos: \"Chusa\", \"Adelina\" y \"La uva en el paladar\". La obra es interpretada por seis actrices que dan vida a una multiplicidad de personajes. La historia comienza poco antes de la Segunda República española y termina en la actualidad representando el sin sentido de la guerra, la dictadura y la injusticia del olvido a través de los personajes que nunca aparecerán en los libros de historia ni en documentales. \n\nPalabras de Susana Hornos y Zaida Rico\n\"La obra me ha redescubierto nuestro país, pero sobre todo su historia desde un lado humano que ni silencios ni transiciones han podido tapar. Siento que desde nuestro lugar, desde el teatro, hemos abierto una puerta, capaz que diminuta pero es un inicio, es la sensación de que del otro lado hay voces, susurros, gente que callaron, pero están. Nadie pudo ni podrá nunca con ellos”.  Susana Hornos. \n\n\"Esta obra me ha dado una visión holística, no sólo del hecho teatral, sino de la vida, de mi posición ante ella. Valorar el hecho de hablar sobre la historia de nuestro país, a la distancia, pero a la vez desde una cercanía y un amor (también dolor) muy grandes. Siento que todo lo que contamos en \"Granos de uva en el paladar\" está hecho desde el corazón\". Zaida Rico\n\nFicha artística-técnica\nActrices: Arantza Alonso, Morgane Amalia, Lucía Andreotta, Marta Cuenca, Clara Díaz, Ruth Palleja\nDiseño de caracterización y vestuario: Néstor Burgos\nIluminación: Mariano Arrigoni\nDiseño escenográfico: Alejandro Mateo\nBanda Sonora Original: Gonzalo Morales\nCoreografía \"Paco y Rosa\": Antonio Luppi\nFotografía: Akira Patiño\nProducción ejecutiva: Cooperativa \"Granos de uva en el paladar\"\nPrensa: Marisol Cambre\nDramaturgia y dirección: Susana Hornos y Zaida Rico\n\nVIERNES DE NOVIEMBRE A LAS 21HS.\nTeatro Payró | San Martín 766\nValor de la entrada $60 | Estudiantes y jubilados $30 (Presentando credencial)\nReservas: www.teatropayro.com.ar \nEn Facebook: Granosdeuva Enelpaladar  | Twitter:  @en_el_paladar\nMás información: www.granosdeuvaenelpaladar.blogspot.com.ar \n\n\nDice la crítica:\n\n\"Una pieza que ningún amante del arte debe dejar pasar, porque no sólo comprende a la innovación a la hora del relato, sino también al sentimiento y la identidad de un pueblo (...) Una capacidad interpretativa y corporal magnífica que permite la transmisión de las emociones con devoción y sentimiento. Generando una conexión con el público que va más allá de lo escénico, llevando esa ilusión teatral a una interacción directa con el corazón de la audiencia. Arantza Alonso, Morgane Amalia, Lucía Andreotta, Marta Cuenca, Clara Díaz y Ruth Palleja, todas se destacan, componiendo a lo largo de la obra diversos personajes y climas, animándose a combatir el silencio del olvido (...) gran capacidad de dirección para conjugar todos estos elementos, diseñando movimientos en escena que construyen lugares, develando gestos que dicen mucho y componiendo una obra que ataca la medianía y los grises; y los destroza con emoción, clase y jerarquía. Uno de esos fenómenos artísticos que consolidan un goce estético pero que dejan mucho más en la mente y el corazón de los espectadores\". Show on line\n\n\"Granos de uva en el paladar parece encontrar el punto justo entre la denuncia y la poetización, entre el llamado de atención a la memoria de los pueblos y la invitación al goce artístico (...) tiene delicadeza y sutil poesía pero también fuerza y profundidad para la denuncia de los hechos del pasado que inundan y condicionan nuestro presente. Es un viaje estético y político por las tierras de la memoria, es como un poema que a Lorca no le dejaron escribir. Le quedan justas las palabras finales del libro de Gusmán: 'Como diría Quentin Compson, este trabajo, como tantos otros, fue escrito para que se sepa…para que se sepa, incluido el sonido y la furia que hay en el derecho a la muerte escrita' (...) Vaya y ejercite su derecho (que es también obligación) a tener memoria\". Leedor\n\n\"Con la magnífica interpretación de Arantza Alonso, Morgane Amalia, Lucía Andretotta, Marta Cuenca, Clara Díaz, Ruth Palleja, 'Granos de uva en el paladar'se convierte en una de las propuestas teatrales más interesantes de la última parte del 2012\". Soy Buenos Aires.\n\n\"Granos… es un espectáculo equilibrado, conceptualmente orgánico, visualmente bien resuelto sobre la materia de la luz, claro en sus alusiones y elusiones, que vibra el contraste del rojo sobre el negro, la mutación de paños grises, ora embozo, ora fusiles, uniformes carcelarios, hábitos monjiles, avíos aldeanos; siempre objetos de juego y travestimiento. Una poderosa extrateatralidad potencia por las suyas este espectáculo y lo pone en diálogo con la realidad española inmediata\". Revista Veintitres\n\n\"Seis actrices españolas residentes en Buenos Aires se hacen cargo de casi una veintena de papeles que ellas van alternando con una fluidez en las transiciones que nunca empaña la claridad narrativa, pese a la celeridad con que tienen lugar los cambios de personaje, apoyados en precisas coreografías y en estilizadas composiciones\". La Nación\n\n“La pieza es un pertinente ejercicio de la memoria y cobra alta temperatura en la secuencia ‘17 años de vida, 75 de muerto’, con la ‘vuelta a vivir’ de un adolescente fusilado por acompañar a un amigo íntimo, cuyos restos son rescatados por sus deudos, ya mayores. Ahí lo trágico se abalanza sobre la escena y dispara una sombría poesía que vincula inevitablemente el drama de los desaparecidos en España con los desaparecidos argentinos de la última dictadura cívico-militar”. Telam\n\n“Las seis actrices construyen con dinamismo a los quince personajes comprometidos emocionalmente y la obra adquiere un lenguaje y ritmo escénico que le es propio. A través de sus desplazamientos y del poder expresivo, tanto de sus cuerpos como de sus gestos, de sus voces y de sus miradas, como la  presencia no menor de otros sistemas significantes - la iluminación, la banda sonora original y la coreografía- hacen que en esta propuesta estética la corporeidad social trascienda el color local y cada espectador realice su propio camino a través de los diferentes intersticios que la obra nos abre”. Luna teatral\n\n“La obra, con un desarrollo coral de gran inteligencia y con una notable precisión escénica, cuenta varias historias de amor, de revolución y de muerte que tienen su inicio en los días revueltos de la República. (…) La dirección y la puesta de Susana Hornos y Zaida Rico es impecable. Las actrices, todas y cada una de ellas, actúan con una precisión y un convicción que nos llevan, tan sólo con recursos interpretativos a los campos de Soria de Machado, a los olivares altivos de Hernández, a la Cataluña de Nin, regados de sangre plebeya que aun clama por su memoria”. Julio Fernández Baraibar, asesor del Secretario de Cultural de la Nación\n\n\"La intensidad en las tablas. Seis mujeres que en el escenario , nada se guardan. Nada se reservan...Y la pasion por denunciar, por actuar. El oficio puesto al servicio del espectador\". Rita Kall\n\n\"..una obra fuerte e impactante que reclama una nueva reflexión sobre temas universales de la humanidad como la violencia, la represión y el deseo de vivir como uno quiere\". El circuito de teatro\n\n“Un espectáculo punzante, profundo y emotivo…una mirada sobre la realidad española que nace en los fragores de la Guerra civil… las actrices nos llevan a puro relato, canción y cuidada expresión corporal por los senderos del odio, la culpa y la redención…” Rómulo Berruti\n\n\"...lo que hace grande a “Granos de uva en el paladar” es el hecho de contar historias anónimas en una historia de España conocida por todos, y esto siendo parte fundamental, sostenido por unas soberbias interpretaciones de las actrices  quienes dotan a sus criaturas de una expresividad magnífica, que junto al lenguaje corporal elegido hacen una conjunción impecable (...) logra el equilibrio justo entre un teatro educativo y poético, que rompe la barrera de lo común y se posiciona tranquilamente en un teatro de calidad artística\". Red teatral\n\n\n\"Granos de uva en el paladar atrapa desde el principio, con una puesta emotiva y rica, donde la femineidad está a flor de piel para retratar con poesía y exactitud momentos por demás difíciles de la historia de España, cuyas consecuencias se extienden a la actualidad\". Caleidoscopio de Lucy\n\nPara más Información, pedido de notas y acreditaciones: \nMarisol Cambre\nprensa@marisolcambre.com.ar \nwww.marisolcambre.com.ar \n\n\n-Se agradece la difusión y/o publicación de la presente información-\n", :start_time => "2012-11-23 19:00:00", :end_time => "2012-11-23 22:00:00", :address => "Viamonte 401-499, Buenos Aires, Autonomous City of Buenos Aires, Argentina", :fb_id => 388874401184305, :owner_id => 1234094535, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/592327_388874401184305_1802267183_q.jpg", :atenders => 128, :privacy => nil, :created_at => "2012-11-19 20:38:56", :updated_at => "2012-11-19 20:38:56" },
