  { :name => "Circulo de la Mujer Salvaje en Casa Lotus Valparaíso", :longitude => -114.4469317, :latitude => 32.6750415, :gmaps => true, :description => "CIRCULO DE MUJERES, Valparaiso, Chile.\n\nMUJER SALVAJE es un recuerdo en ti, está en tus celulas, en tu vientre, en tu corazón.\n\nRecordemos juntas, que el velo de la civilización, es moldeable por nuestro instinto, puede estar a nuestro servicio, para dirigirlo hacia los espacios de nuestra intuición, fuerza, creatividad, nuestro mas profundo amor y luz quieran ir.\n\nExperimentemos colectivamente este poder, en gozo, en danza, en conexión cosmica, en donde nuestro pulso sexual, creativo, ludico, mágico y medicinal pueda expresarse y renovarse.\n\npd. Si tienes algun instrumento (tambores, sonajas, didge, trompe, cuencos, tu voz, tus manos), y te gusta hacerlo sonar, será del todo bienvenido ! :)\n\n\nA QUIEN ESTA ENFOCADO\n· A todas las mujeres que quieran vivir mas plenas y compartir su caminar.\n\n♥ INSCRIPCIONES: en vignolar@gmail.com\n♥ Aporte sugerido: $3500.\n♥ Lugar: CASA LOTUS, yerbas buenas 780, cerro yungay, valparaiso.\n♥ Te invito a traer frutas para compartir y una botella de agua para ti.\n\ninfo: +56 9 88149161 • vignolar@gmail.com\nCaro Paz (Masajista ayurveda y profesora de yoga)", :start_time => "2012-11-24 16:30:00", :end_time => "2012-11-24 19:30:00", :address => "Lotus, Yuma, AZ 85365, USA", :fb_id => 265038120274894, :owner_id => 1151610221, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/372863_265038120274894_1995018078_q.jpg", :atenders => 35, :privacy => nil, :created_at => "2012-11-19 20:40:08", :updated_at => "2012-11-19 20:40:08" },
