  { :name => "Voyage au Mont Tremblant", :longitude => -74.5879657, :latitude => 46.2127176, :gmaps => true, :description => "(English version below)\n\n* Du 4 au 6 janvier 2013 (départ vendredi après-midi, ski toute la journée du samedi et du dimanche, départ le dimanche à 16h).\n\n* A Partir de 319$ taxes incluses\n\n* Date limite pour l'inscription: 30 novembre 2012\n\n* Le Forfait comprend 2 nuits\n\n* Transport aller-retour en autobus de luxe\n\n* Chambre au pied des pistes\n\n* Chambre occupation 6, 5, 4 personnes\n\n* Forfait ski inclus 2 jours de ski\n\n* Jacuzzi extérieur, sauna, Wi-Fi\n\n* Village de Tremblant avec ses attraits et attractions\n\n* Possibilité de loué de l'équipement (35$)\n\n* Leçon de snowboard et ski disponible ($)\n\n* Party de Chalet « après ski »\n\n* Sorties de nuit mystère ($)\n\n* Traîneau à chien, motoneige ($) Et plus encore...\n\n* Personnel disponible 24h/24 pour toute aide\n\n\nVidéo du voyage de l’année précédente : http://www.youtube.com/watch?v=XUMOBi1-wzc\n\nPour t'inscrire, rendez-vous au bureau voyage Le Transit (local 2225, pavillon Maurice Pollack)\n\n\n\n* From January 4 to 6, 2013 (starting Friday afternoon, ski all day Saturday and Sunday, leaving on Sunday at 16h).\n\n* Starting at $ 319 taxes included\n\n* Deadline for registration: November 30, 2012\n\n* The package includes 2 nights\n\n* Round-trip transportation by luxury bus\n\n* Room on the slopes\n\n* Room occupancy 6, 5, 4 people\n\n* Ski Package included 2 days of skiing\n\n* Outdoor Jacuzzi, sauna, Wi-Fi\n\n* Village of Tremblant with its charms and attractions\n\n* Possibility of leased equipment ($ 35)\n\n* Ski and snowboard lesson available ($)\n\n* Chalet Party \"after ski\"\n\n* Mystery night ($)\n\n* Dogsledding, snowmobiling ($) And more ...\n\n* Staff available for assistance 24h/24\n\nLast year it was crazy :  http://www.youtube.com/watch?v=XUMOBi1-wzc\n\nTo purchase your trip, come to \"bureau voyage Le Transit\" (local 2225, pavillon Maurice Pollack)", :start_time => "2013-01-04 02:00:00", :end_time => "2013-01-05 02:00:00", :address => "100-118 Chemin de Kandahar, Mont-Tremblant, QC J8E 1E1, Canada", :fb_id => 169941206483001, :owner_id => 275644492539183, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373280_169941206483001_1157439382_q.jpg", :atenders => 8, :privacy => nil, :created_at => "2012-11-19 20:41:01", :updated_at => "2012-11-19 20:41:01" },
  { :name => "ICARUS + CAÑONERO EN ONACIU", :longitude => -70.6408332, :latitude => -33.4285549, :gmaps => true, :description => "ROADIE.CL celebrará su quinto año de vida con una tocata explosiva!!!\n\nLas bandas ICARUS y CAÑONERO compartirán escenario el jueves 22 de noviembre en una noche de stoner-rock a fuego.\n\n::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\n\nICARUS finalizará su gira internacional con esta fecha, luego de presentarse en lugares como Buenos Aires, Montevideo y Punta Arenas. \n\nCAÑONERO se presentará por primera vez en Onaciú y adelantará nuevas canciones que siguen la línea de su primer discazo ¨Camino al alba¨. \n\n::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::::\n\nRESEÑAS DE LAS BANDAS:\n\nICARUS es una banda de stoner rock magallánico que ha recibido excelentes críticas a nivel internacional. De hecho, en MTV Iggy la destacaron como una de las mejores del mundo.\n\nSi  no nos cree, lea este artículo: http://www.publimetro.cl/nota/espectaculos/mtv-distingue-a-banda-de-punta-arenas-como-una-de-las-mejores-del-mundo/xIQlfA!0qCeVnbraYltM/\n\nEscúchelos en: http://soundcloud.com/icarusgasoline\n\n\nCAÑONERO es una banda de hard-rock-stoner que explota en velocidad y energía sobre el escenario, va en camino hacia su segundo disco y ha tocado en multitud de bares y pubs de Stgo y Valpo. \n\nEl gran David Ponce, hizo una reseña de su primer disco, léala aquí: http://www.lamusica.emol.com/detalle/index.asp?idnoticia=525767\n\nEscúchelos en: http://www.canonero.bandcamp.com\n\n\n\nNo se lo pierda!!!! Apoye al imperio del rock!!\n\nCuándo: Jueves 22 de noviembre, 23hrs.\nDónde: Bar Onaciu, Loreto 460\nCuánto: $3.000 hasta las 1am.\n\n\n\n", :start_time => "2012-11-22 02:00:00", :end_time => "2012-11-23 02:00:00", :address => "Loreto 390-498, Recoleta, Santiago Metropolitan Region, Chile", :fb_id => 370197059723263, :owner_id => 111856685497450, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276538_370197059723263_1142769177_q.jpg", :atenders => 64, :privacy => nil, :created_at => "2012-11-19 20:42:04", :updated_at => "2012-11-19 20:42:04" },
  { :name => "Revista Taller de Cuentos de La Bandera", :longitude => -70.6449938, :latitude => -33.5489654, :gmaps => true, :description => "Hola, \nEstamos participando en un TALLER DE CUENTOS dirigido a niños y jóvenes de la población La Bandera, en la comuna de San Ramón. Nuestro principal objetivo es fomentar la lectura y la escritura creativa a través de un trabajo muy personalizado. Actualmente tenemos un grupo permanente de alrededor de 30 niños que asisten al taller cada sábado. Puedes ver parte de nuestro trabajo en www.tallerlabandera.com y en https://www.youtube.com/watch?feature=player_embedded&v=y907vaXBnt0#!\n\nEn diciembre de este año LANZAREMOS UNA REVISTA con los cuentos escritos por los participantes del taller. Es por tal motivo que queremos SOLICITAR TU AYUDA para poder imprimir la revista en una imprenta y realizar un acto de lanzamiento junto a la comunidad de La Bandera. \nObviamente, están INVITADÍSIMOS AL LANZAMIENTO, que será el 9 de diciembre a las 13.00 horas en la Parroquia de Jesús Señor de la Vida (Av. Eduardo Barrios 1755, San Ramón).\n\nSi quieres ayudarnos por favor realiza tu aporte antes del 30 de noviembre a:\n\n\nNombre: Alejandro Fernández.\nRut: 15.777.184-1\nmail: pollofernandez@gmail.com \nBanco Security.\nCta ctte: E- 1235397-01\n\nTODO APORTE SIRVE!!\n\nMUCHAS GRACIAS!!", :start_time => "2012-12-09 11:00:00", :end_time => "2012-12-09 14:00:00", :address => "Eduardo Barrios 1755, San Ramón, Santiago Metropolitan Region, Chile", :fb_id => 522955924400874, :owner_id => 710408397, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/211211_522955924400874_1175278067_q.jpg", :atenders => 22, :privacy => nil, :created_at => "2012-11-19 20:42:35", :updated_at => "2012-11-19 20:42:35" },
  { :name => "BAZAR NAVIDEÑO \" MUNDO GENIAL\"", :longitude => -0.000173, :latitude => 0.000225, :gmaps => true, :description => "Los invitamos a participar del BAZAR NAVIDEÑO \"MUNDO GENIAL\", se llevará a cabo el día 1 diciembre desde las 10:30 hrs en adelante. \n\nEste bazar consiste en tener diferentes stands con variados productos a la venta de preferencia nuevos y si son usados deben estar en excelentes condiciones, ya contamos con algunos stands los productos a la venta son: adornos, alimentos en general, ropa de mujer, jugos, helados.\n\nPara participar en la venta debes inscribirte y reservar tu stand cancelando una cuota de $ 5.000 (cupos limitados) a más tardar el lunes 19 lunes noviembre.\n \nSi sólo quieres asistir ven el día sábado con tu familia, amigos o invita a quien tú quieras a participar asistiendo o poniendo un stand previamente inscrito.\n\t\t\t\nLos esperamos :) \n", :start_time => "2012-12-01 08:30:00", :end_time => "2012-12-01 16:00:00", :address => "Vicente Huidobro 383, Esq. Las Tranqueras LAS CONDES\" Jardin Infantil Mundo Genial \"", :fb_id => 111423115687793, :owner_id => 556511603, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/static-ak/rsrc.php/v2/yE/r/tKlGLd_GmXe.png", :atenders => 20, :privacy => nil, :created_at => "2012-11-19 20:42:39", :updated_at => "2012-11-19 20:42:39" },
