  { :name => "Evento benefico  Toki para Escuela de Musica Rapa Nui", :longitude => -70.641997, :latitude => -33.4691199, :gmaps => true, :description => "Como grupo de jóvenes rapanui y futura ONG Toki estamos organizando el primer evento benéfico para la Escuela de Música de Rapa Nui:\n\nNuestro fin es juntar fondos para financiar a los profesores del próximo año con clases de piano, violin y violoncello.\n\nEl evento será una presentación artística rapanui, coctel y remate.\n\n................... Detalles del evento..................................\n\nCoctel amenizado por música en vivo de Enrique Icka y Mario Tuki\n\nPresentación artística:\n-Mahani Teave, piano\n-Moa Edmunds, guitarra\n-Niños rapanui en piano y violín\n-Conjunto de baile rapanui Tautanga\n\nRemate de obras de arte rapanui, pinturas y esculturas, así como aportes de privados (grabado de R. Matta), etc.\n\n PRECIO ENTRADA 35.000 pesos\n\nHoy anunciaremos puntos de venta.\n\nPuede comprar electronicamente su entrada y le enviamos su entrada cuando nos escriba el numero de confirmacion al mail mahaniteave@gmail.com\n\nCuenta bipersonal:\n\n\nMahani Teave Williams  (RUT. 17948030-1) o\n\nBanco: Banco Itau\n\nCuenta:  203560208\n\nIBAN or SWIFT code: ITAUCLRM\n\nFono: 056-9-88036760\n\nInformacion adicional: Sucursal Republica", :start_time => "2012-11-21 17:30:00", :end_time => "2012-11-21 20:30:00", :address => "Ñuble 646-690, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 294012984048712, :owner_id => 510813263, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/277103_294012984048712_1089931737_q.jpg", :atenders => 62, :privacy => nil, :created_at => "2012-11-19 20:42:55", :updated_at => "2012-11-19 20:42:55" },
  { :name => "Feria de arte FAXXI 2012", :longitude => -70.570498, :latitude => -33.4025754, :gmaps => true, :description => "FAXXI, Feria Arte XXI, es un espacio de encuentro entre 100 artistas nacionales que, durante 5 días, exponen sus obras y venden en forma directa, sin intermediarios, al público asistente. FAXXI ofrece además, para adultos y niños, una serie de talleres y charlas relacionadas a diferentes aristas de las artes visuales.\n\nMISIÓN\nProporcionar una plataforma de aproximación y conocimiento de los mejores exponentes del arte nacional contemporáneo a través de la experiencia directa entre el artista y el público, y al mismo tiempo contribuir a la apertura de espacios de exhibición en Chile, a la adquisición de obras y a la integración de la sociedad al arte.\n\nEn su segunda versión, FAXXI se llevará a cabo desde el 6 al 9 de diciembre 2012 en el Rosedal del Parque Araucano.\nDirección: Presidente Riesco 5698, Las Condes", :start_time => "2012-12-06 22:45:00", :end_time => "2012-12-07 01:45:00", :address => "Presidente Riesco 5698, Las Condes, Santiago Metropolitan Region, Chile", :fb_id => 258895534222283, :owner_id => 718773841, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-prn1/41804_258895534222283_1107517448_q.jpg", :atenders => 29, :privacy => nil, :created_at => "2012-11-19 20:43:02", :updated_at => "2012-11-19 20:43:02" },
