  { :name => "Pre-ventas Paradise 2013 ! Fiesta año nuevo.", :longitude => -71.1972222, :latitude => -32.7866667, :gmaps => true, :description => "\t\nSi eres un sobreviviente del 2012! vive Paradise 2013 Still Alive\n\nhttps://www.facebook.com/2013Paradise\n\n▼Despliega la Info en Ver más.\n\n► Paradise Stage\n\n10.000 M2 Para activar tus sentidos con la mejor música!\nSeras envuelto de la magia de Paradise con un escenario de 10 metros de alto, 4 torres lanza fuego, tus oídos solo escucharan los armónicos de la música con un sistema line Array, tu ojos no podrán pestañar con las luces y las visuales en una Performance única en Chile.\n________________________________________________________________\n\n► Green Stage\n\nDesprende tus neuronas del estrés de la cuidad y sumérgete en el Green Stage de Paradise, donde podrás relajarte en un ambiente de armonía con la naturaleza y la música, donde tus sensaciones te llevaran al máximo.\n\n________________________________________________________________\n\n► VIP House\n\nTu exclusividad solo se vera reflejada en la VIP House, disfruta de una noche mágica con la mejor comodidad y privacidad, tu paladar sera seducido por los tragos que solo el paraíso te puede ofrecer, en un ambiente místico por los secretos que en la casa se ocultan.\n\n________________________________________________________________\n\n► VIP Lounge\n\nTu mente te puede llevar a lugares irreales, pero que para ti son la proyección de tus pensamientos mas íntimos, disfruta del VIP Lounge en un exceso que sólo podrás manejar con tus sentidos, deja que la música te lleve al éxtasis de la vida y los colores te envuelvan, siente como tus poros se abren y tu piel se eriza al vivir Paradise de una forma exclusiva.\n\n________________________________________________________________\n* Pronto Line-up\n\n\nSíguenos a traves de Facebook y Twitter\n\n►https://www.facebook.com/2013Paradise\n►https://twitter.com/Paradise_2013", :start_time => "2012-12-31 22:05:00", :end_time => "2013-01-01 06:00:00", :address => "María Rita 499, Calera, Valparaíso Region, Chile", :fb_id => 164857510320943, :owner_id => 1209816598, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/211190_164857510320943_306261318_q.jpg", :atenders => 627, :privacy => nil, :created_at => "2012-11-19 20:43:18", :updated_at => "2012-11-19 20:43:18" },
