  { :name => "Festival por la DIVERSIDAD", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Los invitamos a terminar el último día de clases celebrando la diversidad dentro de la universidad. Tendremos música, artistas, comida, cervezas, de todo para celebrar desde las 17.00 horas en el Patio de Humanidades del Campus San Joaquín.\n\n+ LIENZO DE LA DIVERSIDAD: tendremos pinturas y un lienzo y con la ayuda de un muralista TODOS podrán pintar parte del lienzo de las \"Agrupaciones por la diversidad\". Estaremos desde las 13.00 horas pintando.\n\n+ SERIGRAFÍA: trae tus poleras para que sean estampadas.\n\n+ KASKIVANO: contaremos con la presencia del gran Kaskivano y parte de su banda para acompañarnos con la música.\n\n+ CHORIPANES, CERVEZA, BEBIDA Y MUCHO MÁS.\n\nVen a compartir y celebrar..\n\nInvitan: U¿C? - Democracia UC - Colectivo Memoria PUC - CODECOMAPU - Cannabia UC - CEUC - FEUC.\n\n+++ LA UNIVERSIDAD ES DIVERSIDAD +++", :start_time => "2012-11-20 15:00:00", :end_time => "2012-11-20 20:30:00", :address => "Patio de Humanidades, Campus San Joaquín.", :fb_id => 447071922016272, :owner_id => 384197584982171, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373484_447071922016272_726871630_q.jpg", :atenders => 398, :privacy => nil, :created_at => "2012-11-19 20:44:01", :updated_at => "2012-11-19 20:44:01" },
  { :name => "Marcha Contra La Ley Hinzpeter", :longitude => -70.6790006, :latitude => -33.4504535, :gmaps => true, :description => "Como ya todos saben el gobierno por medio de la Ley Hinzpeter busca criminalizar todo acto que nosotros realicemos para expresarnos... Como respuesta a esto llamamos a todos aquellos que aún creen que la libertad de expresión es un derecho, a una marcha en el frontis de la USACH el día 20 de noviembre a las 11:30 de la mañana, se esperará hasta las 12:00 hrs pero se pide puntualidad por razones de organización.", :start_time => "2012-11-20 09:30:00", :end_time => "2012-11-20 12:30:00", :address => "Matucana 2-16, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 382665048475470, :owner_id => 100004592592847, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/276739_382665048475470_630020819_q.jpg", :atenders => 186, :privacy => nil, :created_at => "2012-11-19 20:44:06", :updated_at => "2012-11-19 20:44:06" },
