  { :name => "TRABAJOS DE VERANO 2013 Universitarios RM - #VeranoenBlocks", :longitude => -70.6347998, :latitude => -33.5071175, :gmaps => true, :description => "¿Sabías que en Chile más de UN MILLÓN de personas vive en BLOCKS de viviendas sociales? En la periferia de las ciudades, con malos servicios públicos, hacinadas en viviendas de bajo estándar, alejadas de las redes de cultura, trabajo y educación?\n\nPor eso, los Universitarios de RM  nos movilizamos del 3 al 13 de Enero para trabajar en una de las grandes heridas de nuestros país, para realizar proyectos comunitarios de infraestructura junto a las familias más excluidas y olvidadas de nuestra ciudad.\n\nTe invitamos a ver lo que Santiago esconde, ¡Nuestro trabajo es nuestra denuncia!\nJuntos podemos cambiar la historia de Chile, ¡HAZTE PARTE!.\n\nInscríbete en http://tinyurl.com/9bcopq2\n\nSíguenos en twitter a través de la cuenta @TECHOblocks y el hastag #VeranoenBlocks\n\nCualquier duda, escríbenos. ¡No te quedes fuera!\n\nSofía Mitarakis (sofia.mitarakis@techo.org)\nGerardo Zegers (gerardo.zegers@techo.org)\n\nJefes de Trabajos de Verano 2013 \nUniversitarios RM\nTECHO - Chile", :start_time => "2013-01-03 02:00:00", :end_time => "2013-01-04 02:00:00", :address => "Departamental 400-478, San Joaquín, Santiago Metropolitan Region, Chile", :fb_id => 540894935925919, :owner_id => 8093963076, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/592192_540894935925919_987779760_q.jpg", :atenders => 244, :privacy => nil, :created_at => "2012-11-19 20:44:16", :updated_at => "2012-11-19 20:44:16" },
  { :name => "Emory Dance Marathon", :longitude => -84.3215391, :latitude => 33.7967233, :gmaps => true, :description => "Hey Emory!\n  Come support The Children's Miracle Network by participating in this years Emory Dance Marathon Event! The Event is 6 hours long so come when you can and support this incredible charity! Free food and prizes will be given out sporadically throughout the event!\n\nEmory Miracle Marathon Facts\n\nWhat is Miracle Marathon?\n\nBenefiting Children’s Miracle Network (CMN), Miracle Marathon is the largest student-run philanthropy event at Emory University. Emory held its first marathon in 2003, and in the last eight years, we have raised more than $150,000.\n\nWhat is the event?\n\nThe 2012 Emory Miracle Marathon will be held on February 25th. The day is packed with entertainment and activities to keep the participants energized and enthusiastic. In the past we have had the Atlanta Falcons Cheerleaders, local bands a hypnotist and other exciting performances. Miracle Marathon serves as a celebration for the lives of children, and throughout the day Miracle Kids will share stories of their triumphs.\n\nWho benefits?\n\n100% of the funds raised will stay in Atlanta. All funds raised at Emory’s Miracle Marathon will benefit the Rehabilitation Services Program at Children's Healthcare of Atlanta. Rehabilitation Services helps children with traumatic brain injuries, spinal cord injuries, neurological diseases and other physical setbacks. The staff works with care to restore functions such as motor skills and balance, and the whole family is involved in the healing process. In the last five years, the bulk portion of our funds have gone towards the neo-natal intensive care unit at the Scottish Rite branch. ", :start_time => "2013-02-23 12:00:00", :end_time => "2013-02-23 18:00:00", :address => "1497 Clifton Rd NE, Emory Law School, Atlanta, GA 30329, USA", :fb_id => 429391520455027, :owner_id => 1084830068, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373134_429391520455027_987065540_q.jpg", :atenders => 82, :privacy => nil, :created_at => "2012-11-19 20:44:28", :updated_at => "2012-11-19 20:44:28" },
  { :name => "The 5th Annual Salsa Rueda Festival in SF, Feb. 14 -17, 2013", :longitude => -0.1310719, :latitude => 51.5097929, :gmaps => true, :description => "Salsa Vale Todo presents:\n\nThe 5th Annual Salsa Rueda Festival in San Francisco\n\nFebruary 14 -17, 2013, www.salsaruedafestival.com\n\nTimbaversity Guest Stars\n\nIsaias Rojas*, Ned Sublette, and Roberto Borrell\n\n- Lectures, Q & A sessions, and Multi-Media Demos on Cuban Music and Dance\n\n5 Live Bands: Rumbankete, Team Bahia, Rumbache, Dos 4, and Son de la Bahia\n\nDJ WaltDigz, DJ Dark Rum, and DJ Antonio\n\nDance Instructors: Isaias Rojas, Yeni Molinet, Roberto Borrell, Kati Hernandez, Yismari Ramos Tellez, René Dennis Thompson, Temistocles Betancourt, duane Wrenn, Julian Meija, Ramon Ramos Alayo, Royland Lobato, Sandra Moro Sleeper, El Salsaron Cubano, Mike and Simona, Chris Rogicki and Evelyn Ramirez, Rick Washington, Yussef Breffe, Greisy Prieto and Javier Rosillo, Leslie Vazquez and Reinier Fernandez, Victoria-Hadar Harel, Tania de La Pena, Wilfredo Guilbiac Rodriguez and Nick and Serena.\n\n- SRF Pre-Party!! Wednesday, Feb. 13th, 2013.  Flash Mob Ruedas around SF on The SVTIMBUS. Only 70 seats available on this incredible experience. check it out: http://www.facebook.com/events/275244412595845/?fref=ts\n\n- 15 min breaks between dance workshops.\n\n- 17 hours of Beginners Bootcamp!!\n\n- Beginners Mixer/Social Room\n\n- DJ Room with Timba, Salsa, Cubaton, Bachata, Reggaton, Kizomba and more\n\n- After - Party room with all star Salsa Timba DJ's till 5 a.m.\n----------------------------------------------------\n** Full and Limited Pass Price will go up on Nov.20th, 2012 **\n\nGet yours here: http://salsaruedafestival2013.eventbrite.com/\n----------------------------------------------------\nJoin us in celebration of Cuban music and dance in the US! We've grown to become the largest Cuban music and dance festival in the US. We've grown from 3 nights, 2 days, 3 classes at a time, 2 live bands, and 1 Hotel to 4 nights of non-stop dance and partying, 3 days of dance Workshops, 5 classes each hour to choose from, 5 Live Bands and 2 Hotels to house all the excitement. Each and every year our international guests and performers grows!! We hope this event supports and contributes to the ongoing growth of the Cuban salsa community in the United States and throughout the World. Thank you for your ongoing support of this event, building your Cuban salsa dance communities in your home towns, and being part of the ever changing and growing landscape of the salsa rueda and casino world!\n\nCheck out the press we've gotten in the New York Times:\nhttp://www.nytimes.com/2011/05/20/arts/music/a-havana-connection-infuses-the-music-scene.html\n\nAs always, each year the festival showcases new groups. The festival strives to be a welcoming, non-competitive environment for groups to showcase their latest works with others that share the love of Cuban music and dance. We have never turned away any group that wishes to participate. Our deadline for confirming 2013 performers is Nov. 30th, so please contact Nick and Serena if you are interested at salsavaletodo@gmail.com\n\nAs always, the festival is the third weekend in February and this year we are lucky to have President's Day on Monday, February 18th. So book your trip now and enjoy a long weekend in San Francisco at the festival!!!\n\n* not confirmed, waiting for confirmation of Visa", :start_time => "2013-02-14 21:00:00", :end_time => "2013-02-18 08:00:00", :address => "56 Whitcomb St, James's, City of Westminster, WC2H, UK", :fb_id => 298470440267394, :owner_id => 785751319, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/592214_298470440267394_420167044_q.jpg", :atenders => 358, :privacy => nil, :created_at => "2012-11-19 20:44:33", :updated_at => "2012-11-19 20:44:33" },
