  { :name => "St. Patrick's Day Savannah Style", :longitude => -81.09983419999999, :latitude => 32.0835407, :gmaps => true, :description => "So I bought a room at the Double Tree Inn right smack in downtown Savannah! If you buy now a for a 2 person room its $150 and that split about 6 ways is basically nothing! **P.S. there are cheaper places, but this is the cheapest for right on the Main St.**\n\nSo what I'm suggesting is COME to Savannah for St. Patty's Day! It's only supposed to be the best party on that day! Plus  it is on a Sunday this year so it works out for most everyone! \n\n\nThe Plan:\n\nCaravan 6am\nArrive at Savannah around 9am\nParty our faces off until there is NO MORE Green Beer left!\nCheck Out/ Head to Tybee for the day! (If class schedule prohibits)\nDrive Home to Good ol ATL\n\nWhat do you think?", :start_time => "2013-03-17 06:00:00", :end_time => "2013-03-17 09:00:00", :address => "2 N Fahm St, SCAD: Collaborative Learning Center, Savannah, GA 31401, USA", :fb_id => 522902031070334, :owner_id => 688090423, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/372819_522902031070334_85727784_q.jpg", :atenders => 17, :privacy => nil, :created_at => "2012-11-19 20:44:54", :updated_at => "2012-11-19 20:44:54" },
