  { :name => "Parranda 2012 Fundraiser for A Place of Comfort", :longitude => -81.27113399999999, :latitude => 28.528433, :gmaps => true, :description => "Dear Friends and Loved ones, \nIt gives me great pleasure to announce The Parranda 2012 Fundraiser for Easy Access Resource Inc and A Place of Comfort. \n\nThis years celebration will be taking place on Dec.1 at 8pm and will go until we have no voice from all the singing w...e will be doing again this year. It gives me great pride to have Easy Access Resource Inc and \"A Place of Comfort\" as t...he recipient of this year’s fundraiser. \n\nThe suggested donation for this years event is $15. This donation is not meant to be restrictive of the event, so if there should there be a hardship in which someone is not able to make a donation please contact me well in ADVANCE so arrangements can be made, and not at the front door of my home. I want everyone who wants to be a part of this to be here. \n\nI would like to touch on a few things before the party to ensure the enjoyment of all. I live in a residential neighborhood, please do not leave trash, beer bottles, and cups in my neighbor’s yard, and be quiet walking to and from your vehicles. Parking is a premium, so if at all possible carpool. The celebration is BYOB, which means bring your own alcohol to drink and some to share. That does not mean come with noting and expect people to get you drunk. Sorry I have to put it so bluntly but those who do that know who you are. Finally have a great time, enjoy the celebration and one another.\n\nI look forward to seeing you all on Dec. 1 for the best Parranda ever. May God Richly bless you all!!!\n\nLove,\nMichael Angelos\n\nFor more information you can email me at insurer519@aol.com The address of the celebration is 8042 Nicklaus Dr. Orlando, Fl 32825\n\n\n\n", :start_time => "2012-12-01 20:00:00", :end_time => "2012-12-02 03:00:00", :address => "8042 Nicklaus Dr, Orlando, FL 32825, USA", :fb_id => 557411400940621, :owner_i