  { :name => "De Santiago con amor, olvido y una tarjeta bip en el bolsillo", :longitude => -96.723586, :latitude => 17.0615969, :gmaps => true, :description => "ESTRENO TEATRAL 2012 DE TEATRO AZARES\nNuevo montaje teatral inspirado en la ciudad de Santiago se mueve entre las risas y los amores anónimos de sus habitantes.\nDesde el Viernes 09 de Noviembre sigue la temporada del montaje urbano “De Santiago con amor, olvido y una tarjeta Bip en el Bolsillo”. Este montaje relata a través del humor, la historia de 4 personajes habitantes de la ciudad de Santiago que luchan día a día por sobrevivir en la corriente citadina. \nEspacios llenos de historias, de amor y de desamor, como el Barrio Yungay, Bellas Artes, Plaza Italia, entre otros reconocibles lugares de Santiago, nos van revelando la vida de estos antihéroes capitalinos a través de una original narrativa y una puesta en escena que mezcla el audiovisual con el teatro.\nAldo es un hombre en extremo ahorrativo, acaba de contratar el plan perfecto de minutos de celular, lleva mucho tiempo calculando y promediando el plan ideal, ahora que lo ha encontrado tiene un solo problema, no tiene con quien gastarlos. \nEliana es una solitaria y reprimida mujer que sufre de narcolepsia, ella no conoce el amor, sólo fantasea con él a través de los sueños que su particularidad le trae y que ya no tolera. \nXimena y Gonzalo son una pareja que acaban de dar fin a una relación de esas que nunca terminan, entre los paisajes de Santiago, entre el tráfico, las bocinas y entre el metro van armando y desarmando su historia. \nEl chat, las citas a ciegas, los portales de pareja, todos son inspiración de este montaje que refleja tal cual las relaciones en nuestra ciudad y lo complejo de temas como el desamor, la soledad, el sexo y el olvido.\nViernes de noviembre a las 22:30 horas.\nTeatro Alcalá, sala Neruda.\nBellavista 97, Recoleta. Fono 732 71 61\n\nEntrada General $ 6.000.- \nEstudiantes y tercera edad $ 4.000.\nPreventa $ 3.000. (Puedes comprar preventa directo por la página de teatro Alcalá o con algún integrante de teatro Azares)\n\nCOMPAÑÍA DE TEATRO: AZARES\nDRAMATURGIA Y DIRECCIÓN: David Gajardo Gúmera\nASISTENCIA DE DIRECCIÓN: Leonardo de Luca Navarro\nPRODUCCIÓN GENERAL: Pía Maureira Alegría\nELENCO: Pía Maureira - Angélica Aitken - Martín Célis - David Gajardo\nASESORÍA FÍSICA: Patricio Cabrera\nDISEÑO TEATRAL: Fabián Torres\nREALIZACIÓN AUDIOVISUAL Y GRÁFICA: Rodrigo Aro\nCOMPOSICIÓN MUSICAL: Juan Escobar\nFOTOGRAFÍAS: Leonardo De Luca\n", :start_time => "2012-11-23 20:30:00", :end_time => "2012-11-23 23:30:00", :address => "Independencia 900, Centro, 68000 Oaxaca, Mexico", :fb_id => 476726742347581, :owner_id => 604966118, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373301_476726742347581_1183946558_q.jpg", :atenders => 125, :privacy => nil, :created_at => "2012-11-19 20:46:12", :updated_at => "2012-11-19 20:46:12" },
  { :name => "Showbook Apresenta: Wiz Khalifa In Rio!", :longitude => -43.1805007, :latitude => -22.9125059, :gmaps => true, :description => "Nós prometemos e vocês fizeram acontecer, com mais de 3 mil confirmados em apenas 3 dias, O show do Wiz Khalifa no Rio de Janeiro está confirmado para o dia 12 de janeiro de 2013.\n\nNada melhor do que os arcos da lapa para receber o Wiz na cidade maravilhosa! O show será na Fundição Progresso e fará parte do primeiro festival de hip hop do Showbook. Traremos diversas atividades ligadas a cultura hip hop, como grafite, djs, rap e outras atrações, proporcionando uma experiência única para os fãs. \n\nConfirme sua presença neste evento e compartilhe! \n\nCurta a nossa página e siga o nosso Twitter para ficar por dentro das promoções e anúncios do festival!\n \nFacebook: www.facebook.com/showbookbr\nTwitter: www.twitter.com/showbookbr\n\nINGRESSOS EM BREVE!\n\nShowbook - Você faz acontecer! \nwww.showbook.com.br", :start_time => "2013-01-12 02:00:00", :end_time => "2013-01-13 02:00:00", :address => "R. dos Arcos, 2-132 - Centro, Rio de Janeiro, 20230-060, Brazil", :fb_id => 377986105613814, :owner_id => 254956814523098, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/203603_377986105613814_1457820032_q.jpg", :atenders => 4974, :privacy => nil, :created_at => "2012-11-19 20:46:20", :updated_at => "2012-11-19 20:46:20" },
  { :name => "Tiesto | Glow at Echostage | GlowU Buses | 12.14 + 12.15", :longitude => 7.827862700000001, :latitude => 47.0721721, :gmaps => true, :description => "TIESTO returns to Glow in Washington, DC for his first shows at Echostage on Friday, December 14 & Saturday, December 15!\n\nContact your favorite GlowU rep on campus for school-specific transportation info or email info@glowu.com\n\nTables (almost sold out): \nzack@clubglow.com or 513.335.3208\n\nTickets:\nhttp://www.clubglow.com/\n\nhttp://www.glowu.com/ | @GlowU\nhttp://www.clubglow.com/ | @ClubGlow\n\nContact:\nzack@clubglow.com\ngian@clubglow.com", :start_time => "2012-12-14 22:00:00", :end_time => "2012-12-16 04:00:00", :address => "Hohstegen 169, 4954 Wyssachen, Switzerland", :fb_id => 505571179466990, :owner_id => 144126295733912, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276773_505571179466990_2087561670_q.jpg", :atenders => 51, :privacy => nil, :created_at => "2012-11-19 20:46:25", :updated_at => "2012-11-19 20:46:25" },
  { :name => "San Pedro de Atacama III (23 Nov. - 26 Nov.) / SEN", :longitude => -70.5620515, :latitude => -33.4204481, :gmaps => true, :description => "Te queremos invitar al tercer y último viaje a San Pedro de Atacama del semestre, entre el Viernes 23 de Noviembre y el Lunes 26 de Noviembre. \nVen y disfruta del desierto más seco y de una naturaleza única en el mundo, junto a un gran grupo de estudiantes de distintas universidades y nacionalidades. \n\nEl viaje incluye: \n\n- Pasaje Aereo: Santiago - Calama - Santiago.\n- Transfer: Calama - San Pedro - Calama.\n- Alojamiento*\n- Desayunos\n- BBQ de bienvenida (Cena del Viernes 23)\n- Excursiones**\n- Entrada a los parques nacionales (Valle de la Luna, Lagunas altiplánicas, Salar de atacama, Geysers del Tatio y Ojos del Salar)\n* Hostel en San Pedro de Atacama, con WI-FI, desayunos y biciletas de uso GRATUITO!\n** Valle de la Luna, Valle de la Muerte, Geyser del Tatio, Pueblos de Machuca, Lagunas Altiplanicas, Pueblos de Toconao y Socaire, Salar de Atacama, Laguna Chaxa, Laguna Cejar, Ojos del Salar y Salar de Tebinquinche.\n\n- El precio de viaje para Miembros de Santiago Exchange es de $ 240,000 / USD 480, Si pagas antes que se acaben los cupos.\n- El precio de viaje para No-Miembros de Santiago Exchange es de $ 260,000 / USD 520***, Si pagas antes que se acaben los cupos.\n*** Pide tu tarjeta de membresia y obten precios especiales para este viaje y durante todas nuestras actividades del semestre.\n\nPara confirmar tu participación deberás ingresar a www.santiagoexchange.cl, entrar a VIAJES, SAN PEDRO DE ATACAMA, llenar el formulario, enviarlo y luego podrás pagar utilizando el sistema PayPal.\n\nComo alternativa al pago PayPal, puedes ir a un Banco BICE y hacer un depósito bancario a la siguiente Cuenta Corriente:\n- Banco: BICE\n- Cuenta Corriente N°: 12-75309-8\n- Nombre: Servicios y Eventos S&C Limitada\n- Rut: 76.126.605-5 \n- E-mail: info@santiagoexchange.cl (Enviar mail de confirmación una vez realizado el pago)\n\nPD 1: Si somos menos de 10 inscritos el Viaje se suspende y se hacen las respectivas devoluciones de dinero.\nPD 2: Despues de comprado los pasajes aereos no hay devoluciones, ya que los pasajes son intransferibles.", :start_time => "2012-11-23 05:00:00", :end_time => "2012-11-26 21:00:00", :address => "Hernando de Magallanes 1231-1269, Las Condes, Santiago Metropolitan Region, Chile", :fb_id => 122487651236008, :owner_id => 197537983647949, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373054_122487651236008_650873574_q.jpg", :atenders => 11, :privacy => nil, :created_at => "2012-11-19 20:46:35", :updated_at => "2012-11-19 20:46:35" },
  { :name => "Cambio de Mando - Centro de Alumnos de Ingeniería", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Todos invitados al cambio de mando del Centro de Alumnos de Ingeniería UC. Este partirá con una misa a las 10:30 horas en el templo de SJ para luego dar paso a la ceremonia de cambio de mando a las 11:30 horas en la sala Raúl Devés.\n\nLos invitamos a todos, a despedir al CAi 2012 y a darle la bienvenida al CAi 2013.\n", :start_time => "2012-11-20 08:30:00", :end_time => "2012-11-20 11:30:00", :address => "Raúl Devés. Ingeniería UC", :fb_id => 408344162568088, :owner_id => 100003733476045, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/261157_408344162568088_1350154819_q.jpg", :atenders => 182, :privacy => nil, :created_at => "2012-11-19 20:46:50", :updated_at => "2012-11-19 20:46:50" },
  { :name => "Fonda Oficial de Maitencillo (18 de septiembre)", :longitude => 0.000181, :latitude => 0.000189, :gmaps => true, :description => "FONDA OFICIAL DE MAITENCILLO (UP25) --> RESERVA TÚ VAN:\nPara la ida\nDebes reservar con anticipación y elegir uno de los horarios disponibles entre las 22:45 y las 02:30.La van te pasará a buscar a la hora y lugar acordados para llevarte a la fonda.\nVan Completa (10 a 12 pp): $30.000 (solo ida)\nMedia Van (hasta 5 pp): $20.000 (solo ida)\n**Reserva previa transferencia electrónica**\n\nPara la vuelta\nLas vans estarán esperando a la salida de la fonda a partir de las 4:00 am. Salen a maitencillo a medida que se van llenando. El recorrido para dejar pasajeros es solo por la calle principal llendo de norte a sur.\nTarifa única por persona $3.000\n\nReserva@choferonline.cl – 95189433\n(Servicio  sólo disponible para sector Maitencillo. Para otros sectores por favor preguntar por teléfono).\n\nEMPEZARON LAS PAYAS SEÑOOORESSS!\n\nAfírmense cabritos!\nQue este año pide fonda a gritos... Tenemos 4 noches de fiesta, a ver cómo salimos de esta! (15, 16, 17 y 18 con todos los clásicos, banda fondera en vivo con todo el style diciochero).\n\nSi todavía no sabe dónde es este brillo,\nEs en la Ramada Las Palmas de Maitencillo,\nY si no se acuerda cómo estuvo el año pasado \nQuizás cómo se debe haber portado!\n(dj´s, chicha, piscola, empanadas, choripanes, pañuelo en mano, y mucho más, celebrando como siempre el carrete más esperado del año)\n\nPoniéndole color este año\nhasta que salga el care' gallo:\n\n★ARMANDO JARANA \n★SONORA MADRIGAL (Elegido como la banda tropical del 2011)\n★DJ´S invitados\n\nHay que sacudir el polvo ay sí\nDe las paletas y las parrillas \nque esta fonda será una maravilla!\n(Prepare maletas, desempolve parrillas, cargue su cooler)\n\nSi tiene duda de cómo se viene este año!\nNo se preocupe, agrandamos los baaañoos ..\nY si aún cree que esto es un leseo\nMétale triple w y cáchese el tremendo paseo.\n(Toda la información sobre datos de alojamiento y mapa de la Fonda en: www.fondamaitencillo.cl, y próximamente más info de precios, puntos de venta, etc.)\n\n★ Pre-venta -->las entradas para el 15, 16 ,17 y 18 a $20.000, $5.000 por día! Stock de entradas limitada.\nSANTIAGO\nCon recargo: Sistema de Punto Ticket\nSin recargo: Celulares: 97313700 / 96710728\nMAITENCILLO:\nLa picá de la flora (Laguna de Zapallar) y team de playa. Entradas limitadas.\n\nEn Puerta ($ 7.000 hasta las 1:30 am)\nAproveche de comprar preventa con Acceso directo, con eso entraran directo al evento.\n\nOJO Chiquillos que si no se ponen pillos, \nse van a quedar sin brillo\nY no los veré en la gran fonda de Maitencillo!!!\n(arriende pronto su casa!) \n\nFonda Oficial de Maitencillo\nY que Viva Chile mierda! UYUUUUUIIIIII\n\nMaitencillo-Cachagua-Zapallar-Marbella (SOLO MAYORES DE 25 AÑOS)\n\nAmigos FB: http://www.facebook.com/profile.php?id=100000167147256", :start_time => "2012-09-15 22:00:00", :end_time => "2012-09-19 05:00:00", :address => "Media Luna de Maitencillo (camino izq del KIRON)", :fb_id => 252676928119706, :owner_id => nil, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373222_252676928119706_1570189644_q.jpg", :atenders => 0, :privacy => nil, :created_at => "2012-11-19 20:46:55", :updated_at => "2012-11-19 20:46:55" },
