  { :name => "End of the World: FOREM Winter Formal", :longitude => -78.898619, :latitude => 35.9940329, :gmaps => true, :description => "So, the Mayans were pretty smart, and they predicted that the world will end on December 21, 2012. Unfortunately, none of us will have graduated from Duke by then, so that kind of sucks...\n\nIn spite of that, join us for FOREM's Winter Formal, celebrating the end of the semester (and the world) with drinks, dancing, and hopefully some memories!\n\nThe doomsday festivities will be taking place at Casbah Durham on Main Street. Tickets include a free drink, and there will be a cash bar for the rest of the night. $8 FOREM, $12 non-FOREM.\n\nAttire is, well, formal, so dust off your suit jackets and high heels, 'cause it's gonna be a classy night.\n\nTabling will start the week after Thanksgiving, so look out for your beautiful FOREM representatives.\n\nNote: the world will not actually end on December 21, it's just a good reason to party.", :start_time => "2012-12-06 21:00:00", :end_time => "2012-12-07 02:00:00", :address => "E Main St at Roxboro St, Durham, NC 27701, USA", :fb_id => 432371446811545, :owner_id => 1464390153, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276409_432371446811545_2048396193_q.jpg", :atenders => 57, :privacy => nil, :created_at => "2012-11-19 20:47:43", :updated_at => "2012-11-19 20:47:43" },
