  { :name => "MONTE MAPU FESTIVAL 2013", :longitude => -99.2171994, :latitude => 19.7082033, :gmaps => true, :description => "╔════════════════════╗\nॐ   MONTE MAPU FESTIVAL 2013  ॐ\n╚════════════════════╝\n\n\"MONTEMAPU\" (Salvemos la Tierra) escrito en Mapudungún, lengua autóctona de Chile, tribu de los Mapuches o Araucanos como nombraron los españoles. Este nombre nace con el propósito de dar a conocer el problema que existe en este momento en el mundo entero.\n\n\"MONTEMAPU\" (Let's save the Earth) written in Mapudungun, the native tongue of Chile, of the Mapuche tribes or Araucanians, as named by the Spanish. This name is born with the sole purpose of raising awareness of the problem that exists at this time in the world. \n\n\"La Tierra es nuestro hogar y el hogar de todos los seres vivos. La Tierra misma está viva. Somos partes de un universo en evolución. Somos miembros de una comunidad de vida interdependiente con una magnificente diversidad de formas de vida y culturas. Nos sentimos humildes ante la belleza de la Tierra y compartimos una reverencia por la vida y las fuentes de nuestro ser...\" \n\nSerá tú festival… tu alegría es fundamental!!! Trae colores, juegos y danza…\n\nNo contaminar será la demostración de que somos capaces de aportar un grano de arena a esta causa. Podemos vivir en armonía con lo que nos rodea y con nosotros mismos. Apoyándonos y cuidándonos unos a otros.\n\nLugar: Balneario El Trébol. (http://www.balnearioeltrebol.cl)\n\n◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊\n\nSTAGE CULTURAL CALENTAMIENTO GLOBAL\nSTAGE MONTE MAPU (Psytrance, Full On, Progressive)\nSTAGE GOA - DARK\nSTAGE CHILL OUT\n\nPRONTO ARTISTAS CONFIRMADOS !!! \n\n◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊\n\n►►►VENTA DE ENTRADAS◄◄◄\nPreventas en Feria Ticket & Oficina Global Blue (Bombero Núñez 178, Bellavista)\nPreventas Diciembre: $17.000 sin recargo.\nPreventas Enero: $17.000 sin recargo.\nPreventas Febrero: $20.000 sin recargo.\nVenta Marzo y en puerta $22.000 sin recargo.\nExtranjeros: $35 dólares. ($17.000 pesos chilenos con pasaporte en mano y ticket aéreo)\n\n►►►PONTO DE VENDA BRASIL (SP)◄◄◄\n\nE.Music Brasil - Brasil - São Paulo - Ipiranga\nEduardo Marques\nFone: +55 11 963500375 / 11-4306-0610\nE-mail: eduardo@respect.art.br\nZaghini +55 11 9443 2910\nValor: 60 Reais.\n\n\n◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊◊\n\nCÓMO LLEGAR... \n\nEn el kilómetro 43 de la ruta 5 Sur, pasado el paso nivel superior de Paine, encontrará una salida que va hacia la costa la cual dice \"camino a Isla de Maipo\". Siguiendo este camino por 9 kilómetros encontrará un enlace, donde debe virar a la izquierda, hacia Valdivia de Paine el que debe seguir durante 6 kms. señalizados para llegar a Balneario El Trébol ubicado a mano izquierda.\n\n✿✿✿ EL PAGO DE TU ENTRADA TE DA DERECHO A ✿✿✿\n- Disfrutar de los 3 días del festival y participar de todas las actividades programadas, presentaciones en los 4 escenarios, performances y talleres del sector Eco-cultura.\n- Estacionar durante los 3 días del festival sin costo adicional y con guardias de seguridad que vigilarán día y noche el parking de estacionamientos.\n- Usar las piscinas, duchas y baños.\n- Recibir una pulsera oficial, que te acredita a participar de los días del festival.\n- Primeros Auxilios: contaremos con ambulancia y comunicación con el servicio médico más cercano.\nRECUERDA: que al ir a un camping normal la entrada por día cuesta alrededor de $ 4.000. Por eso seamos conscientes y paguemos la entrada en forma normal para que este festival sea autosustentable.\n\n✿✿✿ INFORMACIÓN GENERAL ✿✿✿\n- Los niños hasta 12 años ENTRAN GRATIS.\n- Habrá seguridad en todo el perímetro del camping.\n- Tendremos Stands de Comida (También comida vegetariana) a precios muy económicos, para que tu bolsillo no se reciente y puedas comer saludable y barato.\n- Stands ecológicos, culturales y ropa alternativa.\n»»»NO SE PERMITE EL INGRESO DE BEBIDAS ALCOHÓLICAS, ÉSTAS SERÁN REQUISADAS EN LA PUERTA, DENTRO DEL FESTIVAL SE VENDERÁ«««\n\n✿✿✿ ELEMENTOS PRIMORDIALES ✿✿✿\n- Linternas.\n- Lentes de Sol.\n- Protector Solar.\n- Carpa, Saco de dormir.\n- Ropa de abrigo para la noche.\n- Bolsas para la basura.\n- Repelente para insectos\n- Las cosas que requieras para que tu estadía sea más cómoda!!!\n\n\n¡CUIDA LA NATURALEZA!\n¡RESPETA A LOS QUE TE RODEAN!\n¡NO BOTES BASURA FUERA DE LOS LUGARES INDICADOS!\n¡NO DESPERDICIAR AGUA DISPONIBLE EN CAMPINGS!\n¡CUIDEMOS NUESTRO PLANETA! \n\"La tierra no es del hombre, el hombre es de la tierra.\"\n\n\n٩(●̮̮̃•̃)۶ ÚNETE A NOSOTROS! ٩(●̮̮̃•̃)۶ \n\nFacebook: http://www.facebook.com/pages/Festival-Monte-Mapu/63938594064?ref=hl\nTwitter: http://www.twitter.com/montemapu\n\n\nProduce: Global Blue, Bpms.\nhttp://www.globalblue.cl/\nhttp://www.bpms.cl/", :start_time => "2013-03-08 10:00:00", :end_time => "2013-03-10 19:00:00", :address => "Cristóbal Colón, Texcacoa, 54605 Tepotzotlán, State of Mexico, Mexico", :fb_id => 304468629659260, :owner_id => 1220533175, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373526_304468629659260_36141152_q.jpg", :atenders => 823, :privacy => nil, :created_at => "2012-11-19 20:48:39", :updated_at => "2012-11-19 20:48:39" },
