  { :name => "PAULO MÉNDEZ REVISTA ED MEJOR DISEÑADOR DE MODA 2012", :longitude => -0.000261, :latitude => 0.000135, :gmaps => true, :description => "Señor\nPaulo Méndez\nPRESENTE\nSantiago, 20 de septiembre de 2012\n \nEstimado,\n\nJunto con saludarlo, tenemos el agrado de comunicarle que ha sido elegido como uno de los tres finalistas del “Ranking ED” en la categoría “Mejor Diseñador de Modas”, premio que por tercer año ha reunido a Revista ED y Mastercard Black para distinguir a lo más destacado de nuestro país en tendencias, cultura, viajes y gastronomía.\n\nExtendiéndole nuestras felicitaciones, le informamos que la metodología estuvo a cargo de la empresa de estudios de mercado Feedback. Se hizo un llamado público a través de mailing y redes sociales  para  que nuestros lectores votaran por su favorito, logrando recibir más   de\n10.000 votaciones en el total de las   24 categorías – cada una de ellas con alrededor de 6 nominados escogidos por ED y críticos, académicos y periodistas.\n\nEl nombre   de los nominados y   ganador de cada uno de los premios se conocerá en una ceremonia que se realizará el próximo jueves 11 de octubre a las 20:00 hrs. en la Embajada de Italia (ubicada la calle Miguel Claro 1359, Providencia) y luego se publicarán los resultados en la revista que circulará a partir del viernes 12 de octubre.\n\nPara Revista ED y Mastercard Black es de suma relevancia que estén presentes en el evento, por lo que puede asistir con un acompañante confirmando  nombre y rut de quienes asistan.\n\nReiterando nuestras felicitaciones y esperando su confirmación, se despiden atentamente,\n\n\n\n\n\n\n\n\n\n\nMagdalena Bock\t    Paula Urenda Directora\tGerente General Revista ED\t\tRevista ED\n\n\n\n", :start_time => "2012-11-30 02:00:00", :end_time => "2012-12-01 02:00:00", :address => nil, :fb_id => 414682751900816, :owner_id => 110097999032982, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/211146_41468275