  { :name => "A lukita el número!!! ... y tu premio es arte", :longitude => -70.31139329999999, :latitude => -18.4881632, :gmaps => true, :description => "¿Como participar? Debes depositar en la cuenta de ahorro Banco Estado n° 25760140190, a nombre de Newen tenencia responsable de animales, rut: 65.029.726-1, enviar mail de confirmación o comprobante de depósito al correo tenenciaresponsable2010@gmail.com, y ya estás participando.\n\nLa designación del número se realizará sólo con mail comprobante de transferencia o envío de la copia del depósito.\n\nPREMIOS:\n•\tEscultura en madera de Roberto Pizarro, Escultor www.roberto-pizarro.blogspot.com/\n•\tCuadro de Ricardo Mosella, www.youtube.com/watch?v=EMGLtHvnTCI\n•\tPieza de cerámica esmaltada de Andrea Leyton  www.antutalleruca.blogspot.com/\n•\tEscultura “Luna de cuarzo” de Francy Huenchuñir\n•\tLibro “Nostalgias de lo improbable” Lisselotte Alvarez  www.creolina1876.wordpress.com/\n•\tLibros a elección en tienda Periscopio (equivalente a $10.000) www.facebook.com/periscopio.islanegra\n\nLos premios serán entregados en el litoral central, Santiago en Metro Salvador y Chillán.\n\nEl sorteo se realizará el día 26 de Noviembre a las 17:00 hrs. en el Café Calú, calle Isidoro Dubornais 4380 local 2, Isla Negra. Los resultados se publicarán en facebook. \n\nEsta actividad pretende reunir fondos para los gastos clínicos de animales rescatados, alimentación de callejeros en peligro, esterilización de abandonados y/o callejeros, insumos varios, la compra pipetas para nuestros Tito y Kena, gastos en general que nunca faltan habiendo tanta irresponsabilidad e indolencia presente en nuestra sociedad. \n", :start_time => "2012-11-26 02:00:00", :end_time => "2012-11-27 02:00:00", :address => "Isla Negra 301-399, Arica, Arica and Parinacota Region, Chile", :fb_id => 472108459488348, :owner_id => 100001089585405, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/592331_47210845948834