  { :name => "Matrimonios Santiago", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "http://www.facebook.com/matrimonios.santiago\n\nEstimados amig@s;\n\nHemos observado lo difícil y costoso que es organizar un matrimonio. Muchos amigos nos preguntan por datos y esas cosas, asique desde hace un tiempo que hemos estado trabajando para facilitarles el cuento a quienes quieran casarse. Estamos logrado tener algunos convenios y seguimos trabajando para incluir muchos más. \n\nSi tienen algun familiar o amigo cercanos que estés en busca de banquetera y/o centros de eventos nosotros podemos ayudarlos.\n\nLos invitamos a visitar nuestro nuevo fan page! .... dale like\nhttp://www.facebook.com/matrimonios.santiago", :start_time => "2012-11-25 21:00:00", :end_time => "2012-11-26 00:00:00", :address => nil, :fb_id => 439497462753849, :owner_id => 1107437797, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373147_439497462753849_1586339010_q.jpg", :atenders => 66, :privacy => nil, :created_at => "2012-11-19 21:06:14", :updated_at => "2012-11-19 21:06:14" },
  { :name => "Vote for Confess - Bråvalla Festival 2013", :longitude => -0.000186, :latitude => 0.000194, :gmaps => true, :description => "Damer och herrar, Det är dags att rösta på Confess så vi kan få lira på \"Bråballa Festivalen\" i Sommar med artister som - Green day, Rammstein & Avicii. Klicka bara på länken och skriv Confess på alla rader. Peace\n\nhttp://www.bravallafestival.se/sv/onska/onska-band/\n\n--------------------------------------------------------------------------------\n\nLadies and gentlemen, It's time to vote for confess to play at \"Bråballa Festival\" along with artist like - Green day, Rammstein & Avicii Just click on the link and type in Confess on all the Lines. Thank U \n\nhttp://www.bravallafestival.se/sv/onska/onska-band/", :start_time => "2013-06-26 18:00:00", :end_time => "2013-06-26 21:00:00", :address => nil, :fb_id => 241327695992839, :owner_id => 131372216873460, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/188188_241327695992839_448915639_q.jpg", :atenders => 43, :privacy => nil, :created_at => "2012-11-19 21:06:55", :updated_at => "2012-11-19 21:06:55" },
  { :name => "Projekt hitta vattenscootrarna!!!", :longitude => 17.916667, :latitude => 59.38333300000001, :gmaps => true, :description => "Den som ser till att våra (ronny hall) vattenscootrar kommer tillbaka så gott som hela får en hittelön på 20.000:-!!!!!!!!!! Dem försvann från spånga center mellan 27:e maj och 12:e juni. Det är en rödsvart seadoo 2006 och en rödvit seadoo 2007. Båda är av modellen rxt och har 215hk. Vid tillfället stod dem på en dubbeltrailer där båda står bredvid varandra. Vore tacksam om de kom tillbaka!!! Hoppas ni får en trevlig sommar, för d lär väl inte vi få :(\n\n\n\nNu tycker vi att alla hjälps åt o sprider detta vidare!!! \nHjälp os få tillbaka en efterlängtad sommar!!!\nHann inte ens doppa dem i år!\n\nFördjävligt o bli av me grejjer asså!!!!!!\n\nKommer förmodligen vara med på efterlyst oxå :)", :start_time => "2012-12-24 02:00:00", :end_time => "2012-12-25 02:00:00", :address => "Cervins väg 54A, 163 41 Spånga, Sweden", :fb_id => 372677752785258, :owner_id => 100003483606470, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash3/157978_372677752785258_224879466_q.jpg", :atenders => 265, :privacy => nil, :created_at => "2012-11-19 21:07:01", :updated_at => "2012-11-19 21:07:01" },
  { :name => "Handels Surfresa 2012", :longitude => -9.6, :latitude => 30.4333333, :gmaps => true, :description => "EDIT: Surfresan är full! Jätteroligt med så stort tryck. Vi är alltså fullbokade men ni kan fortfarande maila och hoppas att ni kommer med från reservlistan.\n\nAloooohaa!\n\nSurfresan!!!\nNu har det äntligen blivit dags för surfresa med Handels! 7 dagar i soliga Marocko där vi surfar, festar och bara i allmänhet har så jävla roligt som bara handelsstudenter på resa kan ha!\n\nVi kommer att åka 40 personer och alla bor tillsammans i vårat helt egna hus precis bredvid stranden (inga jobbiga grannar). Huset har självklart terass där vi allihopa kan sitta på eftermiddagarna och ta en bärs och chilla.\n\n\n27 november till 04 december\nResan kommer att äga rum 27nov-4 dec, dvs precis när det börjar bli ordentligt kallt och jävligt i Sverige och när man verkligen vill åka och få lite sol på sig. Självklart missar man lite skoldagar men vi har satt datumen precis så att man inte missar nånting jätteviktigt.\n\n\nI \"all inclusive paketet\" så ingår Mat, Boende, Flyg, Utrustning, Instruktörer, och allt annat vi behöver! (förutom alkohol såklart, det får man köpa själv)\n\nHar man surfat tidigare och inte behöver instruktör så kan man tillochmed få ytterligare rabatt på priset (400kr billigare). Vilket av paketen man väljer får man bestämma vid ett lite senare tillfälle (exakt vad paketen innehåller och kostar står nedan)\n\n\nAnmäl er genom att \n1.\tSkicka ett mail till 50146@student.hhs.se\n\n2.\tNär vi fått er anmälan betalar ni in 1000 kr handpenning till det kontonr som skickas till er på mail (fyll i ert namn i meddelandefältet). Sätter ni inte snarast in pengarna tar vi bort er anmälan så att någon annan kan få den platsen.\n\n3.\tBoka flygbiljetten med Norwegian. Det kan gå att copy pasta länken nedan. Annars så är det: \nDitresa: 06.00, 27e nov, Arlanda till Marrakech. \nHemresa: 11.00, 04 dec, Marrakech till Arlanda\n\nhttp://www.norwegian.com/se/flyg/valj-flyvning/?D_City=ARN&A_City=RAK&D_SelectedDay=27&D_Day=27&D_Month=201211&R_SelectedDay=04&R_Day=04&R_Month=201212&dFare=749&rFare=867&AgreementCodeFK=-1&CurrencyCode=SEK&rnd=76415\n\n\nVill ni ha med en kompis som inte är \"bjuden\" till detta evenemang så bjud in dem!\n\n\nFrågor? Skriv här i eventet eller ring Helene 0735462623 eller Johan 0738414145\n\n\n/ Reseledarna\nHelene & Johan\n\n\n\n\n\n\n3 olika alternativ finns att välja på:\n\nPaket 1:\n•\tBoende under hela vistelsen i surfhuset \t\n•\tFrukost, lunch och middag alla dagar samt välkomstdrink/öl/vin \n•\tTransfer till och från Marrakech flygplats i privat chartrad transfer\t\n•\tFrukt och vatten i transferbussen \n•\tUtrustning som våtdräkter, bräda etc. \t\n•\tDaglig surfundervisning \n•\tCertifierade surfinstruktörer uppdelade på de olika grupperna \n•\tDaglig transport till det surfspot som funkar bäst för dagen\n•\tEn utflykt till marknaden ”Souk” \nPris per person: 3495 sek\n\nPaket 2:\n•\tBoende under hela vistelsen i surfhuset \n•\tFrukost, lunch och middag alla dagar samt välkomstdrink/öl/vin \n•\tTransfer till och från Marrakech flygplats i privat chartrad transfer \n•\tFrukt och vatten i transferbussen \n•\tUtrustning som våtdräkter, bräda etc.\n•\tDaglig surfguidning\n•\tDaglig transport till det surfspot som funkar bäst för dagen \t\n•\tEn utflykt till marknaden ”Souk”\nPris per person: 3095 sek\n\nPaket 3: \n•\tBoende under hela vistelsen i surfhuset \n•\tFrukost, lunch och middag alla dagar samt välkomstdrink/öl/vin \n•\tTransfer till och från Marrakech flygplats i privat chartrad transfer \n•\tFrukt och vatten i transferbussen \n•\tEn utflykt till marknaden ”Souk”\nPris per person: 2595 sek\n\nBonus!\nSom Xtravel-gäst får du träna gratis en månad före din resa på World Class. Dessutom har du 15% rabatt på Helly Hansens Brandstore på Hamngatan i Stockholm, 15% på Alpingaragets hela sortiment (formgjutna pjäxor undantaget) samt 20% på alla hjälmar och ryggskydd från POC på Alpingaraget i Stockholm.\n\n", :start_time => "2012-11-27 02:00:00", :end_time => "2012-11-28 02:00:00", :address => "Route du Cimetière, Agadir, Morocco", :fb_id => 174261032710624, :owner_id => 700865289, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276815_174261032710624_867901381_q.jpg", :atenders => 61, :privacy => nil, :created_at => "2012-11-19 21:07:07", :updated_at => "2012-11-19 21:07:07" },
  { :name => "Swedish House Mafia @ Friends Arena", :longitude => 18.06491, :latitude => 59.32893000000001, :gmaps => true, :description => "Swedish House Mafia proudly announce their homecoming. Friends Arena. Nov 24th. Stockholm. Tickets on sale June 25th 9am. There's no place like home. #SHMSTHLM\n\nTickets and information here: http://www.swedishhousemafia.com/stockholm\n       ", :start_time => "2012-11-24 02:00:00", :end_time => "2012-11-25 02:00:00", :address => "Akademigränd 6, 111 52 Stockholm, Sweden", :fb_id => 232892280163148, :owner_id => 69448024527, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/188036_232892280163148_159222416_q.jpg", :atenders => 4968, :privacy => nil, :created_at => "2012-11-19 21:07:14", :updated_at => "2012-11-19 21:07:14" },
  { :name => "PROMOTERS WANTED", :longitude => 153.0287103, :latitude => -27.4681797, :gmaps => true, :description => "Have you ever wondered who those people are at the clubs that know everyone, party every where for free, have the hook up on festival tickets, and much more? Well those are promoters!!!\n\nThe Planet is expanding by moving to GPO every single Friday and needs fun, outgoing, motivated, sociable, people that love dance music and getting loose.\nBecome a promoter for The Planet and party with your mates for free.\n\nThe Planet is all about the music, with every event hosting a major national or international headliner; the only venue in Brisbane to do this.\n\nWe focus on the most cutting edge Electro, Breaks, Techno and Bass Music. \n\nIf you are interested in promoting inbox the planet page or email hannah@rumorhasitaustralia.com  or just click attending to the event and we'll get in touch with you.\n\nPLEASE NOTE: You must be over 18 to be considered for a  Promoter position as it relates to the Nightclub industry. \n", :start_time => "2012-12-07 02:00:00", :end_time => "2012-12-08 02:00:00", :address => "284 Elizabeth St, Brisbane QLD 4000, Australia", :fb_id => 306874602751030, :owner_id => 382239775169178, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373015_306874602751030_45051135_q.jpg", :atenders => 0, :privacy => nil, :created_at => "2012-11-19 21:08:01", :updated_at => "2012-11-19 21:08:01" },
  { :name => "Stereosonic Kick On's @ JUBILEE HOTEL (& Free Pre Party)", :longitude => 153.0238677, :latitude => -27.4669096, :gmaps => true, :description => "The after-party to end em all + the Pre-party warm up session, both at the hotel closest to the RNA - The Jubilee Hotel.. killer line up of choice DJ's playing the freshest upfront party tunes & bangers, wicked lasers, Awesome drink deals & all the rest of the drinks are on cheap-ass-Sunday public bar priced rates & it's cheap entry.\n\nKICK ON'S! 9pm til all night:- Join us at the instant party non-stop continuation of the biggest night out of the year! So close to Stereo you can smell it!\n\nDJs; the headliner is surprise special guest that we can't mention for obvious reasons ; ) (???? feel free to make your guesses below???) +\nDr. Keen\nAjar\nJack This\nMystro\nD.U.I\nSenior Blow\nBr. Brothers\nJordan Burns\n[entry $10 / $5 f/t students w current ID]\n\n\nStereosonic Pre-Party....\n[FREE ENTRY]\n\nWHY Pre-party? \nBecause drinking festival standard mid strength drinks all day is just a waste of time, you need to pack in a few full strength drinks just prior to festival entry & then top up once you're in with the mid's to keep it going.\n\nThe Jube's drinks will be around half the price & full strength unlike those at the festival (see what i'm saying) & this gets you past dumb ideas like drink driving, drama's with train or bus people or being seriously sober all day. You down some full strength drinks, walk a few hundred metres & you're IN! It's game on! \n\n11am to 3pm\n\ndjs.\nYours Truly\nHammo\nArt House Killers\nBatchelo\n\nstay tuned we may have news on a second dubstep stage t.b.a.\n\nThe Jubilee hotel is at 470 St Pauls Terrace, Fortitude Valley - head up Brunswick St towards Step Inn / Mystique etc, turn right at St Pauls Terrace & its a couple of hundred metres down the road towards the RNA on the left. \n", :start_time => "2012-12-01 20:00:00", :end_time => "2012-12-01 23:00:00", :address => "179 Turbot St, Brisbane QLD 4000, Australia", :fb_id => 369830936441307, :owner_id => 765709618, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276672_369830936441307_845044106_q.jpg", :atenders => 65, :privacy => nil, :created_at => "2012-11-19 21:08:07", :updated_at => "2012-11-19 21:08:07" },
  { :name => "FULL DAY AVENTURA EN EL  CAJON DEL MAIPO", :longitude => -70.61491, :latitude => -33.4325755, :gmaps => true, :description => "Pulmahue Tour\nUna experiencia inolvidable.\nChicos y chicas estamos promocionando nuestro fullday para el día 24 DE NOVIEMBRE, espero que les llame la atención y se motiven. Son cupos LIMITADOS, es 100% seguro así que MOTIVENSE, será una experiencia INOLVIDABLE. Puedes realizar RAFTING, TIROLESA, USO DE PISCINA. \nEste full day incluye transporte privado ida y vuelta Santiago- Cascada de las Ánimas.\nAlmuerzo, bebidas y/o jugo, ensaladas y snack\nEl asado por persona es 2 carnes a elección: Carne vacuno, cerdo o pollo, más ensaladas.\nPara vegetarianos hay hamburguesa de soya con ensaladas.\nBasureros ecológicos para reciclajes, latas y papel.\nForma de pago:\nNiños mayores de 5 años pagan tarifa completa.\nLa cancelación de realiza a costo cero con 15 días de anticipación, hasta los 10 días anticipados se devuelve el 70% del dinero cancelado, con menos de 9 días de antelación se devuelve el 50% del dinero, no se realizan devoluciones el día del servicio.\nEl consumo de bebidas alcohólicas es restringido.\n \nSolo por $35.000, así que MOTIVENSE :)\n\nContacto.\nCelular 6-7659583\nmail: caritoale19@gmail.com o facebook", :start_time => "2012-11-24 05:30:00", :end_time => "2012-11-24 17:00:00", :address => "Eliodoro Yañez 1542-1700, Providencia, Santiago Metropolitan Region, Chile", :fb_id => 301179473331004, :owner_id => 1445521733, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373519_301179473331004_2132942828_q.jpg", :atenders => 23, :privacy => nil, :created_at => "2012-11-19 21:08:18", :updated_at => "2012-11-19 21:08:18" },
