  { :name => "Parcelazo Año Nuevo • EMOTION 2013 • EL Copete Lo Traes Tu !! • Casa Mayor De Chena", :longitude => -70.641997, :latitude => -33.4691199, :gmaps => true, :description => "EMOTION 2013 \n\nEL COPETE LO TRAES TU !!!\n\nCasa Mayor de Chena • San Bernardo • 01:00 Hrs.\n\nLlega a Santiago el evento exito del 2011, donde la Cupula del Parque O`higgins fue un reventon total.\nAhora repetimos la formula en un lugar impresionante al aire libre a solo 15 minutos del Centro de Santiago.\n\nLa locación, un lugar realmente impresionante, lounges, Vip, piscina, campo abierto y la luna serà nuestra principal aliada y donde TÙ, TRAES TU ALCOHOL\n\nEscenario Cerrado para más de 1.000 personas.\nSector Vip con espacios cerrados y al aire libre, cerca de la piscina.\n\nLA Noche magica de año nuevo comienza alrededor de las 01:00 am hasta las 08:30am y contarà con los mejores exponentes de la escena nacional.\n\nTendremos:\nMagia\nSistema de punta\nJUegos Inflables, ganesela al toro, y muuuucho más\nIntervenciones y show tematicos.\nPromociones en Bar\n\nNuestros escenarios estarán contemplados de la siguiente forma:\n\n► ESCENARIO CENTRAL\nPista Cerrada con sistema de sonido linearrive y tecnología de punta, ademàs de \npantallas led.\nPop/Electro comercial/Dance/Pachanga/Full Bailable\n\n► ESCENARIO POOL PARTY\nSector al aire libre, vegetación, piscinas, quincho además del sector Vip mixto \n(Lounge cerrado y terrazas)\nVIP BARRA IMPORTADA \nHouse/Tech House/ Minimal Tech \n\n► ESCENARIO AIRE \nPista al aire libre, vegetación, Solo verás verde.\nBlack Music/Hip Hop/Dance Hall/Drum and Bass/Jungle/Dubstep \n\nSuma y resta, ningun evento de esta envergadura al aire libre te darà algo mejor.\n\nValores preventa:\n\n► $10.000 Primeras 500 preventas generales\n► $13.000 Siguientes 500 preventas generales\n► $16.000 Preventas General\n► $20.000 Preventa Vip (200 vip en preventa)\n\nPuntos De Pre ventas :\n\n◙ TIENDA DREAD • Eurocentro • Ahumada #85 Segundo Piso Local 222\n◙ FONO PRE VENTAS : 9511 5803\n\n◙ CON TU PREVENTA INGRESAS SIN FILAS NI ESPERAS!\n\nDia del evento en puerta:\n\n► $18.000 General\n► $25.000 Vip (100 unidades disponibles)\n\nPreventa a traves de nuestro staff autorizado \n\nTodas las preventas y entradas te dan derecho a ingresar tu copete, siempre y cuando sea en envases plasticos.\n\nNos reservamos el derecho de admision, mayores de 18 años con Carnet de identidad.\n\nSíguenos En Facebook : http://www.facebook.com/emotionchileproduccion\n\n◙ Produce:\nHappy Hours & Universidad del Karrete\n\n◙ Colaboran:\n\n◙ Auspician:\nBarcelo - Shark - Smirnoff - Tienda DREAD", :start_time => "2012-12-30 23:00:00", :end_time => "2013-01-05 06:00:00", :address => "Ñuble 646-690, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 456763277674813, :owner_id => 100000161817130, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/592206_456763277674813_72303683_q.jpg", :atenders => 1368, :privacy => nil, :created_at => "2012-11-19 21:09:18", :updated_at => "2012-11-19 21:09:18" },
  { :name => "Sučany Alumni: čo a ako ďalej? (stretnutie v Brne)", :longitude => 16.6068371, :latitude => 49.1950602, :gmaps => true, :description => "Neformálne stretnutie/stretnutia Števa Korbeľa (predsedu SA) s GBAS-ákmi a GBAS-áčkami v Brne.\n\n*\n\nČo je Sučany Alumni? Prečo vzniklo? O čo ľuďom aktívnym v SA ide? Má to celé zmysel?\n\nPrečo od Vás žiadame pravidelný členský poplatok, a prečo chceme, aby sa čo najviac z Vás zapájalo do aktivít SA? Aký je potenciál SA? \n\n*\n\n12.-13. decembra budem v Brne, a rád by som okrem stretnutia sa s mnohými starými známymi, zábavy a oddychu využil túto príležitosť na to, aby som sa s Vami porozprával o SA: vypočul si Vaše názory, návrhy, nápady, osobne Vám zdelil, prečo som sa ja osobne rozhodol aktívne zapojiť do SA, navrhol a dal Vám priestor na sebarealizáciu v SA, a ideálne Vás aj presvedčil o samotnom význame Sučany Alumni (alebo aby sme spoločne určili, čo SA bude znamenať).\n\nRád sa stretnem s Vami, starí známi a staré (stále mladé ;-) ) známe, ako aj s tými z Vás, s ktorými som sa osobne ešte nestretol.\n\nKonkrétny(e) čas(y) a miesto(a) určím neskôr. S radosťou privítam Vaše návrhy na miesta, kde čapujú skvelé pivo, robia vynikajúcu kávu alebo čaj, respektíve majú dobré jedlo. :)\n\nTeším sa na Vás! :)\n\nŠtevo.", :start_time => "2012-12-12 12:00:00", :end_time => "2012-12-13 16:00:00", :address => "Veselá 172/6, 602 00 Brno-Brno-střed, Czech Republic", :fb_id => 356669334429637, :owner_id => 145154878857772, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373108_356669334429637_553182037_q.jpg", :atenders => 6, :privacy => nil, :created_at => "2012-11-19 21:09:52", :updated_at => "2012-11-19 21:09:52" },
