  { :name => "VII FIESTA A.D.E.L.A.", :longitude => -3.69608, :latitude => 40.41862, :gmaps => true, :description => "Estimados amigos, \n\nDebido al éxito de los últimos seis años, y con motivo de recaudar fondos para la Asociación de Esclerósis Lateral Amiotrófica (A.D.E.L.A), se ha organizado por iniciativa de los jóvenes la \"VII Fiesta de la Juventud\" para ayudar a A.D.E.L.A. a combatir dicha enfermedad.\n\nEste año y en conmemoración de la generación que ha vivido esta fiesta desde su origen, la fiesta será con música \"Remember\". \n\nEl evento tendrá lugar en el Círculo de Bellas Artes (Salón de las Columnas) el día sábado 1 de diciembre.\n\nHORARIO\n21:00 horas - Vino Español \n22:00 horas - Inicio de emisión en sala habilitada del partido \nReal Madrid- Atlético\n22:30 horas - Bienvenida al evento y sorteo de regalo\n23:00 horas - Inicio de la VII Fiesta de la Juventud\n05:30 horas  - Despedida\n\n\nPROCEDIMIENTOS PARA LA DONACIÓN Y ASISTENCIA\n1. Donación mínima: 55 € (en beneficio de A.D.E.L.A. Incluye barra libre y sorteo de regalos)\n2. Forma de pago: compra de entrada a través de la página web www.eventosadela.com\n3. Imprescindible presentar en la puerta copia de la entrada debidamente impresa, que recibirás en tu email una vez finalizada la compra.\n4. Fecha límite: realizar donación antes del día viernes 23 de noviembre antes de las 24:00 h.   A partir de ese día la donación mínima asciende a 65 €. No se podrá pagar en la puerta.\n5. Chaqueta y corbata o traje de cocktail.\n\n\n** Cualquier duda o aclaración referente a la VI Fiesta A.D.E.L.A.diríjanse a los organizadores del evento en: fiestaadela@gmail.com**\nPara información sobre la asociación o donaciones anónimas por favor visiten: www.adelaweb.com\n**", :start_time => "2012-12-01 15:00:00", :end_time => "2012-12-01 23:30:00", :address => "Alcala - Circulo de Bellas Artes, 28014 Madrid, Community of Madrid, Spain", :fb_id => 288809514567512, :owner_id => 259903370728987, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276876_288809514567512_2028498603_q.jpg", :atenders => 409, :privacy => nil, :created_at => "2012-11-19 21:10:40", :updated_at => "2012-11-19 21:10:40" },
