  { :name => "Parcelazo Fin del Mundo \"THE END BLACKOUT\"", :longitude => -70.6726035, :latitude => -33.3813605, :gmaps => true, :description => "***\t¿ESTAS LISTO PARA VIVIR EL FIN DEL MUNDO? ****\n\nTHE END BLACKOUT - EL APAGON FINAL \nPARCELAZO FIN DEL MUNDO\n\nClub de campo Espacio Broadway \n\nVENTA DE ENTRADAS A PARTIR DEL MIERCOLES 7 DE NOVIEMBRE \n\nOperación Daisy en conjunto con Comunidad Ombligo han confirmado la fecha para el 2012 \n\nEn la noche del sábado 01 de Diciembre, a solo 15 minutos del centro de la capital, los habitantes en las afueras de Santiago, verán miles de peregrinos caminar hacia el Fin del Mundo: El Club de Campo de Espacio Broadway. \nEste lugar, será el punto de encuentro de la primera versión de \nTHE END BLACKOUT\n\nLa mezcla de estructuras impresionantes con iluminación de alta tecnología junto a la naturaleza (6 hectáreas) crearán una atmósfera mágica. \nTHE END BLACKOUT es una experiencia de alto nivel para disfrutar al aire libre junto a tus amigos. \n\nDESPERTARAS EL 2013 / RESERVAS PARA SOBREVIVIR: \nELLOS entran 1 botellla de ALCOHOL \nELLAS entran 1 botella de BEBIDA \n\nEste año se sumarán 2 escenarios del mas alto nivel y estándar nacional, entregando así más variedad de música y espectáculos para ver, bailar y sentir. \n\nLINE UP\n\n...:STAGE 1 DESTRUCTION ZONE:...\n\nDJ BYTE Ganador Red Bull Thre3style Chile\nTelonero de LMFAO en Chile\n\nDJ BOSS / DJ PAPITAS \n\n\n...:STAGE 2 AREA OF SURVIVORS:...\n\nALTAMIRANO / FRANCISCO IBARRA / HERNAN ALFARO\n\n\nVENTA ENTRADAS\nLos tickets se pondrán a la venta el miércoles 7 de noviembre. La primera PREVENTA $4.500\nPUERTA $6.000 \nMás información sobre precios, descuentos y otros en:\n\nTwitter @operaciondaisychile \n\nFacebook /operaciondaisychile \n\nwww.operaciondaisy.com \n\n\nCOLABORADORES\nManquehuito Pop Wine - Coca Cola - PF - Flor de caña - Alto del Carmen - Cerveza Roma - Prendela.cl \n\n\nPRODUCE\nComunidad Ombligo - Operacion Daisy\n\n**CONSIGUE LUEGO TU ENTRADAA!!!! CONTACTAME POR INBOX Y RESERVA TU ENTRADA AL MEJOOOOR CARRETEEEE DEL FIN DEL MUNDOOO!!! NO TE ARREPENTIRÁS! :d **\n\n**CONTAREMOS CON BUSES DE ACERCAMIENTO IDA Y REGRESO DESDE METRO ESTACIÓN LAS REJAS !**", :start_time => "2012-12-01 20:00:00", :end_time => "2012-12-01 23:00:00", :address => "Pedro Fontova 4957-4985, Conchalí, Santiago Metropolitan Region, Chile", :fb_id => 307894539323075, :owner_id => 1188781226, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/211194_307894539323075_1111246586_q.jpg", :atenders => 20, :privacy => nil, :created_at => "2012-11-19 21:12:29", :updated_at => "2012-11-19 21:12:29" },
  { :name => "Consejo de Federación UAH", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Compañeros: queremos convocarlos al último consejo de federación del presente año. \nSabemos que estamos en las últimas semanas de este semestre, pero tenemos que hacer el esfuerzo de reunir a nuestras carreras y finalizar el año sin cosas pendientes ! ! \n\nTabla:\n-Legitimación proceso elecciones FEUAH 2013\n-Rendición de cuentas Mesa ejecutiva\n-Rendición de estado de avance de las mesas de negociación \n-Otros\n\nLos esperamos ! !\n", :start_time => "2012-11-21 16:00:00", :end_time => "2012-11-21 19:00:00", :address => "En frente del casino de Barroso 26", :fb_id => 335760959854579, :owner_id => 1066705063, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373480_335760959854579_166986033_q.jpg", :atenders => 57, :privacy => nil, :created_at => "2012-11-19 21:12:39", :updated_at => "2012-11-19 21:12:39" },
  { :name => "SWAA!", :longitude => -70.66323349999999, :latitude => -33.45705780000001, :gmaps => true, :description => "Así es! Anime no Seishin Doukoukai se enorgullece en presentar...\nSWAA!!!\n\n¿Qué es esto?\nSWAA es la segunda versión del evento cultural que como grupo realizamos el año pasado. Esta celebración tiene como objetivo resaltar la parte más tradicional de la cultura japonesa y para ello contamos con el apoyo de la FCFM y la gran colaboración de CEIJA.\nEste año SWAA tendrá como motivación el celebrar el fin de año más al estilo nippon y con ello dar la bienvenida a la deidad del nuevo año. \n\n¿Lugar?\nLa Facultad de Ingeniería de la Universidad de Chile será el sector escogido para realizar magno evento. \nDirección: Beauchef 850, Santiago.\n\n¿Cómo llegar? \nEl sector es muy ubicable. Se encuentra al lado de Fantasilandia y cerca del Club Hípico.\nLos metros cercanos son Parque O'Higgins, Toesca y República. Las micros que pasan por el lugar son 507, 509 y 506 (por Av. Blanco Encalada), 121 (por Av. Beauchef y Club Hípico), 119 (por Club Hípico) y 510 (por Vergara).\nAcá el link al mapa:\nhttp://goo.gl/maps/lA3Op\n\n¿Qué ofrecemos?\n- Cultura japonesa.\n- Juegos tradicionales.\n- Concursos instantáneos y de larga duración.\n- Grupos de Baile.\n- Demostraciones de distintas Artes Marciales.\n- Karaoke al puro estilo Seishin.\n- Tiendas muy variadas en sus productos.\n- Expositores, dibujantes.\n- Comunidades, videojuegos y mucho más! \n\nMayores detalles de lo que se viene con esta segunda versión en los próximos días. Se sorprenderán.\n\nAdhesión: \nPúblico general ==> $1.000\nEstudiantes U. de Chile ==> $500*\n\nPRIMER PUNTO DE VENTA: Tupper 2140, Santiago. Queda a un costado de Fantasilandia. La venta se realizará en la casona del Centro de Estudiantes de Ingeniería (CEI)\n\n* Sólo se venden entradas a dicho precio presentando tu TUI. Una entrada por estudiante.\n   \nRecuerda que este es un evento hecho por fans y para fans.\n\nSWAAludos!\n\n\nATENCION: si deseas contactarnos escríbenos a contacto@seishin.cl ", :start_time => "2012-12-15 09:30:00", :end_time => "2012-12-15 17:00:00", :address => "Blanco Encalada 2008-2206, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 377685488984939, :owner_id => 100002547756083, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/203566_377685488984939_606488939_q.jpg", :atenders => 261, :privacy => nil, :created_at => "2012-11-19 21:12:54", :updated_at => "2012-11-19 21:12:54" },
  { :name => "MESA REDONDA", :longitude => -116.274811, :latitude => 33.748436, :gmaps => true, :description => "¿Estás cansado de alegar y que nadie te escuche?\n\nEste es un espacio para discutir temas importantes de los alumnos. Así, podemos hacer una mesa redonda y hablar los típicos temas que no nos agradan (asistencia, exámenes, impresiones, etc).\nLa idea es que vayan todos los interesados en proponer nuevas ideas para que hagamos propuestas a la facultad y cambiar para evolucionar como facultad !!\n\nLos esperamos a todos el jueves 22 de noviembre a las 11.30 en la 105", :start_time => "2012-11-22 09:30:00", :end_time => "2012-11-22 11:00:00", :address => "79687 Country Club Dr, Bermuda Dunes, CA 92203, USA", :fb_id => 166885730119826, :owner_id => 100000453388747, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373208_166885730119826_679713194_q.jpg", :atenders => 24, :privacy => nil, :created_at => "2012-11-19 21:13:45", :updated_at => "2012-11-19 21:13:45" },
