  { :name => "5 AÑOS JGM: 4to Ciclo de Bandas + Día de la Fraternidad", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "La fiesta será en grande: ¡Nos unimos a la celebración del Día de la Fraternidad!\nTe invitamos a la celebración de nuestros cinco años con el 4to Ciclo de Bandas.\nModesto Medio, Chaleko, Ojo de Vidrio y la Banda Jibarito estarán tocando en esta oportunidad.¡Ven a bailar con la JGM! y celebremos juntos estos 5 años al aire haciendo otra comunicación!\nAdemás, el CECo están organizándose para realizar nuevamente la Fiesta de la Fraternidad en el ICEI, aprovechando también la ocasión para celebrar el aniversario de nuestro Instituto. Para el viernes 23 de noviembre tenemos programadas varias actividades bien entretenidas que tienen como objetivo pasar un día en comunidad y fraternidad. Queremos que nuestro ICEI sea ejemplo de buena y sana convivencia entre sus tres estamentos y por eso esperamos que todos puedan participar. Reiteramos la invitación a asistir el día viernes y pasar un día agradable junto a sus compañeros, funcionarios y profesores. Un abrazo fraterno!\nRecordamos que también podrán disfrutar de la muestra fotográfica \"Retratos del Presente\" que nuestros compañeros del ICEI están montando por toda la universidad.\n\nCronograma Actividades:\n\n12 hrs: Foro \"Sociedades Anónimas en el fútbol\".\n14 hrs: Almuerzo comunitario\n16 hrs: Muestra de documentales de compañeros del ICEI\n17 hrs: Comienzo de actividades deportivas Baby-fútbol (ojalá haya un equipo de profesores y funcionarios más un equipo de hombres y uno de mujeres)\n                                                               Taca-Taca (torneo en parejas)\n                                                               Ping-pong (16 jugadores)\n                                                               Volleyball  (equipos de 6 personas, mixtos)\n20 hrs: Ciclo de Bandas Radio JGM", :start_time => "2012-11-23 10:00:00", :end_time => "2