  { :name => "VENTA CREMITAS DE CARACOL MULIER :)", :longitude => 0.000151, :latitude => 0.00013, :gmaps => true, :description => "PORFAVOR INVITEN Y DIGANLE A SUS MAMAS, AMIGAS, SUEGRAS, ABUELITAS, ETC :)\n\nMULIER es una crema Dermocosmética Natural que regenera los tejidos dañados en la piel. Su calidad comprobada y certificada por laboratorios clínicos, han hecho de Mulier una crema de Alta cosmética. Fabricada con extracto 100% natural de la baba de caracol de tierra Chileno, denominado científicamente Helix Aspersa Müller. \n\nSu presentación fina y elegante, y hermosa terminación en su diseño con envases de vidrios nos diferencian notablemente de las otras marcas. Su fórmula está compuesta de Alantoína y Ácido Glicólico Natural, los principales compuestos de la baba del caracol. No tiene colorantes ni fragancias. No es grasosa y es absorbida rápida y espontáneamente por la piel. \n\nEstas cremas dermocosméticas regeneran las células muertas regenerando el foliculo piloso a través del Ácido Glicólico, creando un efecto de peeling y su Alantoína Q10 cumple con la función de regenerar los tejidos dañados de la piel: \n\n• Estrías\n• Manchas en la piel\n• Acné\n• Quemaduras\n• Rosácea\n• Arrugas\n\n*PRECIOS*PRECIOS*PRECIOS:\n-Crema Dermocosmética Natura (CARA): $15.000\n-Crema Hidratante de Cuerpo y Manos: $7.000\n-CREMA CARA + CREMA CUERPO Y MANOS: $18.000\n", :start_time => "2013-07-10 02:00:00", :end_time => "2013-07-11 02:00:00", :address => nil, :fb_id => 179975772128699, :owner_id => 586589392, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/592215_179975772128699_1297983130_q.jpg", :atenders => 19, :privacy => nil, :created_at => "2012-11-19 21:15:54", :updated_at => "2012-11-19 21:15:54" },
