  { :name => "El Amanecer de la Galaxia...", :longitude => -0.000233, :latitude => 0.000258, :gmaps => true, :description => "Según el calendario Maya, el sistema solar demora 26.000 años aprox. en trasladarse por la Vía Lactea... son 5 ciclos de 5.200 años aprox. El 21 de Dic. de 2012 entramos (Según este calendario) al \"Amanecer de la Galaxia\", o sea, comienza nuevamente el ciclo de 26.000 años.\nEventos cataclísmicos a nivel planetario han ocurrido anteriormente, y coinciden con este ciclo...", :start_time => "2012-12-21 04:30:00", :end_time => "2012-12-21 23:30:00", :address => "Mal llamado Planeta Tierra (Este mundo es casi redondo y cubierto por agua...)", :fb_id => 102072439837982, :owner_id => nil, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-prn1/162079_102072439837982_2928050_q.jpg", :atenders => 221, :privacy => nil, :created_at => "2012-11-19 21:16:21", :updated_at => "2012-11-19 21:16:21" },
