  { :name => "Parcelazo Año Nuevo • EMOTION 2013 • EL Copete Lo Traes Tu !! • Casa Mayor De Chena", :longitude => -0.000202, :latitude => 0.000291, :gmaps => true, :description => "EMOTION 2013 \n\nEL COPETE LO TRAES TU !!!\n\nCasa Mayor de Chena • San Bernardo • 01:00 Hrs.\n\nLlega a Santiago el evento exito del 2011, donde la Cupula del Parque O`higgins fue un reventon total.\nAhora repetimos la formula en un lugar impresionante al aire libre a solo 15 minutos del Centro de Santiago.\n\nLa locación, un lugar realmente impresionante, lounges, Vip, piscina, campo abierto y la luna serà nuestra principal aliada y donde TÙ, TRAES TU ALCOHOL\n\nEscenario Cerrado para más de 1.000 personas.\nSector Vip con espacios cerrados y al aire libre, cerca de la piscina.\n\nLA Noche magica de año nuevo comienza alrededor de las 01:00 am hasta las 08:30am y contarà con los mejores exponentes de la escena nacional.\n\nTendremos:\nMagia\nSistema de punta\nJUegos Inflables, ganesela al toro, y muuuucho más\nIntervenciones y show tematicos.\nPromociones en Bar\n\nNuestros escenarios estarán contemplados de la siguiente forma:\n\n► ESCENARIO CENTRAL\nPista Cerrada con sistema de sonido linearrive y tecnología de punta, ademàs de \npantallas led.\nPop/Electro comercial/Dance/Pachanga/Full Bailable\n\n► ESCENARIO POOL PARTY\nSector al aire libre, vegetación, piscinas, quincho además del sector Vip mixto \n(Lounge cerrado y terrazas)\nVIP BARRA IMPORTADA \nHouse/Tech House/ Minimal Tech \n\n► ESCENARIO AIRE \nPista al aire libre, vegetación, Solo verás verde.\nBlack Music/Hip Hop/Dance Hall/Drum and Bass/Jungle/Dubstep \n\nSuma y resta, ningun evento de esta envergadura al aire libre te darà algo mejor.\n\nValores preventa:\n\n► $10.000 Primeras 500 preventas generales\n► $13.000 Siguientes 500 preventas generales\n► $16.000 Preventas General\n► $20.000 Preventa Vip (200 vip en preventa)\n\nPuntos De Pre ventas :\n\n◙ http://www.facebook.com/patricionashudk.produccion\n◙ http://www.facebook.com/patricionashudk.produccion\n\n◙http://www.facebook.com/groups/114276242065521/?fref=ts\n◙http://www.facebook.com/groups/114276242065521/?fref=ts\n◙ CON TU PREVENTA INGRESAS SIN FILAS NI ESPERAS!\n\nDia del evento en puerta:\n\n► $18.000 General\n► $25.000 Vip (100 unidades disponibles)\n\nPreventa a traves de nuestro staff autorizado \n\nTodas las preventas y entradas te dan derecho a ingresar tu copete, siempre y cuando sea en envases plasticos.\n\nNos reservamos el derecho de admision, mayores de 18 años con Carnet de identidad.\n\n\n◙ Produce:\nHappy Hours & Universidad del Karrete\n\n◙ Colaboran:\n\n◙ Auspician:\nBarcelo - Shark - Smirnoff - Tienda DREAD", :start_time => "2012-12-30 23:00:00", :end_time => "2013-01-05 20:00:00", :address => "CASA MAYOR DE CHENA • EL BARRANCON #3240 • Panamericana Sur Km 20. • A 15 Minutos De Santia", :fb_id => 339261779485180, :owner_id => 1389556041, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276997_339261779485180_1151820463_q.jpg", :atenders => 3428, :privacy => nil, :created_at => "2012-11-19 21:17:48", :updated_at => "2012-11-19 21:17:48" },
  { :name => "cuentavueltas.com", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Hola a todos! Este evento es para que conozcáis cuentavueltas.com. Es un proyecto en el que estamos trabajando varios amigos y agradecería que nos siguieseis a través de nuestra página oficial de Facebook buscando “cuentavueltas.com” y dando a “me gusta”. \n\nSobre todo ahora que vamos a empezar a hacer concursos con Actioncameras a través de Facebook es importante que ganemos todos los seguidores que podamos. Además, así podréis conocerlos y participar para ganar los premios.\n\nMuchas gracias y abrazos a todos!!\n\nhttp://www.facebook.com/pages/cuentavueltascom/219234728187983?fref=ts", :start_time => "2012-11-30 02:00:00", :end_time => "2012-12-01 02:00:00", :address => "http://cuentavueltas.com", :fb_id => 269133116540277, :owner_id => 100000811761287, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/188123_269133116540277_2143972733_q.jpg", :atenders => 56, :privacy => nil, :created_at => "2012-11-19 21:17:58", :updated_at => "2012-11-19 21:17:58" },
  { :name => "VII ESCUELA DE OTOÑO", :longitude => -5.8573586, :latitude => 40.320708, :gmaps => true, :description => "La VII Escuela de Otoño mantiene su carácter de proyecto formativo/educativo, enfocado hacia uno de los principales propósitos del CJEx: facilitar espacios, estrategias y procesos dirigidos a motivar y consolidar una juventud y un tejido asociativo activo y comprometido con las necesidades que la realidad y el futuro plantean.\n\nDesde el CJEx entendemos los eventos como espacios y momentos donde un número determinado de personas se unen entorno a algún tema, inquietud o deseo. Bajo esta premisa, la VII Escuela de Otoño se muestra como un ecosistema ideal donde promover acciones con un importante valor añadido, más allá de la propia formación, acciones que faciliten creaciones colaborativas, que permitan a las personas interactuar, conectarse, descubrir y explorar nuevas oportunidades, tejer y consolidar redes, concretando la formación en ámbitos como enfocando la formación en ámbitos como: la educación alternativa como herramienta de cambio y transformación; la economía social y otras fórmulas de emprendimiento; ética hacker y procesos de acción colaborativos.\n\nHay que cambiar y enfocar nuestras miras hacia nuevas perspectivas de presente y futuro. ¿Te sumas a la VII Escuela de Otoño? #espabila!!!\n\nAccede a la info completa donde encontrarás los cursos ofrecidos, la ficha de inscripción y más información de interés.\n\nhttp://cjex.org/component/content/article/343-vii-escuela-de-otono.html\n", :start_time => "2012-11-24 03:00:00", :end_time => "2012-11-25 08:00:00", :address => "Av de las Termas, 55, 10750 Baños de Montemayor, Caceres, Spain", :fb_id => 364797370279934, :owner_id => 230747847001508, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373125_364797370279934_1785193966_q.jpg", :atenders => 85, :privacy => nil, :created_at => "2012-11-19 21:18:03", :updated_at => "2012-11-19 21:18:03"