  { :name => "TRABAJO FIESTA AÑO NUEVO 2013 / Cap 10 MIL PERSONAS - Jefes de Staff , Staff ...", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "TRABAJO PARA STAFF y JEFE DE STAFF \nZONA ORIENTE - ZONA PONIENTE-ZONA NORTE- ZONA SUR \n\nCARGOS\n\nSTAFF: Poseer muchos contactos en facebook y vender entradas a full para la gran fiesta de año nuevo\n\nJEFE DE STAFF: debe tener un grupo de al menos 10 Staff, ser proactivo y vendedor de preventas a full con sus grupos optimo para productoras medianas y pequeñas\n\n\nREQUISITO :\n\nGANAS DE DIFUSION MASIVA Y VENTA DE ENTRADAS \nMAYORES DE 18 AÑOS \nMANEJO MINIMO EN REDES SOCIALES \n\nSe nos viene en grande la fiesta de año nuevo 2013 con capacidad para 10.000 personas . donde tendremos grupos de gran trayectoria en vivo , performance , concursos sorpresas , 2 escenarios , sector general, sector vip y golden vip , sector empresas , sector lounge, todos con beneficio de barra libre hasta la 7 de la mañana \n\n\nMAS INFO VIA INBOX\n\nhttps://www.facebook.com/danielgablerII\nhttps://www.facebook.com/danielgablerII\n\n\nAtte: Daniel Gabler\nProductor General Año nuevo 2013\nDanielgablerg@gmail.com\n+569 8-1996000", :start_time => "2012-12-31 20:00:00", :end_time => "2012-12-31 23:00:00", :address => "MAS INFO LUEGO", :fb_id => 170597093081283, :owner_id => 100000970956269, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/187792_170597093081283_1607556049_q.jpg", :atenders => 74, :privacy => nil, :created_at => "2012-11-19 21:18:32", :updated_at => "2012-11-19 21:18:32" },
