  { :name => "Torneo \"Leyendas del Flair\"", :longitude => -70.54739099999999, :latitude => -33.3823275, :gmaps => true, :description => "Conoces los inicios del flair en Chile a la vieja escuela? A quien desearías ver competir?\nBueno ahora podrás ver a los pioneros del flair en nuestro país. La idea es compartir y pasar un rato agradable con amigos y seguir motivando a un montón de bartender que están emergiendo. Alugunos de los competidores son:\n\nMatias Supan\nCarlo Astudillo\nMatias Peredo\nPablo Antonio Negrete Allende \"El PANA\"\nFernando Costa\nRaul Fernandez\nMatias Yanquez\nRenzo Vivona\n y más por confirmar...\n\n", :start_time => "2012-12-05 18:30:00", :end_time => "2012-12-06 01:55:00", :address => "Vitacura 9251, Vitacura, Santiago Metropolitan Region, Chile", :fb_id => 433068650080005, :owner_id => 1055423906, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/187790_433068650080005_1188223111_q.jpg", :atenders => 141, :privacy => nil, :created_at => "2012-11-19 21:18:52", :updated_at => "2012-11-19 21:18:52" },
  { :name => "After Office Lista \" PABLO GARCIA 552\"", :longitude => 10.2287008, :latitude => 50.10046630000001, :gmaps => true, :description => "Los espero este Miércoles como de costumbre en el mejor centro de eventos de Santiago. Entran todos gratis antes de las 21:00 diciendo Pablo García 552 en la entrada. (Lleguen antes de las 20:45 por las colas)\n\nEstamos llegando a las 2500 personas cada semana en el carrete mas masivo de Santiago.\n\ndress code: semi formal, sin zapatillas\n\nPachanga, Reggaetón, Electro pop y mucho más en nuestras 2 pistas de Baile\n\nLos espero en la terraza como de costumbre...\n\nreserva de mesas y consultas a ptgarcia@uc.cl\n\n- Mesa Gerencial: $ 200.000, que incluye $ 100.000 en consumo + 10 pulseras Gerenciales.\n- Mesa Ejecutiva: $ 100.000, que incluye $ 50.000 en consumo + 10 pulseras Ejecutivas.\n- Mesa Ejecutiva: $ 80.000, que incluye $ 40.000 en consumo + 8 pulseras Ejecutivas.\n- Mesa Sky Lounge: $ 60.000, que incluye $ 30.000 en consumo.\n- Mesa Pista General: $ 50.000, que incluye $ 40.000 en consumo.\n\nDale like a nuestra página:\nhttp://www.facebook.com/pages/After-Office-552/214977278571103", :start_time => "2012-11-21 17:00:00", :end_time => "2012-11-21 23:00:00", :address => "Afterweg, 97456 Dittelbrunn, Germany", :fb_id => 170166616457665, :owner_id => 214977278571103, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373153_170166616457665_320600608_q.jpg", :atenders => 17, :privacy => nil, :created_at => "2012-11-19 21:19:33", :updated_at => "2012-11-19 21:19:33" },
  { :name => "VIVE EL DAKAR 2013", :longitude => -0.000283, :latitude => 0.000106, :gmaps => true, :description => "WWW.FULLADVENTURE.CL\n\nVIVE EL DAKAR EN DOMOS DE LUJOS\nNo todos pueden contar que vieron a los mejores pilotos en la carrera más dura del mundo, el Dakar.\nEste año, Full Adventure quiere darte un experiencia de lujo que no olvidarás en pleno desierto.\nNuestros pilotos podrán disfrutar de un campamento, compuesto por 18 domos con camas, veladores, luz, comedor, chef, garzones, buena comida, baños, masajista, y toda la comodidad que necesitas para disfrutar en el desierto. \nEste viaje es una oportunidad para disfrutar con amigos, polola, señora e hijos. Si ellos no andan en moto, no te preocupes, contamos con vehículos 4x4 para que puedan acompañarte en esta aventura.\n\nEntonces…¿Qué estás esperando? \n\nNo te resistas a la mejor combinación:DAKAR ¬+ LUJO + BUENA COMPAÑÍA = FULL ADVENTURE\n\nCupos Limitados (reserva con anticipación)Información e Inscripción:viajes@fulladventure.cl\n\nItinerario:\n-16 de Enero de2013: Traslado hacia Caldera. Llegada al aeropuerto Copiapó . Traslado desde Caldera hacia el campamento. (Alojamiento en Domos)\n-17 de Enero de 2013: El recorrido de la carrera será desde Argentina hasta Copiapó, donde podremos ver el trazado y llegada al bivoac de Copiapó. (Alojamiento en Domos)\n-18 de Enero de 2013: El recorrido de la carrera será desde Copiapó hasta La Serena, donde podremos ver la largada de las primeras motos y ver en ruta la carrera de los autos y camiones.\n-Traslado desde los domos hacia el Aeropuerto. Regreso a Santiago \n\nValores:  Solicitar información a:  viajesulladventure.cl  o bajar ficha de www.fulladventure.cl\nValores especiales para grupos.\nArriendo de Camioneta 4x4 con chofer:Consultar según disponibilidad.\n\nValor Incluye:Traslado desde Las cabañas El Mirador en Caldera hasta el sector del campamento en pleno desierto, alojamiento en domos con base: dos y tres camas, Alimentación completa (Desayunos, almuerzos en terreno, Cenas), guías en moto, masajista, Chef, Garzones., traslado de motos desde Santiago (punto de encuentro Mall Sport) hasta el campamento. Valor no incluye Pasajes aéreos.\n\nNota: Las motos deben ser entregadas en Mall Sport el día 13 de Enero con tres correas en buen estado, marcadas con su nombre. \n\nCupos Limitados (reserva con anticipación) Información:viajes@fulladventure.cl\n\n\n", :start_time => "2013-01-14 02:00:00", :end_time => "2013-01-15 02:00:00", :address => nil, :fb_id => 251914574930352, :owner_id => 100003105074938, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373027_251914574930352_1837536128_q.jpg", :atenders => 46, :privacy => nil, :created_at => "2012-11-19 21:19:58", :updated_at => "2012-11-19 21:19:58" },
  { :name => "Halley's Comet 2061", :longitude => -102.4107493, :latitude => 34.2331373, :gmaps => true, :description => "Halley's comet will make its next pass on July 28, 2061. This event is a temporary group because we can only make events up to the year 2014. When it actually happens it will be party time like 1999!\n\nCreated 12/14/09 by Matt Zandbergen and Evan Dahl", :start_time => "2014-07-28 04:15:00", :end_time => "2014-07-28 07:15:00", :address => "N Amherst St, Earth, TX 79031, USA", :fb_id => 240735880759, :owner_id => 629972843, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-prn1/50516_240735880759_4472005_q.jpg", :atenders => 4626, :privacy => nil, :created_at => "2012-11-19 21:20:31", :updated_at => "2012-11-19 21:20:31" },
  { :name => "CELEBRALO!", :longitude => -70.641997, :latitude => -33.4691199, :gmaps => true, :description => "Recuerda que Marzo no es motivo para no celebrar esa fiesta que tienes en mente, aprovecha el clima que nos acompaña y disfruta de la mejor entretención que Maximiliano Producciones te puede dar... Matrimonios - Cumpleaños - Animación - Amplificación - Concursos - Intervenciones Callejeras - Mimos - Malabaristas - Juegos Inflables - Campeonatos Deportivos - Música En Vivo - Promociones - Belleza - Audio y Video - Premios - Cotillón - Adornos - Baile Entretenido - Y MUCHAS, PERO MUCHAS COSAS MAS!!\n\nSOLO LLAMANOS AL 72143601 O ESCRIBENOS A CONTACTO@MAXIMILIANOPRODUCCIONES.CL\n\nPARA VER IMÁGENES Y CONOCERNOS AÚN MAS INGRESA A WWW.MAXIMILIANOPRODUCCIONES.CL", :start_time => "2013-01-01 22:00:00", :end_time => "2013-01-02 01:00:00", :address => "Ñuble 646-690, Santiago, Santiago Metropolitan Region, Chile", :fb_id => 287380197997475, :owner_id => 100000719275065, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-prn1/174702_287380197997475_1573928720_q.jpg", :atenders => 0, :privacy => nil, :created_at => "2012-11-19 21:20:36", :updated_at => "2012-11-19 21:20:36" },
  { :name => "MBR: Moja Reč XXX Tape Tour + Komplot", :longitude => 19.1398712, :latitude => 48.57709699999999, :gmaps => true, :description => "MBR Vám prinesie unikátnu LIVE show formácie MOJA REČ v rámci XXX Tour s doprovodom živej kapely KOMPLOT.\n\n\nVystúpia:\n\n• Moja Reč + Komplot + Jozef Bengerer [Handlová]\n• Radikal + Dj Yaksha [Ružomberok]\n• Plexo + Dj Knockout [Bratislava]\n• Bio + Majco8Kuna + Rudec [Pieštany]\n• PNS + Dj Maybedead [Bratislava]\n• Lepšie Časy + Seth + Dj Slacker [Zvolen]\n\n• Vystúpenie hip-hop tanečnej formácie\n• Freestyle Battle [Porota: Plexo, Bio, Laky_Pns]\n• Imitácia rapperov + beatbox show [Šorty]\n• Hip-Hop afterpárty rap vs. funk [Kynetik, Slacker]\n\n\n• Podujatie moderuje: Polo_MBR [Banská Bystrica]\n• Predaj originálnych CD nosičov a oblečenia priamo od interpretov\n• Podujatie bude spojené so symbolickým krstom troch nových projektov interpretov RADIKALA a BIA ale aj formácie LEPŠIE ČASY.\n\n\nPartneri:\n\n• Red Bull [http://www.redbull.sk/]\n• Stred.tv [http://www.stred.tv/]\n• E-Grafix [http://www.facebook.com/mbr.egrafix]\n• Corino pizza [http://www.corino.sk/]\n• DK ŽSR [http://www.zsr.sk]\n• Avropa [http://wwwavropa.sk/]\n• La Danza [http://www.ladanza.sk/]\n• Ruka Hore [http://www.rukahore.sk/ , http://www.rukahore.eu/ ]\n• Subnet [http://www.sub-net.sk/]\n• Trims Security [http://www.sbstrims.sk]\n\n\nhttp://www.mbr.sk\nhttp://www.facebook.com/monkey.business.records\n\n\nViac info už čoskoro...", :start_time => "2012-12-22 15:00:00", :end_time => "2012-12-22 21:00:00", :address => "Sokolská 1704/69, 96001 Zvolen, Slovakia", :fb_id => 171394762999623, :owner_id => 112896587186, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373175_171394762999623_2098920586_q.jpg", :atenders => 293, :privacy => nil, :created_at => "2012-11-19 21:20:48", :updated_at => "2012-11-19 21:20:48" },
  { :name => "One night in Amsterdam World Tour", :longitude => 137.2119258, :latitude => 36.5628291, :gmaps => true, :description => "ONE NIGHT IN AMSTERDAM - WORLD TOUR\n \n'One night in Amsterdam' world tour continues with its next destination club Sasazu in Prague, Czech Republic! As the name suggests, this night will all be about the Dutch club event experience. It's no secret that Dutch DJ's and dance events have conquered the world and this concept does just that. \n\nWe bring you top notch clubbing with a Dutch flavor.\nClubs Pacha, The Sign, Sliver, Caleo and countries: Macedonia, England, Sweden, Bonaire have already hosted the concept and now it's coming to you! For this night we take you to Amsterdam with DJ's Rosh, Passa and Carlos Squint, who have built a reputation for themselves in Holland and around the world, getting thousands of people's dancing feet of the floor.\nThey are guaranteed to do the same to yours.\n\nSasazu club offers the perfect location for the concept to bring out its true colours. With its impressive light and sound setup this club event will fly you to Amsterdam for that one crazy unforgettable night out.\n\nBe sure not to miss out on the debut of 'One night in Amsterdam' in Prague.\n \nOne Night in Amsterdam - WORLD TOUR \nLocation: SaSaZu (Prague, Czech Republic) \nDate: Saturday 1st of December 2012 \nTime: 11PM - 5AM \nDJ's: Rosh (NL), Passa (NL) \nWarm-up by: Carlos Squint\nAge: 18+ Ticket: 200 KC pre-sale // 250 KC on the door\n\nhttp://www.ticketpro.cz/jnp/hudba/tanecni-elektronicka-hudba/944413-one-night-in-amsterdam-world-tour.html\n \nWebsites: www.sasazu.com // www.facebook.com/onenightinamsterdam\n \n \nSvětové turné \"One night in Amsterdam\" pokračuje v jeho další destinaci - Club SaSaZu v Prahe! Tak jak napovídá jméno, tahle noc bude vše o zážitcích v Nizozemských klubech. Není žádným tajemstvím, že Nizozemský DJi a taneční akce dobili mnoha mista kolem světa a Praha je jejich další destinace!\n \nPřinášíme Vám tu nejlepší  párty s Nizozemskou příchuti! \nKluby Pacha, The Sign, Sliver, Caleo a krajiny Makedonie, Anglie, Švédsko, Bonaire již hostili tenhle koncept a teď přichází k Vám! Tuhle tu noc Vás vezmeme do Amsterdamu s DJ Rosh, DJ Carlos Squint a DJ Passa, kteří se proslavili v Nizozemsku a na celým světe dostávají tisíce lidí do varu! Garantují Vám, že s Vámi udělají to jisté!\n \nKlub SaSaZu ponouká perfektní lokaci pro tuhle party, aby se ukázala v tom pravým style! Okouzlující světelná show a ozvučení s Vámi odletí přímo do Amsterdamu na tuhle nezapomenutelnou noc!\n \nUrčite nepromeškejte jednu z tyhle svetoznámých party v Praze!\n", :start_time => "2012-12-01 17:00:00", :end_time => "2012-12-01 23:00:00", :address => "Japan, Toyama Prefecture, Toyama, Sasazu, ４０８", :fb_id => 267035963399757, :owner_id => 139652456084699, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/373473_267035963399757_1116840713_q.jpg", :atenders => 97, :privacy => nil, :created_at => "2012-11-19 21:20:53", :updated_at => "2012-11-19 21:20:53" },
  { :name => "Lomoamigo v kocke - Lomography výstava", :longitude => 9.198961299999999, :latitude => 46.53111850000001, :gmaps => true, :description => "Alica Gurínova, Žltý, Matej Rafa, Baša Števulová, Haf&Beyuz, Marika Tonbogirl Majorová, Mišo Darila, Miro Remo a Paulína Maťová v spoločnej výstave!\n\nNovember je mesiac fotografie, Lomography oslavuje 20. výročie a v Bratislave už dlhšie nebola žiadna Lomo party. Myslíme, že to je viac než dosť dôvodov niečo zorganizovať a preto prichádzame so super akciou, ktorá prebehne v Max Klinger Gallery v Kabinete už 23. novembra. \n\nA prečo Lomoamigo v kocke? Aby sme pripravili program a výstavu rovnako nabitú energiou ako je priestor a výročie Lomography, rozhodli sme sa skocnetrovať na túto udalosť 9 kreatívnych Lomoamigov a všetko čo ich definuje do pomyselnej kocky o veľkosti 1x1 meter. \n\nLomoamigovia sú v skratke významné kreatívne osobnosti, ktoré rady fotia na Lomo. Nie sú to profesionální fotografi ale ľudia, ktorí vynikajú vo svojom obore - športovci, grafickí dizajnéri, hudobníci, filmári. Na výstavu sa nám podarilo vybaviť:\n\nAlica Gurínova – animátorka, ilustrátorka\nŽltý – grafický dizajn\nMatej Rafa – člen kapely Swan Bride\nBaša Števulová – snowboardistka\nHaf&Beyuz – moderný spevák a producent\nMarika Majorová – blogerka Tonbogirl\nMiro Remo – dokumentarista\nMichal Darila - Buffet clothing\nPaulína Maťová – bloggerka (Paulínaemma) a hudobníčka (Infants)\n\nAtmosféru dotvoria hudobne Beyuz a Walter Schnitzelsson. Počas večera budeme premietať rôzne videá a filmy z tvorby umelcov. Máme pripravené aj ďalšie prekvapenia takže neváhajte a prídte osláviť 20te výročie Lomography v lomo štýle!", :start_time => "2012-11-23 13:00:00", :end_time => "2012-11-23 16:00:00", :address => "Kabinet, 7438 Hinterrhein, Switzerland", :fb_id => 247075728751838, :owner_id => 212767342125349, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/276406_247075728751838_2114642753_q.jpg", :atenders => 138, :privacy => nil, :created_at => "2012-11-19 21:20:59", :updated_at => "2012-11-19 21:20:59" },
  { :name => "Paradise 2013 // Pre-ventas PITUFO (Hernan Gutierrez)", :longitude => -0.000277, :latitude => 0.000141, :gmaps => true, :description => "\n\n\nSi eres un sobreviviente del 2012! vive Paradise 2013 Still Alive\n \nhttps://www.facebook.com/2013Paradise\n \n▼Despliega la Info en Ver más.\n\n \n► Paradise Stage\n \n10.000 M2 Para activar tus sentidos con la mejor música!\n Seras envuelto de la magia de Paradise con un escenario de 10 metros de alto, 4 torres lanza fuego, tus oídos solo escucharan los armónicos de la música con un sistema line Array, tu ojos no podrán pestañar con las luces y las visuales en una Performance única en Chile.\n ________________________________________________________________\n \n► Green Stage\n \nDesprende tus neuronas del estrés de la cuidad y sumérgete en el Green Stage de Paradise, donde podrás relajarte en un ambiente de armonía con la naturaleza y la música, donde tus sensaciones te llevaran al máximo.\n \n________________________________________________________________\n \n► VIP House\n \nTu exclusividad solo se vera reflejada en la VIP House, disfruta de una noche mágica con la mejor comodidad y privacidad, tu paladar sera seducido por los tragos que solo el paraíso te puede ofrecer, en un ambiente místico por los secretos que en la casa se ocultan.\n \n________________________________________________________________\n \n► VIP Lounge\n \nTu mente te puede llevar a lugares irreales, pero que para ti son la proyección de tus pensamientos mas íntimos, disfruta del VIP Lounge en un exceso que sólo podrás manejar con tus sentidos, deja que la música te lleve al éxtasis de la vida y los colores te envuelvan, siente como tus poros se abren y tu piel se eriza al vivir Paradise de una forma exclusiva.\n \n________________________________________________________________\n \n▬ Valores:\n \n▼Entrada General (Paradise Stage - Green Stage)\n \n1era Pre-venta desde el lunes 12 de Noviembre hasta el 1 de Diciembre:\n \n$15.000 - Bar abierto (Pisco - Ron - Vodka)\n _________________________\n \n2da Pre-venta desde el martes 9 de Diciembre hasta el viernes 28 de Diciembre:\n \n$20.000 - Bar abierto (Pisco - Ron - Vodka)\n _________________________\n \nEntrada en puerta el 1 de enero de 2013:\n \n$25.000 - Bar abierto (Pisco - Ron - Vodka)\n _________________________________________________________________\n \n▼Entrada VIP Lounge\n \nHasta agotar stock (200 entradas)\n \n$25.000 - Bar abierto (Pisco - Ron - Vodka - Cerveza - (Energéticas{con stock}))\n _________________________\n \n▼Entrada VIP House\n \nMesa para 6 personas hasta agotar stock:\n \n$200.000 - Bar abierto (Pisco - Ron - Vodka - Cerveza - Whisky - (Energéticas{12 por mesa}))\n _________________________________________________________________\n \n▼Estacionamientos\n \nCupos limitados, asegura tu lugar junto con tu pre-venta\n Por auto:\n \n$2000 \n_________________________________________________________________\n \n▼Buses de acercamiento\n \nLas Condes - Providencia - Ñuñoa - La Florida - Peñalolen - Mauipu - Santiago Centro\n San Bernardo - La Cisterna - Calera de tango - Longuen - Talagante - Buin - Otros por confirmar.\n \nSe confirmaran los lugares de salida y llegada.\n \n$2000 (Ida y vuelta)\n ________________________________________________________________\n \n▼Line-up:\n \n1)Deejay Sedy\n 2)Deejay Kemen\n 3)Deejay Diego Nuñez\n 4)\n 5)\n 6)\n 7)\n ________________________________________________________________\n \n\n▼Sector de comidas:\n \nAperitivos, Sushi, Hot-dog.\n \n\n________________________________________________________________\n \n▼Auspicia:\n \nRed-bull, Corona, Jack Daniel's \n\n________________________________________________________________\n \n▼Banda Invitada:\n \n♫TOMO COMO REY\n \nhttp://www.tomocomorey.cl/\n \n________________________________________________________________\n \nSíguenos a través de Facebook y Twitter:\n \n►https://www.facebook.com/2013Paradise\n ►https://twitter.com/Paradise_2013\n \nEvento para mayores de 18 años.\n \n\nStaff acreditados para vender \n- Alejandra morales /+56974765681 / San Bernardo.\n - Nicolas Gomez / +569 74783346 / La Florida y Las Condes.\n - Cristobal Quezada /+56983831255 / San bernardo.\n - Loreto Navarro / +56954161171 / San Bernardo.\n - Mario fuentes / +56954180401 / San bernardo.\n - Macarena caprio / 88219334 / san bernardo.\n- Nicolas Jara / +56962390187 / Lo barnechea y universidad catolica\n - Francisco Palacios / +56973061297 / San Bernardo .\n - matías leal / 91257149 / san bernardo.\n - Felipe Moraga / +56965413420 / San Bernardo.\n - Nicole Arraño /+569 77437351 / La Cisterna.\n - Diego Villavicencio / +56 9 8963 1283 / san bernardo.\n - jose antonio caro / +56972813039/ la cisterna.\n - Daniel Mancilla / 71085812 / la florida.\n - Jeanfranco Frei - +569 7 969 24 74 - Peñalolén. \n - Hernan Gutierrez // +569 54015397 - La cisterna\n - Maria jose Olea // 94131076 - El Bosque", :start_time => "2012-12-31 23:00:00", :end_time => "2013-01-01 06:00:00", :address => "EX casona peloton", :fb_id => 120902501401506, :owner_id => 1267719344, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373090_120902501401506_786342895_q.jpg", :atenders => 8, :privacy => nil, :created_at => "2012-11-19 21:21:11", :updated_at => "2012-11-19 21:21:11" },
