  { :name => "Artevent´s Producciones", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Junto con saludar, les informo que somos una empresa que se dedica a la realización de eventos, y por motivos administrativos nos cambiamos el nombre  \" Artevent´s\".\nEstamos comenzando a reclutar gente NUEVA  y de CONFIANZA que esté interezada en trabajar y aprender  en las distintas áreas que ofreceremos como empresa de eventos.\n\nNecesito gente interesada en trabajar como  GARZÓN, favor dejar :\n\n- Nombre           - Teléfono          - Correo\n- Comuna donde vive         - Disponibilidad de horario y días\n\n \nRealizamos cumpleaños, matrimonios, graduaciones, eventos a constructoras, entre otros.\n\nSi tienen alguna consulta comunicarse a los e-mail:\n h_gutierrez@live.cl    o\n cotee.__@live.com\n\n*Nota: La fecha indicada no corresponde al día del evento , por favor no tomar en cuenta,  ya que es solo para la selección de los garzones.\n\nLos eventos serán bien seguidos , por ende necesitamos a gente confiable, interesada, responsable y con una buena disposición para el trabajo.\n\nINTERESADOS , CONFIRMAR A LOS E-MAIL YA INDICADOS.", :start_time => "2012-12-21 02:00:00", :end_time => "2012-12-22 02:00:00", :address => "Trabajamos en toda la region Metropolitana.", :fb_id => 399846340071317, :owner_id => 1267719344, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/276660_399846340071317_1874630130_q.jpg", :atenders => 42, :privacy => nil, :created_at => "2012-11-19 21:21:29", :updated_at => "2012-11-19 21:21:29" },
  { :name => "Todos los que viviran en el 2013", :longitude => -98.5101915, :latitude => 29.6191791, :gmaps => true, :description => "Estoy seguro que el mundo no se acabara en una fecha justa, sino que el hombre lo ira destruyendo poco a poco, hasta que no quede nada.... Suena mal pero es la realidad, una recomendacion VIVAN LA VIDA QUE SOLO HAY UNA...!!!", :start_time => "2013-01-01 01:00:00", :end_time => "2013-01-02 01:00:00", :address => "1023 La Tierra, San Antonio, TX 78258, USA", :fb_id => 163424840365165, :owner_id => 100000165714671, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-prn1/157978_163424840365165_6074558_q.jpg", :atenders => 4680, :privacy => nil, :created_at => "2012-11-19 21:21:47", :updated_at => "2012-11-19 21:21:47" },
  { :name => "BINGO Y NOCHE MEXICANA, Cristo Rey", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "El próximo sábado (24 de Noviembre) se va a organizar en la Casa de Reino en la Dehesa (Centro Misión) un BINGO así que están todos mas que invitados a pasarlo bien. \n\nNosotras nos preocupamos de la comida, de los premioos  y de todo así que si al resto se le ocurre algo entretenido con que aportar o quiere llevar más comida o cervezas, es muuuy bienvenido.. \n\nLa entrada va a costar $1500 y vamos a vender cosas como alfajores y sorteos así que no se olviden de traer la billetera. \n\nParte con una Misa de CRISTO REY A LAS 7 EN EL COLEGIO EVEREST, para todas las familias, y después tipo 8 viene la comida mexicana y la competencia por los premios en la casa de Reino…\n\nNos vemos allá!!\n", :start_time => "2012-11-24 17:00:00", :end_time => "2012-11-24 20:00:00", :address => "Casa Reino La Dehesa", :fb_id => 170045659803205, :owner_id => 1172983774, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc7/592326_170045659803205_1449294314_q.jpg", :atenders => 53, :privacy => nil, :created_at => "2012-11-19 21:22:07", :updated_at => "2012-11-19 21:22:07" },
