  { :name => "DISTORTION VESTERBRO @ SØNDER BLVD/ENGHAVEVEJ- HOST: BP - Beat People & FRIENDS", :longitude => 12.5426936, :latitude => 55.664036, :gmaps => true, :description => "200m from ENGHAVE PLADS - take the train to Enghave st! \n\nBeat People (BP) has joined forces with the guys who organized last years streetparty at Mysundegade and the Vesterbro based Høegs! \n\nBeat People (BP) \n- http://www.facebook.com/BeatPeople?sk=app_106171216118819)\n\nHøegs\n-https://www.facebook.com/pages/H%C3%B8egs/175557912467367?rf=237297933042824\n\nJonas Bruun\n- www.facebook.com/dj.jonasbruun\n\nSound Provides - Frontline\nwww.frontlineevent.dk\n\nExpect: green crowdsurfing men, plenty of smoke and plain raving madness!  \n\nThe sound system has been upgraded, the lineup has been upgraded and the amount of smoke machines has been doubled! All for your pleasure.. \n\nLine up so far ...\n\n♫ TOOMANYLEFTHANDS ♫\nhttps://www.facebook.com/toomanylefthands\n\n♫ BOTTLED IN ENGLAND ♫\nRave, straight from the bottle\n\n♫ THE FREDERIK (Mau5trap) ♫\nWho doesn't know Frederik Olufsen..?\n\n♫ TAKO LAKO ♫\nThe Kings of Balkan - a party unlike any other!\n\n♫ COPENHEAVY ♫\nRavers with attitude: http://youtu.be/XogQKTmkCyI\n\n♫ JONAS BRUUN & MARIA ROSENSTAND (Live) ♫\nThis couple trashed Mysundegade last year: http://www.youtube.com/watch?v=SfT8micEFHc\n\n♫ SVEDHYTTEN // LOU VAN & DAVID GARSET ♫\nhttps://www.facebook.com/SvedhyttenVega\n\n♫ WICKED.DK ♫\nThe most read blog on electronic music in Denmark! \nHttp://wicked.dk/\nhttp://vimeo.com/24696013\n\n♫ EMILIO & ESTEBAN ♫\nhttp://soundcloud.com/emilio_cph/emilio-esteban-promilleservice\n\n♫ LA NUIT ♫\nWinner of Jonas Bruuns DJ Competition! \n\nPictures by\nwww.facebook.com/yourlook.me\n\nHOST\n- www.facebook.com/beatpeople\n\n- https://www.facebook.com/pages/H%C3%B8egs/175557912467367?rf=237297933042824\n\n________________\n\n", :start_time => "2013-06-01 10:00:00", :end_time => "2013-06-01 13:00:00", :address => "Sønder Blvd 110, 1720 Copenhagen, Denmark", :fb_id => 350369935019081, :owner_id => 145741322219476, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-prn1/158042_350369935019081_1345077497_q.jpg", :atenders => 2147, :privacy => nil, :created_at => "2012-11-19 21:22:46", :updated_at => "2012-11-19 21:22:46" },
  { :name => "Gartenhaus Straf Session ✖ Vol. 1 ✖", :longitude => 12.5584644, :latitude => 55.67098859999999, :gmaps => true, :description => "Die StrafBar ▲ Gratis Entré ▲ Happy Hour 20-23▲\n▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼\n\nDenne aften fusioneres Straf Barens rå dansegulv, med tonerne fra det danske pladeselskab Gartenhaus. Gartenhaus der har eksisteret siden august 2011, er en spiller på den danske elektroniske musikscene, der er svær at overse. Og med udgivelser fra danske navne som Massimo, Hankat, Frits, Mr. Leman & Thomas Dieckmann, Mathias Mesteno og udenlandske navne som Mobius Strum, Qmusse og Max Chapman, Cosmic Cowboys og Rio Padice er de for alvor ved at slå deres navn fast på den internationale Deep House scene. \nDenne aften bliver Gartenhaus repræsenteret af henholdsvis den danske dj og producer duo Mr. Leman & Thomas Dieckmann, og så et helt nyt skud på stammen i havehuset KANT.\n\nMr. Leman & Thomas Dieckmann(Gartenhaus, Exotic Refreshment, Back And Forth)\n\nhttp://soundcloud.com/mrleman\n\nhttp://soundcloud.com/thomas-dieckmann\n\nKANT (Gartenhaus)\nhttp://soundcloud.com/kantmusic\n\nGartenhaus:\nhttp://soundcloud.com/gartenhaus\n\n▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼\nVi har inviteret nogle af de sejeste dj's vi kender, ned at spille deres yndlings numre. \n\nDer er Happy Hour, fra kl. 20-23 hvor du kan få 4 Guld damer/Ale no.16 for 100,-, eller hvis du er mere til Cocktails kan du slukke tørsten i Barens lækre udvalg af specialiteter.\n\nI den slemme ende af Istedgade, hvor lovovertrædelser sker dagligt, er der åbnet en nye bar, i Copenhagen Gay Centers gamle lokaler, med navnet Die StrafBar. \n\nI denne ende af Istedgade har man ikke været vant til at feste siden Ritz lukkede deres døre i sin tid. Og vi synes at et sted af dennes karakter er blevet savnet ♥ med Die Strafbars rå, afslappede indretning, passer den perfekt til nutidens Vesterbro stemning, og miljø. Og vi glæder os til tilbyde jer velkommen i kælderen ✌ \n\nCOCKTAILS:\n\n♥Japanese mojito\n♥Vanillapolitan\n♥Cosmopolitan\n♥Mojito\n♥Margarita\n♥Caipirinha\n♥Basic Basil\n♥Moccatini\n\n▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼▲▼", :start_time => "2012-11-24 12:00:00", :end_time => "2012-11-24 22:00:00", :address => "Viktoriagade 22, 1655 Copenhagen, Denmark", :fb_id => 430068773715657, :owner_id => 377081768988195, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373525_430068773715657_1393727899_q.jpg", :atenders => 17, :privacy => nil, :created_at => "2012-11-19 21:22:52", :updated_at => "2012-11-19 21:22:52" },
  { :name => "New Book Release", :longitude => -1.252368, :latitude => 51.7507022, :gmaps => true, :description => "As event coordinator, we will be hosting an event to celebrate the release of Paul's new book \"Farmer's Diaries\". I know this is a bit in the future but hope to see you all there. It is going to be great!!!!\n\nSome Book Reviews\n\"Absolutely riveting.  A masterpiece decades ahead of its time\" - The New York Times\n\n\"Paul Gillig is an articulate individual with a knack for corn and other crops.  His brilliant methods for growing corn and tomatoes are an inspiration to us all\" - TIME Magazine\n\n\"Innovative and captivating\"- The New Yorker\n\n", :start_time => "2014-07-13 16:15:00", :end_time => "2014-07-13 22:15:00", :address => "3 Merton St, University Of Oxford, Merton College Bar, Oxford, Oxfordshire OX1 4JE, UK", :fb_id => 199483807065, :owner_id => nil, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-prn1/161979_199483807065_8244840_q.jpg", :atenders => 27, :privacy => nil, :created_at => "2012-11-19 21:22:56", :updated_at => "2012-11-19 21:22:56" },
