  { :name => "Stone Mountain Flash Mob (Biggest Flash mob in Georgia History!)", :longitude => -84.17019599999999, :latitude => 33.8081608, :gmaps => true, :description => "Hey everybody!\n\nHow about making Georgia History? Stone Mountain and I are collaborating to create a flash mob before the Laser Show Performance sometime between the Spring/Summer of 2013. We do not have a set date yet, but we inform you all about this now so we can reach a goal of OVER 10,000 participants!!\n\nYes 10,000 people!  Let’s make history by making the biggest flash mob in Georgia! \n\nThe Flash Mob will be a dancing Flash Mob consists of different songs mixed together for people to dance to. I will provide a Youtube video that will show the routine of the Flash Mob for everyone to learn! It is a fairly easy routine, especially since we aim to have so many people! I will provide more information as time goes by! I informed you guys of this event NOW because we want to get an idea of how many people we can get and also have people ask questions now so we can answer them before the event happens.\n\nHope you guys participate!! :)", :start_time => "2013-06-01 02:00:00", :end_time => "2013-06-02 02:00:00", :address => "5347-5361 E Mountain St, Stone Mountain, GA 30083, USA", :fb_id => 299323663508654, :owner_id => 561864185, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-snc6/187929_299323663508654_955302501_q.jpg", :atenders => 165, :privacy => nil, :created_at => "2012-11-19 21:23:09", :updated_at => "2012-11-19 21:23:09" },
