  { :name => "FLUX PAVILION, DOCTOR P. COOKIE MONSTA, FUNTCASE, BROWN & GAMMON | Fri. Dec 28th 2012", :longitude => -84.3879824, :latitude => 33.7489954, :gmaps => true, :description => "FRIDAY DECEMBER 28TH 2012\nTickets on Sale:\nhttp://liquified.wantickets.com/Events/113324/FLUX-PAVILION-DOCTOR-P-COOKIE-MONSTA-FUNTCASE-MORE/\n\nOn Friday December 28th 2012 Liquified and Atlanta Bass Wars team up yet again to bring the biggest dubstep event ever to Atlanta! Join us and 5000 of your friends on a journey through the earth shattering sounds of the Circus records team all set in an amazing backdrop of LED Visuals, a massive custom sound system and awe inspiring decor!\n\nFeaturing Circus Records crew.... \n\nFLUX PAVILION\nDOCTOR P.\nCOOKIE MONSTA\nFUNTCASE\nBROWN AND GAMMON\n\nSECOND PHASE OF THE LINE-UP COMING SOON!\n\n::::::::::INFO:\n\n18 AND OVER WELCOME\nDOORS OPEN 9:30PM\nMASSIVE LED INSTALLATION\nCUSTOM VDOSC SOUND SYSTEM\nFULL DECOR\nMULTIPLE ENTRANCES FOR SPEEDY ENTRY\n\n\nVENUE\nWBS Event Facility (aka Wild Bills)\n2075 Market Street Duluth, GA 30096\n\nWBS Event facility is a 50,000 square ft state of the art\nentertainment complex with a capacity of 4800 consisting of a MASSIVE main room and a great sized second room.\n\n\nTRAVEL:\n\nlocated just off interstate I-85 on Pleasant Hill Road in front of Gwinnett Place Mall.\n\nFrom Atlanta:\nTake I-85 North to Exit #104-Pleasant Hill Road\nTake a left on Pleasant Hill Road\nThen right onto Gwinnett Place Drive NW then take a left on Market Street\nWild Bill’s will be on the right\n\n\nAtlanta Marriott Gwinnett Place\n1775 Pleasant Hill Road ·\nDuluth, Georgia 30096 USA\n\nCourtyard Atlanta Gwinnett Mall\n3550 Venture Parkway\nDuluth, Georgia 30096 USA\n\n", :start_time => "2012-12-28 21:30:00", :end_time => "2012-12-29 03:00:00", :address => "214 Capitol Pl SW, Atlanta, GA 30303, USA", :fb_id => 367745869974665, :owner_id => 100183642159, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/373526_367745869974665_676206300_q.jpg", :atenders => 980, :privacy => nil, :created_at => "2012-11-19 21:23:36", :updated_at => "2012-11-19 21:23:36" },
  { :name => "Akara (1st Time in ATL) + Skytree / Agobi Project / Kolourz / Distopia @ Asylum", :longitude => -84.3357992, :latitude => 33.7366044, :gmaps => true, :description => "Buy Tickets: http://akara.eventbrite.com/\n----------------------------------\n\n.: Akara (DJ-Set)  - (Los Angeles, CA) \n\n.: Skytree  - (Minneapolis, MN)\n\n.: Agobi Project  - (Asheville, NC)\n\nLocal Support: \nKolourz + Distopia  \n----------------------------------\n\n\n\n\nYou have been invited to join us in a divine gathering to travel through time and space, different dimensions, and realms while exploring love, reality, thought, and consciousness. \n\nThis spiritual awakening will be full of enlightenment and we promise to keep the \"intimate\" vibe going for this one with some chill music and some chill people.\n\nWe are going all night from 9-4am \n\nLive Painting\n+\nVendors\n\n- See you there family - Great way to relax after finals week -\n\nOnly $8 (Afters Fees) in Advance / $10 at the door \nBuy Tickets: http://akara.eventbrite.com/\n\n\n\n\n----------------------------------\nPresented by: Locus Promotions \n\nFacebook.com/LocusPromo\nTwitter.com/LocusPromo\nLocusPromo.com\n----------------------------------\n\nArtist Bio(s)\n\n.: Akara :. (Re:Evolution Media)\nhttp://akaraproject.com/\nCreated by Joshua Penman, a conservatory-trained classical composer turned electronic producer, Akara’s mystical dance ﬂoor symphonies are songs of luminous extradimensional beings, sung across the veil of reality. Akara's music is intricately scored for a live ensemble of classical musicians and the haunting vocals of Femke Weidema. It is a deep, mystical journey into another world, fusing an enormously wide palette of musical inﬂuences with a generous helping of bass. Filigreed and beautiful and immersive, there is nothing like Akara. \n\n.: Skytree :. (Re:Evolution Media)\nwww.soundcloud.com/skytree\nSkytree, aka Evan Snyder, started recording music at the age of 15, after the loan of a beaten Tascam tape deck cracked open the world of multi-track recording. Rough mix tapes followed, looping degraded swatches of guitar and keys over cheap drum machines. The Skytree name found its way onto mixes by accident initially, suggesting a sound both old and new, rooted in the Earth and branching into the cosmos.\n\n.: Agobi Project :.\nhttp://www.reverbnation.com/theagobiproject\nThe band provides a myriad of genre that pushes the boundaries of electronic dance music, with elements of jazz, hip hop, drum and bass, house, electro among others. It is a delicately balanced mix of high energy live drums, state of the art laptop production and seasoned guitar wizardy. With this synthesis, Agobi has gained recognition from a wide range of audiences and scenes. The band strives to ensure that each show is not just a musical experience, but a celebration of art of all forms. With this in mind in Agobi's mission, a positive, free spirited, healing and purely magical experience has resulted every time they take the stage.\n\n.: Kolourz:.\nhttp://kolourzmusic.com/\nClassically trained in guitar and jazz performance Zach King, aka Kolourz, is making a name for himself in the constantly evolving electronic music scene.  Primary influences such as Flying Lotus, Nosaj Thing, and Daedelus have helped shaped his eclectic style and jazzy groove.\n\n.: Distopia :.\nAs the  project continues to grow, more influences have been  established to create the sound  that is in the works. With Funk, Jazz, Southern Rock, Progressive Jam, Electronic, and even a little swing. The overall goal of the members is to have fun doing what they love, and that is playing live music.", :start_time => "2012-12-14 21:00:00", :end_time => "2012-12-15 04:00:00", :address => "1592 Van Vleck Ave SE, Atlanta, GA 30316, USA", :fb_id => 122584577895697, :owner_id => 422959977738852, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/261185_122584577895697_2067468151_q.jpg", :atenders => 161, :privacy => nil, :created_at => "2012-11-19 21:23:42", :updated_at => "2012-11-19 21:23:42" },
