  { :name => "Yoselin #1: Dicky Trisco (UK) + Pavón + García-Reyes", :longitude => -15.996094, :latitude => -33.72434, :gmaps => true, :description => "Desde este 23 de noviembre, los viernes serán de Yoselin, la nueva fiesta que traerá lo mejor de la electrónica al nuevo Club Social y Recreativo El Ritmo.\n\nEl Ritmo es la nueva sala del Centro Cultural Amanda, que dará cabida principalmente a la electrónica y a la música alternativa. Un espacio con capacidad para 400 personas, que será testigo de los mejores desmadres de la capital, con la mejor calidad de sonido.\n\nEn esta primera edición tendremos invitado internacional. Se trata del dj y productor escocés Dicky Trisco, fundador del sello Disco Deviance y parte del cartel del festival Primavera Fauna. Una fina selección de lo mejor del disco y house mundial, a cargo de uno de sus principales exponentes y acompañado por los djs locales Francisco Pavón y Julián García-Reyes.\n\nLine Up\n* Dicky Trisco (Disco Deviance/UK) http://soundcloud.com/dicky-trisco\n* Francisco Pavón (3D´SCO) http://soundcloud.com/3dsco\n* Julián García-Reyes http://soundcloud.com/juliangrs\n\nVisuales\n* Marcelo Fica\n\nValor Entrada: $5.000.-", :start_time => "2012-11-23 21:45:00", :end_time => "2012-11-24 03:00:00", :address => "Club Social y Recreativo El Ritmo", :fb_id => 467314239978203, :owner_id => 168237896654496, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/211191_467314239978203_1330401308_q.jpg", :atenders => 94, :privacy => nil, :created_at => "2012-11-19 21:24:55", :updated_at => "2012-11-19 21:24:55" },
  { :name => "CATALONIA, NEW STATE IN EUROPE", :longitude => 1.5208624, :latitude => 41.5911589, :gmaps => true, :description => "AFEGIU  TOTES LES AMISTATS A L'ESDEVENIMENT !!!\nAdd all your friends in the event !!\n\nEstem farts de formar part d'una Espanya que no mostra cap respecte cap al poble català. L'11 de setembre del 2014, TOT CATALÀ AL CARRER A PROCLAMAR LA REPÚBLICA CATALANA !\n\nI ♥ CATALONIA\nI ♥ CATALUNYA\nI ♥ CATALUÑA\nI ♥ 加泰羅尼亞\nI ♥ KATALONIEN\nI ♥ كاتالونيا\nI ♥ CATALOGNE\nI ♥ Καταλονία\nI ♥ CATALOGNA\nI ♥ カタルーニャ\nI ♥ CATALUNHA\nI ♥ KATALONYA\nI ♥ CATALONIË\nI ♥ קטלוניה\nАз ♥ Каталония \nI ♥ 카탈루냐\n\nCatalonia (Catalan: Catalunya; Spanish: Cataluña; French: Catalogne) is a nation without own State from 1714 when lost his own institutions and govern rules. The Spanish and the French army finished violently the freedom of the Catalan country rights. Few years after the king of France decided with the full permission of the King of Spain (a French one too) to take one part of the country. Today Catalonia is an occupied country, in the North of the Pyrenées by the French Republic and in the Shout by the Spanish State. Isn't been too much different between the democratic and the dictator ship methodology rules of the occupation and colonization in the both sides. We could even said that the old French democracy is been more repressive, offensive, and effective against the Catalan language, culture, and the Catalan dignity that the non-ending Spanish dictator ships in the Catalan Spanish side or Shout Catalonia. \n\nJa som més de 28.000 persones, ya somos más de 28.000 personas; we are more than 28.000 !!*!!\n\n\nDes dels creadors de l'esdeveniment, deixem clar, que no es tolera cap mena d'insult, ofensa, maleducació dirigida a cap altre ideologia. Es pot opinar a favor o en contra, amb tota la llibertat del món.\n\nEXPLICACIÓ DE L'ESDEVENIMENT:\n\nAixò és un esdeveniment per saber quants independentistes estem a la xarxa, les dates són simbòliques, per tant si estàs a favor de l'independència posa que assistiràs, pel contrari posa no. Obvieu l'opció de potser assistiré!\n\nAra sí! Visca una Catalunya LLiure!\n\n", :start_time => "2014-09-11 14:00:00", :end_time => "2014-09-11 23:30:00", :address => "Carretera d'Argençola a Clariana, 08717 Argençola, Province of Barcelona, Spain", :fb_id => 149325578432540, :owner_id => nil, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-ash4/276937_149325578432540_1804966230_q.jpg", :atenders => 4781, :privacy => nil, :created_at => "2012-11-19 21:25:08", :updated_at => "2012-11-19 21:25:08" },
  { :name => "Adéu, Espanya.", :longitude => 1.5208624, :latitude => 41.5911589, :gmaps => true, :description => "PREPAREM LA INDEPENDÈNCIA DE CATALUNYA!!!\n\nL'11 de setembre de 2014 ens abraçarem tots junts i juntes a totes les places de les viles, pobles i ciutats catalanes per un dia històric: el principi de la República Catalana. Un pais amb una bandera, una llengua, un himne,  una història, un amor. Catalans i catalanes d'arreu, vindran generacions, però aquesta ha de ser la nostra empremta per a què ens recordin a l'eternitat: els que van aconseguir la llibertat.\n\nPengeu l'esdeveniment, si us plau, al vostre mur, per tal de poder ser més i més i més i més i més... Declarem-nos tots contraris a la Constitució Espanyola, convertim-nos tots en anticonstitucionals.\n\nPer a què els que moriren el 1714, fa 300 anys, no morissin en va. En record seu, i de nou, els braços enlaire, fins al final, o sense fi, mai perduts, mai vençuts, sense treva. Visca Catalunya.\n\nAclaració final: Això no és cap grup organitzat per cap partit ni associació política. Més aviat tot el contrari: som particulars esgotats de semilluites oficials que no duen enlloc. Ha de ser l'expressió de ciutadans lliures i valents. Tots aquells que no tingueu clar si hi podreu assistir, digueu igualment que sí, per fer força. Som conscients que manquen encara molts sols i moltes llunes.\n\nNotificació: donada alguna possible sorpresa per part d'algun participant pel fet que s'esborrin comentaris, cal fer alguns aclariments: 1) Aquest és un espai exclusivament per a nacionalistes i independentistes catalans. 2) Aquest és un espai de convocatòria a un esdeveniment de manera que no és un forum de polèmica i discussió. Hi ha altres planes, independentistes o no, on es pot polemitzar i dir-hi la seva. 3) A aquells a qui no els agradi el contingut de l'esdeveniment que s'acontentin a dir que no assitiran, perquè, obertament, la seva ideologia no cap en aquest espai, com tampoc hi cap el nazisme, l'art de la ceràmica o la pesca del salmó. 4) Se'n dedueix de tot això que tot comentari antiindependentista i provocador serà esborrat en la mesura del possible, ja que l'esperit dels creadors de l'espai és mantenir el lloc exclusivament per al que ha estat creat. 5) Si algú, no obstant, troba injusta alguna retallada, no passa res: que pensin que és tradició estimada en el seu Tribunal Constitucional.\n\n........................\n\nL'Administració de l'esdeveniment vol fer alguns comentaris d'enhorabona donat l'entusiasme que heu mostrat:\n\n1. L'esdeveniment està sent, gràcies a tots vosaltres, a cadascun de vosaltres, un autèntic èxit. Gairebé 15.000 participants és quelcom fantàstic, i no para de créixer. Si tenim en compte que l'esdeveniment és obert i que, per tant, arriba a tots els països del món, àdhuc el veí, se'm fa inexplicable l'altíssima quota de participació activa per la Independència de Catalunya. Felicitats a tots vosaltres.\n\n2. En segon lloc, s'ha de subratllar el respecte de la majoria de la gent que no és independentista cap a la nostra ideologia, i per tant, també són dignes de lloança. Molts espanyolistes han clicat que no hi assistiran, han respectat les normes, i en la seva enorme majoria, no han entrat en l'insult ni en la provocació, ni en la creació de polèmica que no es busca en aquest espai. Per tant, també felicitats a tots ells. Tots aquells que, en canvi, molt pocs, realment pocs en el còmput general, han entrat en el comentari despectiu, la provocació, l'insult o una mofa nascuda des de la ignorància no han de representar en cap cas l'espanyolisme, i per tant, no els considerarem interlocutors vàlids al nostre propòsit. Evidentment, tal com assenyalen les normes de l'espai, els seus comentaris seran eliminats.\n\n3. En tercer lloc, felicitar-nos pel reconeixement internacional, a partir del cas de Kosovo, de què els pobles estan legitimats a la seva independència sempre que sigui democràticament. La resolució internacional és clara: cap constitució ni cap força externa pot ser legítima davant de la voluntat ferma dels pobles de llibertat.  Era un pas important que molts no es pensaven que arribaria a ser, i una vegada més, la història acaba fent justícia. La Independència és a prop. No defalliu.\n\n4. I per acabar, de nou, agraïr-vos la vostra participació, la vostra força, la vostra resistència. Sense tots nosaltres no hi ha demà. Que no us importi que us insultin, que us diguin fatxes. Tot és màrqueting, tot és por. Sabem que no és així. El que nosaltres volem ho hem de decidir nosaltres, i ningú per nosaltres. Que cridin, que s'enrabiïn, que facin mofa, no en feu cas que és el que volen: és el signe clar del discurs esgotat, de la imposició de sempre, de les mentides de sempre. Nosaltres endavant, i un dia, teniu-ho per segur, es quedaran sense esma, i com sempre han fet, es rendiran. Mai han pogut sufocar els anhels de llibertat, ni a Cuba, ni a Flandes, ni a Filipines, ni a Guinea, ni a Amèrica, ni al Sahara. Però no veuen més enllà, la qual cosa ens ho deixa més fàcil. Només saben defensar Perejil. Per tant, força, que això no serà en va.\n\nFelicitats a tothom.", :start_time => "2014-09-11 00:00:00", :end_time => "2014-09-11 23:30:00", :address => "Carretera d'Argençola a Clariana, 08717 Argençola, Province of Barcelona, Spain", :fb_id => 125550270812056, :owner_id => 1046707656, :city => nil, :country => nil, :picture => "https://fbcdn-profile-a.akamaihd.net/hprofile-ak-prn1/71138_125550270812056_3997022_q.jpg", :atenders => 4824, :privacy => nil, :created_at => "2012-11-19 21:25:14", :updated_at => "2012-11-19 21:25:14" },
